INSERT INTO `products` VALUES (1,'Marita','https://img.ophim.live/uploads/movies/marita-thumb.jpg','Marita','completed','1','106 Phút','2023','HD',NULL,'Roni S. Benaid','Rhen Escaño, Andrea Babierra, Louise delos Reyes, Ashtine Olviga, Yumi Garcia, Ethan David, Taneo Uyam, Neil Tolentino, Sara Joe, Tess Dumpit','Kinh Dị','Philippines','An actress commits suicide in a theatre full of people. Now she haunts the venue and those who visit.',0,0,5,0),(2,'Ngôi Nhà Mơ Ước','https://img.ophim.live/uploads/movies/ngoi-nha-mo-uoc-thumb.jpg','Dream Home','completed','1','96 Phút','2010','HD',NULL,'彭浩翔','何超儀, Eason Chan, 周俊偉, 曾国祥, 駱應鈞, 徐少強, 鮑起靜, 盧海鵬, Vivian Leung Chi-Ching, 葉璇','Kinh Dị','Trung Quốc, Hồng Kông','Nội dung của phim xoay quanh cô nàng Cheng Lai (do Hà Siêu Nghi đóng), người đã tiết kiệm tiền bạc trong suốt nhiều năm để có thể mua được căn hộ mơ ước của cô, ngôi nhà của cô. Cô ấy sống với gia đình, đây là một điều bình thường ở Hồng Kông, cho đến khi kết hôn, rồi ra ở riêng. Những điều dường như sắp xếp cho mình, ngoại trừ những người bán hàng tăng giá một cách vô tội vạ, và những người khác quan tâm đến một và chỉ căn hộ cụ thể mà cô ấy muốn. Cheng Lai lúc này mới bắt đầu tỉnh ngộ và cô ấy bị buộc phải hành động một cách vô nhân đạo.Phim là sự kết hợp giữa tâm lý, tộ phạm và kinh dị, từ một việc khá đơn giản chỉ là “mua nhà ở” mà nó đã dẫn tới một âm mưu giết người trên một căn hộ cao tầng tại Hồng Kông, đồng thời cũng là một lời châm biếm dành cho một trong những thành phố đắt đỏ nhất trên thế giới này, nơi mà giá bất động sản đã tăng lên 15% một cách khác thường kể từ khi nó được trao trả về cho Trung Quốc vào năm 1997.',0,0,5,0),(3,'The Jack in the Box Rises','https://img.ophim.live/uploads/movies/the-jack-in-the-box-rises-thumb.jpg','The Jack in the Box Rises','completed','1','92 Phút','2024','HD',NULL,'Lawrence Fowler','Nicholas Anscombe, Isabella Colby Browne, Derek Nelson, Georgia Conlan, James Reynard, Leona Clarke, Georgina Jane, Oli Meredith','Kinh Dị','Anh','When a creepy Jack-in-the-Box is discovered and opened on the grounds of an exclusive girls\' school, six brave students soon enter a fight to the finish against the unleashed demon.',0,0,5,0),(4,'Seven Cemeteries','https://img.ophim.live/uploads/movies/seven-cemeteries-thumb.jpg','Seven Cemeteries','completed','1','84 Phút','2024','HD',NULL,'John Gulager','Danny Trejo, Efren Ramirez, Maria Canals-Barrera, Lew Temple, Sal Lopez, Sol Rodriguez, Terri Hoyos, Vincent M. Ward, Richard Esteras, Emma Ramos','Hành Động, Kinh Dị','Âu Mỹ','A recent parolee gets a Mexican witch to resurrect his old posse so that they can help him save a woman\'s ranch from a ruthless drug lord.',0,0,5,0),(5,'Bẫy Hồi Sinh','https://img.ophim.live/uploads/movies/bay-hoi-sinh-thumb.jpg','The Ghost Game','completed','1','95 Phút','2025','HD',NULL,'손동완','예리, 이찬형, Suh Dong-hyun, Oh So-hyun, 김은비, Park Seo-yeon','Kinh Dị, Bí ẩn','Hàn Quốc','<p>YouTuber đầy tham vọng Gi-ho dàn dựng một buổi cầu hồn giả để lan truyền nội dung, nhưng Ja-young đã tham gia, tìm kiếm người chị gái mất tích Seo-woo. Trong một bể chứa ngầm, Seo-woo tình nguyện trở thành \"người bị quỷ ám\", nhưng khi cô ngã xuống, nỗi kinh hoàng ập đến. Bị mắc kẹt bởi những thế lực đen tối, các học sinh phải đối mặt với số phận chết chóc, dẫn đến một bước ngoặt gây sốc.</p>',0,0,5,0),(6,'A Night of Soul Turning','https://img.ophim.live/uploads/movies/a-night-of-soul-turning-thumb.jpg','A Night of Soul Turning','completed','1','78 Phút','2023','HD',NULL,'Xiang Qiuliang, Xiang Hesheng','王紫逸, Liu Yuanyuan, Wang Jinsong, 李勤勤, Han xitong','Kinh Dị','Trung Quốc','A Night of Soul Turning-A Night of Soul Turning (2023) [HD-Vietsub]',0,0,5,0),(7,'Plank Face','https://img.ophim.live/uploads/movies/plank-face-thumb.jpg','Plank Face','completed','1','91 Phút','2016','HD',NULL,'Scott Schirmer','Nathan Barrett, Susan M Martin, Brigid Macaulay, Alyss Winkler, Jason Hignite, Ellie Church, Dave Parker, Lexi Thompson','Kinh Dị','Âu Mỹ','A man is taken captive by a feral family in the deep woods. They are determined to transform him, body and mind, into one of their own -- whether he likes it or not.',0,0,5,0),(8,'Giao Ước Quỷ Dữ','https://img.ophim.live/uploads/movies/giao-uoc-quy-du-thumb.jpg','The Pact','trailer','1','118 Phút','2025','HD',NULL,'김남균','김규리, 안내상, 주성환, 동방우, 신선희, 김인우, 최지현, 박지서','Kinh Dị, Chính kịch, Bí ẩn','Hàn Quốc','<p>Từ trò chơi cầu cơ ngây dại thuở ấu thơ, Yoon Ji-hee lớn lên thành kẻ bị ám ảnh bởi quyền năng huyền bí. Với những nghi thức cấm kỵ, cô thay đổi diện mạo, uốn nắn số phận, mê hoặc lòng người… tất cả để thực hiện giấc mộng thống trị Hàn Quốc. Trong khi đó, Jung Hyun Soo, nhà báo điều tra những bí mật đen tối phía sau hậu trường chính trị.<br>&nbsp;</p>',0,0,5,0),(9,'Búp bê tử thần','https://img.ophim.live/uploads/movies/bup-be-tu-than-thumb.jpg','Deadly Doll','completed','1','85 Phút','2025','HD',NULL,'彭發','張兆輝, 羅蘭, 王敏奕, 徐浩昌','Kinh Dị','Trung Quốc, Hồng Kông','<p>Tuyết Tình, mẹ mất con vì tin vào các phương pháp dân gian và điều trị thay vì y tế hiện đại, rơi vào khủng hoảng tâm lý. Cô tìm đến bà đồng “Aunt Mui” qua mạng và được trao một con búp bê được cho là đã “bị linh hồn con trai nhập”. Bà đồng dặn cô: “Đừng phá hỏng con búp bê.” Không lâu sau, hàng loạt hiện tượng kỳ lạ xảy ra: đồ vật tự&nbsp;</p>',0,0,5,0),(10,'Nghĩa Địa Của Người Sống','https://img.ophim.live/uploads/movies/nghia-dia-cua-nguoi-song-thumb.jpg','Tomb Watcher','completed','1','92 Phút','2025','HD',NULL,'Vathanyu Ingkawiwat','วรนุช ภิรมย์ภักดี, ธนเวทย์ สิริวัฒน์ธนกุล, อรัชพร โภคินภากร, Kampanath Ruangkittivilas, Pornchanok Sintanaporn, Nungruthai Chaioata, วรรณา น้ำกรอง, Aphicha Tinnachotradsami, Anurak Srichompoo, Ketsarin Namsen','Kinh Dị, Chính kịch','Thái Lan','<p>Sau khi người vợ giàu có qua đời, người đàn ông nọ và nhân tình phải ở cùng thi thể được bảo quản của cô suốt 100 ngày tại ngôi biệt thự hẻo lánh để nhận được tiền thừa kế.</p>',1,0,5,0),(11,'Tần Số Lạ: Bệnh Viện Sát Nhân Đài Loan','https://img.ophim.live/uploads/movies/tan-so-la-benh-vien-sat-nhan-dai-loan-thumb.jpg','Strange Frequencies: Taiwan Killer Hospital','completed','1','91 Phút','2024','HD',NULL,'Kerwin Go','Enrique Gil, Jane De Leon, Alexa Miro, Mary Jean Lastimosa, Rob Gomez, Raf Pineda, Ryan Azurin','Kinh Dị','Hàn Quốc','<p>Trong cuộc săn ma được phát trực tiếp, bảy người nổi tiếng khám phá một bệnh viện ma ám, hoang tàn rồi phát hiện thế lực quỷ dữ còn khủng khiếp hơn họ có thể tưởng tượng.</p>',0,0,5,0),(12,'Blood Star','https://img.ophim.live/uploads/movies/blood-star-thumb.jpg','Blood Star','completed','1','97 Phút','2024','HD',NULL,'Lawrence Jacomelli','Britni Camacho, John Schwab, Sydney Brumfield, Travis Lincoln Cox, Felix Merback, Arthur Roberts, Gwen Van Dam, Ray Buffer, Joseph Lopez, Brandon Brown','Kinh Dị','Anh','A young woman is driving through the desert alone when she is drawn into a dangerous game of cat and mouse with a psychopathic Sheriff. The chase escalates to deadly levels, and she must use her street-smarts to turn the tables against him.',0,0,5,0),(13,'Ám Ảnh Kinh Hoàng: Nghi Lễ Cuối Cùng','https://img.ophim.live/uploads/movies/am-anh-kinh-hoang-nghi-le-cuoi-cung-thumb.jpg','The Conjuring: Last Rites','trailer','1','135 Phút','2025','HD',NULL,'Michael Chaves','Vera Farmiga, Patrick Wilson, Mia Tomlinson, Ben Hardy, Rebecca Calder, Elliot Cowan, Shannon Kook, Steve Coulter, Kíla Lord Cassidy, Beau Gadsdon','Kinh Dị','Âu Mỹ','Hai nhà điều tra hiện tượng siêu nhiên Ed và Lorraine Warren đối mặt với một vụ án kinh hoàng cuối cùng — nơi họ buộc phải đối đầu với những thực thể bí ẩn đầy đe dọa, thách thức tất cả những gì họ từng tin tưởng.',0,0,5,0),(14,'Alien: Rubicon','https://img.ophim.live/uploads/movies/alien-rubicon-thumb.jpg','Alien: Rubicon','completed','1','90 Phút','2024','HD',NULL,'Adrian Avila','Michael Paré, Preston Geer, Paul Logan, Neeley Dayan, Vinney Pugliese, Eric Davenport, Christina Rose, Doug Jeffery, Tammy Klein, Douglas S. Matthews','Hành Động, Viễn Tưởng, Khoa Học, Kinh Dị','Âu Mỹ','An alien spacecraft lands near New York and destroys everything as it heads toward Washington D.C. If it reaches the capital, it will trigger an invasion. Scientists and the military must stop it before it\'s too late.',0,0,5,0),(15,'The Sacrifice Game','https://img.ophim.live/uploads/movies/the-sacrifice-game-thumb.jpg','The Sacrifice Game','completed','1','99 Phút','2023','HD',NULL,'Jenn Wexler','Georgia Acken, Mena Massoud, Olivia Scott Welch, Gus Kenworthy, Chloë Levine, Derek Johns, Laurent Pitre, Madison Baines, Sophie McIntosh','Kinh Dị','Âu Mỹ, Canada','Christmas break, 1971. Samantha and Clara, two students who are staying behind for the holidays at their boarding school, must survive the night after the arrival of uninvited visitors.',0,0,5,0),(16,'Shades of Desire','https://img.ophim.live/uploads/movies/shades-of-desire-thumb.jpg','Shades of Desire','completed','1','92 Phút','2023','HD',NULL,'Jack Ayers','Sian Altman, Darrell Griggs, May Kelly, Danielle Scott, Jenny Miller, Harrison Thomas Boxley, Mark Sears, Sarah Dionna, Jamie Robertson, Freddie Hogan','Kinh Dị','Anh','After her twin sister Aubrey goes missing, Jennifer uncovers the scandalous, secret double-life that Aubrey leads - and that has put both of them in danger.',0,0,5,0),(17,'Anaconda','https://img.ophim.live/uploads/movies/狂蟒之灾-thumb.jpg','Anaconda','completed','1','84 Phút','2024','HD',NULL,'','','Phiêu Lưu, Kinh Dị','Trung Quốc','A struggling circus crew gets deceived by its former partner, as it embarks on a tour in Thailand. During the journey through a Southeast Asian rainforest, they encounter attacks by a giant python. They meet a mysterious man named Jeff who offers to help, but they soon realize he\'s a poacher. As they search for Jeff\'s boat, they face life-and-death struggles with the python and Jeff himself.',0,0,5,0),(18,'Sumala','https://img.ophim.live/uploads/movies/sumala-thumb.jpg','Sumala','completed','1','113 Phút','2024','HD',NULL,'Rizal Mantovani','Luna Maya, Darius Sinathrya, Makayla Rose Hilli, Ivonne Dahler, Denino Basrial, Budi Gunawan, Denny Rahman, Varen Arianda Calief, Abiyyu Barakbah, Ganesha Putra','Kinh Dị','Indonesia','Một linh hồn báo oán tàn bạo trở về gieo rắc tai ương lên thị trấn đã từng hãm hại chị gái của ả.  Dựa trên một truyền thuyết đô thị kinh hoàng.',0,0,5,0),(19,'Birthrite','https://img.ophim.live/uploads/movies/birthrite-thumb.jpg','Birthrite','completed','1','100 Phút','2025','HD',NULL,'','','Kinh Dị','Âu Mỹ','When a pregnant woman is bequeathed a home from an estranged aunt, she and her girlfriend leave the city behind to begin new chapter. But when a karmic debt threatens the life of their unborn child, they soon discover their place in the cursed history of the town.',0,0,5,0),(20,'Ngôi Nhà Của Sayuri','https://img.ophim.live/uploads/movies/ngoi-nha-cua-sayuri-thumb.jpg','House of Sayuri','completed','1','108 Phút','2024','HD',NULL,'','','Kinh Dị','Nhật Bản','<p>Khi chuyển đến sống cùng người mẹ nuôi mới tại một ngôi nhà hẻo lánh, hai anh em vô tình phát hiện một nghi lễ tà ác — thứ không chỉ đe dọa đến sự sống của họ, mà còn hé lộ những bí mật kinh hoàng và thế lực đen tối đã tồn tại từ lâu</p>',0,0,5,0),(21,'Cô lập','https://img.ophim.live/uploads/movies/co-lap-thumb.jpg','Isolated','completed','1','101 Phút','2025','HD',NULL,'Benedict Mique','Yassi Pressman, Joel Torre, Candy Pangilinan, Yayo Aguila, Wilbert Ross, Rafa Siguion-Reyna, TJ Valderrama, Denise Esteban, Andrea Babierra, Gwen Garci','Kinh Dị','Philippines','<p>Sau khi nhận công việc chăm sóc một ông cụ kỳ lạ tại một ngôi nhà hẻo lánh, cô y tá nọ bắt đầu có những ảo giác đáng lo ngại và linh cảm kỳ lạ rằng trong nhà không chỉ có mình họ.</p>',1,0,5,0),(22,'Piranhaconda','https://img.ophim.live/uploads/movies/piranhaconda-thumb.jpg','Piranhaconda','completed','1','90 Phút','2012','HD',NULL,'Jim Wynorski','Michael Madsen, Rachel Hunter, Rib Hillis, Terri Ivens, Chris De Christopher, Shandi Finnessey, Michael Swan, Kurt Yaeger, Angie Stevenson, Christina DeRosa','Hài Hước, Viễn Tưởng, Khoa Học, Kinh Dị','Âu Mỹ','A hybrid creature - half piranha and half anaconda -- attacks a low-budget horror movie crew on location near her nest when her egg is stolen. Now they must outrun and kill the deadly piranhaconda as well as stop the mad scientist who stole the egg - before they all become dinner.',0,0,5,0),(23,'Sóng Triều','https://img.ophim.live/uploads/movies/song-trieu-thumb.jpg','Tide','completed','1','0 Phút','2024','HD',NULL,'','','Kinh Dị','Anh','Bốn người bạn chạy đua với thủy triều ở một vịnh nổi tiếng cùng với đó họ phải đối mặt với ác mộng thiên nhiên là bãi cát lún, nhưng một mối đe dọa rình rập sẽ khiến tình hình trở nên trầm trọng hơn.',0,0,5,0),(24,'The Cursed (2018)','https://img.ophim.live/uploads/movies/the-cursed-2018-thumb.jpg','The Cursed','completed','1','86 Phút','2018','HD',NULL,'','','Kinh Dị','Hồng Kông, Trung Quốc','Troublesome Night series director Yip Wai Ying returns to the horror genre in the 2018 scarefest The Cursed. Surgeon Jia\'er (Annie Liu, Hungry Ghost Ritual), who grew up in an orphanage, is surprised to one day receive news of a grandmother (Nina Paw, Show Me Your Love) who just passed away. The legal letter states that she has inherited her grandmother\'s mansion in Malaysia. Confused about this sudden revelation, Jia\'er decides to go to Malaysia with her friends Jessica and Amy to find out the truth. Along the way, she re-encounters childhood friend Suwen (Wilfred Lau, The Leakers). While arranging her grandmother\'s matters, strange and terrifying things begin to happen, and Jia\'er sets out to uncover the secret hidden in the mansion',0,0,5,0),(25,'Ga Tử Thần','https://img.ophim.live/uploads/movies/ga-tu-than-thumb.jpg','Ghost Train','trailer','1','95 Phút','2025','HD',NULL,'Tak Se-woong','주현영, 전배수, 최보민, 김지인, 김우겸, 정한빛, 한동희','Kinh Dị','Hàn Quốc','<p>Bước vào thế giới của Ghost Train, khán giả theo chân Da Gyeong (Joo Hyun Young) – một YouTuber trẻ tuổi đang tuyệt vọng cứu vãn tài khoản đang \"flop\" của mình bằng những câu chuyện kỳ bí. Với khát khao phá kỷ lục lượt xem, cô quyết định khám phá ga tàu điện ngầm Gwanglim – nơi phủ đầy truyền thuyết đô thị và nổi tiếng với hàng loạt vụ mất tích bí ẩn. Được dẫn lối bởi người gác ga kỳ lạ (Jeon Bae Soo), Da Gyeong không ngờ rằng chuyến đi liều lĩnh này lại đẩy cô vào vòng xoáy tâm linh rùng rợn, nơi mà chỉ khi chạm đến “đích cuối” của chuyến tàu định mệnh, cô mới mong tìm được lối thoát.</p><p>&nbsp;</p>',0,0,5,0),(26,'Kẻ Bị Nguyền Rủa','https://img.ophim.live/uploads/movies/ke-bi-nguyen-rua-thumb.jpg','The Damned','trailer','1','89 Phút','2025','HD',NULL,'Thordur Palsson','Odessa Young, Joe Cole, Siobhan Finneran, Rory McCann, Turlough Convery, Lewis Gribben, Francis Magee, Mícheál Óg Lane, Andrean Sigurgeirsson, Arnar Gray','Kinh Dị, Chính kịch, Bí ẩn','Âu Mỹ, Anh, Bỉ','<p>Giữa mùa đông băng giá đầu thế kỷ 19 ở bờ biển Iceland, góa phụ Eva phải gánh vác trạm đánh cá trong cảnh thiếu ăn. Khi một con tàu đắm ngoài khơi, cô quyết định không cứu để giữ lại nguồn sống cho nhóm mình. Nhưng từ đó, tội lỗi và nỗi sợ bắt đầu gặm nhấm, biến những bóng hình ngoài kia thành ác quỷ trong trí óc – cho đến khi sự thật phơi …</p>',0,0,5,0),(27,'Halabala: Rừng ma tế xác','https://img.ophim.live/uploads/movies/halabala-rung-ma-te-xac-thumb.jpg','Halabala','completed','1','105 Phút','2025','HD',NULL,'เอกสิทธิ์ ไทยรัตน์','ฉันทวิชช์ ธนะเสวี, ณัฏฐณิชา ดังวัธนาวณิชย์, อานนท์ สายแสงจันทร์, ยะสะกะ ไชยสร, Sirat Intarachote, Piphatkorn Kedkaew, Thanatphong Charurangsimes, ภัคพล ศรีรองเมือง, Peerawat Sareewong, ขวัญชัย เย็นพายัพ','Hành Động, Kinh Dị, Bí ẩn','Thái Lan','Inspector Dan leads the team of infirm police officers to hunt down the brutal escaped prisoner in the Halabala forest down south, only to discover that the dark secret inside the forest is turning against them.',0,0,5,0),(28,'Sky Sharks','https://img.ophim.live/uploads/movies/sky-sharks-thumb.jpg','Sky Sharks','comp