tận giữa chú mèo Tom và chú chuột Jerry mang tới vô vàn tiếng cười cho khán giả. Hanna và Barbera viết kịch bản đồng thời làm đạo diễn cho 114 tập phim Tom &amp; Jerry tại xưởng phim MGM trong thời gian từ những năm 1940 cho tới năm 1958 (năm xưởng phim hoạt hình của hãng đóng cửa). Phiên bản gốc của Tom &amp; Jerry đoạt giải Oscar cho thể loại phim hoạt hình ngắn 7 lần. Tom &amp; Jerry có lượng khán giả đông đảo trên toàn thế giới với đủ mọi thành phần từ trẻ em cho tới thanh niên, người lớn và được công nhận là một trong những huyền thoại điện ảnh sống mãi trong lòng công chúng và lịch sử điện ảnh Mỹ. Năm 2000, tạp chí TIME công bố Tom &amp; Jerry là một trong những show truyền hình hay nhất mọi thời đại.</p>',0,0,23,0),(102,'Tom And Jerry Collections (1940)','https://img.ophim.live/uploads/movies/tom-and-jerry-collections-1940-thumb.jpg','Tom And Jerry Collections (1940)','completed','46','10 phút/tập','1940','SD',NULL,'','','Hài Hước, Phiêu Lưu, Gia Đình','Âu Mỹ','<p>Đây là bộ sưu tập các phim trong series Tom and Jerry cổ điển, được sản suất từ năm 1940 cho đến 199x. Đây là thời kỳ đỉnh cao nhất của loạt phim đã làm nên tuổi thơ của nhiều thế hệ. Series được chiếu trên truyền hình và rạp hát với nhiều thể loại từ phim ngắn cho tới phim dài. Được sản xuất bởi William Hanna và Joseph Barbera cho hãng phim MGM, phim là cuộc đối đầu vô tận giữa chú mèo Tom và chú chuột Jerry mang tới vô vàn tiếng cười cho khán giả. Hanna và Barbera viết kịch bản đồng thời làm đạo diễn cho 114 tập phim Tom &amp; Jerry tại xưởng phim MGM trong thời gian từ những năm 1940 cho tới năm 1958 (năm xưởng phim hoạt hình của hãng đóng cửa). Phiên bản gốc của Tom &amp; Jerry đoạt giải Oscar cho thể loại phim hoạt hình ngắn 7 lần. Tom &amp; Jerry có lượng khán giả đông đảo trên toàn thế giới với đủ mọi thành phần từ trẻ em cho tới thanh niên, người lớn và được công nhận là một trong những huyền thoại điện ảnh sống mãi trong lòng công chúng và lịch sử điện ảnh Mỹ. Năm 2000, tạp chí TIME công bố