khác ám toán, tàn hồn ngủ say vạn năm sau, thức tỉnh ở trên người \"Phế vật Mục Vân\" tại Nam Vân đế quốc Thiên Vận đại lục.Mục Vân mới tỉnh, đã nhận phải sự xem thường của đám học trò, sự khinh rẻ của gia tộc. Nhưng Mục Vân đã dễ dàng hóa giải các thử thách, đồng thời còn khiến nhiều người phải bất ngờ về khả năng của bản thân.Tiếp tục hành trình tu luyện, Mục Vân đã thề phải khuấy đảo thiên địa , trở về đỉnh cao. \"Một đời này, ta nhất định phải thống trị vạn giới, phá vỡ trời cao!</p>',0,0,23,0),(107,'Tôi là sát thủ nhưng chỉ số mạnh hơn hẳn dũng sĩ','https://img.ophim.live/uploads/movies/toi-la-sat-thu-nhung-chi-so-manh-hon-han-dung-si-thumb.jpg','My Status as an Assassin Obviously Exceeds the Hero\'s','ongoing','1','24 phút/tập','2025','HD',NULL,'','大塚剛央, 水野朔, 諏訪部順一, 小林沙苗, 田村好','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Oda Akira, một nam sinh trung học, cùng các bạn cùng lớp được triệu hồi đến một thế giới khác. Trong khi tất cả các bạn cùng lớp đều được ban cho những năng lực bá đào thì cậu lại chỉ nhận được năng lực “”Sát thủ”” tầm thường, có lẽ do sự hiện diện mờ nhạt bẩm sinh của mình.\n\nTuy nhiên, dù chỉ là một “”Sát thủ”” bình thường, chỉ số của cậu lại dễ dàng vượt qua cả nghề nghiệp mạnh nhất là “”Dũng sĩ””!?\n\nNghi ngờ hành động của quốc vương, người chủ trì cuộc triệu hồi, Akira đã che giấu sự tồn tại của mình để vạch trần âm mưu. Nhưng không ngờ, cậu lại bị gán tội danh oan uổng và bị truy đuổi. Thề sẽ trả thù quốc vương, cậu chạy trốn vào tầng sâu của một mê cung chưa từng có ai đặt chân đến và gặp gỡ Amelia, một cô gái Elf.\n\nĐây là câu chuyện về một chàng trai nhận được năng lực “”sát thủ””, gặp gỡ một cô gái Elf và trở thành một “”sát thủ”” thực thụ.',0,0,23,0),(108,'One Punch Man (Phần 3)','https://img.ophim.live/uploads/movies/one-punch-man-phan-3-thumb.jpg','One-Punch Man (Season 3)','ongoing','1','24 phút/tập','2025','HD',NULL,'','','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Câu chuyện diễn ra tại thành phố Z của Nhật Bản tại thời điểm thế giới đầy những quái vật bí ẩn với sức mạnh ghê gớm đã xuất hiện và gây ra biết bao nhiêu thảm họa.  Nhưng cũng chính tại đây xuất hiện 1 siêu anh hùng đấm phát chết luôn, có thể dễ dàng đánh bại và tiêu diệt những con quái vật này. Cũng chính vì tài năng hiếm có này mà có rất nhiều nghi ngại về khả năng thực sự của vị siêu anh hùng, thậm chí anh không bao giờ nhận được bất kỳ lòng tin nào từ dân chúng.\n\nSiêu anh hùng mạnh nhất thế giới có thể giết bất cứ ai chỉ với một đòn. Nhưng không có gì có thể thách thức anh ta, nên anh ta phải vật lộn với sự buồn chán và trầm cảm.',0,0,23,0),(109,'Một Ngày Nọ, Mình Bỗng Dưng Trở Thành Công Chúa','https://img.ophim.live/uploads/movies/mot-ngay-no-minh-bong-dung-tro-thanh-cong-chua-thumb.jpg','The Fated Magical Princess: Who Made Me a Princess','ongoing','2','23 phút/tập','2025','HD',NULL,'','Dian Tao, Lu Zhao, 马正阳, 张琦, Ye Sun, 徐慧, 陳奕雯, Chaoran Yang, Xueting Mu, 张沛','Hài Hước, Viễn Tưởng, Khoa Học','Trung Quốc','<p>Mấu chốt để tránh khỏi Bad End là chiếm được trái tim của người cha lạnh lùng?<br>Công chúa Anthanasia sinh ra tại Đế quốc Phép thuật Obelia sở hữu một năng lực kỳ lạ: cô có thể thấy trước được tương lai. Từ khi mới sinh, cô đã bị cha mình là Hoàng đế Claude ghẻ lạnh, phải lớn lên một mình trong cung điện Hồng Ngọc.&nbsp;<br>Một ngày nọ, cô mơ thấy tương lai mình sẽ bị chính cha ruột trục xuất ra khỏi cung điện vào sinh nhật 18 tuổi.&nbsp;<br>Để thay đổi vận mệnh, Athanasia đã đứng lên, quyết tâm tràn ngập trong cơ thể bé nhỏ.<br>&nbsp;</p>',0,0,23,0),(110,'Nhật Ký Du Hành Dị Giới Của Nhà Thu Thập Nguyên Liệu','https://img.ophim.live/uploads/movies/nhat-ky-du-hanh-di-gioi-cua-nha-thu-thap-nguyen-lieu-thumb.jpg','A Gatherer\'s Adventure in Isekai','ongoing','2','23 phút/tập','2025','HD',NULL,'','島﨑信長, 小市眞琴, 伊藤彩沙','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Câu chuyện xoay quanh Takeru Kamishiro, một nhân viên văn phòng bình thường, bỗng bị triệu hồi đến \"Madeus\"