 thiên tài duy nhất có thể sử dụng phép thuật mà không cần niệm chú, thậm chí từng một mình hạ gục rồng đen huyền thoại. Nhưng đằng sau sức mạnh phi thường đó lại là một cô gái siêu nhút nhát, sợ hãi khi phải nói trước đám đông. Giờ đây, cô được giao một nhiệm vụ không chỉ nguy hiểm vì kẻ thù tàn độc mà còn đáng sợ bởi những cuộc trò chuyện xã giao, đó là bí mật bảo vệ hoàng tử thứ hai. Trong thế giới nơi lời nói chính là sức mạnh, liệu sự im lặng của cô có đủ để cứu lấy mọi người và chính bản thân mình?',0,0,23,0),(121,'Đảo Hải Tặc','https://img.ophim.live/uploads/movies/one-piece-thumb.jpg','One Piece (Luffy)','ongoing','1143','25 phút/tập','1999','FHD',NULL,'','','Hành Động, Hài Hước, Phiêu Lưu','Nhật Bản','<p>Monkey D. Luffy, 1 cậu bé rất thích <strong>Đảo hải tặc</strong> có ước mơ tìm được kho báu <strong>One Piece</strong> và trở thành <strong>Vua hải tặc</strong> - Pirate King. Lúc nhỏ, Luffy tình cờ ăn phải trái quỉ (Devil Fruit) Gomu Gomu, nó cho cơ thể cậu khả năng co dãn đàn hồi như cao su nhưng đổi lại cậu sẽ không bao giờ biết bơi. Sau đó Luffy lại được Shank cứu thoát tuy nhiên ông ta bị mất 1 cánh tay. Sau đấy Shank chia tay Luffy và để lại cho cậu cái mũ rơm (Straw Hat) và nói rằng: Sau này bao giờ thành cướp biển hãy gặp ta và trả lại nó. Chính lời nói này đã thúc đầy Luffy trở thành 1 cướp biển thật sự.</p><p>Hãy cùng theo dõi xem liệu <strong>Luffy</strong> có thể trở thành đạt được kho báu <strong>One Piece</strong> và trở thành <strong>Vua Hải Tặc </strong>không nhé.</p>',0,0,23,0),(122,'Gachiakuta','https://img.ophim.live/uploads/movies/gachiakuta-thumb.jpg','Gachiakuta','ongoing','13','24 phút/tập','2025','HD',NULL,'','市川蒼, 小西克幸, 松岡禎丞, 花守ゆみり','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Hàn Quốc, Nhật Bản','<p>Bị buộc tội giết người và ném xuống Hố, đứa trẻ mồ côi nọ gia nhập nhóm chiến binh diệt quái vật có sức mạnh đặc biệt để khám phá sự thật và trả thù.</p>',1,0,23,0),(123,'Hoa thơm kiêu hãnh','https://img.ophim.live/uploads/