chỉ để cứu mẹ. Hạo Thiên từng bước trưởng thành, liên tiếp trải qua những cuộc gặp gỡ kỳ lạ, âm mưu quỷ kế, tình yêu và tình bạn định mệnh. Hạo Thiên tuân thủ tinh thần kỵ sĩ, nhận được sự công nhận của người khác nhờ vào nhân cách và sự nỗ lực của bản thân, cùng những nhân tài khác của Lục Đại Thánh Điện thành lập “Săn Ma Đoàn số 1” để đấu với Ma Vật, đấu tranh cho sự sống còn và tôn nghiêm của loài người.</p>',0,0,23,0),(127,'Đấu La Đại Lục 2: Tuyệt Thế Đường Môn','https://img.ophim.live/uploads/movies/dau-la-dai-luc-2-tuyet-the-duong-mon-thumb.jpg','Soul Land 2: The Peerless Tang Clan','ongoing','121','21 phút/tập','2023','HD',NULL,'','','Hành Động, Phiêu Lưu, Võ Thuật','Trung Quốc','<p>Nơi đây không có ma pháp, không có hơn thua, không có võ thuật, nhưng lại có võ hồn. Đường Môn suy thoái sau khi đã thành lập được vạn năm ở Đấu La Đại Lục. Một lớp anh tài xuất hiện, liệu thế hệ Thất quái Sử Lai Khắc mới này có chấn hưng được Đường Môn, viết nên bài ca tuyệt thế Đường Môn hay không? Hồn thú triệu năm, Tử Linh Thánh Pháp Thần nắm giữ Nhật Nguyệt Trích Tinh, hệ thống Hồn Đạo Khí hoàn toàn mới khiến Đường Môn suy yếu. Tất cả thần khí đều sẽ lần lượt xuất hiện. Ám khí Đường Môn liệu có chấn hưng được uy phong, Đường Môn có thể tái hiện được huy hoàng hay không?</p>',0,0,23,0),(128,'Tôi Thu Mua Phế Liệu Ở Thiên Đình','https://img.ophim.live/uploads/movies/toi-thu-mua-phe-lieu-o-thien-dinh-thumb.jpg','Heaven Scrap Master','ongoing','5','12 phút/tập','2025','HD',NULL,'','','Hành Động','Trung Quốc','<p>Trong thế giới võ đạo đương thời, Triệu Tín tình cờ được thừa kế Trạm Tái Chế Thiên Đình, từ kẻ bị coi thường trở thành nhân vật được chư tiên giúp đỡ, mỹ nhân vây quanh, từ đó bước lên đỉnh cao võ đạo, trảm yêu trừ ma, danh chấn thiên hạ.</p><p>&nbsp;</p>',0,0,23,0),(129,'Ẩm thực dã ngoại tại dị giới với kỹ năng không tưởng (Phần 2)','https://img.ophim.live/uploads/movies/am-thuc-da-ngoai-tai-di-gioi-voi-ky-nang-khong-tuong-phan-2-thumb.jpg','Campfire Cooking in Another World with My Absurd Skill (Season 2)','trailer','1','24 phút/tập','2025','HD',NULL,'','内田雄馬, 日野聡, 木野日菜, 内田真礼','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Chàng trai bình thường nọ rốt cuộc lại đến một thế giới khác và có năng lực mang đến những sản phẩm từ một siêu thị hiện đại, với những kết quả ngon lành trong thế giới mới này.',0,0,23,0),(130,'Bị phản bội nơi sâu thẳm hầm ngục, nhưng nhờ thiên phú “Vô Hạn Gacha”, tôi chiêu mộ các đồng đội cấp 9999 để trả thù các đồng đội cũ và cả thế giới! Đáng đời chúng!','https://img.ophim.live/uploads/movies/bi-phan-boi-noi-sau-tham-ham-nguc-nhung-nho-thien-phu-vo-han-gacha-toi-chieu-mo-cac-dong-doi-cap-9999-de-tra-thu-cac-dong-doi-cu-va-ca-the-gioi-dang-doi-chung-thumb.jpg','Gacha Vô Hạn/ My Gift Lvl 9999 Unlimited Gacha: Backstabbed in a Backwater Dungeon, I\'m Out for Revenge!','ongoing','1','23 phút/tập','2025','HD',NULL,'','玉城仁菜, 長谷川育美','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Nhật Bản','Ngày xưa, Nữ thần đã tạo ra chín chủng tộc. Trong số đó, loài người là chủng tộc yếu nhất và bị chế giễu. Cậu bé loài người Light đã may mắn được chào đón vào một nhóm mạo hiểm giả được thành lập từ chín chủng tộc, mang tên \"\"Chủng Tộc Tụ Hội\"\", và đã có một khoảng thời gian vui vẻ. Tuy nhiên, đó chỉ là một ảo mộng phù du. Điều chờ đợi cậu là sự phản bội tại \"\"Vực Thẳm\"\" - hầm ngục lớn nhất và tồi tệ nhất thế giới.\n\nSống sót ở tận cùng Vực Thẳm, Light đã khám phá ra sức mạnh thật sự của thiên phú \"\"Vô Hạn Gacha\"\" của mình. Vươn lên từ vực sâu của tuyệt vọng, Light sẽ xây dựng vương quốc mạnh nhất. Với ân huệ độc nhất vô nhị là \"\"Vô Hạn Gacha\"\" trong tay, câu chuyện trả thù của cậu chính thức bắt đầu!',0,0,23,0),(131,'Vong Linh Đau Khổ Muốn Giải Nghệ (Phần 2)','https://img.ophim.live/uploads/movies/vong-linh-dau-kho-muon-giai-nghe-phan-2-thumb.jpg','Let This Grieving Soul Retire (Season 2)','ongoing','1','24 phút/tập','2025','HD',NULL,'','小野賢章, 久保田未夢','Hài Hước, Viễn Tưởng, Khoa Học','Nhật Bản','Krai Andrey và bạn bè hứa hẹn trở thành thợ săn kho báu, nhưng Krai nhận ra mình không có tố chất này, trong khi những kỳ vọng của mọi người và nguy hiểm xung quanh anh ngày càng gia tăng.',0,0,23,0),(132,'Ranma1/2','https://img.ophim.live/uploads/movies/ranma12-thumb.jpg','Ranma1/2','completed','12','23 phút/tập','2024','HD',NULL,'','','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Tendo Akane gặp vị hôn phu mới của mình, Saotome Ranma, một thần đồng võ thuật có một bất ngờ: cậu có thể biến thành con gái một cách kỳ diệu khi chạm vào nước lạnh.',0,0,23,0),(133,'YAIBA: Huyền Thoại Samurai','https://img.ophim.live/uploads/movies/yaiba-huyen-thoai-samurai-thumb.jpg','YAIBA: Samurai Legend','completed','24','24 phút/tập','2025','HD',NULL,'','高山みなみ, 石見舞菜香, 細谷佳正, 小西克幸, 諏訪部順一','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Hành trình trở thành kiếm sĩ thực thụ đưa Yaiba từ ngôi nhà trong rừng đến thành phố nhộn nhịp, đầy rẫy đối thủ, bạn bè và thần lực cổ xưa.',0,0,23,0),(134,'Gia Đình × Điệp Viên (Phần 3)','https://img.ophim.live/uploads/movies/gia-dinh-×-diep-vien-phan-3-thumb.jpg','SPY x FAMILY (Season 3)','ongoing','1','24 phút/tập','2025','HD',NULL,'','江口拓也, 種﨑敦美, 早見沙織','Hành Động, Hài Hước, Phiêu Lưu','Nhật Bản','Nhằm ngăn những kẻ cực đoan châm ngòi cho cuộc chiến với quốc gia láng giềng Ostania, Twilight, điệp viên hàng đầu của Westalis phải điều tra chính trị gia người Ostanian là Donovan Desmond bằng cách xâm nhập vào trường học của con trai ông ta - học viện Eden danh giá. Dưới vỏ bọc Loid Forger, một bác sĩ, Twilight đã nhận nuôi cô bé mồ côi Anya và kết hôn giả với Yor Briar rồi cho Anya nhập học tại học viện Eden mà không hề hay biết hai người này cũng có thân phận bí mật: Yor là sát thủ được mệnh danh \"Công chúa Thorn\" còn Anya là siêu năng lực gia có khả năng đọc suy nghĩ. Tuy khởi đầu là một gia đình giả mà cả ba đều lợi dụng lẫn nhau, nhưng theo thời gian, họ dần nhận ra tầm quan trọng của hai người kia trong trái tim mình.',0,0,23,0),(135,'Học Viện Siêu Anh Hùng (Phần 8)','https://img.ophim.live/uploads/movies/hoc-vien-sieu-anh-hung-phan-8-thumb.jpg','My Hero Academia Final Season','ongoing','1','24 phút/tập','2025','HD',NULL,'','山下大輝','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Chuyển thể từ manga cùng tên của tác giả Horikoshi Kohei. Bối cảnh tương lai, 80% dân số thế giới sở hữu siêu năng lực, anh hùng là một nghề nghiệp phát triển mạnh mẽ. Đây là câu chuyện về Midoriya Izuku (Deku) một cậu nhóc với niềm ngưỡng mộ anh hùng mãnh liệt. Người Deku thần tượng nhất chính là All Might – anh hùng vĩ đại nhất thế giới. Cậu muốn trở thành anh hùng như All Might để bảo vệ và cứu giúp mọi người. Nhưng Hiện thực đau đớn đã dẫm nát giấc mơ của cậu, Deku chỉ là một người bình thường, luôn bị bắt nạt vì không có siêu năng lực. Cứ tưởng chừng ước mơ là không thể thực hiện cho đến ngày Deku gặp gỡ All Might, được ngài ấy ban cho năng lực \"One for All\". Chính thức trở thành học viên của \"Học viện U.A\" - học viện siêu anh hùng hàng đầu tại Nhật Bản. Con đường từ một kẻ bất tài trở thành một siêu anh hùng bắt đầu!',0,0,23,0),(136,'Thông Linh Phi - Phần 2','https://img.ophim.live/uploads/movies/thong-linh-phi-phan-2-thumb.jpg','Psychic Princess','ongoing','13','20 phút/tập','2025','HD',NULL,'','染音若蔡, Lu Lifeng, Xing Chao, 唐策, kinsen, 郭浩然, 范馨源, Yun Hezhui, 賀文瀟, 曾蓉','Tình Cảm, Cổ Trang','Trung Quốc','Qian Yunxi, the oldest daughter of the prime minister was born with a special ability. Because of this she was deemed \'abnormal\' and was raised at Mt. Lin Yun. Upon turning 16, she took her younger sister\'s place to marry into the royal family of Ye. Rumors say Ye Youming is strange, cold and cruel. Just how will Qian Yunxi\'s fate play out?\n\n(Source: Baka-Updates Manga)',0,0,23,0),(137,'Tôi Có Thể Thỉnh Cầu Một Điều Cuối Cùng?','https://img.ophim.live/uploads/movies/toi-co-the-thinh-cau-mot-dieu-cuoi-cung-thumb.jpg','May I Ask for One Final Thing?','ongoing','2','24 phú