có kham nổi công chúa sexy này chăng?</p>',0,0,23,0),(141,'Ẩm thực dã ngoại tại dị giới với kỹ năng không tưởng','https://img.ophim.live/uploads/movies/am-thuc-da-ngoai-tai-di-gioi-voi-ky-nang-khong-tuong-thumb.jpg','Campfire Cooking in Another World with My Absurd Skill','completed','12','24 phút/tập','2023','HD',NULL,'','','Phiêu Lưu','Nhật Bản','<p>Cùng với ba anh hùng khác, Mukouda Tsuyoshi, 27 tuổi, được đưa vào một thế giới giả tưởng để giải cứu một vương quốc khỏi một mối đe dọa không xác định. Tuy nhiên, kỹ năng duy nhất của anh ấy hóa ra lại là \"Thực đơn\", cho phép anh ấy mở một giao diện nơi anh ấy có thể mua và lấy các mặt hàng siêu thị liên quan đến thực phẩm từ Nhật Bản hiện đại. Khả năng tạo ra những món ăn ngon mà thế giới này chưa biết đến của Tsuyoshi sớm được đền đáp, thậm chí còn thu hút cả con sói huyền thoại Fenrir. Fenrir bị thu hút bởi thức ăn và lập giao ước với Tsuyoshi. Theo sau sinh vật thần thoại hay thay đổi này, Tsuyoshi đảm nhận công việc là một thương gia và nhà thám hiểm, đi du lịch và nấu những món ăn ngon miệng không bao giờ khiến cư dân trên thế giới này kinh ngạc.</p>',0,0,23,0),(142,'Thôn Tính Bầu Trời','https://img.ophim.live/uploads/movies/thon-tinh-bau-troi-thumb.jpg','Swallowed Star','ongoing','191','24 phút/tập','2020','HD',NULL,'','','Hành Động, Phiêu Lưu','Trung Quốc, Nhật Bản','<p>Trên Trái đất, một thảm họa đã gây ra sự biến đổi của muôn loài. Kẻ thượng đẳng sống sót và kẻ thấp kém bị tuyệt chủng. Trong hoàn cảnh đó, Luo Feng được thừa kế từ chủ nhân của Ngôi sao Yunmo và trở thành một trong ba người mạnh nhất trên Trái đất. Anh ta bị mất thịt của mình trong cuộc chiến chống lại con quái vật khổng lồ bị nuốt chửng nhưng sau đó anh ta đã lấy thịt của con quái vật. Trong xác thịt, anh ta đã phát triển một cơ thể người. Sau đó, anh bước ra khỏi Trái đất và hướng đến vũ trụ.</p>',1,0,23,0),(143,'Huyết Quỷ Hỗn Chiến','https://img.ophim.live/uploads/movies/tougen-anki-thumb.jpg','Tougen Anki','ongoing','13','24 phút/tập','2025','HD',NULL,'','浦和希, 神谷浩史, 西山宏太朗, 石見舞菜香, 坂田将吾, 花江夏樹, 三浦魁, 愛美','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Bí ẩn','Nhật Bản','<p>Rất lâu sau khi Momotaro huyền thoại chiến đấu với Oni, một thiếu niên nổi loạn phát hiện ra cuộc xung đột vẫn chưa kết thúc — và dòng máu nguy hiểm vẫn chảy trong huyết quản cậu.</p>',0,0,23,0),(144,'Chị Em Nhà Grimm','https://img.ophim.live/uploads/movies/chi-em-nha-grimm-thumb.jpg','The Sisters Grimm','completed','6','24 phút/tập','2025','HD',NULL,'','Ariel Winter, Leah Newman, Laraine Newman, Abubakar Salim, Billy Harris, Harry Trevaldwyn','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Âu Mỹ','Một năm sau sự biến mất bí ẩn của bố mẹ, hai chị em Sabrina và Daphne chuyển đến một thị trấn kỳ diệu, nơi mà các câu chuyện cổ tích là có thật và bí mật ẩn giấu ở mọi ngóc ngách.',0,0,23,0),(145,'Lăng Thiên Độc Tôn','https://img.ophim.live/uploads/movies/lang-thien-doc-ton-thumb.jpg','Supreme Over The Sky','ongoing','30','10 phút/tập','2025','HD',NULL,'','劉三木, Dong Zhou, 萧秋子, 张雪敏, 唐嶷 Yi Tang, 张胡子','Phiêu Lưu, Viễn Tưởng','Trung Quốc','<p>Phim hoạt hình \"Lăng Thiên Độc Tôn\" được chuyển thể từ tiểu thuyết mạng cùng tên của tác giả hợp đồng U Mục của Kỳ Mậu. Lăng Thiên, một kiếm thánh cùng thế hệ, đã chống lại ý trời, cướp lấy bia đá để cứu người mình yêu, nhưng lại bị thiên đạo hãm hại. Khi ngã xuống, chàng cùng thiên đạo đồng thời chết, nhưng bất ngờ được tái sinh, trở về thời điểm ba trăm năm trước khi chàng chết, khi đan điền bị phá hủy hoàn toàn và xương kiếm bị lấy đi. Nhan sắc của chàng vẫn còn đó, kẻ thù cũ vẫn còn đó, và chàng đã đi trên con đường dài trở thành thánh nhân, vậy tại sao không bắt đầu lại? Trong kiếp này, chàng thề sẽ viết lại vận mệnh và đền bù những tiếc nuối!</p>',0,0,23,0),(146,'Võ Toái Tinh Hà','https://img.ophim.live/uploads/movies/vo-toai-tinh-ha-thumb.jpg','Shattering the Galaxy','ongoing','17','10 phút/tập','2025','HD',NULL,'','','Hành Động, Phiêu Lưu','Trung Quốc','Võ Toái Tinh Hà là hành trình rèn luyện và chiến đấu đầy gian khổ và cũng không kém phần lý thú của một thanh niên có tên Giang Hàn. Chẳng hiểu vì lý do khó hiểu nào đó mà Giang Hàn lại phải sống cô độc nơi núi rừng hoang vu u ám, một tia nhất niệm trong lòng cậu là luôn mong muốn tìm lại cha mẹ của mình, được sống trong sự ấm áp của mái ấm gia đình, vậy nên cậu quyết tâm sẽ rèn luyện bản thân, bước ra thế giới đầy chông gai kia để có thể hy vọng tìm được cha mẹ. Điều may mắn xảy đến khi Thiên Thú Đỉnh mà mẹ cậu truyền lại từ khi cậu con rất nhỏ thì nay đã được giải phóng, nó biến Giang Hàn thành một con người hoàn toàn khác, có những khả năng chiến đấu phi phàm, cũng có thể coi là bất khả chiến bại.',0,0,23,0),(147,'Đại Đường Thừa Phong Lục','https://img.ophim.live/uploads/movies/dai-duong-thua-phong-luc-thumb.jpg','Wind Driver in Tang Dynasty','ongoing','4','22 phút/tập','2025','HD',NULL,'','杨昕燃, 李兰陵, 林帽帽, 常蓉珊, Ye Zhiqiu, 冯盛, 伍凤春, Peng Yao','Phiêu Lưu, Viễn Tưởng','Trung Quốc','Một biến cố lớn xảy ra khi sư phụ Mục Thiên Hậu, bậc Thánh Thủ lừng danh giang hồ, bất ngờ bị kẻ gian hãm hại. Từ đó, giang hồ dậy sóng, mở ra hành trình đầy bi hài của hai huynh đệ vừa mới kết giao: Tổ Bi Thu và Trịnh Đông Đình. Đông Đình quyết định cùng sư đệ truy tìm tung tích người vợ mất tích và manh mối kẻ đã ra tay sát hại sư phụ. Nhưng trên đường đi, họ lại bị vu oan là hung thủ trong một vụ thảm sát, trở thành mục tiêu truy đuổi của nhiều môn phái. Càng tìm cách minh oan, mọi hiểu lầm càng chồng chất. Cuối cùng, nhờ thần kiếm Mãn Thiên Tinh, cả hai đánh bại được Cung Thiên Ảnh - kẻ chủ mưu đứng sau tất cả. Minh oan cho bản thân, họ tiếp tục dấn thân vào con đường trả thù, hướng về Côn Luân tìm Đốc Hồng Hoa.',0,0,23,0),(148,'Vương Miện Của Người Thống Trị','https://img.ophim.live/uploads/movies/9-nine-rulers-crown-thumb.jpg','9-nine- Ruler\'s Crown','completed','13','24 phút/tập','2025','HD',NULL,'','阿部敦, 福圓美里, 種﨑敦美, 山岡ゆり, 藤田茜, 山本和臣, 新井里美, 武田華, 杉田智和','Viễn Tưởng, Khoa Học, Bí ẩn','Nhật Bản','<p>9-nine là câu chuyện về thị trấn Shiromitsugawa, nơi lưu giữ những Cổ vật bí ẩn và siêu năng lực mà chúng ban tặng cho Người sử dụng. Một câu chuyện về lòng tin ngày càng lớn dần và tình yêu chớm nở giữa nhân vật chính và nữ chính, đồng thời cũng là một vụ án mạng bí ẩn, nơi họ truy lùng thủ phạm đằng sau một loạt vụ giết người siêu nhiên.</p>',0,0,23,0),(149,'Thương Lan Quyết (Phần 2)','https://img.ophim.live/uploads/movies/thuong-lan-quyet-phan-2-thumb.jpg','Love Between Fairy and Devil (Season 2)','ongoing','14','15 phút/tập','2025','HD',NULL,'','阿杰, 聶曦映, 杨天翔','Viễn Tưởng, Khoa Học, Chính kịch','Trung Quốc','The ancient demon, Dongfang Qingcang, who has been suppressed for a thousand years, comes back to the three worlds and starts a war between immortals and demons the moment he is reborn. In order to get out, the demon lord swaps souls with the immortal Lan Hua, who has difficulty controlling her magic power, and accidentally kills her immortal body. In desperation, the two embarked on a journey to find a new body. Along the way, the two experienced all sorts of things, fighting and joking, and Lan Hua started to develop feelings for Dongfang Qingcang, but little does she know that all this time, Dongfang Qingcang only used her as a tool to resurrect the ancient god of war Chi Di, and under the calm a larger conspiracy is also quietly carried out ......',0,0,23,0),(150,'Thành Phố Kamitsubaki Đang Được Xây Dựng','https://img.ophim.live/uploads/movies/thanh-pho-kamitsubaki-dang-duoc-xay-dung-thumb.jpg','KAMITSUBAKI CITY UNDER CONSTRUCTION','completed','13','24 phút/tập','2025','HD',NULL,'','花譜, 理芽, ヰ世界情緒, 幸祜, 佐倉綾音, 富田美憂, 阿座上洋平, 梅田修一朗, 藤堂真衣, 伊藤静','Viễn Tưởng, Khoa Học, Bí ẩn','Nhật Bản','<p>Bảy năm sau khi nhân loại bị tàn phá bởi một thảm họa lớn, một ngọn hải đăng của khoa học và sự thịnh vượng đã mọc lên ở Thành phố Kamitsubaki. Nhưng ẩn núp trong bóng tối của nó là những con quái vật Tesseractor sinh ra từ bóng tối của con người. Chỉ có Witchling, năm cô gái với Bài hát thanh tẩy, chống lại chúng. Với mỗi nốt nhạc, họ chiến đấu, không chỉ để bảo vệ hòa bình của thành phố, mà còn để chữa lành một thế giới tan vỡ.</p>',0,0,23,0),(151,'Mưa Tháng Tư Mang Tới Hoa Tháng Năm','https://img.ophim.live/uploads/movies/mua-thang-tu-mang-toi-hoa-thang-nam-thumb.jpg','April Showers Bring May Flowers','completed','13','25 phút/tập','2025','HD',NULL,'','早見沙織, 土屋神葉, 青山吉能, 細谷佳正, 小市眞琴, 畠中祐','Hài Hước','Nhật Bản','<p>Học sinh trung học bi quan Hana Tabata không tin rằng cuộc sống của cô có thể giống như một nữ anh hùng trong bộ truyện tranh shoujo mà cô đọc—cô tin rằng mình xấu xí, và cô luôn cô đơn. Tuy nhiên, cô không thể không tưởng tượng mình là một nữ chính khi cô thay hoa vào sáng sớm... cho đến khi cô bị bắt gặp bởi người bạn cùng lớp đẹp trai Yousuke Ueno! Hana không thể hiểu được những lời tốt đẹp của anh ấy lúc đầu, nhưng khi họ gần gũi hơn, cô thấy cuộc sống của mình dần thay đổi...</p>',0,0,23,0),(152,'Khải Huyền Dị Giới Mynoghra: Chinh Phục Thế Giới Từ Nền Văn Minh Suy Tàn','https://img.ophim.live/uploads/movies/khai-huyen-di-gioi-mynoghra-chinh-phuc-the-gioi-tu-nen-van-minh-suy-tan-thumb.jpg','Apocalypse Bringer Mynoghra: World Conquest Starts with the Civilization of Ruin','completed','13','24 phút/tập','2025','HD',NULL,'','熊谷俊輝, 楠木ともり, 井上喜久子, 佐々木李子','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Nhật Bản','<p>Trong Eternal Nations, một trò chơi chiến lược giả tưởng nơi người chơi quản lý một đế chế, Takuto Ira là một người chơi huyền thoại đứng đầu bảng xếp hạng. Takuto bất tỉnh trong thời gian nằm viện và tỉnh dậy trên lục địa Idoragya, trông giống hệt như trong trò chơi. Takuto gặp Sludge Atou, đơn vị yêu thích của anh trong trò chơi, và quyết định xây dựng Mynoghra, một đế chế độc ác.</p>',0,0,23,0),(153,'Classic Stars: Những Ngôi Sao Nhạc Cổ Điển','https://img.ophim.live/uploads/movies/classic-stars-nhung-ngoi-sao-nhac-co-dien-thumb.jpg','Classic Stars','completed','13','24 phút/tập','2025','HD',NULL,'','内田雄馬, Shun Abe, 石毛翔弥, 唯野あかり, 伊東健人','Học Đường','Nhật Bản','<p>Tại Học viện Tư thục Gloria, nơi sản sinh ra những ngôi sao, Beethoven là một chiến binh, cho đến khi âm nhạc chọn ông. Tại khoa âm nhạc danh giá, những sinh viên có tài năng sánh ngang với các nhạc sĩ huyền thoại sẽ được thừa hưởng tài năng và tên tuổi của họ. Đổi đôi găng tay lấy giai điệu, ông bước vào một thế giới nơi những nốt nhạc vang lên mạnh mẽ hơn cả nắm đấm, quyết tâm giành chiến thắng trong cuộc thi cuối cùng.</p>',0,0,23,0),(154,'Chú Gà Siêu Quậy','https://img.ophim.live/uploads/movies/chu-ga-sieu-quay-thumb.jpg','Chicken Little','completed','1','81 Phút','2005','HD',NULL,'Mark Dindal','Zach Braff, Garry Marshall, Don Knotts, Amy Sedaris, Steve Zahn, Joan Cusack, Patrick Stewart, Fred Willard, Catherine O\'Hara, Wallace Shawn','Hài Hước, Gia Đình','Âu Mỹ','Phim kể về Chicken Little, một chú gà con nhỏ bé bị cả thị trấn Oakey Oaks chế giễu sau khi chú hoảng loạn tuyên bố rằng \"trời đang sập\" vì một mảnh của \"bầu trời\" rơi trúng đầu chú. Không ai tin lời chú, và chú trở thành trò cười.\r Một năm sau, khi đang cố gắng lấy lại danh tiếng bằng cách tham gia đội bóng chày của trường, Chicken Little lại bị một mảnh vật thể hình lục giác rơi trúng đầu lần nữa. Lần này, chú phát hiện ra rằng vật thể đó không phải là một mảnh trời, mà là một tấm ngụy trang từ một con tàu vũ trụ ngoài hành tinh! Cùng với những người bạn bị ruồng bỏ của mình – cô vịt xấu xí Abby Mallard, chú heo béo phì Runt of the Litter và chú cá không biết bơi Fish Out of Water – Chicken Little phải cố gắng cảnh báo thị trấn về cuộc xâm lược của người ngoài hành tinh và cứu thế giới, dù mọi người vẫn không tin vào chú.',0,0,23,0),(155,'Thần Mộ (Phần 1)','https://img.ophim.live/uploads/movies/than-mo-phan-1-thumb.jpg','Tomb of Fallen Gods (Season 1)','completed','16','20 phút/tập','2022','HD',NULL,'','','Viễn Tưởng, Khoa Học','Trung Quốc','The book is based on the protagonist Chen Nan\'s search for his lover Yu Xin ten thousand years ago and the pursuit of the secrets of the destruction of gods and demons. It leads to the vast six paths and the chess game of heaven and earth, and interprets a legend full of blood, heroism, and poignant beauty. It tells the legends of countless heroes and beauties, and discusses elements such as human nature, society, and life.',0,0,23,0),(156,'Thần Mộ (Phần 2)','https://img.ophim.live/uploads/movies/than-mo-phan-2-thumb.jpg','Tomb of Fallen Gods (Season 2)','completed','27','20 phút/tập','2024','HD',NULL,'','','Viễn Tưởng, Khoa Học','Trung Quốc','Chen Nan and his party left Dongchu State and enrolled in Shenlan College. Together with Meng Keer and others, they explored the truth of the evil way of destruction. At the same time, the secret of Chen Nan\'s life gradually surfaced.',0,0,23,0),(157,'Ma Pháp Sư Thuộc Tính Nước','https://img.ophim.live/uploads/movies/ma-phap-su-thuoc-tinh-nuoc-thumb.jpg','The Water Magician','completed','12','24 phút/tập','2025','HD',NULL,'','','Hành Động, Phiêu Lưu','Nhật Bản','<p>Reincarnation khiến Ryo mơ về hòa bình, nhưng thay vào đó, anh ta lại rơi vào một vùng đất hoang vu đầy quái vật. Với phép thuật nước và tuổi trẻ vĩnh cửu, anh ta sống sót sau vô số hỗn hợp độc ác trong 20 năm, trở thành một trong những pháp sư mạnh nhất từ ​​trước đến nay. Số phận của Ryo thay đổi khi anh gặp Abel, một hiệp sĩ thiên tài, đẩy anh ta vào ánh đèn sân khấu của xã hội phép thuật. Vì vậy, cuộc phiêu lưu hoang dã của Pháp sư nước bắt đầu!</p>',0,0,23,0),(158,'Đối Phó Với Chị Em Nhà Mikadono Thật Dễ Dàng','https://img.ophim.live/uploads/movies/doi-pho-voi-chi-em-nha-mikadono-that-de-dang-thumb.jpg','Dealing with Mikadono Sisters Is a Breeze','completed','12','24 phút/tập','2025','HD',NULL,'','日向未南, 天海由梨奈, 古賀葵, 青山吉能, 松風雅也, 茅野愛衣','Hài Hước','Nhật Bản','<p>Yu Ayase, con trai của một nữ diễn viên huyền thoại quá cố, lại là một người tầm thường đến mức khó tin. Khi được mời đến ở cùng bạn của mẹ, Yu vô cùng sửng sốt khi biết mình sẽ sống cùng ba chị em thần đồng, vừa xinh đẹp vừa tài năng… và là những người cai quản ngôi trường mới của cậu với danh hiệu Tam Hoàng. Liệu Yu có thể làm tan chảy trái tim băng giá của hai chị em và thực hiện được ước nguyện cuối cùng của mẹ cậu là xây dựng một gia đình hạnh phúc?</p>',0,0,23,0),(159,'Đặc vụ Ali: Phim điện ảnh 2','https://img.ophim.live/uploads/movies/dac-vu-ali-phim-dien-anh-2-thumb.jpg','Ejen Ali: The Movie 2','completed','1','115 Phút','2025','HD',NULL,'Muhammad Usamah Zaid','Ida Rahayu, Noorhayati Maslini Omar, Shafiq Isa, Omar H. Ali, Su Ling Chan, Abu Shafian Abdul Hamid, Nurul Radhiah Ibrahim, Ahmad Sufian Mazilan, Megat Zahrin Megat Hisham, Aina Nadzir','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học, Gia Đình, Bí ẩn','Malaysia','Ejen Ali is appointed as the pilot of Project Satria, a new armoured suit with the help of an Artificial Intelligence programme specially designed to optimise the physical performance and mental skills of MATA agents while carrying out their secret missions.',0,0,23,0),(160,'Shin - Cậu Bé Bút Chì 32: Nhật Ký Khủng Long Của Mình','https://img.ophim.live/uploads/movies/shin-cau-be-but-chi-32-nhat-ky-khung-long-cua-minh-thumb.jpg','Crayon Shin-chan the Movie: Our Dinosaur Diary','completed','1','106 Phút','2024','HD',NULL,'','','Phiêu Lưu, Hài Hước, Gia Đình','Nhật Bản','Kỳ nghỉ hè bắt đầu, Shin cùng nhóm bạn thân trong \"biệt đội Kasukabe\" nhận được lời mời đến thăm công viên giải trí Đảo Khủng Long. Tình cờ thay, Shin cũng gặp gỡ chú khủng long nhỏ Nana và chú khủng long này gia nhập hội bạn của Shin. Tuy nhiên, sau đó bí mật đằng sau \"thân thế\" của Nana được tiết lộ và âm mưu độc ác xuất hiện khiến Shin và hội bạn phải ra tay cứu giúp.',0,0,23,0),(161,'Your Letter','https://img.ophim.live/uploads/movies/your-letter-thumb.jpg','Your Letter','completed','1','97 Phút','2025','HD',NULL,'김용환','이수현, 김민주, 민승우, 남도형','Phiêu Lưu, Chính kịch, Bí ẩn','Hàn Quốc','After summer vacation, So-ri transfers to a new school and finds an anonymous letter in her desk drawer with an introduction to the school and a clue to finding the next letter.  \"If you want to keep reading, find my second letter!\" While following the clues in the letters and searching all over the school like on a treasure hunt, So-ri keeps running into a same-aged student named Dong-soon. So-ri and Dong-soon quickly become friends as they search for the letters together. As she finds one letter after another, the special connection continues, and So-ri\'s curiosity grows for the mysterious sender. \"I want to find the last letter and thank you in person.\"',0,0,23,0),(162,'Cậu Bé Cá Heo: Bí Mật 7 Đại Dương','https://img.ophim.live/uploads/movies/cau-be-ca-heo-bi-mat-7-dai-duong-thumb.jpg','Dolphin Boy 2','completed','1','91 Phút','2025','HD',NULL,'Яна Кузьмина','Полина Авдеенко, Юлия Рудина, Юлия Зоркина, Александр Васильев, Борис Хасанов, Александр Фенин, Ирина Обрезкова, Олег Фёдоров','Phiêu Lưu','Nga','The heroic deeds of the dolphin boy made him a legend among the sea creatures and the inhabitants of the island, but despite his fame, he feels lonely, because everyone around him expects only new achievements from him, and he has almost no real friends. In addition, he still does not know the story of his origin, even his real name is a mystery to the boy. The sudden appearance of huge whales and evil crabs in the sea strikes fear into the hearts of the islanders and sea creatures. Fate throws a new challenge to the dolphin boy, but at the same time gives him hope.',0,0,23,0),(163,'Bộ Ba Sửu Nhi Đại Náo Mỏ Vàng','https://img.ophim.live/uploads/movies/bo-ba-suu-nhi-dai-nao-mo-vang-thumb.jpg','Buffalo Kids','completed','1','83 Phút','2024','HD',NULL,'Pedro Solís, Juan Jesús García Galocha','Mia Pérez Ullod, Jaume Solà, Javier Cassi Gimeno, Federico Bote Bubaila, Isabel Valls, Ricky Coello, Óscar Barberán, Alfonso Vallés, Miguel Ángel Jenner, Celia Sol','Hài Hước, Phiêu Lưu, Gia Đình','Tây Ban Nha','Mary and Tom are parentless Irish siblings who arrive in New York City via ocean liner in 1886 and quickly find themselves on a wild, cross-country journey aboard a transcontinental \"Orphan Train\" where they meet an extraordinary new friend who will change their lives forever.',0,0,23,0),(164,'Nhà Búp Bê Của Gabby: Phim Điện Ảnh','https://img.ophim.live/uploads/movies/nha-bup-be-cua-gabby-phim-dien-anh-thumb.jpg','Gabby\'s Dollhouse: The Movie','completed','1','98 Phút','2025','HD',NULL,'Ryan Crego','Laila Lockhart Kraner, Gloria Estefan, Kristen Wiig, Logan Bailey, Eduardo Franco, Juliet Donenfeld, Donovan Patton, Sainty Nelsen, Maggie Lowe, Carla Tassara','Hài Hước, Phiêu Lưu, Gia Đình','Âu Mỹ','Gabby cùng bà ngoại Gigi lên đường cho một chuyến đi thú vị đến thành phố mèo rực rỡ Cat Francisco. Nhưng rắc rối ập đến khi ngôi nhà búp bê — vật báu quý giá nhất của Gabby — rơi vào tay Vera, một bà cô kỳ quặc mê mèo. Quyết tâm giành lại, Gabby bước vào cuộc phiêu lưu xuyên thế giới thực, tập hợp lại những chú mèo Gabby Cats và cứu ngôi nhà búp bê trước khi quá muộn.',0,0,23,0),(165,'Tử Xuyên (Phần 2)','https://img.ophim.live/uploads/movies/tu-xuyen-phan-2-2025-thumb.jpg','Purple River (Season 2)','ongoing','12','20 phút/tập','2025','HD',NULL,'','Tang Bao, 马正阳, 姜广涛, 宝木中阳, 阿杰, 喬詩語, Liangwei Hu, 高启帆, Xiao Han, Yuanfei Mei','Viễn Tưởng, Khoa Học','Trung Quốc','Truyền kì máu lửa qua từng thời đại: Trong đế quốc của loài người, gia tộc thần bí ở phương Đông xa xôi, Tử Xuyên Tam Kiệt phất lên! Anh cả Đế Lâm chín chắn đa mưu, tàn khốc lí trí, anh hai Sterling chỉ huy một đội quân, có lòng trung thành với nước, em út Tử Xuyên Tú bị người đời gọi với cái tên “Vô Lại”, trí dũng song toàn. Gia tộc Tử Xuyên loạn trong giặc ngoài, Tử Xuyên Tam Kiệt mỗi người đều có thế mạnh riêng: Trong thời khắc nước sôi lửa bỏng, đánh bại Ma tộc hung ác, xông vào hang hổ truy sát tên phản đồ Lôi Hồng đến cùng; Tư Đặc Lâm lấy gia tộc làm gốc, vừa vô tình vừa trọng tình lưu luyến người yêu... Loài người, Ma tộc, Thú tộc. Mỗi tộc ở mỗi phương khác nhau, tranh chấp lẫn nhau trên mảnh đất Đại Lục này, xích mích không ngừng. Khi máu và lửa hòa vào nhau, đao và kiếm va chạm, tạo ra câu chuyện sử thi bi tráng-Tử Xuyên.',0,0,23,0),(166,'Batman Aztec: Đế Chế Huyết Chiến','https://img.ophim.live/uploads/movies/batman-aztec-de-che-huyet-chien-thumb.jpg','Aztec Batman: Clash of Empires','completed','1','89 Phút','2025','HD',NULL,'Juan Jose Meza-Leon','Horacio García Rojas, Álvaro Morte, Omar Chaparro, Humberto Busto, Jesús Guzmán, José Carlos Illanes, Maya Zapata, Teresa Ruiz','Hành Động, Phiêu Lưu','Âu Mỹ, Mexico','<p>Phim kể về Yohualli Coatl, một chàng trai Aztec trẻ tuổi, người chứng kiến cha mình — Toltecatzin — bị quân viễn chinh Tây Ban Nha giết hại. Lớn lên, Yohualli trở thành linh mục dưới triều vua Moctezuma II, đồng thời bí mật sử dụng thân phận siêu anh hùng “Batman”. Hắn được huấn luyện tại đền của thần dơi Tzinacan, chế tạo vũ khí và thiết bị để chống&nbsp;</p>',0,0,23,0),(167,'Tiên Sủng','https://img.ophim.live/uploads/movies/tien-sung-thumb.jpg','Celestial Bonds','completed','18','21 phút/tập','2025','HD',NULL,'','刘校妤, Qian Chen, 劉三木, Yang Kaiqi, 阿杰, 陈张太康, 赵爽','Hài Hước, Bí ẩn','Trung Quốc','Một trăm năm trước, Tiên nữ Thiên Quyển đã chém Thận quân khiến Thận yêu biến mất khỏi Thương Sóc, nhưng cô cũng mất đi ký ức về trận chiến. Sau chiến tranh, Thiên Quyển hạ phàm làm Thổ Địa, nuôi chim Ly Kiêu — sinh vật hóa thành người với dung mạo giống người tình đã khuất Thiệu Vị Ly. Khi Ly Kiêu đi khỏi nhiều ngày, Thiên Quyển đến trấn La Y và phát hiện toàn bộ dân làng bị sát hại, Thận yêu tái xuất hiện. Thiên Quyển cùng Ly Kiêu hợp lực chống lại yêu quái, giải cứu trấn La Y. Trong lúc ký ức dần hồi phục, Thiên Quyển nhận ra mối liên hệ sâu sắc giữa Thiệu Vị Ly, Ly Kiêu và Thận quân mà cô từng giết.',0,0,23,0),(168,'Nàng búp bê thử đồ của tôi biết yêu (Phần 2)','https://img.ophim.live/uploads/movies/nang-bup-be-thu-do-cua-toi-biet-yeu-phan-2-thumb.jpg','My Dress-Up Darling Season 2','completed','12','24 phút/tập','2025','HD',NULL,'','直田姫奈, 石毛翔弥, 種﨑敦美, 羊宮妃那, 斧アツシ','Hài Hước, Chính kịch','Nhật Bản','<p>Ước ao trở thành thợ làm búp bê truyền thống, nam sinh cấp 3 nghiêm túc nọ được cô bạn cùng lớp nổi tiếng và hào nhoáng giới thiệu đến thế giới cosplay.</p>',0,0,23,0),(169,'Mùa hè Hikaru chết','https://img.ophim.live/uploads/movies/mua-he-hikaru-chet-thumb.jpg','The Summer Hikaru Died','completed','12','24 phút/tập','2025','HD',NULL,'','小林千晃, 梅田修一朗, 花守ゆみり, 小若和郁那, 小林親弘, 中島ヨシキ, 若山詩音','Bí ẩn','Nhật Bản','<p>Sáu tháng trước, Hikaru mất tích suốt một tuần. Giờ đây, khi người bạn thân nhất Yoshiki linh cảm có điều không ổn và đối mặt với cậu, sự thật kinh hoàng dần hé lộ.</p><p>&nbsp;</p>',0,0,23,0),(170,'Quái Vật Số 8 (Phần 2)','https://img.ophim.live/uploads/movies/quai-vat-so-8-phan-2-thumb.jpg','Kaiju No. 8 (Season 2)','completed','12','24 phút/tập','2025','HD',NULL,'','','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Những con \"kaiju\" (quái vật khổng lồ) bất ngờ xuất hiện và hoành hành khắp Nhật Bản trong nhiều năm. Một đơn vị tinh nhuệ được gọi là Quân đoàn Phòng vệ phải liều mạng hàng ngày để bảo vệ dân thường. Anh chàng Kafka Hibino mang ước mơ gia nhập Quân đoàn từ nhỏ nhưng lại bị dòng đời đưa đẩy, phải làm công việc chuyên xử lý xác quái vật. Sau một tai nạn kỳ lạ, anh có được khả năng biến hình, được mệnh danh là \"Kaiju số 8\". Từ đây, Kafka bắt đầu hiện thực hóa ước mơ thuở nhỏ của mình, gia nhập Quân đoàn và giấu kín năng lực vừa có được.',0,0,23,0),(171,'Marvel Zombies','https://img.ophim.live/uploads/movies/marvel-zombies-thumb.jpg','Marvel Zombies','completed','4','125 phút/tập','2025','HD',NULL,'','Elizabeth Olsen, Iman Vellani, David Harbour, Simu Liu, Awkwafina, Todd Williams, Robin Atkin Downes, David Boat, Kari Wahlgren, Fred Tatasciore','Viễn Tưởng, Khoa Học','Âu Mỹ','After the Avengers are overtaken by a zombie plague, a desperate group of survivors discover the key to bringing an end to the super-powered undead, racing across a dystopian landscape and risking life and limb to save their world.',0,0,23,0),(172,'Thiên Quan Tứ Phúc (Phần 2)','https://img.ophim.live/uploads/movies/thien-quan-tu-phuc-phan-2-thumb.jpg','Heaven Official\'s Blessing (Season 2)','completed','12','25 phút/tập','2023','HD',NULL,'李豪凌','姜广涛, 马正阳, 趙毅, Xiongfei Tu','Viễn Tưởng, Khoa Học','Trung Quốc','<p>Thái tử Tạ Liên của Tiên Lạc quốc, sau nhiều lần giáng chức, đã được lên Thiên đình. Tuy nhiên, chàng vô tình phá vỡ Kim cung của các quan thần. Không còn người thờ phụng, Tạ Liên đành phải xuống thế gian trừ tà.</p>',0,0,23,0),(173,'Sát thủ về vườn','https://img.ophim.live/uploads/movies/sat-thu-ve-vuon-thumb.jpg','SAKAMOTO DAYS','ongoing','22','24 phút/tập','2024','HD',NULL,'','','Hành Động, Hài Hước','Nhật Bản','Thời gian trôi qua thật yên bình đối với Sakamoto kể từ khi anh ấy rời khỏi thế giới ngầm. Anh ấy đang điều hành một cửa hàng nhỏ trong khu phố với người vợ xinh đẹp và đứa con của mình, và có vẻ hơi... phát tướng rồi. Nhưng một ngày nọ, một nhân vật từ quá khứ của anh ấy đến thăm và đưa ra một lời đề nghị mà anh ấy không thể từ chối: quay trở lại thế giới sát thủ hoặc là chết!',0,0,23,0),(174,'Anh Hùng Bất Tỉnh Và Công Chúa Ám Sát','https://img.ophim.live/uploads/movies/anh-hung-bat-tinh-va-cong-chua-am-sat-thumb.jpg','The Shy Hero and the Assassin Princesses','completed','12','24 phút/tập','2025','HD',NULL,'','武内駿輔, 佐伯伊織, 上田瞳, 白石晴香','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','<p>Người hùng Toto có tài năng, nhưng tính nhút nhát đã ngăn cản anh thành lập một nhóm. Trong lúc anh đang vật lộn tại thị trấn khởi nguyên, ba người phụ nữ xinh đẹp - Ciel, Anemone và Goa - bất ngờ mời Toto tham gia nhóm của họ. Toto chuẩn bị sẵn sàng cho cuộc hành trình, nhưng không hề hay biết, cả ba người phụ nữ đều đang âm mưu giết anh vì lý do riêng của họ!</p>',0,0,23,0),(175,'Công Chúa Da Đỏ','https://img.ophim.live/uploads/movies/cong-chua-da-do-thumb.jpg','Pocahontas','ongoing','1','81 Phút','1995','HD',NULL,'Mike Gabriel, Eric Goldberg','Irene Bedard, Mel Gibson, David Ogden Stiers, John Kassir, Christian Bale, Judy Kuhn, Billy Connolly, Frank Welker, Russell Means, Linda Hunt','Phiêu Lưu, Gia Đình','Âu Mỹ','Năm 1607, làn sóng khai thác thuộc địa mới ở Châu Âu diễn ra ồ ạt. Con tàu của thuyền trưởng John Smith và vị thống đốc tham lam Ratcliffe tìm đến xứ Bắc Mỹ, ngày đó vẫn còn là một vùng đất nằm trong bí ẩn.\r Ngay khi đặt chân tới vùng đất lạ, nhóm của John và bộ lạc da đỏ của thủ lĩnh Powhatan. John đem lòng yêu con gái của Powhatan là Pocahontas, nhưng những bất đồng trong lối sống và tham vọng của bản quốc đã khiến mối tình của họ bị chia cắt bởi chiến tranh với người da đỏ...',1,0,23,0),(176,'Gia Sư Của Công Tước Tiểu Thư','https://img.ophim.live/uploads/movies/gia-su-cua-cong-tuoc-tieu-thu-thumb.jpg','Private Tutor to the Duke\'s Daughter','completed','12','24 phút/tập','2025','HD',NULL,'','上村祐翔, 澤田姫, 守屋亨香, 長谷川育美, 水瀬いのり, 前島亜美','Viễn Tưởng, Khoa Học','Nhật Bản','<p>Sau khi Allen trượt kỳ thi pháp sư của tòa án, anh không thể trở về nhà ngay cả khi anh muốn. Trong khi tìm kiếm việc làm, một lời đề nghị bất ngờ đến với anh để trở thành gia sư riêng cho con gái của công tước. Ngay khi anh hạ thấp cảnh giác, anh phải đối mặt với một cô gái không thể sử dụng phép thuật chút nào! Nhưng điều gì đang ngăn cản phép thuật của cô ấy hoạt động? Những bài học phi truyền thống của Allen nhẹ nhàng soi sáng tương lai của cô gái.</p>',0,0,23,0),(177,'Thần Quốc Chi Thượng','https://img.ophim.live/uploads/movies/than-quoc-chi-thuong-thumb.jpg','Over the Divine Realms','ongoing','17','25 phút/tập','2025','HD',NULL,'','','Hành Động, Phiêu Lưu','Trung Quốc','Chỉ trong sáu ngày đêm, một vụ án ly kỳ dần hé lộ. Liệu lần này chàng thiếu niên trở về từ mười hai năm trước có thể phá tan xiềng xích Thần quốc?',0,0,23,0),(178,'Khách sạn có ma','https://img.ophim.live/uploads/movies/khach-san-co-ma-thumb.jpg','Haunted Hotel','completed','10','25 phút/tập','2025','HD',NULL,'','Will Forte, Eliza Coupe, Skyler Gisondo, Natalie Palamides, Jimmi Simpson','Hài Hước','Âu Mỹ','Sau khi thừa kế một khách sạn từ anh trai quá cố, người mẹ đơn thân nọ chuyển đến sống cùng hồn ma tốt bụng của anh... và những vị khách hay đòi hỏi song không bao giờ trả phòng.',0,0,23,0),(179,'Clevatess','https://img.ophim.live/uploads/movies/clevatess-thumb.jpg','Clevatess','completed','12','24 phút/tập','2025','HD',NULL,'','','Hành Động','Nhật Bản','Một nhóm anh hùng lên đường tiêu diệt Cleavatess, vua của các loài thú. Nhưng họ vấp phải một âm mưu hủy diệt thế giới và phải nhờ Cleavatess giúp đỡ.',0,0,23,0),(180,'DAN DA DAN (Phần 2)','https://img.ophim.live/uploads/movies/dan-da-dan-phan-2-thumb.jpg','Dan Da Dan (Season 2)','completed','12','24 phút/tập','2025','HD',NULL,'','若山詩音, 花江夏樹','Hành Động, Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản','Cá cược để chứng minh sự tồn tại của ma và người ngoài hành tinh, hai học sinh cấp ba đối mặt với những mối đe dọa siêu linh đáng sợ, có được siêu năng lực và thậm chí yêu nhau?!',0,0,23,0),(181,'Họa Giang Hồ Chi Bất Lương Nhân (Phần 1)','https://img.ophim.live/uploads/movies/hoa-giang-ho-chi-bat-luong-nhan-phan-1-thumb.jpg','Họa Giang Hồ Chi Bất Lương Nhân (Phần 1)','completed','54','15 phút/Tập','2014','HD',NULL,'','','Hành Động, Võ Thuật, Phiêu Lưu','Trung Quốc','<p>“Bất lương nhân” tiếp nối sự thành công vô cùng đáng nể của “Hiệp lam”, là một tác phẩm hoạt hình võ hiệp 3D khác nữa của công ti trách nhiệm hữu hạn kĩ thuật số Bắc Kinh Nhược Thâm.”Bất lương nhân” sử dụng giọng văn và cách miêu tả chiến loạn liên miên, sự đen tối của thời kì ngũ đại thập quốc vô cùng độc đáo. Các sự kiện lịch sử và truyền thuyết lưu truyền trong dân gian như khởi nghĩa Hoàng Sào, Chu Ôn soán vị, Lý thị bị diệt tộc, Hữu Khuê giết cha, Sa Đà tranh bá được lồng ghép và xuyên suốt cả bộ phim. Các diễn viên chính cùng các vị anh hùng giương kiếm xông pha nơi giang hồ, đồng thời cũng nếm trải bao biến động, bao đổi thay, bao sóng gió giữa tuổi thanh xuân và tình yêu, giữa bội phản và lòng trung thành trong dòng xoáy lịch sử. Và rồi họ trở thành sức mạnh chủ chốt, đặt dấu chấm hết cho một thời kì rối ren, mở ra một kỉ nguyên hoàn toàn mới, đồng thời cũng viết nên trang sử rực rỡ của võ hiệp Trung Quốc.Bắc Kinh Nhược Thâm cho biết, sở dĩ bộ phim hoạt hình 3D này lấy tên là “Họa giang hồ chi bất lương nhân” là bởi bối cảnh phim diễn ra trong những năm cuối thời nhà Đường. Câu chuyện luôn xoay quanh kho báu khổng lồ mà tổ chức Bất lương nhân đã cất giấu, vậy nên tổ sản xuất đã lựa chọn cái tên này, nhằm giúp độc giả có một cái nhìn khách quan nhất cho bộ phim.</p>',0,0,23,0),(182,'Họa Giang Hồ Chi Bất Lương Nhân (Phần 2)','https://img.ophim.live/uploads/movies/hoa-giang-ho-chi-bat-luong-nhan-phan-2-thumb.jpg','Họa Giang Hồ Chi Bất Lương Nhân (Phần 2)','ongoing','10','20 phút/Tập','2016','HD',NULL,'','','Hành Động, Võ Thuật, Phiêu Lưu','Trung Quốc','<p>Sau phần đầu tiên hết sức thành công được ra mắt vào năm 2014, một phần mới cũng được phát hành vào năm 2015 với 40 tập và kéo dài đến năm 2016, tuy nhiên nó không phải là phần nội dung kế tiếp nên khán giả vẫn còn rất mong chờ một phiên bản viết tiếp nội dung của Họa Giang Hồ Chi Bất Lương Nhân PHIÊN BẢN năm 2014, thật tuyệt vời khi người xem không phải chờ đợi lâu và chỉ ngay sau khi kết thúc Chi Linh Chủ thì Họa Giang Hồ Chi Bất Lương Nhân 2 được lên sóng với hứa hẹn mang tới những cậu chuyện hấp dẫn mới mẻ cùng sự đột phá cả về nội dung lẫn đồ họa hình ảnh. Kết thúc ở phần 1 tạm khép lại những cuộc chiến Lý Tinh Vân cùng nhiều thế lực đen tối cũng như môn phái tham lam Long Tuyền kiếm, đồng thời anh chàng cũng có được cho mình một cô nàng người yêu xinh đẹp thì ở Họa Giang Hồ Chi Bất Lương Nhân Phần 2 sẽ là những cuộc chiến mới, cuộc chơi mới với những đối thủ khó nhằn hơn rất nhiều. Từ Chu Hữu Trình, Chung Tiểu Qùy cho tới Chung Tâm Ma, Lý Tồn Húc của 2 quốc gia khác nhau đều muốn có được Long Tuyền kiếm để trị vì thiên hạ bởi chúng tin rằng nhờ vào nó sẽ giúp đánh đâu thắng đấy và không có bất cứ một nước nào dám bén mảng xâm lược. Thử thách đối với Lý Tinh Vân lúc này sẽ là lớn hơn rất nhiều cùng với nhiều kẻ thù mới đang truy sát anh chỉ để giành lấy thanh bảo kiếm. Trong khi anh chàng ngày càng đào hoa với những cuộc hành trình mới thì không biết rằng nhiều nguy hiểm đang chờ cậu ta ở phía trước. Liệu rằng ở Chi Bất Lương Nhân 2, Lý Tinh Vân có tiếp tục bảo vệ được Long Tuyền kiếm và chống chọi lại được với rất nhiều kẻ thù ngày càng mạnh hơn với tầm vóc của cả một quốc gia hay không, chuyện tình cảm của anh chàng này sẽ đi đến đâu</p>',0,0,23,0),(183,'Họa Giang Hồ Chi Bất Lương Nhân (Phần 4)','https://img.ophim.live/uploads/movies/hoa-giang-ho-chi-bat-luong-nhan-phan-4-thumb.jpg','Họa Giang Hồ Chi Bất Lương Nhân (Phần 4)','completed','13','30 phút/tập','2021','HD',NULL,'','','Võ Thuật, Hành Động, Phiêu Lưu','Trung Quốc','<p>Thập Vạn Đại Sơn nguy cơ tứ bề, chuyến đi Nhiêu Cương gian nan trắc trở. Thập Nhị Động có bí mật gì không thể để người khác biết? Đối diện với các thế lực lớn mạnh, đám người Lý Tinh Vân có thể toàn vẹn rút lui? Chuyến đi Nhiêu Cương thần bí khó lường này sắp sửa khởi hành…</p><p>Sang phần 4 nhiều tên riêng đã bị thay đổi để tránh gây tranh cãi, Miêu Cương =&gt; Nhiêu Cương, Vu vương =&gt; Hủy vương, Cổ vương =&gt; Độc vương&nbsp;v.v…</p>',0,0,23,0),(184,'Cặp Đôi Tu Hú Phần 2','https://img.ophim.live/uploads/movies/cap-doi-tu-hu-phan-2-thumb.jpg','Cặp Đôi Tu Hú Phần 2','ongoing','11','24 phút/tập','2025','HD',NULL,'','','Tình Cảm','Nhật Bản','<p>Second season of Kakkou no Iinazuke.</p>',0,0,23,0),(185,'Thánh Nữ Hoàn Hảo: Bị Hôn Phu Đá Và Bán Qua Nước Khác','https://img.ophim.live/uploads/movies/thanh-nu-hoan-hao-bi-hon-phu-da-va-ban-qua-nuoc-khac-thumb.jpg','The Too-Perfect Saint: Tossed Aside by My Fiancé and Sold to Another Kingdom','completed','12','24 phút/tập','2025','HD',NULL,'','','Khoa Học, Viễn Tưởng','Nhật Bản','<p>Bị hôn phu hắt hủi vì thiếu duyên dáng rồi bị bán sang vương quốc láng giềng, Philia chuẩn bị chấp nhận số phận nghiệt ngã. Nhưng thay vào đó, cô nhận được sự chào đón bất ngờ.</p><p>&nbsp;</p>',0,0,23,0),(186,'TO BE HERO X','https://img.ophim.live/uploads/movies/to-be-hero-x-thumb.jpg','TO BE HERO X','ongoing','22','23 phút/tập','2025','HD',NULL,'','魏超, 刘校妤, 陈张太康, Wentao Chang, 陳錦聞, Qian Chen, 赵爽, 张福正, Yang Kaiqi, 谷江山','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc','In a world full of brilliant heroes, it’s the trust of fans that turns heroes into superheroes. If a hero loses the people’s trust, they lose their special abilities. Trust value is collected, quantified, and used to determine a hero’s ranking, displayed on their wrist. Every two years, the top heroes go to a tournament to fight, determine new trust values, and earn their rankings.',0,0,23,0),(187,'Dũng sĩ otaku béo','https://img.ophim.live/uploads/movies/dung-si-otaku-beo-thumb.jpg','Dũng sĩ otaku béo','ongoing','11','24 phút/tập','2025','HD',NULL,'','','Hành Động','Nhật Bản','<p>Bị kết án oan về một tội ác, Shigeru Yoshioka 34 tuổi mất tất cả mọi thứ, kể cả lòng tin vào phụ nữ, và rút lui khỏi xã hội như một kẻ ẩn dật thất nghiệp.\n\nMột ngày nọ, anh tình cờ tìm ra cách để du hành đến một thế giới khác. Khi một màn hình trạng thái bí ẩn xuất hiện trên máy tính của anh, Shigeru đã hy sinh ngoại hình của mình để có được 100 nghìn tỷ và 5.100 tham số. Bây giờ được tái sinh thành một \"Thần tuyệt đối\", anh bắt đầu cuộc sống thứ hai của mình ở một thế giới khác.</p>',0,0,23,0),(188,'Chúng Tôi Đơn Giản Là Gấu Con (Phần 2)','https://img.ophim.live/uploads/movies/chung-toi-don-gian-la-gau-con-phan-2-thumb.jpg','We Baby Bears Season 2','completed','25','12 phút/tập','2023','HD',NULL,'','','Hài Hước, Gia Đình','Âu Mỹ','Follow Grizz, Panda and Ice Bear – as their younger baby selves – traveling in a magical box to fantastic new worlds searching for a place to call home. Along the way, they meet new friends, learn a few lessons and discover that “home” can mean wherever they are, as long as they’re together.',0,0,23,0),(189,'Chúa Tể Huyền Bí','https://img.ophim.live/uploads/movies/chua-te-huyen-bi-thumb.jpg','Lord of the Mysteries','completed','13','35 phút/tập','2025','HD',NULL,'','','Viễn Tưởng, Khoa Học, Bí ẩn','Trung Quốc','<p>Tác phẩm được chuyển thể từ tiểu thuyết cùng tên \"Chúa Tể Huyền Bí\" của tác giả cấp Bạch Kim trên trang Qidian, Mực Thích Lặn Nước. Tarot, Steampunk, siêu năng lực... Chu Minh Thụy đến từ một thế giới khác, gia nhập vào thế giới nhuốm màu điên loạn và kinh hoàng này, và trở thành \"Klein\".</p><p>&nbsp;</p>',0,0,23,0),(190,'Quân Hữu Vân (Phần 2)','https://img.ophim.live/uploads/movies/jun-you-yun-2nd-season-thumb.jpg','Jun You Yun (Season 2)','ongoing','18','20 phút/tập','2025','HD',NULL,'','','Hành Động, Võ Thuật','Trung Quốc','<p>4 thiếu niên rời khỏi trường bước chân vào giang hồ, trên đường tìm kiếm chân tướng, làm sáng tỏ câu đố thân thế. Vì thành quân tử mà trải qua muôn vàn khó khăn nguy hiểm. Họ trọng đạo quân tử, thể hiện sự hiệp nghĩa lấy thân là sức, thực hiện công đạo nhân gian. Một bộ kỳ thư, một trận ân oán, một loại tín ngưỡng, một đoạn truyền kỳ.</p><p>&nbsp;</p>',0,0,23,0),(191,'Bách Yêu Phổ - Chương Lạc Dương','https://img.ophim.live/uploads/movies/bach-yeu-pho-chuong-lac-duong-thumb.jpg','Fairies Albums (Season 5)','ongoing','9','23 phút/tập','2025','HD',NULL,'','','Cổ Trang','Trung Quốc','<p>Fifth season of Bai Yao Pu.</p>',0,0,23,0),(192,'Vua sói (Phần 2)','https://img.ophim.live/uploads/movies/vua-soi-phan-2-thumb.jpg','Wolf King (Season 2)','completed','8','27 phút/tập','2025','HD',NULL,'','Nina Barker-Francis, Ceallach Spellman','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Anh','In Season 2, Drew fights for his throne and faces enemies from all sides, and he learns the heavy burden of being king — and the daunting task of choosing a queen.',0,0,23,0),(193,'Dư Tẫn Hành Giả','https://img.ophim.live/uploads/movies/du-tan-hanh-gia-thumb.jpg','Embers','completed','15','22 phút/tập','2025','HD',NULL,'','','Hành Động, Phiêu Lưu','Trung Quốc','Đoan Mộc Dạ Vũ, thiếu niên mang ước mơ trở thành thợ săn địa ngục, vô tình cứu một người máy cải tạo và lấy đi vật dụng quan trọng trong nhiệm vụ tuyệt mật. Hành động vô ý ấy châm ngòi cho cuộc truy lùng quy mô lớn của phe phản diện, đẩy thành Dư Tẫn vào cuộc chiến sinh tử khởi nguồn từ lòng tốt ngây thơ của một cậu bé.',0,0,23,0),(194,'Look Back: Liệu Ta Có Dám Nhìn Lại?','https://img.ophim.live/uploads/movies/look-back-lieu-ta-co-dam-nhin-lai-thumb.jpg','Look Back','completed','1','62 Phút','2024','HD',NULL,'押山清高','河合優実, 吉田美月喜, 斉藤陽一郎, 岡幸太, 牧紅葉, Koya Yoshihashi, 宮島岳史, 高橋大輔, 伊東潤, 竹内芳織','Chính kịch','Nhật Bản','Đây là anime được chuyển thể từ one-shot nổi tiếng của tác giả Chainsaw Man - Tatsuki Fujimoto.',0,0,23,0),(195,'Nhị Lang Thần: Thâm Hải Giao Long','https://img.ophim.live/uploads/movies/nhi-lang-than-tham-hai-giao-long-thumb.jpg','God with Three Eyes','completed','1','100 Phút','2024','HD',NULL,'Wang Jun','王凱, Kejian Qi, 梁晓强, 凌振赫, 李昊甲, 胡亞捷, 郭政建','Hành Động, Phiêu Lưu','Trung Quốc','Sau trận chiến phong Thần, nhiều nhân vật có công được ghi danh trên bảng phong Thần rồi phong ấn xuống đáy biển sâu. Tuy nhiên, vì để bảng phong Thần được lập lại lần nữa, có kẻ đã dùng thủ đoạn khiến Nhị Lang Thần mở phong ấn cho Giao Ma Vương thoát ra. Để lấy công chuộc tội, Nhị Lang Thần và những người bạn cùng nhau xử lý tai họa này.',0,0,23,0),(196,'Thiên Mệnh Đại Chúa Tể','https://img.ophim.live/uploads/movies/thien-menh-dai-chua-te-thumb.jpg','The Destiny Ruler','completed','40','7 phút/tập','2025','HD',NULL,'','','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Trung Quốc','Khám phá bộ phim Thiên Mệnh Đại Chúa Tể, một tác phẩm đầy hấp dẫn với câu chuyện về cuộc đối đầu giữa Đại Hạ Thần Châu và chính tà từ thời khai thiên lập địa. Trải qua hàng trăm năm, thế lực ma môn ngày càng mạnh mẽ, khiến cho các tông môn chính đạo phải gồng mình để chống lại. Lý Vạn Niên, một thiếu niên bình thường nhưng sở hữu sức mạnh bất tử, đã bắt đầu hành trình tu luyện và trở thành người có tu vi vô cùng cao cả. Hãy cùng theo dõi peripeteia của nhân vật này trong cuộc chiến giữa ác và thiện, với sự tham gia của dàn diễn viên xuất sắc và kịch tính.',0,0,23,0),(197,'Mục Thần Ký','https://img.ophim.live/uploads/movies/muc-than-ky-thumb.jpg','Tales of Qin Mu','ongoing','48','20 phút/tập','2024','HD',NULL,'沈乐平','Ruoyu Zhang, 李欣, 程玉珠, Qingqing Du, 虞晓旭, 于凯隆, 高嗣航, Yuhang Wang, Hao Tang, 张恒','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc','<p><strong>Tần Mục trời sinh phàm thể, trải qua khảo nghiệm trở thành Thiên Ma giáo giáo chủ, bị diên Khang quốc phong làm đời thứ nhất thái học tiến sĩ. Diên Khang quốc phản loạn chi chiến bên trong Tần Mục dẫn tới Ma Thần, nhấc lên hạo đãng phong vân, sau theo võ Khả Hãn nhập Lâu Lan hoàng kim cung, một người đánh khắp Thánh cung vô địch thủ. Hắn trở về diên Khang, trợ quốc sư bình định, tạo Xạ Nhật thần pháo, sau đến người hoàng truyền thừa trở thành một đời mới Nhân Hoàng. Dưới cơ duyên xảo hợp Tần Mục biết được thân thế của mình, mượn nhờ đạo môn nhỏ Ngọc Kinh bọn người trợ giúp, mở ra đạo pháp thần thông cải cách đại thế.</strong></p>',0,0,23,0),(198,'Bách Yêu Phổ Phần 4','https://img.ophim.live/uploads/movies/bach-yeu-pho-phan-4-thumb.jpg','百妖谱 第四季','completed','12','23 phút/tập','2024','HD',NULL,'','','Tình Cảm','Trung Quốc','Bách Yêu Phổ Phần 4',0,0,23,0),(199,'Bách Yêu Phổ Phần 2','https://img.ophim.live/uploads/movies/bach-yeu-pho-phan-2-thumb.jpg','百妖谱 第二季','completed','12','24 phút/tập','2021','HD',NULL,'','','Phiêu Lưu, Bí ẩn','Trung Quốc','<p>Linh y Đào Yêu của Đào Đô cùng với tiểu hòa thượng Ma Nha, tiểu hồ yêu bị thu phục ở phần một và Liễu công tử - người hàng xóm lâu năm của Đào Đô - cùng nhau viết tiếp câu chuyện ở phần một. Để tìm kiếm Bách Yêu Phổ đã mất tích, họ đi khắp bốn phương. Trên đường đi, họ gặp bốn con yêu quái Ưng Thanh, Hóa Xà, Âu Cơ, Chiếu Hải và chữa trị nhiều