 Paul Rust, Dulé Hill, Alex Newell, Jeff Bennett, H Michael Croner, Darius Johnson, Lauren \'Lolo\' Spencer, Courtenay Taylor','Gia Đình','Âu Mỹ','Vì muốn lan tỏa sự tử tế, cô bé Lulu yêu thích niềm vui sẽ có một chuyến đi khó quên, với sự hỗ trợ của bạn bè, lòng dũng cảm, và những bài hát hay tuyệt!',0,0,23,0),(214,'Snoopy Giới Thiệu: Nhạc Hội Mùa Hè','https://img.ophim.live/uploads/movies/snoopy-gioi-thieu-nhac-hoi-mua-he-thumb.jpg','Snoopy Presents: A Summer Musical','completed','1','40 Phút','2025','HD',NULL,'Erik Wiese','Etienne Kellici, Hattie Kragten, Terry McGurrin, Jayd Deroché, Isabella Leo, Lexi Perri, Wyatt White, Caleb Bellavance, Arianna McDonald, Zoe Wheatley','Gia Đình','Âu Mỹ, Canada','Âm nhạc và tiếng cười rộn ràng khắp nơi khi Charlie Brown và các bạn ở trại hè. Lần đầu đến đây, Sally vẫn chưa hiểu sao mọi người lại háo hức đến thế. Nhưng khi trại hè có nguy cơ phải đóng cửa, cả nhóm phải đoàn kết lại để cứu trại hè, và để nhiều bạn nhỏ khác cũng có cơ hội tạo nên những kỷ niệm đặc biệt.',0,0,23,0),(215,'Thám Tử Lừng Danh Conan','https://img.ophim.live/uploads/movies/tham-tu-lung-danh-conan-thumb.jpg','Detective Conan','ongoing','1046','25 Phút','2005','HD',NULL,'','','Hành Động, Hài Hước, Tâm Lý, Bí ẩn','Nhật Bản','<p>Mở đầu câu truyện, cậu học sinh trung học 17 tuổi (trong truyện tranh là 16) <strong>Shinichi Kudo</strong> (Jimmy Kudo) bị biến thành cậu bé <strong>Conan</strong> Edogawa. <strong>Shinichi</strong> trong phần đầu của Thám tử lừng danh Conan được miêu tả là một thám tử học đường. Trong một lần đi chơi công viên \"Miền Nhiệt đới\" với cô bạn từ thuở nhỏ (cũng là bạn gái) Ran Mori (Rachel Moore), cậu bị dính vào vụ án một hành khách trên Chuyến tàu tốc hành trong công viên, Kishida (Kenneth), bị giết trong một vụ án cắt đầu rùng rợn. Cậu đã làm sáng tỏ vụ án và trên đường về nhà, chứng kiến một vụ làm ăn mờ ám của những người đàn ông mặc toàn đồ đen. Kudo bị phát hiện, bị đánh ngất sau đó những người đàn ông áo đen đã cho cậu uống một thứ thuốc độc chưa qua thử nghiệm là Apotoxin-4869 (APTX4869) với mục đích thủ tiêu cậu. Tuy nhiên chất độc đã không giết chết Kudo. Khi tỉnh lại, cậu bàng hoàng nhận thấy thân thể mình đã bị teo nhỏ trong hình dạng của một cậu học sinh tiểu học.</p>',0,0,23,0),(216,'Bí ẩn quanh Barbie (Phần 2)','https://img.ophim.live/uploads/movies/bi-an-quanh-barbie-phan-2-thumb.jpg','Barbie Mysteries (Season 2)','completed','8','23 phút/tập','2025','HD',NULL,'','Abby Trott, Diamond White','Hài Hước','Âu Mỹ','Barbie and Barbie\'s summer plans take a mysterious turn when the podcast hosts stumble upon a series of beachside mysteries.',2,0,23,0),(217,'Doraemon: Nobita Và Cuộc Phiêu Lưu Vào Thế Giới Trong Tranh','https://img.ophim.live/uploads/movies/doraemon-nobita-va-cuoc-phieu-luu-vao-the-gioi-trong-tranh-thumb.jpg','Doraemon the Movie: Nobita\'s Art World Tales','completed','1','105 Phút','2025','HD',NULL,'寺本幸代','水田わさび, 大原めぐみ, かかずゆみ, 木村昴, 関智一, 和多田美咲, 種﨑敦美, 久野美咲, 鈴鹿央士, 藤本美貴','Phiêu Lưu, Gia Đình','Nhật Bản','Câu chuyện kể về hòn đá \"Arturia\" khoảng thời gian Châu Âu Thế Kỷ 13 | Công Quốc \"ARTURIA\". Tại đây đã xảy ra nhiều hiện tượng kỳ lạ từ thế giới trong tranh.',1,0,23,0),(218,'Quận Vương Và Ta Tâm Tương Chiếu','https://img.ophim.live/uploads/movies/nang-cong-chua-hu-hong-thumb.jpg','A Naughty Princess','completed','24','10 phút/tập','2025','HD',NULL,'','','Chính kịch, Cổ Trang','Trung Quốc','<p>Không biết về thân phận hoàng gia của mình, Lianxiang trở thành người hầu của Hoàng tử Bai Yihan, người đang bí mật tìm kiếm công chúa mất tích - chỉ để tình yêu, sự phản bội và mối quan hệ gia đình đan xen khi nguồn gốc thực sự của cô được tiết lộ.</p>',0,0,2,0),(219,'Võ Thần Chúa Tể','https://img.ophim.live/uploads/movies/vo-than-chua-te-thumb.jpg','Martial Master','trailer','1','7 phút/tập','2020','HD',NULL,'','唐泽宗 Zezong Tang, 陈帅, 吴凡 Fan Wu, 孙科','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc','Thiên Vũ đại lục nhất đại truyền kỳ Tần Trần, bởi vì bạn tốt phản bội bất ngờ ngã xuống Võ vực. 300 năm sau, hắn chuyển sinh thành một con riêng ở một vương phủ phải chịu đủ mọi ức hiếp lên người, lợi dụng trình độ kiếp trước, ngưng thần công, luyện thần đan, đi ngược lên trời, quật khởi mạnh mẽ, từ đây bước lên một đoạn khiếp sợ đại lục kinh thế lữ trình.\n\nĐẳng cấp tu vi: Nhân cấp – Địa cấp – Thiên cấp – Huyền cấp – Võ Tông – Võ Tôn – Võ Vương – Võ Hoàng – Võ Đế – Phàm Thánh – Thánh – Thiên Thánh – Thánh Chủ – Tôn Giả – Chí Tôn (Mỗi cấp phân làm bán bộ – sơ kỳ – sơ kỳ đỉnh phong – trung kỳ – trung kỳ đỉnh phong – hậu kỳ – hậu kỳ đỉnh phong) Thánh cấp có thể phá nát hư không, phi thăng thiên giới.',0,0,1,0),(220,'Angel Guts: Red Classroom','https://img.ophim.live/uploads/movies/angel-guts-red-classroom-thumb.jpg','Angel Guts: Red Classroom','completed','1','79 Phút','1979','HD',NULL,'','','Chính kịch, Phim 18+','Nhật Bản','When Muraki, a porn magazine editor, watches a blue film depicting a gang rape in a school, he becomes obsessed with the lead actress.  Quite by chance, whilst looking to reserve a location for a shoot, he happens to encounter her at a love hotel where she works as a receptionist.  Her name is Nami and she reluctantly agrees to speak with him, and confesses that it was her in the film. Then, Muraki tells Nami that he wants her to model for him.',0,0,8,0),(221,'Ba Đường Luân Hồi','https://img.ophim.live/uploads/movies/ba-duong-luan-hoi-thumb.jpg','San Xian Mi Hui','trailer','1','? phút/tập','2025','HD',NULL,'Ding Ying Zhou','孟子义, Wang Hongyi, Ma Sichao, 王乙, Guo Yun Qi, Ding Ran, Zhang Ningjiang','Viễn Tưởng, Khoa Học, Chính kịch, Bí ẩn','Trung Quốc','<p>Một biến dị bí ẩn tấn công tộc Thủy Yêu, khiến Dịch Tát và Tông Hàng dấn thân vào một hành trình nguy hiểm dưới nước. Khi khám phá những bí mật cổ xưa và đánh thức sức mạnh tiềm ẩn, họ thấy mình lạc vào một thế giới đầy rẫy hiểm nguy, tình yêu và luân hồi. Chuyển thể từ tiểu thuyết \"Tam Tuyến Luân Hồi\" của Ngụy Vũ.</p>',0,0,4,0),(222,'Ngôi Nhà Hạnh Phúc Việt Nam','https://img.ophim.live/uploads/movies/ngoi-nha-hanh-phuc-viet-nam-thumb.jpg','Full House (Vietnam)','completed','26','45 phút/tập','2009','HD',NULL,'','','Tình Cảm, Gia Đình','Việt Nam','<p>Minh Minh là một cô gái mồ côi, sống một mình trong căn nhà do ba mẹ cô để lại, thế nhưng hai người bạn là Bá Thông và Kiều Nhi của cô lại rắp tâm chiếm đoạt căn nhà. Trong thời điểm đó Minh Minh gặp được Vương Hoàng - chàng diễn viên điện ảnh nổi tiếng nhưng cũng lắm tai tiếng.</p>',0,0,9,0),(223,'GINTAMA - Thầy Ginpachi Ở Lớp 3-Z','https://img.ophim.live/uploads/movies/gintama-thay-ginpachi-o-lop-3-z-thumb.jpg','GINTAMA - Mr. Ginpachi\'s Zany Class','ongoing','1','24 phút/tập','2025','HD',NULL,'','','Hài Hước','Nhật Bản','Cốt truyện xoay quanh các học sinh lớp 3-Z và giáo viên chủ nhiệm lập dị Ginpachi-sensei.',0,0,16,0),(224,'Lan Hương Như Cố','https://img.ophim.live/uploads/movies/lan-huong-nhu-co-thumb.jpg','Against the Current','trailer','1','? phút/tập','2025','HD',NULL,'黄颖湘','谭松韵, 刘学义, 李梦, 郑合惠子, 郭柯宇, 吴甜甜, 叶青, 蒲萄, 宋芳园, 刘佳玺','Gia Đình, Chính kịch','Trung Quốc','<p>Sau khi gia đình bị xử tử oan vì tội phản quốc và hôn ước tan vỡ, nữ quý tộc Thẩm Gia Lan đã giả danh Từ Lan Hương, một người hầu trong gia tộc họ Lâm. Không khuất phục trước số phận, cô dùng sự kiên cường, đức hạnh và trí tuệ để vượt qua rào cản giai cấp, giành được tình yêu và sự tôn trọng - tự định hình vận mệnh của mình trong khi đối đầu với những thế lực từng tìm cách hủy hoại gia đình cô.</p>',0,0,14,0),(225,'The Witcher Season One Recap: From the Beginning','https://img.ophim.live/uploads/movies/the-witcher-season-one-recap-from-the-beginning-thumb.jpg','The Witcher Season One Recap: From the Beginning','completed','1','15ph','2021','HD',NULL,'','Henry Cavill, Anya Chalotra, Freya Allan','Hành Động, Phiêu Lưu, Chính kịch','Âu Mỹ','<p>Từ nguồn gốc ma thuật của Yennefer cho đến cuộc gặp đầu tiên của Geralt với Ciri, các sự kiện trên Lục Địa được điểm lại theo thời gian trong bản tóm tắt mùa 1 này.</p>',0,0,25,0),(226,'Biệt Thự Đèn Lồng','https://img.ophim.live/uploads/movies/biet-thu-den-long-thumb.jpg','Red Lantern Villa','completed','6','? phút/tập','2022','HD',NULL,'','Tiến Lộc, Lương Ngọc Hằng, Trâm Anh, Thuy Van Pham, Mạnh Cường, Hương Giang','Tâm Lý','Việt Nam','Biệt Thự Đèn Lồng dựa trên vụ án chấn động có thật về kẻ bắt cóc và nạn nhân mắc hội chứng Stockholm, phim xoay quanh gã dược sĩ lập dị giam giữ 4 cô gái làm nô lệ trong tầng hầm ngôi biệt thự treo đầy đèn lồng đỏ.',1,0,10,0),(227,'Lục Tiểu Phụng Truyền Kỳ','https://img.ophim.live/uploads/movies/luc-tieu-phung-truyen-ky-thumb.jpg','The Return Of Luk Siu Fung','completed','40','41 phút/tập','1986','HD',NULL,'鄧衍成','萬梓良, 陳秀珠, 黃韻材, Mitra King Toi-Yam, Yung Wai-Man, 歐陽震華, 白茵, 惠天賜, Amy Chan, 劉江','Tình Cảm, Cổ Trang','Trung Quốc, Hồng Kông','<p>Lục Tiểu Phong Trở Về là bộ phim truyền hình Hồng Kông năm 1986, chuyển thể từ tiểu thuyết Lục Tiểu Phong của Cổ Long. Phim được phát sóng lần đầu trên TVB tại Hồng Kông vào năm 1986.</p>',0,0,2,0),(228,'Yêu thần ký','https://img.ophim.live/uploads/movies/yeu-than-ky-thumb.jpg','Tales of Demons and Gods','trailer','1','8 phút/tập','2017','HD',NULL,'高峰','苏尚卿, 柳知萧, 张妮, 秦且歌, 柳川鱼','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc','<p>Kiếp trước, tuy yếu đuối đến mức không thể bảo vệ quê nhà khi cần thiết, nhưng với quyết tâm sắt đá, Nhiếp Ly đã trở thành Ma Linh Sư mạnh nhất và đứng trên đỉnh cao của võ lâm. Tuy nhiên, anh đã mất mạng trong trận chiến với Thánh Hoàng và sáu con thú cấp Thần. Linh hồn anh sau đó được đưa trở về năm anh 13 tuổi. Mặc dù là người yếu nhất trong lớp, có thiên phú thấp nhất, chỉ có một linh hồn cảnh giới màu đỏ, lại còn yếu nữa, nhưng với kiến ​​thức uyên bác tích lũy được từ kiếp trước, anh quyết định rèn luyện nhanh hơn bất kỳ ai có thể tưởng tượng. Anh cũng quyết định giúp đỡ những người đã hy sinh anh dũng trong kiếp trước cũng rèn luyện nhanh hơn. Anh đặt mục tiêu bảo vệ thành phố khỏi tương lai bị lũ quái thú tàn phá và số phận bị hủy diệt trước đây. Anh muốn bảo vệ người yêu, bạn bè, gia đình và những người dân đã chết trong cuộc tấn công của quái thú hoặc hậu quả của nó. Và anh muốn tiêu diệt cái gọi là gia tộc Thần Thánh, những kẻ đã ngạo mạn từ bỏ nhiệm vụ và phản bội thành phố trong kiếp trước.</p>',0,0,1,0),(229,'Đất Xanh Sinh Cú','https://img.ophim.live/uploads/movies/dat-xanh-sinh-cu-thumb.jpg','Love on the Turquoise Land','trailer','1','? phút/tập','2025','HD',NULL,'田里, 何坦','迪丽热巴, 陈星旭, 张俪, Zhang Yichi, Tian Xiaojie, Dun Chan, 蘇鑫, 顏卓靈, Songqing Liang, 潘美燁','Bí ẩn','Trung Quốc','<p>Phim kể về câu chuyện của một tổ chức bí mật sở hữu năng lực siêu nhiên mang tên \"Thợ Săn Nam Sơn\". Câu chuyện xoay quanh Nie Jiuluo và Yan Tuo, mối quan hệ ban đầu khá căng thẳng, nhưng sau nhiều lần hợp tác sinh tử, họ dần dần phát triển lòng tin và tình cảm dành cho nhau. Cùng nhau, họ đối đầu với tên phản diện Địch Hiểu, bảo vệ tình yêu và hòa bình, và cuối cùng trở thành bạn đời của nhau.</p>',0,0,7,0),(230,'Hàn Quốc: Xứ Sở Bánh Tteok','https://img.ophim.live/uploads/movies/han-quoc-xu-so-banh-tteok-thumb.jpg','A nation of tteok','ongoing','1','53 phút/tập','2025','HD',NULL,'','','Tài Liệu','Hàn Quốc','<p>Bánh Tteok là món ăn không thể thiếu trong mọi dịp lễ và mỗi mùa. Cùng khám phá cách món tráng miệng truyền thống làm từ gạo này đan xen vào cuộc sống, di sản và văn hóa Hàn Quốc.</p>',0,0,6,0),(231,'Toạ Độ','https://img.ophim.live/uploads/movies/toa-do-thumb.jpg','坐标','completed','4','5 phút/tập','2025','HD',NULL,'','','Chiến Tranh','Trung Quốc','<p>Bộ phim lịch sử AIGC đầu tiên của Trung Quốc, nơi cuộc chiến giữa bản đồ thật và bản đồ giả bộc lộ chiều sâu đức tin và tham vọng của con người.</p>',0,0,3,0),(232,'Hồ Yêu Tiểu Hồng Nương','https://img.ophim.live/uploads/movies/ho-yeu-tieu-hong-nuong-thumb.jpg','Fox Spirit Matchmaker','trailer','1','14 phút/tập','2015','HD',NULL,'王昕','杨天翔, 魏超, 喬詩語, 黎筱濛, 金弦, 刘校妤, Kai Zhang, 唐小喜, Jiang Bian, 閻萌萌','Hài Hước, Viễn Tưởng, Khoa Học','Trung Quốc','Khi Bái Nguyệt