ội Thủ Thư để khám phá những bí mật cổ xưa và bảo vệ thế giới khỏi những mối nguy ma thuật!</p>',0,0,20,0),(235,'Mặt Trời Đỏ','https://img.ophim.live/uploads/movies/mat-troi-do-thumb.jpg','Red Sun','completed','1','114 Phút','1971','HD',NULL,'Terence Young','Charles Bronson, Hiroshi Tanaka, Ursula Andress, Toshiro Mifune, Alain Delon','Kinh Điển','Pháp','Năm 1870, đại sứ Nhật Bản Sakaguchi và đoàn tùy tùng đi tàu hỏa đến Washington để giao một thanh kiếm quý giá cho Tổng thống Hoa Kỳ, một món quà từ Hoàng đế Nhật Bản. Trên cùng một chuyến tàu là hai tên cướp, Link và Gauche, sẵn sàng ra tay…',0,0,22,0),(236,'Cây Táo Nở Hoa','https://img.ophim.live/uploads/movies/cay-tao-no-hoa-thumb.jpg','The Apple Tree Blossom','completed','71','45 phút/tập','2021','HD',NULL,'','','Tình Cảm, Gia Đình','Việt Nam','Cây táo nở hoa bắt đầu khi người cha của 5 đứa con đã trưởng thành đột nhiên quay về và chết. Đám ma kì quặc hé lộ những mâu thuẫn, bất ổn, bi kịch của nhà họ Đỗ bao gồm 5 người con: Ngọc, Ngà, Châu, Báu, Dư. Ngọc - anh trai cả trong 1 gia đình nghèo bình dân, phải đối mặt với rất nhiều bi kịch. Ngọc sống với các em trai em gái, vợ và con gái trong một căn nhà chật hẹp kiêm xưởng sửa chữa xe máy nhỏ. Cuộc sống đã khó khăn nhưng mọi sự ngày càng trở nên khó chấp nhận khi những người em vô cùng lười biếng, vô trách nhiệm đã không giúp đỡ mà còn gây ra vô vàn rắc rối. Ngà mê cờ bạc, liên tục chạy trốn chủ nợ và liên tục gây tai họa cho gia đình.',0,0,9,0),(237,'Thần Tượng K-Pop - K-pop Idols','https://img.ophim.live/uploads/movies/than-tuong-k-pop-k-pop-idols-thumb.jpg','K-Pop Idols','completed','6','41 phút/tập','2024','HD',NULL,'','제시, FATOU, NVEE, GABI, SRIYA, 태영, Park Se-rim, 앨런, 우빈, 원진','Âm Nhạc','Âu Mỹ','Vẻ quyến rũ gặp tính bền bỉ trong tấm vé hậu trường tiếp cận các nghệ sĩ từ khắp thế giới. Thông qua những thử thách và chiến thắng, Jessi, CRAVITY, và BLACKSWAN cống hiến tất cả những gì họ có cho một loại hình nghệ thuật không đòi hỏi gì hơn ngoài sự hoàn hảo.',0,0,13