) [HD-Lồng Tiếng]',0,0,2,0),(270,'Thanh Tra Karen Pirie','https://img.ophim.live/uploads/movies/thanh-tra-karen-pirie-thumb.jpg','Karen Pirie','ongoing','1','59 phút/tập','2022','HD',NULL,'','Lauren Lyle, Chris Jenks, Zach Wyatt, Emer Kenny, Rakhee Thakrar, Steve John Shepherd, John Michie, Julia Brown, Saskia Ashdown, Mark Rowley','Hình Sự, Chính kịch','Anh','<p>Karen Pirie, một nữ thanh tra trẻ, thông minh, táo bạo, không ngại va chạm quyền lực, bắt tay điều tra lại vụ sát hại cô gái trẻ cách đây 25 năm, một vụ án mạng tưởng chừng đã chìm vào quên lãng. Cô không chỉ đối mặt với những bí mật bị che giấu, những lời nói dối chồng chất, mà còn phải chạy đua với thời gian, vì kẻ thủ ác năm xưa đang tìm mọi cách để bịt các đầu mối. Đây là bộ phim mang câu chuyện trinh thám đầy kịch tính, căng thẳng đến nghẹt thở, đậm chất Anh quốc – nơi mỗi manh mối đều có thể đổi hướng toàn bộ vụ án. Nếu bạn thích những dòng phim kiểu Broadchurch hoặc là Line of Duty, Karen Pirie chắc chắn là bộ phim mà bạn không thể bỏ qua.</p>',0,0,17,0),(271,'Nhục Bồ Đoàn 3','https://img.ophim.live/uploads/movies/yu-pui-tsuen-iii-thumb.jpg','Yu Pui Tsuen III','completed','1','1h 36m','1996','HD',NULL,'Kai Keung Lai','Christine Hung Hiu-Wan, Từ Cẩm Giang','Chính kịch, Phim 18+','Trung Quốc','<p>Đặc vụ nhà Minh Ling Ling Ling (000) được giao nhiệm vụ điều tra vụ ngộ độc ma túy liên quan đến loại thuốc tăng cường hiệu suất trong nhà thổ, Ying Chun Kwok. Ling suy nghĩ rất kỹ và cuối cùng nghĩ ra cách cải trang thành tác giả Yuk Po Tuen (Sex and Zen) để lẻn vào nhà chứa. Những cô gái điếm để ghi tên mình vào cuốn sách đều cám dỗ Ling, người để xoa dịu các quý cô đã biến cuốn sách thành một cuốn truyện tục tĩu. Một ngày nọ, người hầu mù Yuk Chu Nui (Jade Virgin) được thử vai, Ling biết được người mua sẽ nhận được thuốc nên đã tăng giá với hy vọng nhận được bằng chứng. Ai có thể mong đợi rằng người khác sẽ trả giá cao hơn?</p>',0,0,8,0),(272,'Mười Vạn Câu Chuyện Cười Nhạt (Phần 1)','https://img.ophim.live/uploads/movies/muoi-van-cau-chuyen-cuoi-nhat-phan-1-thumb.jpg','One Hundred Thousand Bad Jokes (Season 1)','completed','12','7 phút','2013','HD',NULL,'','','Hài Hước, Thần Thoại','Quốc Gia Khác','<p>Mười Vạn Câu Chuyện Cười Nhạt (Phần 1) vietsub | One Hundred Thousand Bad Jokes (Season 1) vietsub là một bộ phim hoạt hình chuyển thể từ tác phẩm truyện tranh hài hước cùng tên của tác giả Hàn Vũ. Phim được đánh giá là tác phẩm thổi luồng gió mới vào phong cách sáng tác của ngành truyện tranh, hoạt hình Trung Quốc. Các nhân vật quen thuộc như Lý Tịnh, Na Tra, Công chúa Bạch Tuyết, Pinocchio, Hồ Lô hay siêu nhân... được kể theo phong cách hoàn toàn mới lạ.</p>',0,0,20,0),(273,'Ác Mộng Của Thiên Nhiên','https://img.ophim.live/uploads/movies/ac-mong-cua-thien-nhien-thumb.jpg','Nightmares of Nature','completed','3','44 phút/tập','2025','HD',NULL,'','Maya Hawke','Tài Liệu','Âu Mỹ, Anh','Những câu chuyện sinh tồn rùng rợn được hé mở trong loạt phim tài liệu này, ghi lại sự kịch tính, hiểm nguy và vẻ đẹp u tối của thiên nhiên qua góc nhìn của những con mồi.',0,0,6,0),(274,'Đất Rừng Phương Nam','https://img.ophim.live/uploads/movies/dat-rung-phuong-nam-thumb.jpg','Song of the South','completed','1','100 Phút','2023','HD',NULL,'Nguyễn Quang Dũng','Trấn Thành, Công Ninh, Hồng Ánh, Mai Tài Phến, Tuấn Trần, Tuyền Mập, Hạo Khang, Bảo Ngọc, Huỳnh Đông','Chiến Tranh, Gia Đình, Chính kịch','Việt Nam','Đất Rừng Phương Nam phiên bản điện ảnh được kế thừa và phát triển từ tiểu thuyết cùng tên của nhà văn Đoàn Giỏi. Bộ phim kể về hành trình phiêu lưu của An - một cậu bé chẳng may mất mẹ trên đường đi tìm cha. Cùng với An, khán giả sẽ trải nghiệm sự trù phú của thiên nhiên và nét đẹp văn hoá đặc sắc của vùng đất Nam Kì Lục Tỉnh, sự hào hiệp của những người nông dân bám đất bám rừng và tinh thần yêu nước kháng Pháp đầu thế kỉ 20.',0,0,3,0),(275,'Quái Vật','https://img.ophim.live/uploads/movies/quai-vat-2025-thumb.jpg','Zombie Warfare','completed','20','12 phút/tập','2025','HD',N