g mình trái tim tan vỡ, đến Trại Haraya cùng hai người bạn Ellen và Tony. Tại đây, cô tình cờ gặp Ralph, người tổ chức sinh nhật và nhóm bạn của anh. Khi cảm xúc bùng cháy và đam mê bùng nổ, Nica phải khám phá xem liệu Ralph có thể giúp cô tìm lại tia lửa mà cô nghĩ mình đã đánh mất hay không.</p>',0,0,25,0),(279,'Tác Giả Của Những Bài Hit','https://img.ophim.live/uploads/movies/tac-gia-cua-nhung-bai-hit-thumb.jpg','Hitmakers','trailer','1','? phút/tập','2025','HD',NULL,'','John Legend, ลิซ่า, Shaboozey','Tài Liệu, Âm Nhạc','Âu Mỹ','<p>Óc sáng tạo và cái tôi xung đột trong series thực tế theo chân một nhóm nhạc sĩ tài năng khi họ sáng tác những bài hát đình đám cho những ca sĩ hàng đầu.</p>',0,0,13,0),(280,'Tôi Là DIệp Chi Mai','https://img.ophim.live/uploads/movies/toi-la-diep-chi-mai-thumb.jpg','Diep Chi Mai','ongoing','3','45phút/tập','2025','FHD',NULL,'','','Tình Cảm, Chính kịch','Việt Nam','<p>Diệp Chi Mai là hành trình cảm động và đầy thử thách của Mai, một cô gái tỉnh lẻ có ước mơ trở thành nhà văn nổi tiếng. Là một nhân viên biên tập bị coi thường trong nhà xuất bản, Mai chấp nhận làm người viết thuê cho Tuyết Vân, một nhà văn danh tiếng mất khả năng sáng tác vì bệnh tật. Ban đầu bị lợi dụng, Mai dần chứng minh được tài năng và bản lĩnh của mình qua từng trang viết. Nhưng khi tình yêu, danh vọng, và sự phản bội cùng lúc ập đến, Mai buộc phải lựa chọn giữa danh lợi và tình nghĩa.</p>',0,0,9,0),(281,'Về Nhà Đi Con','https://img.ophim.live/uploads/movies/ve-nha-di-con-thumb.jpg','Về Nhà Đi Con','completed','85','35 phút/tập','2019','HD',NULL,'Nguyễn Danh Dũng','Trung Anh, Thu Quỳnh, Bảo Thanh, Bảo Hân','Gia Đình','Việt Nam','Câu chuyện phim Về nhà đi con xoay quanh 3 chị em gái Thu Huệ, Anh Thư, Ánh Dương mồ côi mẹ từ thuở nhỏ, mỗi người một tính cách, một lối sống. Chị cả Thu Huệ dịu dàng, điềm đạm; cô hai Anh Thư xinh đẹp, sắc sảo, thực dụng; cô út Ánh Dương bộc trực, hoang dã, sống như một cậu con trai. Cả 3 chị em đều gặp phải những biến cố của riêng mình nhưng họ may mắn khi có chung một điểm tựa là ông Sơn - một người bố tận tuỵ, hết mực yêu thương các con. Sau nhiều biến cố, cuối cùng, 3 cô con gái đều nhận ra hạnh phúc lớn nhất mà họ có được chính là một người bố luôn sẵn sàng bao bọc và nói \"Về nhà đi con\" bất cứ khi nào họ cần một mái ấm...',0,0,14,0),(282,'Thị Trấn Rio Bravo','https://img.ophim.live/uploads/movies/thi-tran-rio-bravo-thumb.jpg','Rio Bravo','completed','1','141 Phút','1959','HD',NULL,'Howard Hawks','John Wayne, Dean Martin, Ricky Nelson, Angie Dickinson, Walter Brennan','Kinh Điển','Âu Mỹ','<p>Cảnh sát trưởng của một thị trấn nhỏ ở phía tây nam Texas phải giam giữ một kẻ giết người mà anh trai của hắn, một chủ trang trại quyền lực, đang cố gắng giúp hắn trốn thoát. Sau khi một người bạn bị giết khi cố tập hợp sự ủng hộ cho anh ta, anh ta và các cấp phó của mình phải tìm cách cầm cự trước những khẩu súng được thuê của người chủ trang trại cho đến khi cảnh sát trưởng đến. Trong khi đó, vấn đề trở nên phức tạp bởi sự hiện diện của một tay súng trẻ tuổi - và một người đẹp bí ẩn vừa đến trên chiếc xe ngựa cuối cùng.</p>',0,0,22,0),(283,'Ưu Tuyệt Thần Thám','https://img.ophim.live/uploads/movies/uu-tuyet-than-tham-thumb.jpg','The Enforcer\'s Experience','completed','20','45 phút/tập','1990','HD',NULL,'','鄧萃雯, 張兆輝, 林文龍, 邵仲衡, 鮑方, Angela Yeung, 吳國敬, 駱應鈞, 秦煌, 郭政鴻','Tâm Lý, Hình Sự','Trung Quốc, Hồng Kông','Ưu Tuyệt Thần Thám-The Enforcer\'s Experience (1990) [HD-Vietsub]',0,0,10,0),(284,'Debut','https://img.ophim.live/uploads/movies/debut-thumb.jpg','The Debut','completed','13','40 phút/tập','2021','HD',NULL,'Pun Homchuen, Ornusa Donsawai','พลอยไพลิน ตั้งประภาพร, ณัฐสิทธิ์ โกฏิมนัสวนิชย์, จิรายุ ละอองมณี, ดริสา การพจน์, รชานันท์ มหาวรรณ์, ชนนิกานต์ เนตรจุ้ย, Nachjaree Horvejkul, Nara Thepnupha, Nardear Montgod, Warawut Brown','Chính kịch, Bí ẩn','Thái Lan','<p>Cái chết của một thành viên Newtype dẫn đến hành trình tìm kiếm nguyên nhân cái chết của 6 thành viên Yok, Smile, Yui, Kirin, Minnie và Minor. Fame quyết định tham gia thử giọng cho nhóm nhạc thần tượng nổi tiếng \"Newtype\" để tìm ra sự thật về cái chết của em gái mình, Farn, một cựu thành viên của nhóm. Với sự giúp đỡ của Kla, cô phải thay đổi bản thân từ một cô gái nhạc rock để hòa nhập với Newtype. Cuộc điều tra của cô dẫn cô đến việc chứng kiến ​​nhiều thành viên trong nhóm đã vi phạm quy tắc của chính họ. Toàn bộ trải nghiệm này cũng tạo ra mâu thuẫn với bạn trai rocker Ble, người không thích việc họ đang trong một mối quan hệ bí mật. Fame sẽ làm gì? Và cô sẽ lựa chọn thế nào giữa mối quan hệ của mình và việc tìm ra sự thật?</p>',0,0,7,0),(285,'Điều 370','https://img.ophim.live/uploads/movies/dieu-370-thumb.jpg','Article 370','ongoing','1','160 Phút','2024','HD',NULL,'Aditya Suhas Jambhale','Yami Gautam, Priyamani, Skand Thakur, Vaibhav Tatwawadi, Raj Arjun, Arun Govil, Kiran Karmarkar, Raj Zutshi, Divya Seth Shah, Sumit Kaul','Hành Động, Chính kịch','Ấn Độ','Trước một quyết định hiến pháp quan trọng khiến Điều 370 của nhà nước Ấn Độ trở nên vô hiệu, đặc vụ Zooni Haksar được giao nhiệm vụ bí mật là dập tắt bạo lực ở một khu vực đang xảy ra xung đột.',0,0,1,0),(286,'Người Phán Xử','https://img.ophim.live/uploads/movies/nguoi-phan-xu-thumb.jpg','Người Phán Xử','completed','94','45 phút/tập','2017','HD',NULL,'Nguyễn Khải Anh, Nguyễn Danh Dũng','Hoàng Dũng, Việt Anh, Hồng Đăng, Trung Anh, Chu Hung, Doãn Quốc Đam, Thanh Quý, Huong Dung, Thanh Hương, Bảo Thanh','Hành Động, Hình Sự, Phiêu Lưu, Chính kịch','Việt Nam','Bô phim Người Phán Xử nói về hoạt động của thế giới xã hội đen với những câu chuyện bè phái, trừ khử và tranh giành quyền lực; bộ phim dài tập được hợp tác cùng điện ảnh nước ngoài. Phim có sự tham gia của các diễn viên NSND Hoàng Dũng, nghệ sỹ Thanh Quý, NSƯT Trung Anh, Việt Anh, Quốc Trọng, Hồng Đăng, Đan Lê...\n\nPhim khai thác đề tài về hoạt động tội phạm, băng nhóm có tổ chức thời kinh tế thị trường - sự kết hợp giữa bạo lực và kinh doanh, trùm giang hồ đội lốt doanh nhân, Người phán xử hy vọng sẽ mang lại \"luồng gió\" mới cho thể loại phim hình sự. Theo chia sẻ của đạo diễn Mai Hiền - đạo diễn phim Người phán xử: \"Người phán xử là một câu chuyện hư cấu nhưng ở mức vừa phải để khán giả vẫn cảm thấy hấp dẫn bởi câu chuyện phù hợp với xã hội Việt Nam, con người Việt Nam. Hy vọng diễn xuất của các diễn viên sẽ mang đến nhiều thú vị cho khán giả\".\n\nVới dàn diễn viên có nhiều kinh nghiệm diễn xuất, các nhân vật trong Người phán xử sẽ hiện lên đầy sinh động, đặc biệt là nhân vật nặng ký ông trùm do NSND Hoàng Dũng thể hiện - một nhân vật mưu mô, thâm độc, sống rất nguyên tắc. Đội lốt một doanh nghiệp, \"bố già\" Phan Quân (NSND Hoàng Dũng) đã gây dựng nên một tổ chức tội phạm hùng hậu. Xung quanh ông là những đệ tử thân tín, sẵn sàng ra tay để bảo vệ lợi ích của tập đoàn.',0,0,17,0),(287,'Bí Mật Chợ Tình','https://img.ophim.live/uploads/movies/secret-chronicle-she-beast-market-thumb.jpg','Secret Chronicle: She Beast Market','completed','1','83 Phút','1974','HD',NULL,'Noboru Tanaka','Meika Seri, Junko Miyashita, Genshū Hanayagi, Shiro Yumemura, Moeko Ezawa, Akira Takahashi, Hyōe Enoki, Ikunosuke Koizumi, Nagatoshi Sakamoto, Kenji Shimamura','Chính kịch, Phim 18+','Nhật Bản','<p>Roman Porno từ năm 1974, tập trung vào cuộc sống hàng ngày của những người thuộc tầng lớp thấp hơn trong khu ổ chuột ở Osaka.</p>',0,0,8,0),(288,'Thủy Chiến Đảo Hansan: Rồng Trỗi Dậy','https://img.ophim.live/uploads/movies/thuy-chien-dao-hansan-rong-troi-day-thumb.jpg','Hansan: Rising Dragon','completed','1','129 phút','2022','HD',NULL,'Kim Han min','Park Haeil, Byun YoHan, Ahn SungKi, Son HyunJoo, Kim SungKyu, Kim SungKyun, Kim HyangGi, Ok TaecYeon, Gong Myoung, Park JiHwan','Chiến Tranh, Thần Thoại','Hàn Quốc','<p>Là một sử thi chiến tranh lịch sử mô tả Trận chiến đảo Hansan ngoài khơi bờ biển phía nam Hàn Quốc vào tháng 7 năm 1592, nơi Đô đốc Yi Sun-sin đánh bại lực lượng lớn hơn của Nhật Bản thông qua các chiến thuật thông minh và việc sử dụng chiến hạm rùa đặc trưng của ông “Geobukseon” .Phim kể về trận đại chiến giữa Hàn Quốc và Nhật Bản tại Vịnh Hansan. Chỉ với 66 chiến thuyền, quân của Yi Sun Sin đã thành công trong việc đẩy lùi quân Nhật. Trên thực tế, quân của Yi Sun Sin không có thương vong, trong khi Nhật Bản phải mất 66 tàu chiến.Tướng Yi Sun Sin là một nhân vật anh hùng của Hàn Quốc trong Chiến tranh Imjin chống Nhật Bản. Tổng cộng, đã có ít nhất 23 cuộc hải chiến mà Yi Sun Sin đã phải đối mặt. Nhân vật Yi Sun Sin do Park Hae-il thủ vai.Bộ phim thủy chiến đảo hansan: rồng trỗi dậy này nối tiếp thành công của The Admiral: Roaring Current được rất nhiều người xem. Hansan: Rising Dragon đã thu về 6 triệu lượt xem kể từ khi công chiếu tại Hàn Quốc vào ngày 27/7. Đây là con số khá tuyệt vời khi chỉ trong 26 ngày phát sóng.</p>',0,0,20,0),(289,'Sao biển','https://img.ophim.live/uploads/movies/sao-bien-thumb.jpg','Starfish','completed','1','101 Phút','2019','HD',NULL,'A.T. White','Virginia Gardner, Christina Masterson, Eric Beecroft, Shannon Hollander, Elias Brett, Tanroh Ishida, Regina Saldivar, Andreas Wigand, Haruka Abe, Janis Ahern','Viễn Tưởng, Khoa Học, Kinh Dị, Chính kịch','Âu Mỹ','<p>Nhân loại sắp đi đến hồi kết vì một tín hiệu bí ẩn; bị mắc kẹt tại nhà của một người bạn đã chết, Aubrey cố gắng thay đổi mọi thứ sau khi tìm thấy một cuộn băng cassette bí ẩn.</p>',3,0,4,0),(290,'Next Gen Chef','https://img.ophim.live/uploads/movies/next-gen-chef-thumb.jpg','Next Gen Chef','completed','8','53 phút/tập','2025','HD',NULL,'','Olivia Culpo, Carlton McCoy, Kelsey Barnard Clark','Tài Liệu','Âu Mỹ','<p>Chương trình đưa 21 thí sinh vào một cuộc thi khắc nghiệt tại Học viện Ẩm thực Hoa Kỳ. Vòng đầu tiên, họ phải vượt qua thử thách làm một bữa 7 món để giành quyền bước vào ký túc xá của CIA, những ai thất bại sẽ bị loại ngay. Sau đó, 12 thí sinh xuất sắc nhất sẽ tiếp tục bước vào các vòng thử thách như: nấu món ăn gia đình, tận dụng nguyên</p>',0,0,6,0),(291,'Battle for the Western Front','https://img.ophim.live/uploads/movies/battle-for-the-western-front-thumb.jpg','Battle for the Western Front','completed','1','90 Phút','2022','HD',NULL,'Aaron Huggett','Michael Lake, Christopher Cordell, Sylvain Plasse, Corey Chainey, Sam Biskey, Julian Seguin, Adam Daniel Mezel, Kyle Naylor','Chiến Tranh','Canada','Inspired by Canuck WWI flying ace Billy Bishop, two young soldiers crash the front lines in August 1918. With the Allies detained, their platoon must desperately hold out alongside legendary Anishinaabe sniper Francis \"Peggy\" Pegahmagabow.',0,0,3,0),(292,'Đừng động vào băng đảng của tôi!!','https://img.ophim.live/uploads/movies/dung-dong-vao-bang-dang-cua-toi-thumb.jpg','Don\'t Touch My Gang','completed','22','25 phút/tập','2023','HD',NULL,'Kritsada Kaniwichaphon','ปุริม รัตนเรืองวัฒนา, ภัณฑิรา พิพิธยากร, หฤษฎ์ ชีวการุณ, Thanawat Shinawatra, Ratchapon Pootong, Panupan Jantanawong, ปาณิสรา ริกุลสุรกาน, กิตติศักดิ์ ปฐมบูรณา, เฉลิมพล ทิฆัมพรธีรวงศ์, สุชาดา สอนพันธ์','Hài Hước','Thái Lan','<p>Four youths who dream of studying in the capital end up in a vocational school as they spelled their school\'s name wrong on the application. At the school, however, a girl they meet dramatically changes their lives.</p>',0,0,16,0),(293,'Phá Kén Hoá Bướm','https://img.ophim.live/uploads/movies/pha-ken-hoa-buom-thumb.jpg','Long Planned Love','ongoing','16','14 phút/tập','2025','HD',NULL,'Zhou Xiao','明加加, Sun Zihang, 王曉詩, Ning Xianzhou, 李冰冰','Chính kịch','Trung Quốc','<p>Tiểu thư kiêu ngạo Giản Tranh, sau khi bị vị hôn phu phản bội, trong cơn giận dữ đã hủy hôn và kết hôn chớp nhoáng với Châu Đình Yến – chú của vị hôn phu. Giữa những mối quan hệ gia tộc phức tạp và những cuộc đấu trí thương trường, cuộc hôn nhân khởi đầu từ \"ơn cứu mạng\" này dần biến thành sự cứu rỗi và tình yêu chân thành. Dưới sự che chở của Châu Đình Yến, Giản Tranh từng bước hé mở bí mật vụ bắt cóc thời trung học, đồng thời trưởng thành từ một “vầng trăng điên dại” kiêu kỳ, bướng bỉnh thành một “nữ hoàng” độc lập và sáng suốt. Còn Châu Đình Yến, sự yêu chiều dưới danh nghĩa báo ơn của anh thực ra là tình cảm thầm kín nhiều năm cuối cùng cũng được toại nguyện. Hành trình từ hôn nhân hợp đồng đến tình yêu thật sự, hướng về phía nhau đầy kiên định của cả hai trái tim.</p><p>&nbsp;</p>',0,0,24,0),(294,'Boys II Planet','https://img.ophim.live/uploads/movies/boys-ii-planet-thumb.jpg','Boys II Planet','ongoing','13','152 phút/tập','2025','HD',NULL,'','Han Harry-June, Yang Hee-chan, Jayder, Jeon Lee-jeong, Wonjun, Jo Gye-hyun, Lee Dong-heon, Yoo Kang-min, Kim Jun-seo, Thanathorn Rueangsuwan','Âm Nhạc','Hàn Quốc','<p>Nơi năng lượng tuyệt vời của 154 chàng trai hội tụ cùng sự vận hành song song của Planet K (Hàn Quốc) và Planet C (Trung Quốc), Boys II Planet sẽ kiến tạo nên một nhóm nhạc thần tượng toàn cầu thế hệ mới. Đặng Hồng Hải - thực tập sinh đến từ Việt Nam mang đến một visual bừng sáng và đầy sự quyết tâm, liệu cậu có giành được cơ hội debut?</p><p>&nbsp;</p>',0,0,13,0),(295,'Khử Nghiệp','https://img.ophim.live/uploads/movies/khu-nghiep-thumb.jpg','Tailgate','completed','1','85 Phút','2019','HD',NULL,'Lodewijk Crijns','Jeroen Spitzenberger, Anniek Pheifer, Willem de Wolf, Roosmarijn van der Hoek, Liz Vergeer, Tim Linde, Hubert Fermin, Truus te Selle, Peter Blankenstein','Kinh Dị','Hà Lan, Bỉ','<p>Một người đàn ông tự phụ, hung hăng trên đường thấy mình bị truy đuổi và khủng bố bởi một tài xế xe tải đầy thù hận mà anh ta chọn để bám đuôi.</p>',1,0,25,0),(296,'Transit Love (Phần 4)','https://img.ophim.live/uploads/movies/transit-love-phan-4-thumb.jpg','EXchange (Season 4)','ongoing','2','114 phút/tập','2025','HD',NULL,'','','Tình Cảm','Hàn Quốc','<p>Các cặp đôi từng chia tay vì nhiều lý do khác nhau tụ họp lại để cùng nhìn lại tình yêu trong quá khứ và tìm kiếm tình yêu mới.</p>',0,0,9,0),(297,'Jason và bộ lông cừu vàng','https://img.ophim.live/uploads/movies/jason-va-bo-long-cuu-vang-thumb.jpg','Jason and the Argonauts','completed','1','1g 43phút','1963','HD',NULL,'Don Chaffey','Todd Armstrong,  Nancy Kovack,  