hát hiện ra rằng người bạn thân nhất thời thơ ấu của mình giờ đã là một nữ sinh trung học! Liệu sự thay đổi bất ngờ này có thay đổi mối quan hệ của họ mãi mãi?</p>',0,0,9,0),(310,'Girls Planet 999','https://img.ophim.live/uploads/movies/girls-planet-999-thumb.jpg','Girls Planet 999','completed','11','150 phút/tập','2021','HD',NULL,'','','Âm Nhạc','Hàn Quốc','<p>Để hiện thực hóa giấc mơ trở thành siêu thần tượng, các cô gái đến từ Trung Quốc, Hàn Quốc và Nhật Bản đã tụ họp tại [Hành tinh của các cô gái]. Một thế giới ảo nơi các cô gái đoàn kết bất kể xuất thân. Người hâm mộ trên toàn thế giới cũng được kết nối với thế giới này để chứng kiến sự ra đời của một thế hệ nhóm nhạc nữ quốc tế mới. Ai trong số họ sẽ ra mắt toàn cầu?</p>',0,0,13,0),(311,'Chuyến Xe Định Mệnh','https://img.ophim.live/uploads/movies/chuyen-xe-dinh-menh-thumb.jpg','Beyond Trust','completed','20','45 phút/tập','1991','HD',NULL,'','林文龍, 戴志偉, 鄭伊健, 歐陽震華, 胡楓, 鄭君熾, Ching-Ching Yiu, 王偉','Hình Sự, Tâm Lý','Trung Quốc, Hồng Kông','Chuyến Xe Định Mệnh-Beyond Trust (1991) [HD-Lồng Tiếng]',0,0,10,0),(312,'Bóng ma','https://img.ophim.live/uploads/movies/bong-ma-thumb.jpg','Ghost','completed','1','2g 7phút','1990','HD',NULL,'Jerry Zucker','Patrick Swayze,  Demi Moore,  Whoopi Goldberg,  Tony Goldwyn,  Susan Breslau,  Martina Degnan,  Rick Aviles,  Vincent Schiavelli,  Angelina Estrada,  Phil Leeds,  Gail Boggs,  Armelia McQueen,  Alma Beltran','Chính kịch, Kinh Điển','Âu Mỹ','<p>Sau khi một nhân viên ngân hàng bị bắn chết, hồn ma của anh ở lại trần gian và nhờ một nhà ngoại cảm giúp cảnh báo người phụ nữ anh yêu rằng cô ấy đang gặp nguy hiểm.</p>',0,0,22,0),(313,'Thước Vải Se Duyên','https://img.ophim.live/uploads/movies/thuoc-vai-se-duyen-thumb.jpg','The Kinnaree Conspiracy','trailer','1','110 phút/tập','2022','HD',NULL,'Pongpat Wachirabunjong','ณเดชน์ คูกิมิยะ, อุรัสยา เสปอร์บันด์, Diana Flipo, Jirayu Thantrakul, David Asavanond, พุทธชาด พงศ์สุชาติ, Natha Lloyd, Daraneenute Pasutanavin, Bongkot Kongmalai, Prissana Klampinij','Bí ẩn','Thái Lan','<p>Thời kỳ vua Narai thịnh vượng, người Tây nhập cư cùng những hoạt động thương mại sôi nổi. Thế nhưng, cái chết bí ẩn của một thuyền trưởng người Pháp đã đe dọa an nguy vương quốc khi Pháp có thể mượn cớ phát động xâm lược Ayutthaya. Lúc này, ba người, ba thân phận cùng tham gia điều tra vụ án, mở ra cuộc tình tay ba ngang trái.<br>&nbsp;</p>',0,0,7,0),(314,'Quỷ Dữ Ẩn Mình','https://img.ophim.live/uploads/movies/quy-du-an-minh-thumb.jpg','All the Devils Are Here','completed','1','87 Phút','2025','HD',NULL,'Barnaby Roper','Eddie Marsan, Sam Claflin, Burn Gorman, Suki Waterhouse, Tienne Simon, Rory Kinnear, Benjamin Dilloway','Hình Sự, Chính kịch','Âu Mỹ','<p>Sau một vụ cướp táo bạo, bốn tên tội phạm rút về một căn nhà an toàn nằm biệt lập, chờ đợi chỉ thị tiếp theo. Tuy nhiên, khi sự nghi ngờ và căng thẳng ngày càng gia tăng, họ dần nhận ra rằng mối nguy hiểm thật sự không phải ở bên ngoài — mà có thể đang ẩn mình ngay trong chính nhóm của họ.</p>',0,0,17,0),(315,'Velluto nero','https://img.ophim.live/uploads/movies/velluto-nero-thumb.jpg','Black Emanuelle, White Emanuelle','completed','1','94 Phút','1976','HD',NULL,'Brunello Rondi','Laura Gemser, Annie Belle, Al Cliver, Gabriele Tinti, Ziggy Zanger, Nieves Navarro, Feodor Chaliapin Jr.','Chính kịch, Phim 18+','Ý','<p>Trong thiên đường sa mạc của niềm vui và nỗi đau, một người mẫu thời trang quyến rũ và một người đẹp có tinh thần tự do đầu hàng để hoàn thành trạng thái xuất thần tình dục. Nhưng liệu một người đàn ông thánh thiện không có bản lĩnh giờ đây có dẫn dắt những người yêu mới này - cũng như bạn bè và thậm chí cả thành viên gia đình của họ - vào những hành vi vô đạo đức gây sốc nhất có thể tưởng tượng được không?</p>',0,0,8,0),(316,'Những sự kiện lớn nhất Thế chiến II (bản màu)','https://img.ophim.live/uploads/movies/nhung-su-kien-lon-nhat-the-chien-ii-ban-mau-thumb.jpg','Greatest Events of WWII in Colour','completed','10','50phút/tập','2019','HD',NULL,'','','Thần Thoại, Tài Liệu, Gia Đình, Bí ẩn','Nhật Bản, Anh, Pháp, Canada, Nga, Mexico, Brazil, Ý, Ireland','<p>Từ cuộc tấn công Trân Châu Cảng đến ngày D, những sự kiện then chốt của Thế chiến II sẽ được tái hiện sinh động trong loạt phim tài liệu với những thước phim màu này.</p>',0,0,20,0),(317,'Eugene Levy, Vị Lữ Khách Miễn Cưỡng (Phần 3)','https://img.ophim.live/uploads/movies/eugene-levy-vi-lu-khach-mien-cuong-phan-3-thumb.jpg','The Reluctant Traveler with Eugene Levy (Season 3)','ongoing','2','32 phút/tập','2025','HD',NULL,'','Eugene Levy','Tài Liệu','Anh','Diễn viên đạt nhiều giải thưởng và nhà thám hiểm yếu tim Eugene Levy bước ra khỏi vùng an toàn của mình và dấn thân vào chuyến du hành kỳ thú đến những điểm du lịch xinh đẹp và hấp dẫn nhất thế giới.',0,0,6,0),(318,'Chiến Dịch Blitz','https://img.ophim.live/uploads/movies/chien-dich-blitz-thumb.jpg','Blitz','completed','1','120 Phút','2024','HD',NULL,'Steve McQueen','Elliott Heffernan, Saoirse Ronan, Benjamin Clémentine, Paul Weller, Stephen Graham, Harris Dickinson, Kathy Burke, Leigh Gill, Mica Ricketts, CJ Beckford','Chiến Tranh, Chính kịch','Âu Mỹ, Anh','Ở London trong Thế Chiến II, cậu bé chín tuổi George được mẹ, Rita, đưa đi sơ tán về vùng nông thôn để tránh các vụ đánh bom. Bất khuất và quyết tâm về với gia đình, George bước vào một hành trình gian truân để trở về nhà trong lúc Rita đi tìm cậu.',0,0,3,0),(319,'Công Chúa Da Đỏ 2: Hành Trình Đến Thế Giới Mới','https://img.ophim.live/uploads/movies/cong-chua-da-do-2-hanh-trinh-den-the-gioi-moi-thumb.jpg','Pocahontas II: Journey to a New World','completed','1','72 Phút','1998','HD',NULL,'','','Gia Đình, Tình Cảm','Âu Mỹ','Tiếp theo nội dung của phần 1, thuyền trưởng John Smith trở về nước Anh và gặp nạn. Trong lúc đó, ở Miền Đất Mới, Pocahontas gặp một chàng trai khác là John Rolfe. Khi tin tức về cái chết của John Smith đến được nước Mĩ, Pocahontas đã rất đau buồn, và quyết định lên đường tới Anh trong một sứ mệnh ngoại giao: đặt nền tảng cho hoà bình và hữu nghị giữa