 có những giây phút vui vẻ khi đọc truyện Tiên Nghịch!</p>',7,0,23,0),(323,'Thợ Săn Quái Vật (Phần 4)','https://img.ophim.live/uploads/movies/tho-san-quai-vat-phan-4-thumb.jpg','The Witcher (Season 4)','trailer','1','66 phút/tập','2025','HD',NULL,'','Liam Hemsworth, Anya Chalotra, Freya Allan','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Âu Mỹ, Ba lan','The Witcher được chuyển thể từ bộ tiểu thuyết nổi tiếng của nhà văn Ba Lan Andrzej Sapkowski, cũng như loạt game ăn khách cùng tên. Bối cảnh của The Witcher đặt tại một vùng đất hư cấu có tên Đại Lục (The Continent), tràn ngập những loài quái vật nguy hiểm. Một nhóm những chiến binh sở hữu siêu năng lực được tạo ra, được gọi là Witcher để săn lùng và tiêu diệt chúng.',0,0,1,0),(324,'Thời Khắc Thanh Trừng','https://img.ophim.live/uploads/movies/thoi-khac-thanh-trung-thumb.jpg','The Cleansing Hour','completed','1','91 Phút','2019','HD',NULL,'Damien LeVeck','Kyle Gallner, Ryan Guzman, Alix Angelis, Chris Lew Kum Hoi, Emma Holzer, Daniel Hoffmann-Gill, Joanna David, Tara Karsian, Giulia Nahmany, Amrou Al-Kadhi','Kinh Dị','Âu Mỹ','<p>Hai doanh nhân thế hệ thiên niên kỷ dàn dựng những buổi trừ tà giả phức tạp trên mạng xã hội cho đến khi một trong những người bạn gái của họ bị quỷ ám.</p>',0,0,25,0),(325,'Vinh quang','https://img.ophim.live/uploads/movies/vinh-quang-thumb.jpg','Glory','completed','1','2g 2phút','1989','HD',NULL,'Edward Zwick','Matthew Broderick,  Denzel Washington,  Morgan Freeman,  Cary Elwes,  Jihmi Kennedy,  Andre Braugher,  John Finn,  Donovan Leitch Jr.,  JD Cullum,  Alan North','Chính kịch, Kinh Điển','Âu Mỹ','<p>Bộ phim đầy xúc động kể về những người Mỹ gốc Phi đầu tiên tham gia cuộc Nội chiến Hoa Kỳ và cho thấy họ đã xoay chuyển cuộc chiến như thế nào.</p>',0,0,22,0),(326,'Cô Tinh Kiếm Khách','https://img.ophim.live/uploads/movies/co-tinh-kiem-khach-thumb.jpg','The Lone Star Swordsman','completed','15','45 phút/tập','1994','HD',NULL,'','鄭伊健, 梁小冰, Elaine Ho Yuen-Ying, 魏駿傑, Amy Wu Mei-Yee, 陳嘉輝, 吳詠紅','Tình Cảm, Tâm Lý, Hình Sự','Hồng Kông','<p>Một con rối nhỏ nắm giữ bí mật hoàng gia đã gây ra một làn sóng đổ máu trong triều đại nhà Thanh. Được hoàng tử giao nhiệm vụ bảo vệ con rối, kiếm sĩ đơn độc Tuen Long (Ekin Cheng) thấy mình phải chống lại các điệp viên và sát thủ bao gồm cả Chin Sik (Noel Leung). Thất bại của Chin Sik trong việc hoàn thành nhiệm vụ đã dẫn đến cái chết của cả gia đình cô. Từ ngày đó, Chin Sik không ngừng truy đuổi Tuen Long để trả thù, nhưng khi họ dành nhiều thời gian bên nhau hơn, cô cuối cùng lại phải lòng người đàn ông mà cô định giết. Bị giằng xé giữa tình yêu kiên định của Chin Sik nóng bỏng và Chi Lan dịu dàng (Ho Yuen Ying), Tuen Long không biết trái tim và ngôi nhà trôi dạt của mình nằm ở đâu. Những vấn đề của trái tim mang đến những hậu quả sống còn khi âm mưu nguy hiểm đằng sau con rối dần lộ diện.</p>',0,0,10,0),(327,'Cùng Nhau Trưởng Thành (Phần 2)','https://img.ophim.live/uploads/movies/cung-nhau-truong-thanh-phan-2-thumb.jpg','Growing Together (Season 2)','completed','32','? phút/tập','2025','HD',NULL,'李少飞','张嘉益, Chen Hao, 王晓晨, 赵达, 曲凌子, Liu Ruilin, Chuanying Li, 孙思程, Ran Wei, 石杭鹭','Gia Đình','Trung Quốc','<p>Vào năm 2024, ba gia đình sôi nổi phải đối mặt với những thử thách hàng ngày, học cách cân bằng giữa công việc, gia đình và sự phát triển khi con cái họ trưởng thành và mối quan hệ ngày càng bền chặt.</p>',0,0,14,0),(328,'Out of Order','https://img.ophim.live/uploads/movies/out-of-order-2025-thumb.jpg','Out of Order','completed','1','105 Phút','2025','HD',NULL,'Alden Richards','Alden Richards, Heaven Peralejo, Nonie Buencamino, Joyce Ching, Nicco Manalo, Yayo Aguila, Soliman Cruz, Francine Garcia, Andrea Del Rosario','Hình Sự, Chính kịch, Bí ẩn','Philippines','<p>Một luật sư túng quẫn có cơ hội đổi đời khi người cha xa cách nhờ anh hỗ trợ pháp lý sau khi bị đưa ra tòa vì tội giết người mà ông không hề nhớ đã gây ra.</p><p>&nbsp;</p>',0,0,7,0),(329,'Kẻ Đi Săn','https://img.ophim.live/uploads/movies/the-chaser