ức ảnh bí ẩn do mối tình đầu Ji Seo-jun để lại. Từ năm tám tuổi, họ đã là bạn thân, nhưng anh đã tự tử vào đúng ngày sinh nhật của cô mười năm trước.</p>',0,0,7,0),(343,'Hành Trình Thủ Tiêu Anh','https://img.ophim.live/uploads/movies/hanh-trinh-thu-tieu-anh-thumb.jpg','The Journey to Killing You','ongoing','3','25 phút/tập','2025','HD',NULL,'上條大輔','和田雅成, 髙橋大翔, 遊屋 慎太郎, 堀海登, 寺中敬輔, 中林登生, 工藤俊作, 小沢真珠','Hành Động, Hình Sự, Phiêu Lưu, Chính kịch','Nhật Bản','<p>Kataoka là một thành viên trung thành của yakuza trẻ, đang chịu lệnh “ẩn mình” do xung đột trong băng đảng. Kiriei, con trai của ông trùm, giao nhiệm vụ cho Odajima – một thành viên trong bang – được phân công theo sát và bảo vệ Kataoka. Tuy nhiên, dưới vẻ ngoài chăm sóc, Odajima thực chất mang trong mình mệnh lệnh bí mật: giết Kataoka.<br>Trên hành trình “ẩn mình” này, giữa hai người phát sinh những cảm xúc phức tạp — tình yêu, hận thù, sự phản bội — tất cả hòa quyện trong mối quan hệ nguy hiểm. Liệu cuối cùng họ sẽ chọn cái chết hay chọn tình yêu? &nbsp;￼</p>',1,0,17,0),(344,'Cùng Nhau Trưởng Thành (Phần 1)','https://img.ophim.live/uploads/movies/cung-nhau-truong-thanh-phan-1-thumb.jpg','Growing Together (Season 1)','completed','40','? phút/tập','2024','HD',NULL,'李少飞','张嘉益, Chen Hao, 王晓晨, 赵达, 曲凌子, Liu Ruilin, Chuanying Li, 孙思程, Ran Wei, 石杭鹭','Gia Đình','Trung Quốc','<p>Biên kịch Lưu Tường Thượng có lịch trình làm việc khá thoải mái. Anh đảm nhiệm việc học hành và chăm sóc con trai Quốc Ninh và con gái Quốc Bảo ở nhà, trong khi vợ anh, Đới Tĩnh, chọn làm việc tại một công ty nước ngoài với mức lương cao hơn.</p>',0,0,14,0),(345,'Mạt Đại Ngự Y','https://img.ophim.live/uploads/movies/mat-dai-ngu-y-thumb.jpg','The Last Healer in Forbidden City','completed','20','45 phút/tập','2016','HD',NULL,'','郭晉安, 楊茜堯, 羅蘭, 敖嘉年, 張穎康, 林子善, 朱晨麗, Regen Cheung, Woo Wai-Hong, 林秀怡','Cổ Trang, Tâm Lý, Tình Cảm','Trung Quốc, Hồng Kông','During the late reign of the Qing dynasty skilled physician To Chung is named the new Imperial Palace Physician when he successfully heals Empress Dowager Chee Hei from her illness. To Chung eventually grows close to the Gwong-seoi Emperor who is under house arrest at the Forbidden City and stripped of his powers after angering Dowager Chee Hei due to losing the First Sino-Japanese War and rebelling against her authority. To Chung also heals Gwong-seoi Emperor from his illness and helps the young emperor with his relationship with Consort Tsan. However how great he is as a physician to the imperial family, To Chung cannot heal his crippled wife Hung Bak-hap. Desperate to heal his wife he seeks out the services of bone-setter Fuk Ling. Fuk Ling\'s treatments help Bak-hap relieve some of her pain. Impress by Fuk Ling, To Chung refers her to the Forbidden City where she becomes Empress Dowager Chee-hei personal bone-setter. To Chung and Fuk Ling\'s friendship eventually turns romantic but his loyalty to his wife Bak-hap prevents him from further pursuing his romance interest in Fuk Ling. Fuk Ling, however, has ulterior motives for getting close to the imperial family as she has been tasked to kill the Gwong-seoi Emperor.',0,0,2,0),(346,'Người Mẹ Rất Thích Nhiệt Tình','https://img.ophim.live/uploads/movies/nguoi-me-rat-thich-nhiet-tinh-thumb.jpg','친구에 봇물터진 엄마','completed','1','60 phút','2023','HD',NULL,'Lee Ro-Won','Leesu, Woo Yeolhun, Hyeonmo, Kang Sun','Phim 18+','Hàn Quốc','<p>Các mẹ đơn thân thường chăm con từ bé đến lớn nhưng những điều người mẹ muốn là thứ rất ít ai biết được....</p>',0,0,8,0),(347,'Ảnh hưởng xấu: Mặt tối của Kidfluencing','https://img.ophim.live/uploads/movies/anh-huong-xau-mat-toi-cua-kidfluencing-thumb.jpg','Bad Influence: The Dark Side of Kidfluencing','completed','3','53 phút/tập','2025','HD',NULL,'Jenna Rosher, Kief Davidson','Claire RockSmith, Corinne Joy, Sophie Fergi, Sawyer Sharbino, Brandon Stewart, Taylor Lorenz, Ashley RockSmith, Karen North, Patience Rocksmith, Steevy Areeco','Tài Liệu','Âu Mỹ','Trong phim tài liệu vạch trần sự thật này