n ra rằng nơi đây không hề bình yên như vẻ ngoài khi các vụ án mạng bí ẩn liên tục xảy ra. Anh buộc phải vận dụng tất cả kỹ năng thám tử của mình để điều tra và giải quyết những vụ giết người liên tiếp “trôi dạt vào bờ\" của thị trấn này.</p>',0,0,24,0),(351,'Thành Phố Xa Xôi','https://img.ophim.live/uploads/movies/thanh-pho-xa-xoi-thumb.jpg','Far Away','ongoing','2','140 phút/tập','2024','HD',NULL,'','','Tình Cảm','Thổ Nhĩ Kỳ','<p>Một người phụ nữ và con trai mang theo thi thể của người chồng quá cố đến quê hương, quyết tâm chôn cất ông tử tế. Nhưng gia đình quyền lực của ông đã sớm mắc kẹt cô trong một mạng lưới bí mật và kiểm soát, khiến cô không thể trốn thoát.</p>',0,0,9,0),(352,'Ban Nhạc Rock Nhí (Phần 3)','https://img.ophim.live/uploads/movies/ban-nhac-rock-nhi-phan-3-thumb.jpg','Mini Beat Power Rockers (Season 3)','completed','55','10 phút/tập','2020','HD',NULL,'','','Phiêu Lưu, Âm Nhạc','Âu Mỹ, Mexico','<p>Ban Nhạc Rock Nhí (Phần 3)</p>',0,0,13,0),(353,'Khám Phá Cõi Âm','https://img.ophim.live/uploads/movies/kham-pha-coi-am-thumb.jpg','Unveil The Mystery','completed','10','25 phút/tập','2001','HD',NULL,'','羅蘭, Maria Chen','Tâm Lý','Trung Quốc, Hồng Kông','Khám Phá Cõi Âm-Unveil The Mystery (2001) [HD-Lồng Tiếng]',0,0,10,0),(354,'Thiết Huyết Kim Thuẫn','https://img.ophim.live/uploads/movies/thiet-huyet-kim-thuan-thumb.jpg','Operation Golden Shield','completed','1','84 Phút','2025','HD',NULL,'袁广安','罗立群, 溫茉言, Lin Jinglai, 元武, 路一萍','Hành Động, Hình Sự','Trung Quốc','<p>Phim kể về cảnh sát Lô Bành nhận nhiệm vụ từ cấp trên, trải qua hiểm nguy sinh tử, lần lượt hoạt động nằm vùng trong đường dây ma túy của tên buôn nội địa Chư Lạt Vọng và tên buôn ngoại quốc Nạp Oa. Cùng đồng đội phối hợp trong ngoài, triệt phá hai tập đoàn ma túy đóng lâu năm gần biên giới, làm nổi bật tinh thần hy sinh quên mình và dũng cảm của đội viên phòng chống ma túy công an.</p>',0,0,17,0),(355,'Mộc Quế Anh','https://img.ophim.live/uploads/movies/moc-que-anh-thumb.jpg','The Heroine of the