rn to Istanbul.',0,0,3,0),(362,'Truyền Thuyết Thanh Khâu Hồ','https://img.ophim.live/uploads/movies/truyen-thuyet-thanh-khau-ho-thumb.jpg','The Legend of Nine Tales Fox','completed','40','45 phút','2016','HD',NULL,'Lâm Ngọc Phân','Cổ Lực Na Trát, Tưởng Kính Phu, Mike D. Angelo, Trần Dao, Trương Nhược Quân, Kim Thần, Trương Tuyết Nghênh, Đường Nghệ Hân, Vương Khải, Trần Nhược Hiên, Phó Tân Bác, Kiều Hân, Diêu Dịch Thần','Tình Cảm, Cổ Trang, Tâm Lý, Thần Thoại','Trung Quốc','<p>Dựa trên nguyên tác “Liêu trai chí dị” của Bồ Tùng Linh, Truyền Thuyết Thanh Khâu Hồ gồm 6 câu chuyện khác nhau: Phong Tam Nương, A Tú, Anh Trữ, Hồ Tứ Tướng Công, Trường Đình, Hằng Nương. Mang tính ly kỳ mà đầy cảm động.Bộ phim đưa người xem đến một thế giới không tưởng, ở đó hồ tiên như loài người, nhiều câu chuyện tưởng tượng có tình có lý.</p>',0,0,20,0),(363,'Ban Nhạc Rock Nhí (Phần 2)','https://img.ophim.live/uploads/movies/ban-nhac-rock-nhi-phan-2-thumb.jpg','Mini Beat Power Rockers (Season 2)','completed','51','10 phút/tập','2019','HD',NULL,'','','Phiêu Lưu, Âm Nhạc','Âu Mỹ, Mexico','<p>Ban Nhạc Rock Nhí (Phần 2)</p>',0,0,13,0),(364,'Hành Động Liêm Chính 2000','https://img.ophim.live/uploads/movies/hanh-dong-liem-chinh-2000-thumb.jpg','The ICAC Investigators 2000','completed','5','44 phút/tập','2000','HD',NULL,'','黃錦燊, 劉松仁, 黃德斌, 吳美珩, 吳家樂, 馬德鐘, 郭耀明, 劉愷威, 林峯, 梁詠琳','Tâm Lý, Hình Sự, Hành Động','Trung Quốc, Hồng Kông','Hành Động Liêm Chính 2000-The ICAC Investigators 2000 (2000) [HD-Lồng Tiếng]',0,0,10,0),(365,'Cảm Ơn Vì Yêu Em','https://img.ophim.live/uploads/movies/cam-on-vi-yeu-em-thumb.jpg','Thank You For Loving Me','completed','1','103 Phút','2025','HD',NULL,'李强','刘子玄, 多妮, 于俭, 明笑亮, 张灵儿','Hành Động, Hình Sự','Trung Quốc','<p>Lâm Quả Quả và Tiền Bân vốn là người yêu, nhưng sa vào cạm bẫy của bọn buôn ma túy, cả hai dính nghiện và không thể tự thoát ra. Người đồng nghiệp Phùng Hiểu Nam, thầm yêu Lâm Quả Quả, đã kiên quyết đưa cô đi cai nghiện. Sau khi cai thành công, Lâm Quả Quả trở lại sâ