 cho Thương, cô đã kiên trì đầy nghị lực để quyết tâm thay đổi cuộc sống. Thương thành công và kỳ vọng em trai đi theo con đường mình đã lựa chọn. Tuy nhiên, sự áp đặt vô tình tạo nên rạn nứt, đẩy hai chị em vào những mâu thuẫn sâu sắc – thậm chí đến mức đối mặt sinh tử.',1,0,14,0),(382,'Người đẹp và đồng phạm Bester','https://img.ophim.live/uploads/movies/nguoi-dep-va-dong-pham-bester-thumb.jpg','Beauty and the Bester','completed','3','? phút/tập','2025','HD',NULL,'','','Hình Sự, Tài Liệu','Âu Mỹ','<p>Liệu Tiến sĩ Nandipha nổi tiếng có liên quan đến vụ vượt ngục của Thabo Bester không? Loạt phim tài liệu rùng rợn này sẽ khám phá mối liên hệ bí ẩn giữa họ.</p>',0,0,6,0),(383,'Không Lực','https://img.ophim.live/uploads/movies/khong-luc-thumb.jpg','Sky Force','completed','1','125 Phút','2025','HD',NULL,'Sandeep Kewlani, Abhishek Kapur','Veer Pahariya, अक्षय कुमार, Nimrat Kaur, Sara Ali Khan, Sharad Kelkar, Mohit Chauhan, Manish Chaudhary, Naisha Khanna, Soham Majumdar, Varun Badola','Hành Động, Chiến Tranh','Ấn Độ','Bộ phim hé lộ một câu chuyện đầy kịch tính, lấy cảm hứng từ những sự kiện có thật trong một trong những cuộc không kích khốc liệt nhất giữa Ấn Độ và Pakistan. Một người hùng ngã xuống, một đồng đội quyết tâm tìm ra sự thật – bản anh hùng ca tôn vinh lòng dũng cảm, sự hy sinh và tinh thần kiên cường bất diệt.\"',0,0,3,0),(384,'Thiên Bồng Trở Lại','https://img.ophim.live/uploads/movies/thien-bong-tro-lai-thumb.jpg','Marshal Tianpeng Returns','completed','1','100 phút','2022','HD',NULL,'Fang Xiaogang','Zhao Yuanyuan,  Chen Xinzhe,  Li Jiatong,  Huang Jiaxin','Cổ Trang, Võ Thuật, Thần Thoại, Chính kịch','Trung Quốc','<p>Huang Jiaxin đã trở thành trò cười của Gao Laozhuang. Ông Gao đã cố gắng hết sức để đạo diễn và vào vai Vua Núi để cướp đi người thân của mình, trên đường đi vô tình gặp phải cái bờm của Zhu Gang, ông đã mắc sai lầm và đưa Gao Cuilan trở lại, và sau đó hàng loạt câu chuyện về tình yêu, thù hận xảy ra giữa Gao Cuilan và đối địch.</p><p>Cuối cùng