họa, nhiệm vụ chết chóc khác vào mỗi tập. Bode Donovan và đồng đội sẽ phải dùng mọi kinh nghiệm và sự dũng cảm để chống lại những thảm họa tự nhiên và nhân tạo. Phần 3 này tiếp tục giữ vững phong độ của loạt phim khi kết hợp hành động cứu hỏa cường độ cao với kịch tính gia đình, cá nhân sâu sắc và nhận được nhiều phản hồi đánh giá tích cực từ giới phê bình phim.</strong></p>',0,0,17,0),(407,'Thư Kiếm Ân Thù Lục','https://img.ophim.live/uploads/movies/thu-kiem-an-thu-luc-thumb.jpg','The Legend of the Book and Sword','completed','28','45 phút/tập','1987','HD',NULL,'','Nixon Pang, 羅慧娟, 梁藝齡, 黎美嫻, 吳啟華, 陳敏兒, 任達華, 關菁, 石修, 廖啟智','Cổ Trang','Trung Quốc, Hồng Kông','Phim lấy bối cảnh thời nhà Thanh, xoay quanh cuộc đấu tranh của Hồng Hoa Hội – tổ chức phản Thanh phục Minh. Tổng đà chủ Vu Vạn Đình nắm giữ bí mật lớn về thân thế của Hoàng đế Càn Long nên bị truy sát, còn Văn Thái Lai – tứ đương gia của Hồng Hoa Hội – bị bắt. Trần Gia Lạc được bầu làm tân tổng đà chủ, dẫn anh em Hồng Hoa Hội đi cứu Văn Thái Lai. Trên đường, họ giúp bộ tộc Mộc Trác Luân đoạt lại kinh sách, và Trần Gia Lạc nên duyên với Hô Thanh Đồng, con gái trưởng của tộc trưởng. Tại Tây Hồ, Trần Gia Lạc vô tình gặp Càn Long và biết được bí mật Càn Long là người Hán, chính là anh trai ruột của mình. Dù hai bên thỏa thuận hòa hoãn, Càn Long vẫn phản bội và ra lệnh vây công Hồng Hoa Hội. Cuối cùng, Hồng Hoa Hội bắt được Càn Long nhưng bị quân triều đình bao vây. Lúc này, Trần Gia Lạc liều mình cứu anh trai, khiến Càn Long cảm động và đồng ý bí mật liên minh với Hồng Hoa Hội chống lại nhà Thanh.',0,0,2,0),(408,'Truy Nã Đặc Biệt: Tin Tặc Tuổi Mới Lớn','https://img.ophim.live/uploads/movies/truy-na-dac-biet-tin-tac-tuoi-moi-lon-thumb.jpg','Most Wanted: Teen Hacker','trailer','1','41 phút/tập','2025','HD',NULL,'','Julius Kivimäki','Hình Sự, Tài Liệu','Phần Lan','<p>Hacker, nạn nhân, chuyên gia an ninh mạng, và cựu đặc vụ FBI cùng hé lộ thế giới ngầm của mối đe dọa số, trong câu chuyện tội phạm mạng toàn cầu.</p>',1,0,6