 Akharaphaisansakul. Người đứng đầu Tập đoàn Pearl Star và tộc trưởng Nawin Akharaphaisansakul có bốn người con ruột: Phop, Chan, Pat và Natty. Với người vợ mới, Philai, ông có một đứa con nuôi, Vee, cực kỳ trung thành với gia đình. Với địa vị của gia đình, một đám tang lặng lẽ và khiêm tốn do gia đình tổ chức đã gây ra sự nghi ngờ của công chúng khi những bức ảnh bị rò rỉ trên mạng xã hội. Nawin buộc phải sắp xếp một cuộc họp báo để xóa tan những nghi ngờ đó. Nhưng Vee vẫn còn nghi ngờ. Đêm diễn ra sự kiện dẫn đến đám tang đó, Vee đã bị thương và có những điều anh không thể nhớ. Anh sẽ biết rằng anh không phải là người duy nhất tuyệt vọng muốn biết những gì thực sự đã xảy ra đêm đó.</p>',0,0,17,0),(456,'Mượn Vợ Của Bạn Một Ngày','https://img.ophim.live/uploads/movies/muon-vo-cua-ban-mot-ngay-thumb.jpg','어쩌다먹은친구아내','completed','1','90 phút','2023','HD',NULL,'','Dongwoo, Ji Sung, Seoyul, Jin Si-ah','Phim 18+','Hàn Quốc','<p>Gia đình của bạn tôi ép phải có người yêu gấp, anh ta hết cách đành phải qua nhà một người bạn thân và mượn cô ấy một ngày để che giấu chuyện chưa có người yêu và rồi....</p>',0,0,8,0),(457,'Unknown Number: The High School Catfish','https://img.ophim.live/uploads/movies/unknown-number-the-high-school-catfish-thumb.jpg','Unknown Number: The High School Catfish','completed','1','94 Phút','2025','HD',NULL,'Skye Borgman','Lauryn Licari, Sophie Weber, Macy Johnston, Owen McKenny, Shawn Licari','Tài Liệu','Âu Mỹ','<p>Một cô gái tuổi teen và bạn trai trở thành mục tiêu quấy rối liên tục từ một số điện thoại ẩn danh. Khi điều tra sâu hơn, cảnh sát phát hiện ra một bí mật thách thức mọi niềm tin ban đầu của họ về vụ án.</p>',0,0,6,0),(458,'Phóng Viên Hào Hùng','https://img.ophim.live/uploads/movies/phong-vien-hao-hung-thumb.jpg','File Noir','completed','20','44 phút/tập','1989','HD',NULL,'','邵仲衡, 黎美嫻, 甄子丹, 吳鎮宇, Ching-Ching Yiu, 周星馳, 吳孟達, 黎耀祥, 駱應鈞, 吳詠紅','Tình Cảm, Hành Động, Tâm Lý','Trung Quốc, Hồng Kông','Phóng Viên Hào Hùng-File Noir (1989) [HD-Lồng Tiến