ovies/kiem-ma-doc-co-cau-bai-thumb.jpg','The Legend of The Invincible','completed','20','45 phút/tập','1990','HD',NULL,'','黃日華, Candy Wen Xue-Er, 邵美琪, 吳岱融, 李麗麗, 羅樂林, Carrie Choi, 劉家輝, Katherine Lau Ying-Hung, 李成昌','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Nội dung phim bắt đầu từ một người có sức mạnh tàn ác trên giang hồ là Độc Cô Thiên Phong. Độc Cô Thiên Phong là kỳ tài của võ học, tuy nhiên tính tình khác người. Vì muốn độc chiếm các bí cấp võ công nên ra tay tàn sát võ lâm. Sau khi bị các phái tiêu diệt, Thiên Phong bị bắt giam hơn 20 năm, đứa con mới sinh và người vợ cũng bị thất lạc. 20 năm sau, Lâm Khang từ 1 thiếu niên tốt bụng, trở thành 1 thiếu hiệp hành hiệp trượng nghĩa. Anh cùng với thiếu chủ Bạch Gia Bảo trở thành đệ tử phái Thiên Sơn, nhưng tính tình của Bạch Thừa Trung nham hiểm nên đã hại cả nhà Lâm Khang. Và sau cùng, khi quyết đấu với Độc Cô Thiên Phong, sau khi đánh bại được Độc Cô, Lâm Khang mới biết mình là đứa con thất lạc hơn 20 năm. Sau cùng, khi sáng chế ra môn kiếm pháp: Độc cô cửu kiếm lừng danh trong giang hồ, Lâm Khang tiêu diệt Bạch Thừa Trung và đổi tên là: Kiếm Ma Độc Cô Cầu Bại. Sau này truyền nhân của ông là Dương Quá, Phong Thanh Dương và Lệnh Hồ Xung.',1,0,2,0),(463,'Ma Nữ Si Tình','https://img.ophim.live/uploads/movies/ma-nu-si-tinh-1985-thumb.jpg','Happy Spirit','completed','20','40 phút/tập','1985','HD',NULL,'','鄭裕玲, 呂良偉, 鄧萃雯, Lam Lap-San, 王書麒, 張衞健, 呂有慧, 秦沛, 白茵, 黃愷欣','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','Ma Nữ Si Tình-Happy Spirit (1985) [HD-Lồng Tiếng]',1,0,9,0),(464,'Champion','https://img.ophim.live/uploads/movies/champion-thumb.jpg','Champion','completed','8','45 phút/tập','2024','HD',NULL,'','Déja J. Bowens, Malcolm Kamulete, Nadine Marshall, Ray Fearon, Ray BLK, Kerim Hassan','Âm Nhạc, Chính kịch','Anh','Rapper Bosco ra tù và sẵn sàng cho màn tái xuất, nhưng rồi em gái Vita của anh trở thành tâm điểm chú ý và khiến mối quan hệ gia đình của họ gặp thử thách.',0,0,13,0),(465,'Ẩm Thực Tử Cấm Thành','https://img.ophim.live/uploads/movies/am-thuc-tu-cam-thanh-thumb.jpg','Royal Masterchef','completed','1','1 giờ 27 phút','2021','HD',NULL,'','Cui Erkang,  Lu Jiani,  Zhang Chunzhong,  Zhu Jian,  Zhu Xuan, ','Hài Hước, Thần Thoại','Trung Quốc','<p>Phim kể về câu chuyện tình yêu của một cặp tình nhân ở Tử Cấm Thành, sau khi trải qua những thử thách trong chốn thâm cung tranh đấu đã kết hôn với nhau. Nhân vật chính Jing Xiangege và đầu bếp trong cung Zhang Dongguan đã vượt qua sự khác biệt trong quan niệm gia đình truyền thống, về danh tính và những áp lực khác nhau để có thể tồn tại. Họ liên tiếp giúp các cung nữ, hoàng tử, tướng lĩnh giải quyết các vấn đề của mỗi người, thông qua việc làm một loạt các món ăn ngon được chuẩn bị tỉ mỉ để giải quyết mọi mâu thuẫn. Trong quá trình đó, cả hai đã cùng nhau vượt qua khó khăn, hiểu nhau hơn, lặng lẽ hoàn thành quá trình trưởng thành của bản thân và cuối cùng quay về cuộc sống bình thường cùng nhau.</p>',0,0,20,0),(466,'Miền viễn Tây ngày ấy','https://img.ophim.live/uploads/movies/mien-vien-tay-ngay-ay-thumb.jpg','Once Upon a Time in the West','completed','1','2g 46ph','1968','HD',NULL,'','Claudia Cardinale, Henry Fonda, Jason Robards','Hành Động, Phiêu Lưu, Kinh Điển','Ý','<p>Trong phim cao bồi viễn tây hùng tráng này, ông trùm đường sắt thuê một tay súng rắn rỏi để giết bất cứ ai cản đường con ngựa sắt xuyên Mỹ của mình.</p>',0,0,22,0),(467,'Quái vật: Câu chuyện của Ed Gein','https://img.ophim.live/uploads/movies/quai-vat-cau-chuyen-cua-ed-gein-thumb.jpg','Monster: The Ed Gein Story','completed','8','? phút/tập','2025','HD',NULL,'','','Hành Động','Âu Mỹ','Serial killer. Grave robber. Psycho. In the frozen fields of 1950s rural Wisconsin, a friendly, mild-mannered recluse named Eddie Gein lived quietly on a decaying farm - hiding a house of horrors so gruesome it would redefine the American nightmare. Driven by isolation, psychosis, and an all-consuming obsession with his mother, Gein\'s perverse crimes birthed a new kind of monster that would haunt Hollywood for decades. From Psycho to The Texas Chainsaw Massacre to The Silence of the Lambs, Gein\'s macabre legacy gave birth to fictional monsters born in his image and ignited a cultural obsession with the criminally deviant. Ed Gein didn\'t just influence a genre -- he became the blueprint for modern horror.',0,0,24,0),(468,'Bí Mật Của Em','https://img.ophim.live/uploads/movies/bi-mat-cua-em-thumb.jpg','Miss Gu Who is Silent','completed','20','45 phút/tập','2020','HD',NULL,'孙浩','Aliyah, 李子峰, 蔡卓音, 葉筱瑋, 郭迦南, Liu Luo Xi','Chính kịch, Bí ẩn','Trung Quốc','<p>Cố Tinh Đan đổi tên, che giấu thân phận, vạch ra hàng loạt kế hoạch giúp anh trai gột rửa nỗi đau. Tuy nhiên, tình hình đã bị người khác thao túng, Cố Tinh Đan rơi vào bẫy, trở thành quân cờ của kẻ khác.</p>',0,0,7,0),(469,'Hãy Để Tôi Tỏa Sáng','https://img.ophim.live/uploads/movies/hay-de-toi-toa-sang-thumb.jpg','Love\'s Ambition','trailer','2','44 phút/tập','2025','HD',NULL,'陈畅','赵露思, 陳偉霆, 万鹏, 唐晓天, 管梓净, Zhong yating, Wang Yiyao, 王雅佳, 李梵诚','Chính kịch','Trung Quốc','<p>Người dẫn chương trình nổi tiếng Từ Yến và chàng trai thành thị giàu có Thẩm Hạo Minh dường như là một cặp đôi hoàn hảo, nhưng lại gặp khó khăn trong việc hòa nhập với cộng đồng xã hội của nhau do xuất thân khác biệt. Khi mâu thuẫn nảy sinh, Từ Yến bỏ đi, khiến Thẩm Hạo Minh nhận ra tình yêu sâu sắc anh dành cho cô và cố gắng giành lại cô. Trên hành trình của mình, họ đối mặt với những thử thách, lột bỏ lớp vỏ bọc và tìm lại chính mình.</p>',0,0,27,0),(470,'Gái có chồng rất ngon','https://img.ophim.live/uploads/movies/gai-co-chong-rat-ngon-thumb.jpg','임자있는여자가더맛있더라','completed','1','63 phút','2023','HD',NULL,'Ham Hae Young','Chaerin, Soohyun, Myunghoon, James','Phim 18+','Hàn Quốc','<p>Một cô gái mới chuyển vào sinh sống khu nhà chung, khi tìm được công việc bán thời gian mới, khiến cô kiếm được rất nhiều tiền nhờ công việc này nên mới....</p>',1,0,8,0),(471,'Tài Xế Đêm','https://img.ophim.live/uploads/movies/tai-xe-dem-thumb.jpg','The Accidental Getaway Driver','completed','1','102 Phút','2025','HD',NULL,'','','Chính kịch, Hình Sự','Âu Mỹ','The Accidental Getaway Driver (Tài Xế Đêm) là một bộ phim tội phạm Mỹ năm 2023 dựa trên câu chuyện có thật về vụ bắt cóc có thật năm 2016. tài xế taxi Mã Hoàng Long, một tài xế taxi gốc Việt tại Quận Cam, bị bắt cóc bởi ba tù nhân vượt ngục. Phim có sự tham gia của Hiệp Trần Nghĩa, Phi Vũ, Dali Benssalah và Dustin Nguyễn. Bộ phim ra mắt tại Liên hoan phim Sundance 2023 vào ngày 23 tháng 1 và đã giúp Lee giành được Giải thưởng Đạo diễn xuất sắc tại hạng mục phim Mỹ. Sau đó, phim được phát hành vào ngày 28 tháng 2 năm 2025 bởi Utopia. Bộ phim nhận được nhiều đánh giá tích cực với 85% trên Rotten Tomatoes và 69 điểm trên Metacritic.',0,0,17,0),(472,'Triệu Phú','https://img.ophim.live/uploads/movies/trieu-phu-thumb.jpg','Millionaire','completed','1','102 Phút','2025','HD',NULL,'José Isla, Felipe Isla','','Tài Liệu','Chile','<p>Trong bộ phim tài liệu này, người đàn ông Chile nọ trở thành tâm điểm dư luận khi tờ vé số bị hỏng của anh trúng giải độc đắc đổi đời, khơi mào cuộc điều tra trên toàn quốc.</p>',0,0,6,0),(473,'Mặt Trái Tình Yêu (phần 2)','https://img.ophim.live/uploads/movies/mat-trai-tinh-yeu-phan-2-thumb.jpg','The Threat Of Love (Season 2)','completed','10','44 phút/tập','2003','HD',NULL,'','','Tình Cảm, Tâm Lý','Hồng Kông','Mặt Trái Tình Yêu (phần 2)-The Threat Of Love (Season 2) (2003) [HD-Lồng Tiếng]',0,0,10,0),(474,'Red Poppies','https://img.ophim.live/uploads/movies/red-poppies-thumb.jpg','Red Poppies','completed','1','0 Phút','2024','HD',NULL,'','','Chính kịch, Chiến Tranh','Ba lan','We see the story of the legendary battle through the eyes of Jedrek - a boy who went through the hell of the gulag and left Russia with the Polish Army as one of thousands of polish orphans. Soon a decisive attack on a monastery located on the hills of Monte Cassino is to take place at the front - this spectacular battle will decide the lives of many soldiers and the fate of the Allied offensive in Italy, and will change Jedrek\'s life forever.',0,0,3,0),(475,'Thế Giới BL Và Chàng Trai Không Muốn Bị Bẻ Cong','https://img.ophim.live/uploads/movies/the-gioi-bl-va-chang-trai-khong-muon-bi-be-cong-thumb.jpg','A Man Who Defies the World of BL','completed','4','25 phút/tập','2021','HD',NULL,'','犬飼貴丈, ゆうたろう, 伊藤あさひ, 塩野瑛久, Masaki Yabe, 小林亮太, 栗山航, 北村諒, 濱正悟, 草地稜之','Hài Hước, Chính kịch','Nhật Bản','<p>Mob cố gắng tránh trở thành nhân vật chính trong thế giới BL, nhưng khi tình yêu tìm đến, anh phải lựa chọn giữa việc ở lại phía sau hoặc đón nhận sự lãng mạn.</p>',0,0,16,0),(476,'Người Vận Chuyển','https://img.ophim.live/uploads/movies/the-transporter-thumb.jpg','The Transporter','completed','1','Đang cập nhật','2002','HD',NULL,'','','Hành Động','Âu Mỹ, Pháp','<p>Nhà điều hành lực lượng đặc biệt Frank Martin sống những gì dường như là một cuộc sống yên tĩnh dọc theo Địa Trung Hải Pháp, thuê mình là một \"Transporter\" Mercenary, người di chuyển hàng hóa - con người hoặc cách khác - từ nơi này đến nơi khác. Không có câu hỏi hỏi. Thực hiện các nhiệm vụ bí ẩn và đôi khi nguy hiểm trong BMW bị lừa của mình, Frank tuân thủ một loạt các quy tắc nghiêm ngặt, mà anh ta không bao giờ phá vỡ. Quy tắc One: Không bao giờ thay đổi thỏa thuận. Quy tắc hai: Không có tên - Frank không muốn biết người mà anh ta đang làm việc, hoặc những gì anh ta đang vận chuyển. Quy tắc ba: Không bao giờ nhìn vào gói. Giao thông vận tải mới nhất của Frank dường như không khác gì với vô số người mà anh ấy đã làm trong quá khứ. Anh ta được người Mỹ chỉ được gọi là \"Phố Wall\" để giao hàng; Nhưng khi Frank dừng dọc theo tuyến đường, anh ta sẽ thông báo gói hàng của mình đang di chuyển. Vi phạm quy tắc ba, Frank nhìn vào bên trong chiếc túi, tìm thấy nội dung của nó là một người phụ nữ xinh đẹp, bịt miệng. Tuân thủ kiên định của Frank với hai quy tắc khác của anh ấy - tạo nên bộ luật sinh tồn cơ bản của anh ấy - cũng nhanh chóng thất bại, làm tổn thương anh ấy và người bạn đồng hành mới của anh ấy trên một con đường dẫn đến những bí mật gây sốc, biến chứng chết người, và điều cuối cùng Frank đã từng ngờ tới Hãy tin rằng: các quy tắc đó được thực hiện để bị phá vỡ.</p>',0,0,25,0),(477,'Hoa Sơn Luận Kiếm - Đông Tà Tây Độc','https://img.ophim.live/uploads/movies/hoa-son-luan-kiem-dong-ta-tay-doc-thumb.jpg','Eastern Heretic and Western Venom','completed','8','48 phút/tập','2025','HD',NULL,'','','Hành Động, Võ Thuật, Cổ Trang','Trung Quốc','<p>Hoàng Dược Sư, Âu Dương Phong, hai quái nhân mới bước chân vào giang hồ, một người tiêu dao tựa thần tiên, một người ngây thơ như trẻ nhỏ, vừa là địch vừa là bạn, châm ngòi một cuộc loạn thế phân tranh đầy âm mưu khôn lường.</p><p>&nbsp;</p>',1,0,2,0),(478,'Người Kế Nghiệp','https://img.ophim.live/uploads/movies/nguoi-ke-nghiep-thumb.jpg','Storm in a Cocoon','completed','33','45 phút/tập','2014','HD',NULL,'','馬浚偉, 楊茜堯, 麥長青, 邵美琪, 唐詩詠, 曹永廉, Mat Yeung, 嶽華, 程可為, 李國麟','Tình Cảm','Trung Quốc, Hồng Kông','\"Wing Tai Lung\" is Guangzhou\'s largest silk factory during its time. The owner POON WING LIN is growing old and has passed on the business to his eldest son POON KA HIN and second daughter POON HAU YEE to manage, but unexpectedly HAU YEE strangely commits suicide. Youngest son POON KA YEUNG is a military doctor, who returns home after completing his service and takes over the business. He was suspicious of his sister HAU YEE\'s death as there were too many questions unanswered. HAU YEE\'s good friend and worker at the silk factory, TONG BING BING also questioned the death. YEUNG and BING BING joined forced to investigate the mysterious death and unfolds the complex relationships in the silk factory, each and every one of them are suspects. The head of the silk factory, SIN BIK SUET is regarded as the big sister in the factory and frequently picks on BING BING. After the big liar FUNG CHI CHING joined the silk factory, she appeared to have a different motive. As for BING BING\'s courageous style deeply attracted YEUNG, the two gradually developed feelings, but then BING BING\'s fiancé KWAN JO YIU, who had been missing for several years, suddenly returns and stirs up a giant wave. As for HAU YEE\'s murderer is someone unexpected, and because of this the Poon\'s family business is faced with retribution. Thus, YEUNG and BING BING were determined to be the property protectors...',0,0,9,0),(479,'Nếu tôi là Luísa Sonza','https://img.ophim.live/uploads/movies/neu-toi-la-luisa-sonza-thumb.jpg','If I Were Luísa Sonza','completed','3','33 phút/tập','2023','HD',NULL,'','Luísa Sonza','Âm Nhạc, Tài Liệu','Brazil','Nhiều người yêu nhưng cũng lắm người ghét, nữ ca sĩ nhạc pop Brazil trải lòng trong loạt phim tài liệu về đời sống tình cảm, sự nghiệp, tranh cãi và quá trình làm album mới của cô.',0,0,13,0),(480,'Istanbul, tôi đến đây!','https://img.ophim.live/uploads/movies/istanbul,-toi-den-day-thumb.jpg','Istanbul aku datang!','completed','1','1g 34ph','2012','HD',NULL,'','Lisa Surihani, Tomok, Beto Kusyairy','Kinh Điển','Malaysia','<p>Khi tới thăm bạn trai ở Istanbul, nữ blogger tự thuê nhà nghỉ và buộc phải giấu đi người bạn cùng phòng bất đắc dĩ.</p>',0,0,22,0),(481,'Play Dirty','https://img.ophim.live/uploads/movies/play-dirty-thumb.jpg','Play Dirty','trailer','1','125 Phút','2025','HD',NULL,'Shane Black','Mark Wahlberg, LaKeith Stanfield, Rosa Salazar, Keegan-Michael Key, Chukwudi Iwuji, Nat Wolff, Thomas Jane, Tony Shalhoub, Gretchen Mol, Hemky Madera','Hình Sự','Âu Mỹ','<p>Tên trộm chuyên nghiệp Parker có cơ hội thực hiện một vụ trộm lớn, nhưng để thành công, anh và nhóm của mình phải qua mặt một nhà độc tài Nam Mỹ, mafia New York và người đàn ông giàu nhất thế giới.</p>',0,0,27,0),(482,'Linh Hồn Bạc phần 1','https://img.ophim.live/uploads/movies/linh-hon-bac-phan-1-thumb.jpg','Gintama ss1','completed','259','25 Phút','2006','HD',NULL,'','','Hành Động, Hài Hước, Viễn Tưởng, Thần Thoại','Nhật Bản','<p>Đất nước của những Samurai. Có một thời đất nước chúng tôi được gọi như vậy.20 năm trước…Những kẻ ngoài hành tinh tự xưng là Amanto đột ngột đổ bộ xuống và thiết lập lệnh cấm mang kiếm. Samurai giờ đây bị khinh rẻ, coi thường. Trong thời đại như thế, vẫn còn một người đầy tinh thần samurai. Tên anh ta là Sakata Gintoki. Và tôi, Shimura Shinpachi, cùng Kagura-chan vì một số việc đưa đẩy mà bắt đầu làm việc cho cái tên vô trách nhiệm, hảo ngọt đó tại Vạn Sự Ốc. 3 người Vạn Sự Ốc chúng tôi sẽ cùng nhau dọn sạch Edo hủ bại này. Ừm, anime này là vậy thì phải?</p>',0,0,20,0),(483,'Xem Cô Vợ Trẻ Của Sếp Như Người Tình','https://img.ophim.live/uploads/movies/xem-co-vo-tre-cua-sep-nhu-nguoi-tinh-thumb.jpg','같은 상사의 연하 와이프','completed','1','95 phút','2023','HD',NULL,'Yan-shin-su','Ji Won, Ga Jeongsu, Jungwon, Eugene','Phim 18+','Hàn Quốc','<p>Một người đàn ông buộc phải đi dự tiệc sinh nhật của sếp vào một ngày cuối tuần đầy nắng. Nhưng ở đó anh nhìn thấy một người không ngờ tới....</p>',0,0,8,0),(484,'Cầu Vồng Trong Đêm','https://img.ophim.live/uploads/movies/cau-vong-trong-dem-thumb.jpg','Fate Twisters','completed','22','45 phút/tập','2003','HD',NULL,'李添勝','蔡少芬, 吳啟華, 黎姿, 關禮傑, 高雄, 黎彼得, 戴耀明, 鍾麗淇, 陳穎妍, 曾慧雲','Chính kịch','Trung Quốc, Âu Mỹ, Hồng Kông','<p>Bộ phim này là một trong những bom tấn bất ngờ của năm 2003. Được thực hiện với kinh phí thấp, bộ phim vẫn đạt tỷ suất người xem tốt ở Hồng Kông mặc dù bị lu mờ bởi các tác phẩm đình đám khác. Về cốt truyện, \"Fate Twisters\" không có gì nổi bật, khai thác những kịch bản quen thuộc như một người đàn ông giàu có tìm lại đứa con trai thất lạc từ lâu, những khó khăn thăng tiến trong công ty, và cuộc sống của tầng lớp trung lưu thấp. Nhưng điều làm nên thành công của bộ phim chính là dàn diễn viên xuất sắc, xây dựng nhân vật xuất sắc, và diễn xuất toàn diện.</p>',2,0,24,0),(485,'G4nh Đua','https://img.ophim.live/uploads/movies/g4nh-dua-thumb.jpg','RIV4LRIES','completed','14','35 phút/tập','2025','HD',NULL,'','Andrea Arru, Samuele Carrino, Edoardo Miulli, Joseph Figueroa, Lorenzo Ciamei','Gia Đình','Ý','<p>Tại một trường cấp hai ở Pisa, chưa từng có ai thách thức nhóm học sinh cộm cán – cho đến khi cô nàng Terry chuyển đến với những ý tưởng táo bạo, khơi mào hàng loạt cuộc ganh đua.</p>',0,0,14,0),(486,'Dấu Vết Của Sự Lừa Dối','https://img.ophim.live/uploads/movies/dau-vet-cua-su-lua-doi-thumb.jpg','Misleading Track','completed','20','40 phút/tập','2005','HD',NULL,'','','Hành Động, Tâm Lý','Hồng Kông','Ân Đình bị buộc tội mưu sát chồng và ngậm ngùi chịu án tù oan suốt năm năm. Sau khi mãn hạn tù, Đình tích cực xây dựng lại cuộc sống. Cô luôn nhớ người chồng quá cố và muốn tìm ra sự thật về cái chết của anh. Số phận trớ trêu, đưa đẩy Đình gặp phải Nguyễn Văn Sơn với dung mạo giống hệt Trung. Đình lấy lại cân bằng và quyết tâm làm rõ mọi việc mà không ngờ quyết tâm đó có thể đẩy mình vào vòng lao lý một lần nữa. May thay, Đình làm quen với luật sư La Lý Hạo. Hạo dốc lòng giúp đỡ Đình, thậm chí cứu cô thoát chết. Với những bằng chứng thuyết phục, bộ mặt thật của Sơn dần được hé lộ. Sơn móc nối với Du Thượng Chí để phản kích Hạo và Đình, nhằm đưa họ vào đường cùng. Trước nhiều áp lực, Hạo buộc mình phải thay đổi bản chất. Đình sẽ làm gì để chiến đấu, giành lại công bằng cho bản thân?',0,0,10,0),(487,'Gettysburg','https://img.ophim.live/uploads/movies/gettysburg-thumb.jpg','Gettysburg','completed','1','254 Phút','1993','HD',NULL,'Ronald F. Maxwell','Jeff Daniels, Tom Berenger, Martin Sheen, Sam Elliott, Stephen Lang, C. Thomas Howell, Richard Anderson, Richard Jordan, Kevin Conway, Andrew Prine','Chiến Tranh, Chính kịch','Âu Mỹ','In the summer of 1863, General Robert E. Lee leads the Confederate Army of Northern Virginia into Gettysburg, Pennsylvania with the goal of marching through to Washington, D.C. The Union Army of the Potomac, under the command of General George G. Meade, forms a defensive position to confront the rebel forces in what will prove to be the decisive battle of the American Civil War.',0,0,3,0),(488,'Lời Hẹn Ước','https://img.ophim.live/uploads/movies/loi-hen-uoc-thumb.jpg','Be Loved in House: I Do','completed','13','30 phút/tập','2021','HD',NULL,'Chiang Ping Chen','賴東賢, Hank Wang, Liao Wei Po, Jie-En Yu, Yao Mi, Hsi-Teng Chen, 王彩樺, Deyn Li, 艾雨帆','Hài Hước, Chính kịch','Nhật Bản, Đài Loan','<p>Khi một ông chủ mới nghiêm khắc ra lệnh cấm hẹn hò trong văn phòng, một nhân viên bất chấp lệnh cấm này đã quyết định thách thức lệnh cấm, nhưng rồi lại phải lòng người đàn ông đứng sau lệnh cấm.</p>',0,0,16,0),(489,'Người Vận Chuyển 3','https://img.ophim.live/uploads/movies/transporter-3-thumb.jpg','Transporter 3','completed','1','Đang cập nhật','2008','HD',NULL,'','','Hành Động','Pháp','<p>Bong bóng chất thải độc hại trong một tàu chờ đợi để cập cảng ở Odessa. Frank Martin tắt một công việc ở Brussilles, đề cập đến một người bạn. Một thời gian ngắn sau, Pal, bị thương bởi tiếng súng, đâm xe vào phòng khách của Frank và chết, khiến một phụ nữ trẻ ở ghế sau. Người sử dụng lao động của người chết xuất hiện, buộc Frank để nhận công việc, chộp lấy một chiếc vòng tay trên cổ tay của anh ta sẽ nổ tung nếu Frank có nhiều hơn 75 feet từ chiếc xe của mình và gửi thẳng thắn trên một hành trình về phía đông với người phụ nữ trẻ và một thân cây đầy một cái gì đó Cô ấy là Valentina, gần như câm. Frank có thể tìm ra những gì đang xảy ra, giao gói hàng, và trốn thoát sống? Và con tàu phải làm gì với nó?</p>',0,0,25,0),(490,'Những Kỷ Nguyên Của Taylor Swift','https://img.ophim.live/uploads/movies/nhung-ky-nguyen-cua-taylor-swift-thumb.jpg','TAYLOR SWIFT | THE ERAS TOUR','completed','1','169 Phút','2023','HD',NULL,'Sam Wrench','Taylor Swift, Mike Meadows, Max Bernstein, Paul Sidoti, Amos Heller, Matt Billingslea, Karina DePiano, Melanie Nyema, Kamilah Marshall, Jeslyn Gorman','Âm Nhạc','Âu Mỹ','<p>Hiện tượng văn hóa tiếp tục trên màn ảnh lớn! Đắm chìm trong trải nghiệm xem phim hòa nhạc độc nhất vô nhị với góc nhìn ngoạn mục, đậm chất điện ảnh về chuyến lưu diễn mang tính lịch sử. Khuyến khích khán giả đeo vòng tay tình bạn và mặc trang phục Taylor Swift Eras Tour!</p><p>&nbsp;</p>',0,0,13,0),(491,'Thiết Huyết Đại Kỳ Môn','https://img.ophim.live/uploads/movies/thiet-huyet-dai-ky-mon-thumb.jpg','The Sect of Blood & Iron','completed','21','45 phút/tập','1989','HD',NULL,'','劉淑華, 陳庭威, 劉青雲, 崔加寶, 石修, 麥翠嫻, 馬海倫, 關海山, Carrie Choi, 郭鋒','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p>Thiết Huyết Đại Kỳ Môn</p>',0,0,2,0),(492,'Chuyên Gia Gỡ Rối','https://img.ophim.live/uploads/movies/chuyen-gia-go-roi-thumb.jpg','The Fixer','completed','21','45 phút/tập','2015','HD',NULL,'','錢嘉樂, 黃智雯, 袁偉豪, 朱晨麗, LuLu Kai, 洪天明, 朱千雪, 黃淑儀, 魯振順, 李國麟','Tình Cảm','Trung Quốc, Hồng Kông','<p>Khi cảnh sát, luật sư hoặc thành viên hội Tam Hoàng gặp phải những vấn đề nan giải không thể giải quyết, một tổ chức ngầm mang tên \"The Fixers\" sẽ vào cuộc. Kẻ chủ mưu Szeto Sam Ping dẫn đầu nhóm, bao gồm chuyên gia pháp lý Leoi Leoi, chuyên gia máy tính Mak Ping On, tên trộm lẳng lơ Chan Dai Man và cựu quan chức chính phủ Bak Seon. Nhóm năm người này sử dụng những chiến thuật phi thường, đang có xu hướng đi đến bờ vực thẳm để giúp thân chủ của họ giải quyết những vấn đề khó khăn. Dưới sự lãnh đạo của Szeto Sam Ping dũng cảm và thông minh, nhóm trở nên bất khả chiến bại. Nhưng khi anh gặp lại anh trai mình, sĩ quan OCTB Mak Hang Zik, người mà anh đã không gặp trong nhiều năm, anh phát hiện ra rằng mẹ anh, Szeto Yan Yan, mắc chứng mất trí nhớ. Để chuộc lại những lỗi lầm trong quá khứ, anh hàn gắn mối quan hệ với gia đình và trải nghiệm sự ấm áp gia đình mà anh chưa từng có trước đây. Tuy nhiên, sự xuất hiện của một người bí ẩn đã đẩy mọi thứ của Szeto Sam Ping đến bờ vực. Danh tính của các thành viên trong nhóm lần lượt bị lộ. Bị cả cảnh sát và hội Tam Hoàng truy đuổi, bất hòa với chính anh trai mình và phải chiến đấu một mình, làm sao Szeto Sam Ping có thể giải quyết vấn đề của mình?</p>',0,0,9,0),(493,'The Wicked Game: Ván Tình Lừa Dối','https://img.ophim.live/uploads/movies/the-wicked-game-van-tinh-lua-doi-thumb.jpg','The Wicked Game','ongoing','2','51 phút/tập','2025','HD',NULL,'Thanawat Panyarin','พิทยา แซ่ฉั่ว, กันตภณ จินดาทวีผล, Natthawut Skidjai, Kitsakorn Kanogtorn, มนชนก แสงฉายเพียงเพ็ญ, อริศรา วงษ์ชาลี, จักราสินธุ์ อัศวธนะชัย, พิชญ์อร วนรัตน์, กิตติพงษ์ ปลื้มปรีดาพร, Thira Chutikul','Hành Động, Phiêu Lưu, Chính kịch, Bí ẩn','Thái Lan','<p>Một người thừa kế bị bỏ rơi đã tiến hành chiến tranh để vạch trần người cha tàn nhẫn của mình và giành quyền kiểm soát đế chế gia đình, nhưng sự phản bội và ham muốn đã đe dọa kế hoạch của anh ta.</p>',0,0,7,0),(494,'Điệp huyết song hùng','https://img.ophim.live/uploads/movies/diep-huyet-song-hung-thumb.jpg','The Killer','completed','1','1g 51ph','1989','HD',NULL,'','Châu Nhuận Phát, Danny Lee, Diệp Thiên Văn','Hành Động, Phiêu Lưu, Chính kịch, Kinh Điển','Trung Quốc','<p>Trong phim hành động giật gân này của Ngô Vũ Sâm, một sát thủ nhận phi vụ cuối cùng để kiếm tiền đền bù cho một phụ nữ mà gã vô tình làm bị thương trong một màn đấu súng.</p>',0,0,22,0),(495,'Trận Chiến Sau Trận Chiến','https://img.ophim.live/uploads/movies/tran-chien-sau-tran-chien-thumb.jpg','One Battle After Another','trailer','1','161 Phút','2025','HD',NULL,'Paul Thomas Anderson','Leonardo DiCaprio, Sean Penn, Chase Infiniti, Benicio del Toro, Regina Hall, Teyana Taylor, Wood Harris, Tony Goldwyn, D.W. Moffett, Dijon Duenas','Hành Động, Hình Sự','Âu Mỹ','Mười sáu năm sau ngày kẻ thù tàn bạo bị xóa sổ, nhóm cựu chiến sĩ cách mạng buộc phải tái hợp để giải cứu con gái của một đồng đội thân thiết trong nhóm, đối mặt với hiểm nguy mới để bảo vệ di sản tình nghĩa và lý tưởng của họ.',1,0,27,0),(496,'Chuyện bí mật giữa sếp và nhân viên','https://img.ophim.live/uploads/movies/chuyen-bi-mat-giua-sep-va-nhan-vien-thumb.jpg','은밀하게그리고음탕하게','completed','1','65 phút','2023','HD',NULL,'Kim Taehoon','Dohee, Minja, Woo Yeolhun','Phim 18+','Hàn Quốc','<p>Buổi tiệc được diễn ra trong nhà của tổng giám đốc, sau khi buổi tiệc tàn thì mới nhận ra một bí mật động trời khi nam nhân viên muốn đi tham quan nhà của giám đốc...</p>',0,0,8,0),(497,'Katrina: Vượt Qua Bão Tố','https://img.ophim.live/uploads/movies/katrina-vuot-qua-bao-to-thumb.jpg','Katrina: Come Hell and High Water','completed','3','60 phút/tập','2025','HD',NULL,'','','Tài Liệu','Âu Mỹ','<p>Hai mươi năm sau cơn bão Katrina, những người sống sót nhìn lại trận bão thảm khốc đã thay đổi vĩnh viễn cuộc đời họ và phơi bày những bất bình đẳng mang tính hệ thống.</p>',0,0,6,0),(498,'Fanfan la Tulipe','https://img.ophim.live/uploads/movies/fanfan-la-tulipe-thumb.jpg','Fan-Fan the Tulip','completed','1','102 Phút','1952','HD',NULL,'Christian-Jaque','Gérard Philipe, Gina Lollobrigida, Marcel Herrand, Olivier Hussenot, Noël Roquevert, Geneviève Page, Sylvie Pelayo, Henri Rollan, Nerio Bernardi, Jean-Marc Tennberg','Hài Hước, Chiến Tranh, Phiêu Lưu','Pháp, Ý','Fanfan is a young handsome peasant. He joins the army to escape marriage because a gypsy girl predicted he will get glory and the king\'s daughter as a wife. But the gypsy girl was in fact Adeline, the daughter of the recruiting officer. Once he has discovered the stratagem, Fanfan refuses to forget this dream and decides to fulfill the destiny of the fake prediction.',0,0,3,0),(499,'Cạm Bẫy Thương Trường','https://img.ophim.live/uploads/movies/cam-bay-thuong-truong-thumb.jpg','Provocateur','completed','25','45 phút/tập','2017','HD',NULL,'','羅嘉良, 鄭俊弘, 李佳芯, 黃心穎, 胡諾言, 張穎康, Roxanne Tong, 羅樂林','Chính kịch','Trung Quốc, Âu Mỹ, Hồng Kông','Trác Quân Lâm (La Gia Lương) – người sở hữu một vương quốc mỹ phẩm nổi tiếng Mỹ Thế Đại có hai đời vợ nhưng đều đã qua đời, anh sống cùng với con gái Trác Mẫn Lợi (Huỳnh Tâm Dĩnh). Công việc kinh doanh của Quân Lâm thuận lợi cho đến khi Phan Thiếu Kiệt (Trịnh Tuấn Hoằng) từ nước ngoài trở về. Thiếu Kiệt có một tuổi thơ đau buồn khi bị cha bỏ rơi, còn mẹ anh qua đời trong nỗi cô đơn và bệnh tật. Thiếu Kiệt bắt tay với các thanh niên có sở trường giỏi để cùng nhau kiếm tiền bằng cách trộm những bí mật thương nghiệp. Họ gồm Lăng Tấn (Trương Dĩnh Khang) có tài thu thập tình báo, Trâu Bội Du (Thang Lạc Văn) giỏi về mặt ngoại giao, Đỗ Chí Nhân (Lại Úy Linh) có sở trường khoa học kỹ thuật và Lâm Tín Huy (Hồ Nặc Ngôn) có tài cải trang. Biết được Quân Lâm là người cha đã bỏ rơi mình năm xưa, Thiếu Kiệt bắt tay với ông chủ công ty khác cùng đối phó với Mỹ Thế Đại...',0,0,24,0),(500,'Ngày Thứ Sáu Siêu Kỳ Quái','https://img.ophim.live/uploads/movies/ngay-thu-sau-sieu-ky-quai-thumb.jpg','Freakier Friday','completed','1','111 Phút','2025','HD',NULL,'Nisha Ganatra','Lindsay Lohan, Jamie Lee Curtis, Julia Butters, Sophia Hammons, Mark Harmon, Manny Jacinto, Maitreyi Ramakrishnan, Christina Vidal, Haley Hudson, Chad Michael Murray','Hài Hước, Gia Đình','Âu Mỹ','Sau 22 năm, phim teen đình đám một thời “Freaky Friday” sẵn sàng trở lại với phần tiếp theo mang tên “Freakier Friday”. Giờ đây Anna đã trở thành một người mẹ, cô có một cô con gái tên Harper. Anna cũng có một cô con gái là con riêng của chồng, tên Lily, người sẽ gọi cô là mẹ kế. Lần này, phép màu không chỉ hoán đổi Anna và mẹ Tess, mà hai cô con gái cũng “nhập cuộc”. Cụ thể, Anna hoán đổi cơ thể với Harper, còn mẹ Tess hoán đổi với Lily.',0,0,14,0),(501,'The Sound of a Flower','https://img.ophim.live/uploads/movies/the-sound-of-a-flower-thumb.jpg','The Sound of a Flower','completed','1','Đang cập nhật','2015','HD',NULL,'','','Tâm Lý, Thần Thoại','Hàn Quốc','<p>Trong triều đại Joseon, Lino-Sun Chae-Sun thách thức quy tắc chỉ cho những người đàn ông chỉ được phép hát trong khi điều hướng sự tận tâm với giáo viên của mình và những yêu cầu của cha của nhà vua.</p>',0,0,20,0),(502,'Người Vận Chuyển 2','https://img.ophim.live/uploads/movies/transporter-2-thumb.jpg','Transporter 2','completed','1','Đang cập nhật','2005','HD',NULL,'','','Hành Động','Âu Mỹ, Pháp','<p>Frank Martin là tốt nhất trong kinh doanh. Các hoạt động của các lực lượng đặc biệt của EX đã thuê mình là một \"người vận chuyển\" lính đánh thuê, người di chuyển hàng hóa - con người hoặc cách khác. Rất đơn giản, anh ta cung cấp, không có câu hỏi nào. Frank đã chuyển từ Địa Trung Hải Pháp sang Miami, Florida, nơi có lợi cho một người bạn, Frank đang lái xe cho gia đình Billings giàu có. Có rất ít điều đó có thể gây bất ngờ cho người vận chuyển, nhưng Young Jack Billings đã làm điều đó; Frank đã bất ngờ liên kết với Jack, 6 tuổi, người mà anh ta lái xe đến và đi học. Nhưng khi Jack bị bắt cóc, Frank phải sử dụng các kỹ năng chiến đấu được thử nghiệm chiến đấu của mình để lấy lại cậu bé và cản trở kế hoạch tổng thể của kẻ bắt cóc sẽ giải phóng một loại virus sẽ giết chết bất kỳ ai mà nó tiếp xúc.</p>',0,0,25,0),(503,'Phù Thủy J Nhà Bên','https://img.ophim.live/uploads/movies/phu-thuy-j-nha-ben-thumb.jpg','Next Door Witch J','completed','12','11 phút/tập','2021','HD',NULL,'Yoon Ji Hoon','박지연, Lee Tae-seon, 장의수, Go Sung-min','Hài Hước, Chính kịch','Hàn Quốc','<p>Seo Je Yi là ngôi sao sáng tạo nội dung làm đẹp, người tạo nội dung dưới cái tên \"Phù thủy nhà bên J\". Cô là người ăn nói lưu loát, không ngại nói ra cảm xúc của mình và điều đó đã giúp cô thành công với tư cách là một nhà sáng tạo nội dung làm đẹp. Lee Woo Bin là CEO của một công ty khởi nghiệp về mỹ phẩm. Sản phẩm của anh được Seo Je Yi, ngôi sao sáng tạo nội dung làm đẹp, công nhận, nhưng anh lại gặp khó khăn trong việc gần gũi với cô như một con người. Anh rất thông minh nhưng lại không có kỹ năng xã hội nào khi nói đến hẹn hò. Lee Tae Kyung là giám đốc của công ty MCN, một công ty chuyên quản lý những người sáng tạo nội dung làm đẹp. Cao ráo và đẹp trai, Lee Tae Kyung cũng thầm thích Seo Je Yi, khiến anh trở thành một trong ba người trong mối tình tay ba với Lee Woo Bin. Oh Oh Young là một nhà sáng tạo nội dung làm đẹp khác có hơn 1 triệu người đăng ký. Cô từng là thần tượng của Seo Je Yi, nhưng cô nhanh chóng trở thành kẻ gây rối với \"bệnh ngôi sao\", đòi được đối xử đặc biệt và chất lượng nội dung của cô ngày càng giảm. Cô hiện là đối thủ của Seo Je Yi.</p>',0,0,16,0),(504,'The Archies','https://img.ophim.live/uploads/movies/the-archies-thumb.jpg','The Archies','completed','1','2g 23phút','2023','HD',NULL,'Zoya Akhtar','Agastya Nanda, Suhana Khan, Khushi Kapoor, Dot., Mihir Ahuja, Vedang Raina, Yuvraj Menda, Vinay Pathak, Alyy Khan, Suhaas Ahuja','Âm Nhạc, Chính kịch','Ấn Độ','Lấy bối cảnh Ấn Độ những năm 1960, Archie và nhóm bạn xoay xở với tình yêu, tình bạn và tương lai của Riverdale khi các nhà phát triển đe dọa phá hủy một công viên được yêu thích.',0,0,13,0),(505,'Thế Giới Muôn Màu','https://img.ophim.live/uploads/movies/the-gioi-muon-mau-thumb.jpg','Invisible Journey','completed','21','? phút/tập','2002','HD',NULL,'','','Tình Cảm','Hồng Kông','Lâm Lạc Nhi (Tuyên Huyên), một người hiền lành, xinh đẹp và tốt bụng, tuy nhiên khiết điểm về thị giác khiến cô tự ti về bản thân. Có một cuộc sống bình yên cùng gia đình trên một đảo nhỏ, Lạc Nhi luôn lạc quan, yêu đời và chấp nhận cuộc sống đơn giản đó. Và cho đến khi Trương Gia Phát xuất hiện, anh đã làm thay đổi tư tưởng, suy nghĩ của Lạc Nhi, giúp cô từ từ bước ra thế giới bên ngoài với nhiều niềm vui, lỗi buồn và cả những thử thách. Hai người rất hợp nhau và luôn dành tình cảm đặc biêt cho nhau nhưng cuối cùng Gia Phát cũng phải rời khỏi đảo. Một thời gian sau, Lạc Nhi quyết định đi tìm Gia Phát, liệu họ có được hưởng hạnh phúc trọn vẹn.',0,0,9,0),(506,'Tiểu Lý Phi Đao','https://img.ophim.live/uploads/movies/tieu-ly-phi-dao-1996-thumb.jpg','Rise Of The Taiji Master','completed','20','45 phút/tập','1996','HD',NULL,'','關禮傑, 羅樂林, 駱應鈞, 鮑方, 梁藝齡, 馬德鐘, Elaine Ho Yuen-Ying, 曾偉權, 吳詠紅, Cheng Lui','Cổ Trang, Võ Thuật','Trung Quốc, Hồng Kông','Tình yêu là gì? Một đáng đại hiệp Lý tầm Hoan, từng trãi trăm trận, hóa gian nan trong tầm tay, nhưng lại vướng vào chữ tình. Đứng nhìn người yêu đi theo nghĩa huynh mà ân hận suốt đời. Chàng coi nhẹ danh lợi, tuy ba đời làm thám hoa, nhưng vẫn bỏ công danh, bỏ gia tài, phiêu bạc đây đó. Tiếc thay người trong giang hồ không hề tự chủ, chàng hay bị lôi cuống trong ân oán giang hồ, trở mặt thành thù với nghĩa huynh. Cuộc đời vì tình vì nghĩa, khổ thay hay bị hiểu lầm...',2,0,2,0),(507,'Nghệ thuật cua đào 3','https://img.ophim.live/uploads/movies/nghe-thuat-cua-dao-3-thumb.jpg','The Romancing Star III','completed','1','1g 36ph','1989','HD',NULL,'','Phùng Thối Phàm, Vương Tinh, Trịnh Đan Thụy','Hài Hước, Kinh Điển','Trung Quốc','<p>Nỗ lực chiếm cảm tình từ người thương, bốn anh em họ nhờ một chuyên gia tình yêu truyền dạy nghệ thuật tán tỉnh.</p>',0,0,22,0),(508,'Nhập thanh vân','https://img.ophim.live/uploads/movies/nhap-thanh-van-thumb.jpg','Love in the Clouds','trailer','1','? phút/tập','2025','HD',NULL,'知竹, 落落','侯明昊, 卢昱晓, 余承恩, 鶴男, Wang Junbi','Chính kịch','Trung Quốc','<p>Tại Đại hội Thanh Vân được tổ chức hằng năm ở Hợp Hư Lục Cảnh, kẻ xuất thân tù nhân Kỷ Bá Tể (do Hầu Minh Hạo thủ vai) chỉ trong một đòn đã đánh bại Minh Ý (do Lư Dục Hiểu thủ vai), nữ chiến thần lạnh lùng đã giữ vững chuỗi chiến thắng suốt bảy năm liền. Chỉ sau một đêm, hắn trở thành ngôi sao sáng giá nhất của vực Cực Tinh.Thế rồi, Minh Ý che giấu con người thật của mình, cải trang thành vũ cơ để tiếp cận Kỷ Bá Tể. Hai người đều \"mang mặt nạ\", cuốn vào trận chiến vừa kịch tính vừa đắm say, cùng bảo vệ lẽ phải và cuối cùng đón nhận tình yêu chân thành.<br>&nbsp;</p>',1,0,27,0),(509,'Mẹ Trẻ Thích Bạn Của Con Trai','https://img.ophim.live/uploads/movies/me-tre-thich-ban-cua-con-trai-thumb.jpg','친구에게뚫린젊은엄마','completed','1','57 phút','2023','HD',NULL,'Yan-shin-su','Park Ji-Hye, Ji Sung, So Jung, Ji Won','Phim 18+','Hàn Quốc','<p>Khi bạn của con trai đến nhà chơi, người mẹ trẻ rất thích bạn của con trai từ ánh nhìn đầu tiên....</p>',0,0,8,0),(510,'Đồng Phạm Bất Đắc Dĩ','https://img.ophim.live/uploads/movies/caught-stealing-thumb.jpg','Caught Stealing','completed','1','107 Phút','2025','HD',NULL,'','','Hình Sự, Hài Hước','Âu Mỹ','<p>Phim Caught Stealing (2025) kể về Hank Thompson – cựu sao bóng chày sa sút, nay làm bartender ở New York. Khi anh nhận trông mèo giúp người h