leted','10','20 phút/tập','2025','HD',NULL,'','','Gia Đình','Âu Mỹ','<p>Blippi và Meekah đang thực hiện nhiệm vụ tìm hiểu về đủ loại công việc. Từ lái xe tải quái vật đến làm pizza, không có công việc nào là quá lớn hay quá nhỏ!</p>',0,0,14,0),(529,'Ngôi Nhà Mật Ngọt','https://img.ophim.live/uploads/movies/ngoi-nha-mat-ngot-thumb.jpg','At Home With Love','completed','20','45 phút/tập','2006','HD',NULL,'','蒙嘉慧, 譚小環, 胡定欣, 曹永廉, 唐詩詠, 吳啟華, 鍾景輝, 吳家樂, 許紹雄, 李天翔','Chính kịch','Trung Quốc, Âu Mỹ, Hồng Kông','<p>At Home With Love là bộ phim truyền hình hiện đại của TVB phát sóng vào tháng 10 năm 2006.</p>',0,0,24,0),(530,'Percy Jackson & Kẻ Cắp Tia Chớp','https://img.ophim.live/uploads/movies/percy-jackson-ke-cap-tia-chop-thumb.jpg','Percy Jackson & the Olympians: The Lightning Thief','completed','1','Đang cập nhật','2010','HD',NULL,'','','Viễn Tưởng, Thần Thoại, Gia Đình','Âu Mỹ, Anh, Canada','<p>Khi tia sét của anh ta bị đánh cắp, Zeus buộc tội con trai của Poseidon Percy Jackson và đưa cho con trai của Poseidon mười bốn ngày để trả lại, nếu không anh ta sẽ bắt đầu một cuộc chiến giữa các vị thần. Trong khi đó, thiếu niên, Percy, chứng khó đọc và có ADHD đang đến thăm Bảo tàng Metropolitan of Art và bị Fury ngụy trang tấn công trong giáo viên của mình. Grover người bạn tốt nhất về mặt vật lý của anh ta cho thấy Percy là một Demigod và anh ta là người bảo vệ và giáo viên của ông Mr Brunner cho anh ta một cây bút nói với anh ta rằng đó là một vũ khí mạnh mẽ. Họ đến nhà của Percy và cùng với mẹ Sally họ lái xe đến một nửa máu trại. Tuy nhiên, Sally bị tấn công bởi một minotaur và biến mất trước khi Percy có thể giúp đỡ cô. Trong trại, Percy kết bạn với Annabeth tuyệt đẹp; Khi chúng bị Hades tấn công, những người muốn ánh sáng cho chính mình, Percy phát hiện ra rằng mẹ anh đang ở trong thế giới ngầm với Hades. Percy quyết định đi du lịch trong một nhiệm vụ nguy hiểm để lấy lại tia sét và cứu mẹ mình. Grover và Annabeth tham gia cùng anh ta và Luke đưa ra một lá chắn mạnh mẽ của riêng mình để bảo vệ Percy. Họ sẽ có thể thành công?</p>',0,0,20,0),(531,'Kinh Hoa Xuân Mộng','https://img.ophim.live/uploads/movies/kinh-hoa-xuan-mong-thumb.jpg','Yesterday\'s Glitter','completed','25','45 phút/tập','1980','HD',NULL,'','劉松仁, 汪明荃, 鮑方, 譚炳文, 江毅, 廖偉雄, 湯鎮業, Tang Pik-Wan, 韓馬利, 陳嘉儀','Tâm Lý','Trung Quốc, Hồng Kông','<p>Kinh Hoa Xuân Mộng (Yesterday\'s Glitter) 1980</p>',0,0,10,0),(532,'Jon Batiste: Bản giao hưởng Hoa Kỳ','https://img.ophim.live/uploads/movies/jon-batiste-ban-giao-huong-hoa-ky-thumb.jpg','American Symphony','completed','1','1g 43phút','2023','HD',NULL,'Matthew Heineman','Jon Batiste, Suleika Jaouad','Âm Nhạc, Tài Liệu','Âu Mỹ','Trong bộ phim tài liệu vô cùng sâu sắc này, nhạc sĩ Jon Batiste nỗ lực sáng tác một bản giao hưởng khi vợ ông, nhà văn Suleika Jaouad, đang điều trị ung thư.',5,0,13,0),(533,'Đồng thoại mùa thu','https://img.ophim.live/uploads/movies/dong-thoai-mua-thu-thumb.jpg','An Autumn\'s Tale','completed','1','1g 38ph','1987','HD',NULL,'','Châu Nhuận Phát, Chung Sở Hồng, Trần Bách Cường','Chính kịch, Kinh Điển','Trung Quốc','<p>Lee Kay – người gốc Hong Kong – chuyển đến khu người Hoa ở thành phố New York khi đang học đại học. Khi cô biết được bạn trai đang lừa dối mình, người anh họ đã an ủi cô.</p>',0,0,22,0),(534,'Tình Yêu Bị Che Giấu','https://img.ophim.live/uploads/movies/tinh-yeu-bi-che-giau-thumb.jpg','Hidden Love','completed','23','11 phút/tập','2025','HD',NULL,'','文淵, 卢梦琳, Shi Nan, 郭祥','Chính kịch','Trung Quốc','<p>Vào thời kỳ đầu của Trung Hoa Dân Quốc, nghệ sĩ đường phố Thư Yến bị bắt cóc và tỉnh dậy trong thân phận là vợ của chủ tịch phòng thương mại giàu có, Nghiêm Kỳ Chiếu. Được bao quanh bởi sự xa hoa và tình cảm, cô bắt đầu đặt câu hỏi về sự thật đằng sau thân phận mới của mình.</p>',0,0,21,0),(535,'Beauty in Black (Phần 2)','https://img.ophim.live/uploads/movies/beauty-in-black-phan-2-thumb.jpg','Beauty in Black (Season 2)','trailer','1','56 phút/tập','2025','HD',NULL,'','','Chính kịch','Âu Mỹ','Số phận của một