ngờ, khi Weikang trở thành một đối thủ đáng gờm. Bộ phim khai thác chủ đề về tình bạn, tình yêu và công lý khi Điền đứng trước một lựa chọn khó khăn.</p>',0,0,9,0),(539,'Vân Hách Dao','https://img.ophim.live/uploads/movies/van-hach-dao-thumb.jpg','The Antidote to Love','completed','24','12 phút/tập','2025','HD',NULL,'','','Chính kịch, Cổ Trang','Trung Quốc','Thời kỳ Đại Vị, xã tắc hỗn loạn, Ninh vương Triệu Hách dẫn binh xuất trận, tính mạng ngàn cân treo sợi tóc. Thái bốc thự phụng chỉ, dâng dược nô giúp hắn giải độc. Dược nô Nhất Cửu che dấu thân phận là thánh nữ Nguyệt tộc, tự lấy mình làm mồi nhử để dấn thân vào nguy hiểm. Cuối cùng, Triệu Hách và Vân Dao cùng nhau làm sáng tỏ chân tướng về vụ thảm sát Nguyệt tộc, trải qua sinh tử, giữ vững tâm niệm ban đầu, bảo vệ thiên hạ thái bình.',0,0,2,0),(540,'Tiếng Vọng Của Người Sống Sót: Thảm Án Tại Hàn Quốc','https://img.ophim.live/uploads/movies/tieng-vong-cua-nguoi-song-sot-tham-an-tai-han-quoc-thumb.jpg','The Echoes of Survivors: Inside Korea\'s Tragedies','completed','8','50 phút/tập','2025','HD',NULL,'','','Tài Liệu','Hàn Quốc','<p>Từ các trại giam tàn bạo đến các giáo phái lợi dụng đức tin, những người sống sót đã phá vỡ sự im lặng để tiết lộ những thảm kịch đau lòng mà ít ai tin là có thể xảy ra ở Hàn Quốc.</p>',0,0,6,0),(541,'24 Hours to D-Day','https://img.ophim.live/uploads/movies/24-hours-to-d-day-thumb.jpg','24 Hours to D-Day','completed','1','0 Phút','2024','HD',NULL,'Monroe Robertson','Eric Roberts, Nick Annunziata, Chris Cleveland, Andrew Colford','Chiến Tranh, Chính kịch','Âu Mỹ','Just hours before the D-Day invasion of Normandy, a team of American Special Forces parachutes into German-occupied France. Their mission: avoid capture and activate critical drop zone beacons to guide the 101st Airborne’s assault.',0,0,3,0),(542,'The Story of Bihyung: Enchanted Master of the Goblin','https://img.ophim.live/uploads/movies/the-story-of-bihyung-enchanted-master-of-the-goblin-thumb.jpg','The Story of Bihyung: Enchanted Master of the Goblin','ongoing','2','22 phút/tập','2025','HD',NULL,'','Lee Cha-min, Kang Chan-woo, Nam Taek-jun, Hwang Jae-wook','Viễn Tưởng, Khoa Học, Chính kịch','Hàn Quốc','<p>Ngày xửa ngày xưa, vào thời Silla, Yêu Tinh Bihyung đã ra đời, được muôn loài kính sợ. Tại Seoul thời hiện đại, chàng trai trẻ ngây thơ Geumbok, đang theo đuổi ước mơ trở thành diễn viên, đã trở thành nạn nhân của một vụ lừa đảo và trở thành người vô gia cư. Đúng lúc rắc rối chồng chất, Bihyung xuất hiện, dẫn đến một cuộc sống chung bất ngờ. Nhưng Geumbok lại ẩn chứa một sức mạnh bí ẩn và một mối liên kết định mệnh với Bihyung. Khi tình yêu và xung đột đan xen, liệu họ có thể phá vỡ lời nguyền ngàn năm?</p>',1,0,4,0),(543,'The History of Mossad','https://img.ophim.live/uploads/movies/the-history-of-mossad-thumb.jpg','History of The Mossad','completed','3','53 phút/tập','2023','HD',NULL,'Ina Kessebohm','Anne Moll','Tài Liệu','Âu Mỹ, Đức','The Israeli foreign intelligence agency was founded to guarantee the ongoing existence of Israel. This series takes us behind-the-scenes.',0,0,24,0),(544,'Loro 1','https://img.ophim.live/uploads/movies/loro-1-thumb.jpg','Loro 1','completed','1','Đang cập nhật','2018','HD',NULL,'','','Tâm Lý, Thần Thoại','Pháp, Ý','<p>Một bộ phim về cuộc sống của Silvio Berlusconi.</p>',0,0,20,0),(545,'Trạng Sư Hồ Đồ','https://img.ophim.live/uploads/movies/trang-su-ho-do-thumb.jpg','A Case of Misadventure','completed','20','45 phút/tập','2002','HD',NULL,'','蘇永康, 陳慧珊, 關菁, 蔣志光, 汪琳, 歐錦棠, 郭鋒, 郭政鴻, 胡楓, 陳狄克','Tâm Lý','Trung Quốc, Hồng Kông','<p>Trạng Sư Hồ Đồ (A Case Of Misadventure) 2002</p>',0,0,10,0),(546,'Robbie Williams Live at Knebworth','https://img.ophim.live/uploads/movies/robbie-williams-live-at-knebworth-thumb.jpg','Robbie Williams Live at Knebworth','completed','1','1g 16phút','2003','HD',NULL,'Hamish Hamilton','Robbie Williams','Âm Nhạc','Anh','Ghi lại ba ngày phá kỷ lục của Robbie Williams tại Lễ hội Knebworth năm 2003, bộ phim hòa nhạc này có cả các bản nhạc