him.live/uploads/movies/luc-tieu-phung-va-hoa-man-lau-thumb.jpg','Detectives And Doctors','completed','30','45 phút/tập','2015','HD',NULL,'潘文傑','张晓龙, 林峯, 斕曦, 张檬','Võ Thuật, Cổ Trang','Trung Quốc','The series follows the plot from the first novel, “The Golden Bird Dynasty” (大金鵬王), as Lu Xiao Feng (Raymond Lam) investigates the Emperor’s mysterious illness and meets with a lost princess Shang Guan Dan Feng (Lan Xi) who tells him that he has to find three officials of her old kingdom to find the answer. In his quest, Lu befriends a blind doctor Hua Man Lou (Zhang Xiao Long) and a swordsman Xi Men Chui Xue (Shaun Tam), and they then work together to unveil the mystery.',0,0,2,0),(552,'Cuộc Đua Giảm Cân: Sự Thật Về The Biggest Loser','https://img.ophim.live/uploads/movies/cuoc-dua-giam-can-su-that-ve-the-biggest-loser-thumb.jpg','Fit for TV: The Reality of the Biggest Loser','completed','3','124 phút/tập','2025','HD',NULL,'','Alison Sweeney, Bob Harper, Jillian Michaels, Rob Huizenga, J.D. Roth, Caroline Rhea','Tài Liệu','Âu Mỹ','<p>Trong loạt phim tài liệu gây tranh cãi này, các thí sinh và nhà sản xuất từng tham gia tiết lộ sự thật khắc nghiệt và hậu quả nặng nề đằng sau thành công của \"The Biggest Loser\".</p>',0,0,6,0),(553,'Shoah','https://img.ophim.live/uploads/movies/shoah-thumb.jpg','Shoah','completed','1','293 phút/tập','1985','HD',NULL,'','','Tài Liệu','Âu Mỹ','Director Claude Lanzmann spent 11 years on this sprawling documentary about the Holocaust, conducting his own interviews and refusing to use a single frame of archival footage.  This epic documentary changed the way we think about the Holocaust. Featuring interviews with survivors, bystanders, and perpetrators from across Europe, mostly Poland and Germany, Shoah is drawn from over 300 hours of contemporary conversations with these witnesses, along with footage of overgrown sites of unspeakable horrors, including the concentration camp at Auschwitz.\n\nThe monumental film grew out of Lanzmann\'s concern that the genocide perpetrated only 40 years earlier was already being forgotten. In response, he relied entirely on accounts from witnesses, rather than historical footage or reenactments, sometimes resorting to hidden cameras or other deceptions to coax stories and memories from those with whom he spoke.',0,0,24,0),(554,'Khinh Công','https://img.ophim.live/uploads/movies/khinh-cong-2022-thumb.jpg','Go with the Float','completed','25','43 phút/tập','2022','HD',NULL,'黃偉聲','黎耀祥, 蔣祖曼, 龔慈恩, 朱晨麗, 朱敏瀚, 鄭俊弘, 楊卓娜, 韋家雄, Jimmy Au Shui-Wai, 鄭子誠','Hành Động, Phiêu Lưu, Gia Đình, Chính kịch','Trung Quốc, Hồng Kông','Một diễn viên nổi tiếng quyết tâm vượt qua chướng ngại tâm lý để luyện tập khinh công trở lại, viết tiếp đam mê của mình, cũng là để làm tròn di nguyện của vợ.',0,0,14,0),(555,'Desert Flower','https://img.ophim.live/uploads/movies/desert-flower-thumb.jpg','Desert Flower','completed','1','Đang cập nhật','2009','HD',NULL,'','','Tâm Lý, Thần Thoại','Anh, Pháp, Đức','<p>Waris Dirie, sinh năm 1965 tại Somalia, chạy trốn lúc 13 tuổi khi được bán là người vợ thứ 4. Cô ấy là người giúp việc tại Đại sứ quán Somalian ở London, sau đó là McDonald, nơi cô ấy được phát hiện và trở thành người mẫu hàng đầu quốc tế. 1997, cô ấy lên tiếng chống lại sự cắt xén bộ phận sinh dục nữ.</p>',0,0,20,0),(556,'Đô Thị Kinh Hoàng','https://img.ophim.live/uploads/movies/do-thi-kinh-hoang-thumb.jpg','Passion Among Us','completed','8','87 phút/tập','1993','HD',NULL,'','黎海珊, 尹揚明, Ng Wai-Kwok, 吳國敬, Elizabeth Lee Mei-Fung, 李國麟, 林其欣, 林保怡, 林偉, 宣萱','Tâm Lý','Trung Quốc, Hồng Kông','<p>Đô Thị Kinh Hoàng</p>',0,0,10,0),(557,'Robbie Williams','https://img.ophim.live/uploads/movies/robbie-williams-thumb.jpg','Robbie Williams','completed','4','53 phút/tập','2023','HD',NULL,'Joe Pearlman','Robbie Williams','Âm Nhạc, Tài Liệu','Anh','Sau 25 năm sự nghiệp solo phá kỷ lục, Robbie nhìn lại bản thân lúc trẻ và suy ngẫm về cuộc đời luôn được chú ý.',0,0,13,0),(558,'Nhân viên bán thời gian phục vụ khách hàng','https