hút','2024','HD',NULL,'Ethan Coen','Margaret Qualley, Geraldine Viswanathan, Beanie Feldstein, Joey Slotnick, C.J. Wilson, Colman Domingo, Pedro Pascal, Bill Camp, Matt Damon, Connie Jackson','Hài Hước, Hình Sự','Âu Mỹ, Anh','Jamie, an uninhibited free spirit bemoaning yet another breakup with a girlfriend, and her demure friend Marian desperately needs to loosen up. In search of a fresh start, the two embark on an impromptu road trip to Tallahassee, but things quickly go awry when they cross paths with a group of inept criminals along the way.',0,0,17,0),(563,'Tàng Hải Truyện','https://img.ophim.live/uploads/movies/tang-hai-truyen-thumb.jpg','Legend of Zang Hai','completed','40','40 phút/tập','2025','HD',NULL,'郑晓龙','肖战, 張婧儀, 周奇, 黄觉, Yu Nan, 陳妍希, 张国强, 喬振宇, Tian Xiaojie, Sha Baoliang','Chính kịch, Cổ Trang','Trung Quốc','\"Tàng Hải Truyện\" kể về con trai của quan Giám chính Khâm Thiên Giám Khoái Đạc, mang mối thù sâu như biển máu. Sau mười năm khổ luyện, anh lấy tên là Tàng Hải, vào kinh tìm kiếm sự thật, cuối cùng rửa được mối hận, trừng trị kẻ ác, bảo vệ lẽ phải và kiên trì theo đuổi công lý.',0,0,2,0),(564,'Thái Ngạc và Tiểu Phụng Tiên','https://img.ophim.live/uploads/movies/thai-ngac-va-tieu-phung-tien-2009-thumb.jpg','In the Chamber of Bliss','completed','20','45 phút/tập','2009','HD',NULL,'','馬國明, 梁靖琪, 劉松仁, 周海媚, 林嘉華, 田蕊妮, 湯盈盈, 羅樂林, Oscar Chan Yat-Tin, 麥子樂','Tình Cảm','Trung Quốc, Hồng Kông','<p>Thống đốc quân sự Choi Ngok (Lưu Đức Hoa) đã cố gắng lật đổ chính quyền của Nguyên Tây Hội. Để tạo điều kiện cho kế hoạch gây ra một cuộc nổi dậy ở Vân Nam, ông ta giả vờ quan hệ với kỹ nữ rất được săn đón Trương Phong Uyển (Châu Hội Mỹ), biệt danh là Tiểu Phụng Tiên, để tránh bị phát hiện. Nguyên Tây Hội (Law Lok Lam), người nghi ngờ Ngok, đã cử Tham mưu trưởng Mok Yik Tin (Lam Ka Wah) đi theo dõi anh ta. Sau đó, ông ta thậm chí còn dụ dỗ vợ của Ngok là Pak Sz Ting (Tin Yui Nei) đến Bắc Kinh, hy vọng rằng điều này sẽ buộc Ngok phải tuyên thệ trung thành với chính phủ. Để đảm bảo thành công của phong trào cách mạng, Ngok tiếp tục ngoại tình với Wan như một vỏ bọc ngụy trang, mà không nhận ra rằng cô đã thực sự yêu anh ta. Wan sẵn sàng từ bỏ tất cả chỉ để được ở bên Ngok trong khi anh ta vẫn lạnh lùng và xa cách với cô.</p>',0,0,9,0),(565,'Bài ca sau song sắt','https://img.ophim.live/uploads/movies/bai-ca-sau-song-sat-thumb.jpg','Songs from the Hole','completed','1','106 Phút','2024','HD',NULL,'Contessa Gayles','','Tài Liệu, Chính kịch','Âu Mỹ','<p>Một nhạc sĩ bị giam cầm đấu tranh để chữa lành và tìm lại sự bình yên khi anh trưởng thành trong hành trình âm nhạc - phim tài liệu được sáng tác sau song sắt.</p>',0,0,6,0),(566,'Lời Tạm Biệt Dễ Nghe','https://img.ophim.live/uploads/movies/loi-tam-biet-de-nghe-thumb.jpg','The Shore of Life','completed','1','110 Phút','2025','HD',NULL,'Zhang Chi','鍾欣潼, 林棟甫, Tao Huimin, 侯桐江, 陈依莎','Gia Đình','Trung Quốc','<p>Sau khi mẹ mất, mối quan hệ giữa cô bé Ying Nuo và cha trở nên xa cách và căng thẳng. Nhiều năm sau, cô trở về quê hương cùng cô con gái năm tuổi, Diu Diu, với hy vọng gửi Diu Diu cho cha để cô bé có thể ra nước ngoài tham gia thi đấu. Tuy nhiên, cha cô đã từ chối cô vì nhiều lý do, buộc Ying Nuo phải tạm thời ở lại quê nhà. Tuy nhiên, đằng sau cuộc sống cộng đồng ấm áp và hòa thuận, cả cha và con gái đều có những nỗi lo riêng… Bộ phim lấy ý tưởng “chăm sóc giảm nhẹ” làm góc nhìn khởi đầu để khắc họa nỗi đau và sự ấm áp mà một gia đình bình thường trải qua khi đối mặt với sự chia ly và mất mát.</p>',0,0,14,0),(567,'Anaconda: Khu Rừng Nguyền Rủa','https://img.ophim.live/uploads/movies/狂蟒之灾-thumb.jpg','Anaconda','completed','1','84 Phút','2024','HD',NULL,'','','Phiêu Lưu, Kinh Dị','Trung Quốc','A struggling circus crew gets deceived by its former partner, as it embarks on a tour in Thailand. During the journey through a Southeast Asian rainforest, they encounter attacks by a giant python. They meet a mysterious man named Jeff who offers to help, but they soon realize he\'s a poacher. As they search for Jeff\'s boat, they face life-and-death struggles with the python and Jeff himself.',0,0,25,0),(568,'Duyên Vị Tình Nồng','https://img.ophim.live/uploads/movies/duyen-vi-tinh-nong-thumb.jpg','My Love in the Countryside','completed','24','47 phút/tập','2024','HD',NULL,'Saratswadee Wongsomphet','วชิรวิชญ์ ไพศาลกุลวงศ์, Thunyaphat Phatrathinchaicherin, ณิชาภัทร ฉัตรชัยพลรัตน์, นิชคุณ ขจรบริรักษ์, ภัสรนันท์ อัษฎมงคล, Boonthong Hanchanang, Sueangsuda Lawanprasert, มินรญา ตั้งสืบวงศ์, Chamaiporn Sitthiworanang, จตุรงค์ พลบูรณ์','Hài Hước, Chính kịch','Thái Lan','Saisamorn Suaisamoe, một diễn viên hàng đầu xuất thân từ một gia đình giàu có, được giám đốc dự án mới của cô cử đến sống ở Lat Chado ở Ayutthaya và tìm hiểu về tình yêu. Tại đây, cô phải chuyển đến nhà của Marasri, một người phụ nữ mồm mép và đang bị theo dõi bởi một người tên là Mha.',1,0,16,0),(569,'Erin và Aaron','https://img.ophim.live/uploads/movies/erin-va-aaron-thumb.jpg','Erin & Aaron','completed','13','26phút/tập','2023','HD',NULL,'','Ava Ro, Jensen Gering, Pyper Braun, David S. Jung, Larisa Oleynik','Hài Hước, Âm Nhạc','Âu Mỹ','Tên của Erin và Aaron nghe có vẻ giống nhau, nhưng họ lại hết sức đối lập. Thông qua âm nhạc, hai chị em kế mới này học cách chung sống hòa thuận.',0,0,13,0),(570,'Lúc Tình Yêu Đến','https://img.ophim.live/uploads/movies/luc-tinh-yeu-den-thumb.jpg','A Time of Love','completed','4','60 phút/tập','2014','HD',NULL,'','','Tâm Lý','Trung Quốc, Hồng Kông','<p>Bộ phim ca nhạc dài bốn tiếng với chủ đề “Thời khắc yêu thương” sẽ được quay tại Tokyo, Seoul, Singapore và Kuala Lumpur với sự kết hợp của các nghệ sĩ tài năng trong khu vực Châu Á - Thái Bình Dương, bao gồm Vương Tổ Lam (Hồng Kông), Vương Bân (Hồng Kông), Watanabe Naomi (Nhật Bản) và Viêm Á Luân (Đài Loan) của loạt phim Nhật Bản, Yeon Jung Hoon (Hàn Quốc) và Chung Gia Hân (Hồng Kông) của loạt phim Hàn Quốc, Mã Quốc Minh (Hồng Kông) và Xa Thi Mạn (Hồng Kông) của loạt phim Singapore, Vương Tuấn Khải (Đài Loan), Từ Hy Viên (Hồng Kông) và Văn Đức (Đài Loan) của loạt phim Malaysia.</p>',1,0,10,0),(571,'Duy Nhất trong Tòa Nhà (Phần 5)','https://img.ophim.live/uploads/movies/duy-nhat-trong-toa-nha-phan-5-thumb.jpg','Only Murders in the Building','ongoing','6','37 phút/tập','2025','HD',NULL,'','Steve Martin, Martin Short, Selena Gomez, Michael Cyril Creighton','Hài Hước, Hình Sự, Bí ẩn, Chính kịch','Âu Mỹ','<p>Phần 5 tiếp tục với bộ ba nhân vật chính quen thuộc đầy hài hước và kỳ quặc — Charles, Oliver và Mabel — khi họ lại một lần nữa bị cuốn vào một vụ án mạng bí ẩn ngay tại Arconia. Lần này, cái chết tưởng chừng vô tình của một người thân quen, một cái chết bất ngờ mở ra chuỗi manh mối rắc rối, kéo họ vào hành trình điều tra vừa hài hước vừa căng thẳng, đẩy cả ba vào hành trình điều tra gay cấn và kịch tính hơn bao giờ hết.&nbsp;</p><p>Nếu bạn đã yêu mến series này với tinh thần đầy hài hước, pha trộn giữa bí ẩn, âm mưu, nhân vật kỳ cục, vừa châm biếm đời sống và văn hóa thành phố, thì mùa 5 hứa hẹn giữ được tinh thần ấy, đồng thời mở rộng quy mô và độ phức tạp của thử thách lần này khi có thêm nhiều nhân vật khách mời mới xuất hiện, gồm những người trong giới giàu có, các nhân vật mafia, và những người có ảnh hưởng trong xã hội New York.</p>',0,0,7,0),(572,'Cô gái thuê nhà trọ','https://img.ophim.live/uploads/movies/co-gai-thue-nha-tro-thumb.jpg','하숙집 딸내미들','completed','1','90 phút','2023','HD',NULL,'Yan-shin-su','Park Ji-Hye, Ji Sung, So Jung, Ji Won','Phim 18+','Hàn Quốc','<p>Một cô gái mới chuyển vào sinh sống khu nhà chung, khi tìm được công việc bán thời gian mới, khiến cô kiếm được rất nhiều tiền nhờ công việc này nên mới....</p>',0,0,8,0),(573,'Vượt Mọi Địa Hình','https://img.ophim.live/uploads/movies/vuot-moi-dia-hinh-thumb.jpg','Off Road','completed','6','35 phút/tập','2025','HD',NULL,'','','Thể Thao','Quốc Gia Khác','<p>Hai diễn viên Lior Raz (\"Hỗn loạn\") và Rotem Sela (\"Đứa con và người thứ ba\") khám phá văn hóa và vẻ đẹp của Trung Á – một hành trình thử thách tình bạn giữa họ.</p>',0,0,11,0),(574,'Tiếng Gầm Kallang','https://img.ophim.live/uploads/movies/tieng-gam-kallang-thumb.jpg','Kallang Roar The Movie','completed','1','84 Phút','2008','HD',NULL,'Cheng Ding An','Lim Kay Siu, Randall Tan','Thể Thao','Nga, Singapore','<p>Được trang bị những cầu thủ huyền thoại như Quah Kim Song, Rajagopal, Samad, Mat Noh, Dollah Kassim, Chú Choo bắt đầu một hành trình bất khả thi để nhắc nhở những người đồng hương của mình về ý nghĩa của việc trở thành một người Singapore. Đây là câu chuyện về sự kiên cường, ý chí không thể phá vỡ và niềm đam mê sâu sắc, cuộc đấu tranh không ngừng nghỉ với xã hội và bản thân, để cuối cùng đạt được vinh quang cho đất nước thông qua bóng đá và vô tình tạo ra một di sản, được mọi người biết đến với cái tên \'Tiếng gầm Kallang\', nhưng cuối cùng lại chẳng có ý nghĩa gì với chính ông.</p>',0,0,11,0),(575,'Gặp Người Khổng Lồ','https://img.ophim.live/uploads/movies/gap-nguoi-khong-lo-thumb.jpg','Meeting the Giant','completed','1','104 Phút','2014','HD',NULL,'郑斌辉','Na Guangzi, Ian Fang, 朱厚任','Thể Thao','Nga, Singapore','<p>“Meeting the Giant” kể về cuộc gặp gỡ của một thiếu niên với một nhóm cầu thủ bóng rổ trẻ người Trung Quốc được đưa đến Singapore và được đào tạo để chơi để giành chiến thắng. Sau sự oán giận ban đầu, anh học cách nhìn xa hơn vẻ bề ngoài hời hợt của quốc tịch các cầu thủ và hiểu được những đấu tranh riêng tư của họ cũng như những hy sinh mà gia đình họ phải thực hiện để mang đến cho họ cơ hội có một cuộc sống tốt đẹp hơn. Khi các cầu thủ trẻ dần hòa nhập và thích nghi với văn hóa địa phương, thiếu niên hình thành mối quan hệ gắn bó chặt chẽ với họ.</p>',0,0,11,0),(576,'Vũ Điệu Patin','https://img.ophim.live/uploads/movies/vu-dieu-patin-thumb.jpg','Roller Jam','completed','6','50 phút/tập','2024','HD',NULL,'','Jordin Sparks, Johnny Weir, Terrell Ferguson','Thể Thao','Âu Mỹ','<p>Các đội trượt patin giỏi nhất trên khắp nước Mỹ thi đấu qua nhiều thập kỷ để có cơ hội giành được giải thưởng 150.000 đô