lớn.',0,0,11,0),(598,'Triều Bái Võ Đang','https://img.ophim.live/uploads/movies/trieu-bai-vo-dang-thumb.jpg','Wudang Rules','completed','20','45 phút/tập','2015','HD',NULL,'','楊茜堯, 錢小豪, 元秋, 電影, 梁靖琪, 元華, 郭政鴻, 陳自瑤, 康華','Võ Thuật','Trung Quốc, Hồng Kông','After a setback in life, former Hong Kong undercover detective Pau Kai Chung heads to the Wudang Mountains in Hubei, China to get away from life. At Wudang he reconnects with his former martial arts senior Mo Yee Shan, who now operates an inn and martial arts school in the Wudang Mountains. She also takes in a man named Ho Ching Tung with a mysterious past. Kai Chung takes up a job as a chef at Yee Shan\'s inn. All is peaceful until a group of martial art students lead by Yee Shan\'s daughter Lok Yeung arrives. Lok Yeung and Kai Chung had previously met in Hong Kong, their encounter in Wudang brings back painful memories for Kai Chung...',0,0,18,0),(599,'Ngon Từng Ngõ Ngách','https://img.ophim.live/uploads/movies/ngon-tung-ngo-ngach-thumb.jpg','Delicious in Every Alley','completed','3','25 phút/tập','2022','HD',NULL,'Nguyễn Quang Dũng','','Phiêu Lưu','Việt Nam','Ngon Từng Ngõ Ngách là bộ phim về ẩm thực của đạo diễn Nguyễn Quang Dũng. Bộ phim thông qua chất liệu là những món ăn, ẩm thực đặc trưng của một vùng đất để kể về con người nói riêng và cả văn hoá của một vùng đất nói chung. Những chia sẻ đặc biệt của mỗi nhân vật sẽ giúp người xem nhìn thấy những thay đổi của cả một vùng đất. Qua đó, khán giả có thể cảm nhận rõ những thành phố du lịch dưới một lăng kính thật khác.',0,0,12,0),(600,'Mãi mãi','https://img.ophim.live/uploads/movies/mai-mai-thumb.jpg','Forever','completed','1','1g 43phút','2023','HD',NULL,'Anders Hazelius','Flutra Çela, Judith Sigfridsson, Agnes Lindström Bolmgren, Eleftheria Gerofoka, Mustapha Aarab, Joel Forslund Nylén','Thể Thao, Chính kịch','Thụy Điển','Mối liên kết từng không thể phá vỡ giữa các tín đồ bóng đá tuổi teen Mila và Kia bắt đầu trở nên căng thẳng khi cựu tuyển thủ chuyên nghiệp kh