t the Winter Cup. Despite struggling with Akashi&#39;s Emperor Eye that sees through everything, Midorima and Takao fight back with their consecutive plays, and the whole Shutoku team bites back at Rakuzan. However, it doesn&#39;t take long before Akashi crushes all of their hopes. It is decided that the finals will be fought between Seirin and Rakuzan. Kagami immediately enters the Zone as soon as the match starts, but it is no match for Akashi. Facing an extreme difference in ability against Rakuzan, Seirin loses their hope a number of times during the match. However, Kuroko doesn&#39;t give up, and continues to strongly fight against Akashi.',1,0,11,0),(608,'Anh Hùng Thiếu Lâm Tự','https://img.ophim.live/uploads/movies/anh-hung-thieu-lam-tu-thumb.jpg','The Young Heroes Of Shaolin','completed','20','41 phút/tập','1981','HD',NULL,'','苗僑偉, 石修, 董瑋, Susanna Au-Yeung Pui-San','Võ Thuật','Trung Quốc, Hồng Kông','<p>Anh Hùng Thiếu Lâm Tự (The Young Heroes Of Shaolin)</p>',0,0,18,0),(609,'Tiêu điểm Giải Mùa đông - Ánh dương và Bóng rổ','https://img.ophim.live/uploads/movies/tieu-diem-giai-mua-dong-anh-duong-va-bong-ro-thumb.jpg','Kuroko no Basket Movie 1: Winter Cup - Kage to Hikari','completed','1','90 phút/tập','2016','HD',NULL,'','','Thể Thao, Học Đường','Nhật Bản','First of three compilation films of the Kuroko no Basket franchise.\n\nThe first match of Seirin vs Touou Gakuen at the Winter Cup. Seirin swore they would get revenge from the Inter-High, but Aomine&#39;s talents grew even stronger and Kuroko&#39;s new move is seen through. After having all of his efforts denied by his former light, Aomine, Kuroko is benched and faces humiliation. Seeing his partner like this, something almost beast-like awakens within Kagami, and he challenges Aomine. Aomine had lost almost all sense of fighting, until he and Kagami both intensely face off with each other as they go into the Zone.',0,0,11,0),(610,'Bóng rổ của Kuroko - Trận đấu cuối cùng','https://img.ophim.live/uploads/movies/kurokos-basketball-the-movie-last-game-thumb.jpg','Kuroko no Basket Movie 4: Last Game','completed','1','90 phút/tập','2017','HD',NULL,'','','Thể Thao, Học Đường','Nhật Bản','Hailing from America, Jabberwock—a street basketball team with skills comparable to those of the NBA—has come to Japan to play an exhibition match against Strky, a team of former third-year students who once played in the Interhigh and Winter Cup. However, due to the vast difference in skill, Jabberwock easily wins. Their captain, Nash Gold Jr., mocks the basketball style of all players in Japan by comparing them to monkeys.\n\nInfuriated by the nasty comment, Kagetora Aida challenges them to a revenge match. Because of pride and the belief that the results will be no different, Nash accepts the challenge. Kagetora then assembles Vorpal Swords, a team composed of the Generation of Miracles, including Kuroko Tetsuya and Kagami Taiga, for they are the only ones who stand a chance against a foe that seems unbeatable from every angle.',0,0,11,0),(611,'Bí mật giới thể thao: Bê bối Balco','https://img.ophim.live/uploads/movies/bi-mat-gioi-the-thao-be-boi-balco-thumb.jpg','Untold: Hall of Shame','completed','1','1g 18phút','2023','HD',NULL,'Bryan Storkel','','Thể Thao, Tài Liệu','Âu Mỹ','Tìm hiểu một trong những bê bối steroid lớn nhất của thể thao qua cuộc phỏng vấn với người đứng đầu phòng thí nghiệm BALCO, vận động viên bị nghi ngờ sử dụng chất kích thích, v.v.',0,0,11,0),(612,'Hanma Baki (Phần 2)','https://img.ophim.live/uploads/movies/hanma-baki-phan-2-thumb.jpg','Baki Hanma (Season 2)','completed','27','25 phút/tập','2023','HD',NULL,'','Shimazaki Nobunaga, Otsuka Akio, Hochu Otsuka, Nojima Kenji, Koyama Mami, Hashi Takaya, Han Megumi, Genda Tessho, Mamiya Yasuhiro, Yamadera Koichi, Ono Kensho, Tanaka Ryouichi, Asou Tomohisa, Kusunoki Taiten, Okawa Toru, Saito Jiro, Ehara Masashi, Furuya Toru','Hành Động, Thể Thao','Nhật Bản','<p>Các nhà khoa học phát hiện ra một người đàn ông thời tiền sử vô cùng mạnh mẽ, từng săn khủng long kỷ Jura và được bảo tồn hoàn hảo. Baki nóng lòng muốn chiến đấu với anh ta.</p>',0,0,11,0),(613,'Hiện Trường Vụ Án Số 0','https://img.ophim.live/uploads/movies/crime-scene-zero-thumb.jpg','Crime Scene Zero','ongoing','8','83 phút/tập','2025','HD',NULL,'윤현준, Hwang Seul-woo','박지윤, 장동민, 김지훈, 안유진, 민희','Hình Sự','Hàn Quốc','<p>Crime Scene Zero vẫn trung thành với trò chơi nhập vai tại hiện trường vụ án. Mỗi người chơi sẽ hóa thân thành nhân vật có câu chuyện nền riêng biệt, đồng thời đảm nhận vai trò thám tử hoặc nghi phạm. Thông qua các manh mối và quá trình tranh luận, người chơi phải cùng nhau tìm ra tội phạm ẩn náu trong nhóm.</p><p>&nbsp;</p>',0,0,17,0),(614,'Ông Trùm Vùng Tulsa (Phần 3)','https://img.ophim.live/uploads/movies/ong-trum-vung-tulsa-phan-3-thumb.jpg','Tulsa King','ongoing','3','47 phút/tập','2025','HD',NULL,'','Sylvester Stallone, Martin Starr, Jay Will, Annabella Sciorra, Neal McDonough, Frank Grillo, Garrett Hedlund, Dana Delany, Robert Patrick, Beau Knapp','Hài Hước, Hình Sự, Chính kịch, Hành Động','Âu Mỹ','<p>Phần 3 của loạt phim Tulsa King tiếp tục câu chuyện về Dwight \"Tướng Quân\" Manfredi (Sylvester Stallone) với những thử thách mới và nguy hiểm hơn, khi đế chế tội phạm mà anh gây dựng tại Oklahoma ngày càng mở rộng. Trong quá trình mở rộng kinh doanh, Dwight đụng độ với đối thủ mới và tàn nhẫn nhất từ trước đến nay: gia tộc Dunmire, đứng đầu là Jeremiah Dunmire (Robert Patrick), một ông trùm sừng sỏ với mối quan hệ sâu rộng. Jeremiah cũng muốn thâu tóm nhà máy chưng cất rượu lâu đời của gia đình Montague để hợp pháp hóa và mở rộng hoạt động. và không từ thủ đoạn nào để đạt được mục đích. Xung đột nhanh chóng leo thang khi Jeremiah Dunmire ra lệnh sát hại chủ sở hữu nhà máy rượu, gây ra một cuộc chiến băng đảng khốc liệt tại Tulsa. Dwight bị dồn vào thế phải trả thù và bảo vệ địa bàn của mình. Bên cạnh cuộc chiến với Dunmires, Dwight còn phải đối phó với sự can thiệp từ băng đảng New York (gia tộc Renzetti) và một sát thủ mới nguy hiểm có biệt danh Quiet Ray. Ngoài ra, mùa phim còn giới thiệu nhân vật Russell Lee Washington (do Samuel L. Jackson thủ vai), một người bạn tù cũ của Dwight được cử đến Oklahoma để ám sát anh, đồng thời đây cũng là nhân vật sẽ mở đường cho loạt phim ngoại truyện tiềm năng mang tên NOLA King.&nbsp;</p><p>Phần 3 của Tulsa King đẩy mức độ nguy hiểm và căng thẳng lên cao, khi Dwight Manfredi phải chiến đấu trên nhiều mặt trận – từ cuộc chiến tranh giành lãnh thổ khốc liệt chống lại Jeremiah Dunmire, đến việc cố gắng giữ bí mật hoạt động khỏi sự theo dõi sát sao của FBI.</p>',0,0,17,0),(615,'Hơi thở sâu nhất','https://img.ophim.live/uploads/movies/hoi-tho-sau-nhat-thumb.jpg','The Deepest Breath','completed','1','1g 50phút','2023','HD',NULL,'Laura McGann','','Thể Thao, Tài Liệu','Âu Mỹ','Gắn kết nhờ tình yêu với bộ môn lặn tự do, nhà vô địch lập kỷ lục và anh hùng thợ lặn an toàn cố gắng làm nên lịch sử bằng một kỳ tích đáng nể và họ sẵn sàng mạo hiểm tất cả.',0,0,11,0),(616,'Hoàng Đế Lưu Manh','https://img.ophim.live/uploads/movies/hoang-de-luu-manh-thumb.jpg','The Misadventure of Zoo','completed','20','45 phút/tập','1981','HD',NULL,'','鄭少秋, 李司棋, Bai Lan, 沈殿霞, Tang Pik-Wan, 莊文清, 葉德嫻, 黃日華, 秦煌, 龍天生','Võ Thuật','Trung Quốc, Hồng Kông','The Misadventure of Zoo is a TVB television series, premiered in 1981. Theme song \"Personhood Loves Freedom\" composition and arrangement by Joseph Koo, lyricist by Wong Jim, sung by Adam Cheng, and the sub theme song \"Cheers\" composition and arrangement by Joseph Koo, lyricist by Wong Jim, sung by Adam Cheng.',0,0,18,0),(617,'Mantis','https://img.ophim.live/uploads/movies/mantis-thumb.jpg','Mantis','completed','1','113 Phút','2025','HD',NULL,'이태성','임시완, 박규영, 조우진, 설경구, 전도연, 최현욱, 유수빈, 배강희','Hành Động, Hình Sự','Hàn Quốc','<p>Tổ chức sát thủ giết thuê bí mật bỗng rơi vào hỗn loạn, khai sinh một thế hệ sát thủ mới. Khi những quy tắc cũ bị phá vỡ, ai dám trỗi dậy thống trị thế giới ngầm ấy?</p>',0,0,17,0),(618,'Quarterback','https://img.ophim.live/uploads/movies/quarterback-thumb.jpg','Quarterback','completed','8','51 phút/tập','2023','HD',NULL,'','Patrick Mahomes, Kirk Cousins, Marcus Mariota','Thể Thao','Âu Mỹ','<p>Cùng tham gia cuộc hội ý và vào nhà của Patrick Mahomes, Kirk Cousins và Marcus Mariota trong loạt phim tài liệu thẳng thắn này để theo dõi mùa giải NFL 2022-2023 của họ.</p>',0,0,11,0),(619,'Rose Martial World','https://img.ophim.live/uploads/movies/rose-martial-world-thumb.jpg','Rose Martial World','completed','30','? phút/tập','2009','HD',NULL,'Viên Anh Minh; Vương Thiếu Kiệt','Tôn Phi Phi; Hoắc Tư Yến; Chung Hán Lương; Trần Kiện Phong; Hà Thịnh Minh; Phùng Thiệu Phong','Võ Thuật','Trung Quốc, Hồng Kông','Rose Martial World-Rose Martial World (2009) [HD-Lồng Tiếng]',0,0,18,0),(620,'Quý Cô Ẩn Danh','https://img.ophim.live/uploads/movies/quy-co-an-danh-thumb.jpg','Ms. Incognito','ongoing','3','? phút/tập','2025','HD',NULL,'','전여빈, 정진영, 서현우, 장윤주, 주현영, 문성근','Hình Sự','Hàn Quốc','<p>Một quý cô sắc lạnh, một nhân vật quyền lực ẩn giấu bí mật khủng khiếp – tất cả cuốn bạn vào vòng xoáy điều tra nghẹt thở, nơi ranh giới giữa chính nghĩa và tội ác mong manh hơn bao giờ hết.<br>&nbsp;</p>',1,0,17,0),(621,'Tour de France: Trên từng dặm đường','https://img.ophim.live/uploads/movies/tour-de-france-tren-tung-dam-duong-thumb.jpg','Tour de France: Unchained','completed','8','45 phút/tập','2023','HD',NULL,'','','Tài Liệu, Thể Thao','Âu Mỹ','Qua nước mắt và chiến thắng, loạt phim này theo chân một số đội đua xe đạp khi họ thi đấu trong cuộc đua xe đạp khắc nghiệt nhất thế giới năm 2022.',0,0,11,0),(622,'Vạch Mặt','https://img.ophim.live/uploads/movies/vach-mat-thumb.jpg','No Mercy','ongoing','4','47 phút/tập','2025','HD',NULL,'최형준','이주영, 지승현, Ju-ne','Hình Sự','Hàn Quốc','<p>Một bộ phim truyền hình trả thù và tội phạm giật gân về Han So Min, một nữ diễn viên vô danh, người đã kiên cường vượt qua tất cả. Một ngày nọ, cô mất cha mẹ vì một vụ lừa đảo qua mạng và thâm nhập vào một tổ chức lừa đảo giọng nói quy mô lớn bằng công nghệ deepfake, rồi hạ gục tất cả.</p>',0,0,17,0),(623,'Cua-rơ trung học (Phần 5)','https://img.ophim.live/uploads/movies/cua-ro-trung-hoc-phan-5-thumb.jpg','Yowamushi Pedal (Season 5)','completed','25','23 phút/tập','2016','HD',NULL,'','Yamashita Daiki, Toriumi Kohsuke, Fukushima Jun, Yasumoto Hiroki, Showtaro Morikubo, Ito Kentaro, Kishio Daisuke, Matsuoka Yoshitsugu, Suwabe Junichi, Suwa Ayaka, Han Megumi, Maeno Tomoaki, Yonaga Tsubasa, Kakihara Tetsuya, Hino Satoshi, Yoshino Hiroyuki, Abe Atsushi, Yusa Koji, Miyata Kouki, Shimono Hiro, Hatano Wataru, Nakamura Yuichi, Nojima Kenji, Miyano Mamoru, Ono Daisuke, Uchida Yuma, Fukuyama Jun, Ichiki Mitsuhiro','Thể Thao, Gia Đình, Chính kịch','Nhật Bản, Anh','<p>Onoda Sakamichi nỗ lực hết sức khi cậu và cả đội nhắm đến chiến thắng thứ hai liên tiếp trong giải liên trường.</p>',0,0,11,0),(624,'Những Điệp Viên Hết Thời (Phần 5)','https://img.ophim.live/uploads/movies/nhung-diep-vien-het-thoi-phan-5-thumb.jpg','Slow Horses (Season 5)','ongoing','2','56 phút/tập','2025','HD',NULL,'','Gary Oldman, Jack Lowden, Kristin Scott Thomas','Hài Hước, Hình Sự, Chính kịch','Âu Mỹ, Anh','In season five, everyone is suspicious when resident tech nerd Roddy Ho has a glamorous new girlfriend. When a series of increasingly bizarre events occur across the city, it falls to the Slow Horses to work out how everything is connected. After all, Lamb knows that in the world of espionage, the London Rules — cover your back — always apply.',0,0,17,0),(625,'Vua sưu tập: Nhà đấu giá Goldin','https://img.ophim.live/uploads/movies/vua-suu-tap-nha-dau-gia-goldin-thumb.jpg','King of Collectibles: The Goldin Touch','completed','6','35 phút/tập','2023','HD',NULL,'','Ken Goldin','Thể Thao','Âu Mỹ','Trong chương trình này, Ken Goldin cùng đội ngũ chuyên gia điều hành hoạt động gay cấn diễn ra bên trong một nhà đấu giá hàng đầu chuyên về những món đồ sưu tập hiếm.',0,0,11,0),(626,'Cá Mập: Cơn Bão','https://img.ophim.live/uploads/movies/ca-map-con-bao-thumb.jpg','Shark: The Storm','completed','6','? phút/tập','2025','HD',NULL,'','','Chính kịch, Võ Thuật','Hàn Quốc','<p>Cha Woo Sol từng là nạn nhân của bạo lực học đường và sau đó phải vào tù vì một sự cố ngoài ý muốn. Trong tù, anh gặp một võ sĩ võ thuật tổng hợp và bắt đầu theo đuổi môn thể thao này. Cá Mập 2: Cơn Bão (Shark 2: The Storm) theo chân Cha Woo Sol trong hành trình trở thành nhà vô địch võ thuật tổng hợp sau khi ra tù với những thử thách không chỉ đến từ bên ngoài mà còn từ nỗi ám ảnh tâm lý của chính bản thân anh.</p><p>&nbsp;</p>',0,0,18,0),(627,'Cuộc Đời Thăng Trầm Của Boris Becker','https://img.ophim.live/uploads/movies/cuoc-doi-thang-tram-cua-boris-becker-thumb.jpg','Boom! Boom! The World vs. Boris Becker','completed','2','99 phút/tập','2023','HD',NULL,'Alex Gibney','Boris Becker','Tài Liệu, Thể Thao','Âu Mỹ, Anh','<p>Cái nhìn bên trong về cuộc đời và sự nghiệp gây tranh cãi của tay vợt vĩ đại Boris Becker—có các cuộc phỏng vấn với John McEnroe, Novak Djokovic, Björn Borg và các biểu tượng khác.</p>',0,0,11,0),(628,'Thần Long Kiếm Hiệp','https://img.ophim.live/uploads/movies/than-long-kiem-hiep-thumb.jpg','The Holy Dragon Saga','completed','20','47 phút/tập','1995','HD',NULL,'','Catherine Hung Yan, Cheung Yuen-Mei, 林文龍, 曹眾, 朱威廉, 魏駿傑, 蔡國慶, 李麗麗, 張翼, 李家鼎','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Thần Long Kiếm Hiệp-The Holy Dragon Saga (1995) [HD-Lồng Tiếng]',0,0,18,0),(629,'Ngày Lành Của Eun Soo','https://img.ophim.live/uploads/movies/ngay-lanh-cua-eun-soo-thumb.jpg','Walking on Thin Ice','ongoing','6','70 phút/tập','2025','HD',NULL,'Song Hyun-wook','이영애, 김영광, 박용우, 이수빈, 조연희, 황재열, 도상우, 원현준, 오연아, 김동원','Hình Sự, Chính kịch, Bí ẩn','Hàn Quốc','<p>Eun-soo là một bà nội trợ, đang chật vật kiếm tiền chữa bệnh cho chồng. Anh ta mắc bệnh nan y. Eun-soo vướng vào một túi ma túy với một giáo viên tên Yi-kyeong. Anh ta là một nhân vật bí ẩn. Eun-soo và Yi-kyeong bị thám tử kỳ cựu Tae-gu truy đuổi.</p>',0,0,17,0),(630,'Cuộc Đấu Dài Hơn: Hơn Cả Bóng Rổ','https://img.ophim.live/uploads/movies/cuoc-dau-dai-hon-hon-ca-bong-ro-thumb.jpg','The Long Game: Bigger Than Basketball','completed','5','50 phút/tập','2022','HD',NULL,'','Makur Maker','Tài Liệu, Thể Thao','Âu Mỹ','<p>Makur Maker là một cầu thủ NBA năm sao triển vọng hướng đến Dự thảo cho đến khi một đường vòng bất ngờ đưa anh đến Đại học Howard. Loạt phim tài liệu đầy cảm hứng này kể về hành trình của Makur và quyết tâm viết lại câu chuyện của anh ấy với sự giúp đỡ của gia đình.</p>',0,0,11,0),(631,'Thiếu Lâm Thất Hiệp','https://img.ophim.live/uploads/movies/thieu-lam-that-hiep-thumb.jpg','Shaolin Adventure','completed','40','50 phút/tập','2001','HD',NULL,'Tô Thẩm Phong','Nguyên Bưu, Châu Minh Tăng, Chu Mễ Qua, Khương Đại Vệ, Hồng Thiên Minh, Thiệu Mỹ Kỳ, Trương Đình, Lương Gia Nhân','Võ Thuật, Cổ Trang','Đài Loan, Trung Quốc','<p><i>Phim kể về những ân oán trên giang hồ, vào những năm của cuối đường triều giặc ngoại xâm đang chiếm lấy lãnh thổ của nước Kim, chúng tàn phá và giết hết những người dân vô tội, lúc này trên giang hồ các đại môn phái đang cùng nhau hợp sức chống trả lại những cuộc tấn công đó của kẻ địch, những trận mai phục của các chưởng môn nhân đặt ra nhằm dụ kẻ thù vào nơi định sẳng, toàn bộ quân vào đều bị tiêu diệt hết, lúc này có thiếu lâm nam phái phái đứng lên chủ trì cùng với các anh anh thất hiệp ngũ nghĩa củng ra tay chống trả lại, biết được điều này triều đình mang trọng thưởng cho những môn phái giúp công. Để nêu cao tinh thần trượng nghĩa và đoàn kết của các phái, chính những cao tăng chùa thiếu lâm đã dạy cho các đệ tử phật môn những bí kiếp gia truyền, trong đó có đại lực kim kang chưởng, sư tử hống và hàng long quyết là những môn võ mang danh uy chấn thiên hạ. Cùng với những màng võ thuật đặc sắc mãn nhãn xen vào đó là những chuyện tình, anh anh hết lòng vì bằng hữu củng hội tụ hết trong Phim Thiếu Lâm Thất Hiệp điều đó chứng tỏa rằng tin thần thếp luôn phát hy, ngoài ra nó còn cho chúng ta nhiều bài học quý giá.</i></p>',0,0,18,0),(632,'Trí Tuệ Tiềm Năng (Phần 2)','https://img.ophim.live/uploads/movies/tri-tue-tiem-nang-phan-2-thumb.jpg','High Potential','ongoing','3','44 phút/tập','2025','HD',NULL,'','Kaitlin Olson, Daniel Sunjata, Judy Reyes, Steve Howey, Javicia Leslie, Deniz Akdeniz, Amirah J, Matthew Lamb','Hình Sự, Chính kịch, Bí ẩn, Hài Hước','Âu Mỹ, Pháp','<p>Sau thành công của mùa đầu tiên, Morgan Gillory (Kaitlin Olson) - bà mẹ đơn thân thông minh xuất chúng với chỉ số IQ 160 – tiếp tục trở lại trong mùa 2 của High Potential.&nbsp;</p><p>Ở mùa 1, Morgan từ một nhân viên dọn dẹp bình thường đã khiến Sở cảnh sát Los Angeles phải kinh ngạc bởi khả năng quan sát và suy luận thiên tài. Nhưng bên cạnh những vụ án hóc búa, cô cũng phải đối diện với những rắc rối riêng tư: nuôi dạy ba đứa con nhỏ và mối quan hệ phức tạp giữa mình và Karadec bước sang một giai đoạn mới, khi cả hai vừa phải hợp tác phá án, vừa phải giải quyết cảm xúc cá nhân. Mùa 2 mở ra nhiều thử thách mới. Một kẻ thù nguy hiểm, \"Game Maker\", tiếp tục thách thức trí tuệ của Morgan với những trò chơi chết chóc, đặt gia đình cô vào vòng nguy hiểm.&nbsp;</p>',0,0,17,0),(633,'Đất rừng','https://img.ophim.live/uploads/movies/dat-rung-thumb.jpg','Jungleland','completed','1','1g 30phút','2020','HD',NULL,'Max Winkler','Charlie Hunnam, Jack O\'Connell, Jessica Barden, Jonathan Majors, Fran Kranz, John Cullum','Thể Thao, Chính kịch','Âu Mỹ','Khi một võ sĩ quyền Anh và anh trai kiêm quản lý vướng vào một khoản nợ, cả hai buộc phải đi khắp đất nước cùng một hành khách và tham gia giải đấu tay không tàn khốc.',0,0,11,0),(634,'Đoạn Thù Cốc','https://img.ophim.live/uploads/movies/doan-thu-coc-thumb.jpg','Valley Of No Hartre','completed','30','45 phút/tập','2003','HD',NULL,'Vu Kiều','Hồng Kim Bảo, Quan Lễ Kiệt, Kỳ Diệm, Đỗ Ninh Lâm.','Võ Thuật','Hồng Kông, Trung Quốc','<p><i>Phim Đoạn thù cốc xoay quanh các diễn biến đầy kịch tính trong cuộc đời của chàng trai Thạch Hạo Thiên. Là con nuôi của đại tướng quân Vạn Bá Long, Hạo Thiên có võ công cao cường tính tình cương trực, thẳng thắn và yêu chuộng chính nghĩa.</i><br><i>Trong một dịp tình cờ, anh cứu sống Phương Hữu Vi là con trai của một gia đình quyền thế ở trấn Hoà Bình và cô gái thường dân tên bạch Huyên. Phương Hữu Vi bái Hạo Thiên làm thầy, Bạch Huyên nảy sinh tình cảm với ân nhân của mình. a</i><br><i>Những mối liên hệ ân oán giang hồ cũng bắt đầu từ đây. Thạch Hạo Thiên vướng và vòng luẩn quẩn của ân oán và những thủ đoạn nơi giang hồ hiểm ác. Cùng lúc đó, anh còn phải chịu đựng những khó khăn vì sự đố kỵ của Vạn Uy – con trai Vạn Bá Long. Tình tiết phim ngày càng diễn biến phức tạp, những trận chiến xảy ra liên tiếp nhưng cuối cùng kẻ ác phải đền tội, người tốt lấy lại danh dự và được hưởng hạnh phúc.</i><br><i>Trong phim có những chi tiết gợi nghĩ sâu sắc: đại tướng quân Vạn Bá Long và tùy tùng đuổi theo giết con chim ưng gây thương tích cho ái thiếp của Phúc Thân Vương lạc vào sa mạc rồi lại được chính con chim này chỉ cho nguồn nước và thoát chết. Từ đó, họ nhận ra sự vô nghĩa khi phụ vụ cho triều đình và ở lại nơi sơn cốc, đặt tên cốc là Đoạn thù; Thạch Hạo Thiên muốn tự sát để tạ tội với Bạch Huyên vì cứ nghĩ rằng mình là người gây ân án mạng cho gia đình cô ...</i><br><i>Vẫn những mô-típ ân – oán, tình – thù, quan hệ thiện – ác, chính nghĩa – phi nghĩa, đố kỵ – cao thượng quen thuộc trong phim cổ trang Trung Quốc, Đoạn thù cốc là khúc ca bi tráng về người anh hùng Thạch Hạo Thiên với một triết lý xưa nhưng không cũ: cái thiện luôn chiến thắng cái các và chính nghĩa sẽ lên ngôi sau nhiều gian nan vất vả.</i></p>',0,0,18,0),(635,'Đặc Vụ Truy Kích','https://img.ophim.live/uploads/movies/dac-vu-truy-kich-thumb.jpg','Emergency Unit','completed','30','42 phút/tập','2009','HD',NULL,'','陳鍵鋒, 吳卓羲, 苗僑偉, 周海媚, 謝天華, 江若琳, 梁嘉琪, 林嘉華, 陳山聰, 楊天經','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Sau 10 năm ngồi tù, đại ca giang hồ khét tiếng một thời Giang Thế Hiếu trở về mang theo âm mưu trả thù những kẻ năm xưa đã hãm hại y. Kế hoạch của Hiếu còn kéo theo lực lượng cảnh sát cùng trùm xã hội đen Đỗ Diệc Thiên rơi vào cuộc chơi tay ba gay cấn. Cuộc chiến phi nghĩa này sẽ kết thúc ra sao? Mời các bạn theo dõi bộ phim.',0,0,17,0),(636,'BIRDIE WING -Golf Girls’ Story- Season 2','https://img.ophim.live/uploads/movies/birdie-wing-golf-girls-story-season-2-thumb.jpg','BIRDIE WING -Golf Girls’ Story- Season 2','ongoing','12','24 phút/tập','2023','HD',NULL,'','','Thể Thao, Học Đường','Nhật Bản','BIRDIE WING -Golf Girls’ Story- Season 2',0,0,11,0),(637,'Đế Cẩm','https://img.ophim.live/uploads/movies/de-cam-thumb.jpg','DiJing','completed','52','45','2012','HD',NULL,'Kim Ngao Huân','Lâm Văn Long, Kangta, Thi Diễm Phi','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Phim xoay quanh một bí mật kinh thiên động địa phía sau ngai vàng. Nữ chính Bảo Cẩm do Thi Diễm Phi đảm nhận là một cô nương có 2 bộ mặt: sự mạnh mẽ mà nam nhân cũng phải nể phục ẩn giấu sau vẻ ôn nhu yếu đuối của một tiểu cô nương. Vì muốn đền nợ nước thù nhà, Bảo Cẩm thề rằng sẽ lật đổ vương triều của tân hoàng đế (Kang Ta). Cô vào hậu cung để thực hiện âm mưu của mình nhưng lại không ngờ rằng mình lại đem lòng yêu kẻ thù mà cô phải tiêu diệt.</i></p>',0,0,18,0),(638,'Toàn Trí Độc Giả','https://img.ophim.live/uploads/movies/toan-tri-doc-gia-thumb.jpg','Omniscient Reader: The Prophecy','completed','1','117 Phút','2025','HD',NULL,'김병우','안효섭, 이민호, 채수빈, 신승호, 나나, 지수, 박호산, 최영준, 정성일, 조현정','Hành Động, Phiêu Lưu','Hàn Quốc','<p>Kim Dok-ja, một chàng trai bình thường ngoài 20 tuổi, là độc giả duy nhất của một tiểu thuyết mạng ít người biết đến có tựa đề \"Ba Cách Sống Sót Sau Ngày Tận Thế\". Sau khi đọc xong chương cuối, cuốn tiểu thuyết bỗng chốc trở thành hiện thực, và người anh hùng toàn năng Yu Jung-hyeok xuất hiện trước mặt Kim. Là người duy nhất biết cách sinh tồn trong thế giới này, Kim và những người bạn đồng hành nỗ lực cứu thế giới bằng cách viết nên cái kết mới cho riêng mình.</p>',0,0,12,0),(639,'Lực lượng Hải Quan','https://img.ophim.live/uploads/movies/a-matter-of-customs-thumb.jpg','A Matter of Customs','completed','32','45 phút/tập','2000','HD',NULL,'','汪明荃, 宣萱, 王喜, 李修賢, 曹永廉, 吳美珩, 梁崢, 麥長青, 許紹雄, 駱應鈞','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Ming Lui devotes all her energy to her job as a customs superintendent. Ming\'s two capable subordinates, Lam Chi-kong and Moon Fung, always quarrel at work, but at the same time find each other attractive. However, their romance is short-lived, owing to their strong egos, and the two young customs inspectors soon fall in love with Kung Siu-yau and Lam Chi-kit respectively. Ming\'s newly developed relationship with rich publisher Tao Ling-shan faces challenges from Ling-shan\'s ex-girlfriend. Meanwhile, at work, Ming, Chi-kong, and Moon are forced to pay increasingly more attention to their careers as law enforcers.',0,0,17,0),(640,'Đội Bóng Rổ Đặc Biệt','https://img.ophim.live/uploads/movies/doi-bong-ro-dac-biet-thumb.jpg','Champions','completed','1','2 giờ 4 phút','2023','HD',NULL,'Bobby Farrelly','Woody Harrelson, Kaitlin Olson, Matt Cook','Hài Hước, Tâm Lý, Thể Thao','Âu Mỹ','kể về một huấn luyện viên bóng rổ từng dẫn dắt một đội bóng rổ nhỏ, bị buộc phải quản lý một đội bóng với các thành viên bị khuyết tật trí tuệ bởi tòa án. Ban đầu, ông ta không tin rằng đội của mình có thể thành công, nhưng sau đó, ông ta nhận ra rằng cùng nhau, đội của ông ta có thể đi xa hơn những gì họ từng tưởng tượng. Bộ phim Champions là một câu chuyện cảm động và lấy cảm hứng từ thực tế, về sự đoàn kết, tình bạn và hy vọng trong cuộc sống. ',0,0,11,0),(641,'Tân Bao Thanh Thiên: Khai Phong Kỳ Án','https://img.ophim.live/uploads/movies/tan-bao-thanh-thien-khai-phong-ky-an-thumb.jpg','Justice Bao','completed','40','45 phút/tập','2013','HD',NULL,'Kim Siêu Quần','Hà Gia Kính, Kim Siêu Quần, Phạm Hồng Hiên, Vương Sa Sa, Thôi Ba','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Điều đặc biệt là khi xây dựng kịch bản cho \"Khai Phong kỳ án\" những vụ án nổi tiếng không được tái hiện lại mà sẽ tập trung phát triển những vụ án hoàn toàn mới với độ phức tạp cao tạo nên những phút giây hồi hộp, đầy kịch tính trong suốt 40 tập phim. Nối tiếp thành công của những phiên bản trước đó cùng với sự đầu tư công phu, kỹ lưỡng, \"Bao Thanh Thiên Khai Phong kỳ án\" hứa hẹn sẽ là những câu chuyện vừa ly kỳ hấp dẫn, vừa đọng lại trong lòng người xem nhiều bài học về công lý, nhân quả trong cuộc đời.</i></p>',0,0,18,0),(642,'Caught Out: Tội ác. Tham nhũng. Cricket.','https://img.ophim.live/uploads/movies/caught-out-toi-ac-tham-nhung-cricket-thumb.jpg','Caught Out: Crime. Corruption. Cricket.','completed','1','1g 17phút','2023','HD',NULL,'','','Tài Liệu, Hình Sự, Thể Thao','Ấn Độ','<p>Bộ phim tài liệu về thể thao này xoay quanh vụ bê bối dàn xếp tỉ số lớn nhất Ấn Độ, những nhân vật mang tính biểu tượng có liên quan và những nhà báo phanh phui vụ tham nhũng đó.</p>',0,0,11,0),(643,'Thỏ Đen','https://img.ophim.live/uploads/movies/tho-den-thumb.jpg','Black Rabbit','completed','8','60 phút/tập','2025','HD',NULL,'','Jason Bateman, Jude Law, Chris Coy, Troy Kotsur, Abbey Lee, Odessa Young, Robin de Jesús','Hình Sự, Chính kịch','Âu Mỹ, Anh','<p>Một chủ nhà hàng (Jude Law) bị kéo vào thế giới tội phạm ngầm của New York khi người anh trai tai quái của anh (Jason Bateman) gây ra món nợ không thể chi trả.</p>',0,0,17,0),(644,'Hán Sở Song Tranh','https://img.ophim.live/uploads/movies/han-so-song-tranh-thumb.jpg','The Story of Han Dynasty','completed','50','50 phút/tập','2005','HD',NULL,'Wei Handao','Dương Cung Như, Hồ Quân, Lý Lập Quần, Ngô Thanh Liên, Vương Cương','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>(Tây Sở Bá Vương - Triều Đại Nhà Hán) Sở Hán Xuân Thu 206 – 202 là thời kỳ sau thời đại nhà Tần ở Trung Hoa. Trong thời kỳ này, các vị vương từ các đất khác nhau ở Trung Hoa đã xuất hiện sau sự sụp đổ của nhà Tần và tạo nên hai phái kình địch nhau rõ rệt. Một bên do Lưu Bang, vua nhà Hán lãnh đạo, còn bên kia do Hạng Vũ, tự xưng Tây Sở bá vương. Một vài vị vương khác có uy lực thấp hơn cũng có nghĩa quân đánh nhau độc lập trong thời gian này. Cuộc chiến đã kết thúc với thắng lợi hoàn toàn thuộc về Lưu Bang, người sau này đã lên ngôi hoàng đế và thiết lập nên nhà Hán.</i></p>',0,0,18,0),(645,'Real Madrid: Chiến đấu đến phút cuối cùng','https://img.ophim.live/uploads/movies/real-madrid-until-the-end-thumb.jpg','Real Madrid: Until the End','completed','3','60 phút/tập','2023','HD',NULL,'','','Tài Liệu, Thể Thao','Tây Ban Nha','<p>Bước ra sân và khám phá hậu trường với đội bóng biểu tượng để xem lại mùa giải 2021–2022 đáng kinh ngạc của họ. Được thúc đẩy bởi những người hâm mộ cuồng nhiệt của họ, họ bất chấp những khó khăn và bịt miệng những người hoài nghi.</p>',2,0,11,0),(646,'Tuyệt Mệnh Thư Kích','https://img.ophim.live/uploads/movies/tuyet-menh-thu-kich-thumb.jpg','Desperate Sniper','completed','1','86 Phút','2024','HD',NULL,'He Yijie','甘婷婷, Henry Prince Mak, 李子雄, 駱達華, 张笑君, Peng Tianying, Wang Junjun, 何浚豪','Hành Động, Hình Sự','Trung Quốc','The story takes place in Country A, where the male protagonist, Zhao Jian, leads his Black Wolf Squad to escort goods for General Chachai of Country A. On the way, they encounter an ambush by guerrillas. Zhao Jian captures the female guerrilla leader, Zhang Ling, and learns that the Black Wolf Squad is not transporting humanitarian goods but materials for human experimentation. General Chachai, driven by personal greed, is conducting experiments on humans. Zhang Ling requests the Black Wolf Squad\'s help but is refused. On their way back, the Black Wolf Squad discovers the gruesome aftermath of the human experiments in the forest. Unable to bear the pain in his heart, Zhao Jian quits the Black Wolf Squad and decides to join Zhang Ling and fight against Chachai. His teammates unanimously support the decision and join him in a mission to take down Chachai\'s organization, seeking justice for the innocent souls who died.',0,0,17,0),(647,'Chung Vô Diệm','https://img.ophim.live/uploads/movies/chung-vo-diem-thumb.jpg','The Legend of Lady Chung','completed','10','39 phút/tập','1985','HD',NULL,'Cam Chí Huy, Trần Mộc Thắng','Trịnh Du Linh, Trần Tú Châu, Thang Chấn Nghiệp, Lý Long Cơ, Lư Hải Bằng, ...','Võ Thuật','Trung Quốc, Hồng Kông','Chung Vô Diệm-The Legend of Lady Chung (1985) [HD-Lồng Tiếng]',0,0,18,0),(648,'Laputa: Lâu đài trên không','https://img.ophim.live/uploads/movies/laputa-lau-dai-tren-khong-thumb.jpg','Castle in the Sky','completed','1','2g 4ph','1986','HD',NULL,'','Tanaka Mayumi, Yokozawa Keiko, Hatsui Kotoe','Gia Đình, Kinh Điển','Nhật Bản','<p>Bộ phim hoạt hình phiêu lưu cho trẻ em kể về cậu bé thợ mỏ và cô bé bí ẩn. Hai em khao khát tìm kiếm hòn đảo mất tích đã lâu mà mọi người đồn rằng có rất nhiều của cải.</p>',0,0,22,0),(649,'Trò Chơi Ảo Giác: Ares','https://img.ophim.live/uploads/movies/tro-choi-ao-giac-ares-thumb.jpg','TRON: Ares','completed','1','119 Phút','2025','HD',NULL,'Joachim Rønning','Jared Leto, Greta Lee, Evan Peters, Gillian Anderson, Jodie Turner-Smith, Jeff Bridges, Hasan Minhaj, Cameron Monaghan, Arturo Castro, Sarah Desjardins','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Âu Mỹ','Một chương trình trí tuệ nhân tạo siêu việt mang tên Ares được gửi từ thế giới số vào thế giới thực trong một nhiệm vụ đầy nguy hiểm — đánh dấu lần đầu tiên nhân loại tiếp xúc trực tiếp với một thực thể A.I. sống động.',0,0,12,0),(650,'Huấn Luyện Viên Trưởng','https://img.ophim.live/uploads/movies/huan-luyen-vien-truong-thumb.jpg','Coach Prime','completed','4','45 phút/tập','2022','HD',NULL,'','','Tài Liệu, Thể Thao','Âu Mỹ','<p>Theo dõi đội bóng Những chú hổ của Đại học bang Jackson năm 2022 khi luyện tập và trong các trận đấu, trong phòng thay đồ, ngoài sân cỏ và trong cộng đồng, trong suốt mùa giải Giải vô địch SWAC bất bại 12-0 của họ.</p>',0,0,11,0),(651,'Killer Heat','https://img.ophim.live/uploads/movies/killer-heat-thumb.jpg','Killer Heat','completed','1','97 Phút','2024','HD',NULL,'Philippe Lacôte','Joseph Gordon-Levitt, Richard Madden, Shailene Woodley, Babou Ceesay, Clare Holman, Abbey Lee, Manos Gavras, Αργύρης Γκαγκάνης, Ελένη Βεργέτη, Δημήτρης Τοπαλίδης','Hình Sự, Chính kịch','Âu Mỹ, Anh, Hy Lạp','An expat PI is hired to investigate a suspicious death in Crete, Greece, where jealousies run deep amongst the victim\'s powerful family.',0,0,17,0),(652,'Blade Heart','https://img.ophim.live/uploads/movies/blade-heart-thumb.jpg','Blade Heart','completed','42','44 phút/tập','2004','HD',NULL,'Thích Kỳ Nghĩa','Trịnh Thiếu Thu, Uông Minh Thuyên, Lâm Phong, Dương Tư Kỳ, Dương Tuyết, Lý Vĩnh Hào, La Mẫn Trang, Trần Hồng Liệt, Lý Chấn Khởi, Vương Thư Kỳ','Võ Thuật, Cổ Trang','Hồng Kông, Trung Quốc','The Szema family murdered the Tong family in order to monopolize the weapons industry. Twenty years later, the chief of Brocade Guards, YUEMAN FUNG (CHENG SIU CHOW, ADAM), fights against MRS. WONG (WANG MING CHUN, LIZA) of the biggest escort carrier in town. During the fight, they realize they might know each other… FUNG has changed his name, put on an eye patch and become a Brocade Guard. His wife, TONG PIK, has married WONG. They live with humiliation while they wait for the day of revenge. However, they both are in situations where they can’t reveal their identities. PIK hires MANG LUI (LAM RAYMOND) as a fighter. He falls in love with PIK’s daughter YEE (YEUNG SZE KI, SHIRLEY). Ironically, LUI is PIK’s son, whom she lost many years ago, and so love between the two is impossible. How can love and hatred end between two generations?',0,0,18,0),(653,'Nàng công chúa ở Thung lũng gió','https://img.ophim.live/uploads/movies/nang-cong-chua-o-thung-lung-gio-thumb.jpg','Nausicaä of the Valley of the Wind','completed','1','1g 57ph','1984','HD',NULL,'','Shimamoto Sumi, Tsujimura Mahito, Kyoda Hisako','Gia Đình, Kinh Điển','Nhật Bản','<p>Khi tài nguyên thiên nhiên của hành tinh bị hủy hoại, công chúa chiến binh Nausicaa tập hợp thần dân của mình chống lại đội quân hung tàn của nữ hoàng độc ác.</p>',0,0,22,0),(654,'Bill Russell: Huyền thoại','https://img.ophim.live/uploads/movies/bill-russell-huyen-thoai-thumb.jpg','Bill Russell: Legend','completed','2','1g 33phút/tập','2023','HD',NULL,'Sam Pollard','Bill Russell','Thể Thao, Tài Liệu','Âu Mỹ','<p>Bộ phim tài liệu tiểu sử này xoay quanh nhà vô địch NBA thành công nhất kiêm biểu tượng dân quyền Bill Russell, người gây dựng di sản hoành tráng cả ở trong và ngoài sân đấu.</p>',0,0,11,0),(655,'Lệnh Truy Nã','https://img.ophim.live/uploads/movies/lenh-truy-na-1997-thumb.jpg','I Can\'t Accept Corruption','completed','20','40 phút/tập','1997','HD',NULL,'','古天樂, 張兆輝, 陳法蓉, 袁潔瑩, 鮑方, 何寶生, 張玉珊, Gregory Charles Rivers, 夏韶聲, 李子奇','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','<p>Tôi Không Chấp Nhận Tham Nhũng kể về một đội chống tham nhũng dưới sự lãnh đạo của một thanh tra trưởng tài ba Diệp Quốc Anh (Trần Thiếu Kỳ). Diệp Quốc Anh dẫn đầu một đội ngũ sĩ quan tinh nhuệ bao gồm thanh tra cấp cao giàu kinh nghiệm Lâm Chí Công (Trương Tiểu Huy); và bốn sinh viên mới tốt nghiệp đại học khác đang khao khát được vào cơ quan chống tham nhũng, Phương Trác Văn (Cổ Thiên Lạc), Khảm Minh Huy (Viên Huệ Văn); La Gia Kiệt (Hà Bảo San) mồ côi, cùng với Lưu Chí Sơn (Trương Ngọc Sơn) tốt bụng. Bộ phim hành động này ghi lại các phương thức hoạt động của ICAC để giải quyết các vụ hối lộ. Các vụ án bao gồm các sĩ quan cảnh sát nhận hối lộ để che đậy một nhà thổ, giao dịch nội gián giữa các nhà phát triển bất động sản và đại lý bất động sản, tham nhũng của lính cứu hỏa cũng như buôn bán vũ khí...</p>',0,0,17,0),(656,'Kiếm Pháp Anh Hào','https://img.ophim.live/uploads/movies/kiem-phap-anh-hao-thumb.jpg','Romance of Book and Sword','completed','21','45 phút/tập','2002','HD',NULL,'Lý Thần Phong','Triệu Văn Trác, Quan Vịnh Hà, Trịnh Phối Phối, Nhan Dĩnh Tư, Trần Chiêu Vinh, Lữ Lương Vỹ, Tạ Quân Hào, Tôn Lợi','Võ Thuật, Cổ Trang','Trung Quốc, Đài Loan','<p>Càn Long bị sắc đẹp của Kha Tư Lệ quyến rũ và ra sức ép buộc Kha Tư Lệ phục tùng mình nhưng cô kiên quyết chống cự. Trần Gia Lạc vào hoàng cung và gặp lại Càn Long. Chàng nhắc nhở Càn Long về lời thề phản Mãn phục Hán trên Lục Hòa tháp, và vì quyền lợi chung của quốc gia dân tộc, chàng sẵn sàng hy sinh hạnh phúc của bản thân khi thuyết phục Kha Tư Lệ phục tùng Càn Long. Kha Tư Lệ phát hiện ra rằng Càn Long đã tráo trở bội ước và âm mưu giăng một mẻ lưới bắt gọn các yếu nhân Hồng Hoa hội nhằm giữ kín bí mật thân thế.</p>',0,0,18,0),(657,'Trong tầm lửa đạn','https://img.ophim.live/uploads/movies/trong-tam-lua-dan-thumb.jpg','In the Line of Fire','completed','1','2g 8ph','1993','HD',NULL,'','Clint Eastwood, John Malkovich, Rene Russo','Hành Động, Phiêu Lưu, Kinh Điển','Âu Mỹ','<p>Kẻ sát nhân mưu trí nhưng lệch lạc giày vò một cựu mật vụ, người vẫn mang nỗi ám ảnh vì không thể cứu được Tổng thống John F. Kennedy nhiều năm về trước.</p>',0,0,22,0),(658,'Thể chất: 100','https://img.ophim.live/uploads/movies/the-chat-100-thumb.jpg','Physical: 100','completed','9','53 phút/tập','2023','FHD',NULL,'','','Tâm Lý, Thể Thao','Hàn Quốc','<p>Một trăm thí sinh có hình thể đẹp cùng thi đấu trong một loạt thử thách cam go để giành danh hiệu và phần thưởng tiền mặt khi trở thành người cuối cùng trụ lại.</p>',0,0,11,0),(659,'Ngày Không Ngủ','https://img.ophim.live/uploads/movies/ngay-khong-ngu-thumb.jpg','Mobius','completed','16','45 phút/tập','2025','HD',NULL,'Liu Zhangmu','白敬亭, Janice Man, Song Yang, 张柏嘉, 韩立','Hình Sự, Chính kịch, Bí ẩn','Trung Quốc','Bộ phim kể về một vị “thần thám” tại Cục cảnh sát thành phố Hoa Áo, nổi tiếng thông minh và dũng cảm, nhiều lần phá giải những vụ án kỳ bí. Thế nhưng, khi hàng loạt vụ án giết người hoàn mỹ liên tiếp xảy ra, anh phải đối mặt với những thử thách chưa từng có, trong một thành phố đầy biến động và hiểm nguy rình rập ở khắp nơi.',0,0,17,0),(660,'Hoa Mộc Lan Truyền Kỳ','https://img.ophim.live/uploads/movies/the-story-of-mulan-thumb.jpg','The Story Of Mulan','completed','57','45 phút/tập','2012','HD',NULL,'Vệ Hàn Thao','Hầu Mộng Dao, Quách Phẩm Siêu, Lưu Đức Khải, Trịnh Phối Phối, Lữ Lương Vỹ, Vương Âu, Dương Lệ Thanh','Võ Thuật, Cổ Trang','Trung Quốc','<p>Thời Bắc Ngụy, Bắc Địa Vương công cao lấn chủ, bị hoàng đế ban chết. Hai vương tử Thác Bạt Thiên Nhiên và Thác Bạt Á Thuật đào thoát thành công. Cha của Mộc Lan vâng mệnh bảo vệ huyết mạch cho tông thất, nuôi dưỡng hai vương tử. Mộc Lan cùng hai vương tử cùng nhau lớn lên. Ba năm sau, Thác Bạt gia được xá miễn, hai vương tử được triệu về kinh nhập ngũ. Sáu năm sau, lân bang sang xâm phạm, triều đình tiến hành tuyển quân rộng rãi. Dù già yếu thương tật, nhưng cha Mộc Lan cũng bị gọi nhập ngũ. Mộc Lan quyết định thay cha cải nam trang tòng quân. Trong quân doanh, Mộc Lan gặp lại Thác Bạt Thiên Nhiên và Thác Bạt Á Thuật. Thiên Nhiên biết được thân phận của Mộc Lan, nhưng yêu cầu Mộc Lan giữ bí mật với Á Thuật. Trong quá trình thao luyện binh sĩ, Mộc Lan và Á Thuật thường xuyên xung đột. Ban đầu Mộc Lan không muốn giết người, nhưng Á Thuật đã phân tích cho nàng hiểu ý nghĩa của chiến tranh và chức trách của quân nhân. Mộc Lan trở thành tướng tài, nhiều lần lập công. Chiến tranh kết thúc, Mộc Lan khôi phục thân phận nữ nhi. Hoàng đế tha cho nàng tội khi quân, và ban cho họ Hoa. Mộc Lan không ham vinh hoa phú quý, quyết định hồi hương quy ẩn...</p>',0,0,18,0),(661,'Annie','https://img.ophim.live/uploads/movies/annie-thumb.jpg','Annie','completed','1','2g 7ph','1982','HD',NULL,'','Aileen Quinn, Albert Finney, Carol Burnett','Hài Hước, Âm Nhạc, Gia Đình, Kinh Điển','Âu Mỹ','<p>Sống trong hoàn cảnh khó khăn, chính ước mơ tìm thấy bố mẹ và lời hứa về ngày mai là động lực thúc đẩy cô bé Annie kiên cường.</p>',0,0,22,0),(662,'Break Point: Đường tới Grand Slam','https://img.ophim.live/uploads/movies/break-point-duong-toi-grand-slam-thumb.jpg','Break Point','completed','10','52 phút/tập','2023','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Đồng hành cùng một số vận động viên tennis tài năng nhất thế giới khi họ chinh phục sự vĩ đại và Grand Slam trong một mùa giải ngập tràn hành động.</p>',0,0,11,0),(663,'Tiềm Hành Truy Kích','https://img.ophim.live/uploads/movies/tiem-hanh-truy-kich-thumb.jpg','Lives of Omission','completed','30','45 phút/tập','2011','HD',NULL,'','謝天華, 黃宗澤, 陳法拉, 劉松仁, 徐子珊, 江美儀, 黃智賢, 郭政鴻, 歐陽靖','Hành Động, Hình Sự, Phiêu Lưu','Trung Quốc, Hồng Kông','Lương Tiểu Đường trở lại lực lượng cảnh sát làm sĩ quan đào tạo cảnh sát chìm cho khóa tình báo hình sự. Anh quen biết và kết thân với Tô Tinh Bách, một người trong nhóm xã hội đen thông minh lanh lợi nhưng khá tính toán. Bách là người cung cấp thông tin cho Đường, với mục đích lợi dụng anh để đưa mình lên làm người nắm quyền. Cô luật sư Diêu Khả Khả là bạn gái của Bách, nhưng hai người dường như không tin tưởng lẫn nhau. Cấp trên của Đường là Thanh Tra Chu Vọng Tinh, có khuôn mặt giống với cô bạn gái quá cố của anh. Hai người dần nảy sinh tình cảm, nhưng vì giữa họ là cấp trên và thuộc hạ nên luôn có nhiều sự xung đột và mâu thuẫn. Tinh với cấp trên Củng Gia Bồi đều cho rằng Đường không thích hợp với cuộc sống quá kỷ luật này. Mặt khác, Bách vì muốn đạt được mục đích đã hy sinh đồng nghiệp của Đường. Để trả thù cho bạn của mình, Đường quyết định trở lại làm cảnh sát chìm.',0,0,17,0),(664,'Kiếm Khách Vượt Thời Gian','https://img.ophim.live/uploads/movies/kiem-khach-vuot-thoi-gian-thumb.jpg','The Legend of Love','completed','31','45 phút/tập','2005','HD',NULL,'Tào Quốc Lị, Trương Mẫn','Lý Uy, Trần Hảo, Tôn Hưng, Dương Quang, Trương Bác, Đường Vu Hồng, Trương Diệu Dương','Hành Động, Võ Thuật, Cổ Trang','Đài Loan','<p>Mễ Thương (Lý Uy đóng) từ nhỏ nhà tan cửa nát, tất cả đều là do người sư thúc đi vào tà đạo Trần Hoằng Khai gây ra. Y vì muốn cướp đoạt bí kíp võ công của cha mẹ Mễ Thương mà giết chết cả nhà cậu, may nhờ có đại sư bá Tả Vô Sân cứu mạng kịp thời, Mễ Thương mới thoát khỏi đại nạn. Tả Vô Sân truyền dạy võ công cho Mễ Thương nhưng không hề kể cho cậu nghe thân thế thật sự của cậu, một ngày nôi Trần Hoằng Khai tìm được tung tích của họ và truy đuổi họ tới vực sâu, Mễ Thương và sư đệ rớt vào vòng xoáy thời gian bay tới tương lai năm 2003. Tại đây họ gặp được Cary, cô gái ngoài mặt tham tiền nhưng thật sự rất có nghĩa khí, cô dụ dỗ Mễ Thương ký hợp đồng làm diễn viên với cô. Ngày tháng trôi qua, Mễ Thương dần dần có tình cảm với Cary, nhưng Trần Hoằng Khai đã truy đuổi tới thời hiện đại, và định mệnh 2 người của 2 thế giới khác nhau không thể ở cùng nhau. Mễ Thương sẽ làm gì để bảo vệ tình yêu của mình?</p>',0,0,18,0),(665,'Bản sắc anh hùng','https://img.ophim.live/uploads/movies/ban-sac-anh-hung-thumb.jpg','A Better Tomorrow','completed','2','1g 35ph','1986','HD',NULL,'','Địch Long, Trương Quốc Vinh, Châu Nhuận Phát','Hành Động, Phiêu Lưu, Kinh Điển','Trung Quốc','<p>Vốn ở hai đầu chiến tuyến luật pháp, thế giới của hai anh em giao thoa khi bố của họ bị sát hại và lòng trung thành của cả hai bị thử thách.</p>',0,0,22,0),(666,'Break Point','https://img.ophim.live/uploads/movies/break-point-thumb.jpg','Break Point','completed','5','52 phút/tập','2023','HD',NULL,'','','Thể Thao','Âu Mỹ','<p>Travel alongside some of the world\'s most talented tennis players as they swing for greatness and Grand Slams through an action-packed season.</p>',0,0,11,0),(667,'Vô Gian Nhất Chiến','https://img.ophim.live/uploads/movies/vo-gian-nhat-chien-thumb.jpg','Endless Battle','completed','1','0 Phút','2023','HD',NULL,'Mak Ho-Pong','黃宗澤, 謝天華, 陳山聰, 張國強, 陳惠敏, 陳煒, Tony Wu, 林子善, 白只, 吳瑞庭','Hành Động, Hình Sự','Hồng Kông','Vô Gian Nhất Chiến Bành Kiến Trung, một cảnh sát chống ma túy với lý tưởng công lý kiên định, nhưng bỗng một ngày, anh phát hiện người em trai Bành Kiến Thành dường như có dính líu đến một tập đoàn ma túy. Liệu anh có đủ “công tư phân minh” để tìm ra sự thật và triệt phá đường dây tội phạm này?',0,0,17,0),(668,'Võ Lâm Truyền Kỳ','https://img.ophim.live/uploads/movies/vo-lam-truyen-ky-thumb.jpg','The Saga of The Lost Kingdom','completed','32','44 phút/tập','1988','HD',NULL,'','Quách Tấn An, Tăng Hoa Thiên, Trương Vệ Kiện, Châu Hải My, Ngô Đại Dung, Trương Thiệu Huy, Cung Từ Ân, La Huệ Quyên, Cao Hùng, Lê Hán Trì, Quách Chính Hồng, Liêu Khải Trí','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Võ Lâm Truyền Kỳ-The Saga of The Lost Kingdom (1988) [HD-Lồng Tiếng]',0,0,18,0),(669,'Cắm Đầu','https://img.ophim.live/uploads/movies/cam-dau-thumb.jpg','Dive (La caída)','completed','1','95 Phút','2022','HD',NULL,'Lucía Puenzo','Karla Souza, Hernán Mendoza, Déja Ebergenyi','Thể Thao, Chính kịch','Âu Mỹ','<p>Mariel là một thợ lặn ưu tú kỳ cựu, người có một cơ hội cuối cùng tại Thế vận hội Olympic. Tuy nhiên, khi một sự thật khủng khiếp được đưa ra ánh sáng, Mariel phải đối mặt với câu hỏi cá nhân lớn nhất của mình: Có phải giấc mơ thực sự của cô là chiến thắng?</p>',2,0,11,0),(670,'Mathu Vadalara 2','https://img.ophim.live/uploads/movies/mathu-vadalara-2-thumb.jpg','Mathu Vadalara 2','ongoing','1','139 Phút','2024','HD',NULL,'Ritesh Rana','Sri Simha Koduri, Satya, Faria Abdullah, Sunil Varma, Rohini, Ajay, Vennela Kishore, Raja Chembolu, Gundu Sudarshan, Jeevan Kumar','Hài Hước, Hình Sự','Ấn Độ','Babu and Yesu, former delivery agents, embark on a thrilling mission as special agents, facing extraordinary challenges with humor, surprises, and nonstop excitement.',0,0,17,0),(671,'Chỉ còn ngày hôm qua','https://img.ophim.live/uploads/movies/chi-con-ngay-hom-qua-thumb.jpg','Only Yesterday','completed','1','1g 59ph','1991','HD',NULL,'','Imai Miki, Yanagiba Toshiro, Honna Yoko','Gia Đình, Chính kịch, Kinh Điển','Nhật Bản','<p>Từ trái dứa đến tình đầu: đó chính là câu chuyện ngày ấy bây giờ của cô gái 27 tuổi từ Tokyo. Khi cô rời thành phố cũng là lúc cô bước vào miền k