hật.',0,0,17,0),(679,'Đỉnh Mù Sương','https://img.ophim.live/uploads/movies/dinh-mu-suong-thumb.jpg','The Foggy Mountain','completed','1','1g 26phút','2020','HD',NULL,'Phan Anh,  Ken Đinh','Peter Phạm,  Simon Kook,  Thạch Kim Long,  Phạm Huy Thục,  Trúc Mây,  Lê Thảo,  Thiên Nhu,  Mona Bảo Tiên,  Anh Tú Wilson','Hành Động, Thể Thao, Võ Thuật, Phiêu Lưu','Quốc Gia Khác','<p>Bị kéo khỏi cuộc sống bình lặng, một võ sĩ trở về ngôi làng miền núi của mình để tìm cách trả thù những kẻ đã gây ra cái chết của vợ anh.</p>',1,0,11,0),(680,'Dịch vụ giao hàng của phù thủy Kiki','https://img.ophim.live/uploads/movies/dich-vu-giao-hang-cua-phu-thuy-kiki-thumb.jpg','Kiki’s Delivery Service','completed','1','1g 43ph','1989','HD',NULL,'','Takayama Minami, Sakuma Rei, Toda Keiko','Gia Đình, Kinh Điển','Nhật Bản','<p>Trong bộ phim hoạt hình phiêu lưu, cô phù thủy nhỏ rời xa gia đình để rèn luyện tay nghề. Thế nhưng với cô, việc kết bạn mới khó khăn làm sao!</p>',0,0,22,0),(681,'Vương Trùng Dương','https://img.ophim.live/uploads/movies/vuong-trung-duong-thumb.jpg','Rage and Passion','completed','20','45 phút/tập','1992','HD',NULL,'餘明生','Châu Huệ Mẫn, Lâm Thượng Võ, Lê Hân Trí, Trịnh Y Kiện, ','Phiêu Lưu, Chính kịch, Võ Thuật','Trung Quốc, Hồng Kông','Vương Trùng Dương là một bộ phim truyền hình Hồng Kông được chuyển thể từ tiểu thuyết Thần điêu đại hiệp và Anh hùng xạ điêu trở lại của Louis Cha. Nó được phát sóng lần đầu tiên trên TVB Jade ở Hồng Kông vào năm 1992.',1,0,18,0),(682,'Bút Ký Tư Gia Của Ngô Tà','https://img.ophim.live/uploads/movies/but-ky-tu-gia-cua-ngo-ta-thumb.jpg','Time Raiders','completed','18','44 phút/tập','2025','HD',NULL,'潘安子','吳鎮宇, 曹磊, 徐振轩, 程相, 孙葛川野, 李沐宸, 马京','Hành Động, Phiêu Lưu, Bí ẩn','Trung Quốc','Ngô Tà, chủ một tiệm đồ cổ, tình cờ tìm được một cuộn sách lụa bí ẩn. Chú Ba của Ngô Tà là Ngô Tam Tỉnh, phát hiện trong đó ẩn giấu một tấm bản đồ thần bí. Để tìm tung tích chủ nhân đã mất tích của cuộn sách lụa, chú Ba dẫn theo Ngô Tà, Phan Tử, Tiểu ca Trương Khởi Linh và Đại Khuê lập thành một đội thám hiểm, cùng lên đường đến những địa điểm trên bản đồ để giải mã bí ẩn. Trong hành trình này, Ngô Tà làm quen với Vương Bàn Tử, người cũng đến để thăm dò bí mật. Đối mặt với muôn vàn hiểm nguy, thậm chí bị những sinh vật thần bí tấn công, cả nhóm đã đoàn kết, dùng trí tuệ và lòng dũng cảm để hóa giải nguy nan. Sâu dưới lòng đất, thứ họ phát hiện được, một con Xà Mi Đồng Ngư, đã bất ngờ hé mở quá khứ bị chôn vùi của chú Ba. Sau cuộc gặp gỡ với người phụ nữ bí ẩn A Ninh, ông đột nhiên biến mất không dấu vết. Để điều tra rõ sự thật và tìm kiếm người chú mất tích, Ngô Tà cùng các bạn lại dấn thân vào một cuộc hành trình mới...',0,0,12,0),(683,'Chị em kình ngư','https://img.ophim.live/uploads/movies/chi-em-kinh-ngu-thumb.jpg','The Swimmers','completed','1','2g 15phút','2022','HD',NULL,'Sally El Hosaini','Manal Issa, Nathalie Issa, Matthias Schweighöfer, Ahmed Malek, Ali Suliman, Kinda Alloush, James Krishna Floyd, Nahel Tzegal, Akuc Bol','Thể Thao, Chính kịch','Anh','<p>Từ Syria bị chiến tranh tàn phá đến Olympic Rio 2016, hai chị em trẻ tuổi bắt đầu cuộc hành trình mạo hiểm, dành trọn trái tim và kỹ năng bơi lội của họ cho chính nghĩa.</p>',0,0,11,0),(684,'Lưỡng Diện Nhân','https://img.ophim.live/uploads/movies/luong-dien-nhan-thumb.jpg','Unnatural Born Killer','completed','20','47 phút/tập','1996','HD',NULL,'Trương Văn Càn','Dương Linh, Thái Thiếu Phân, Tiền Tiểu Hào, Trương Triệu Huy, ...','Võ Thuật','Trung Quốc, Hồng Kông','<p><i>Đời nhà Minh, Nghiêm Tế Phiên muốn trừ khử Dương Kế Thịnh nên đã cho người tiêu diệt toàn bộ nhà họ Dương. Trong số những người thừa lệnh có Trần Thiệu Nhân - kẻ sát thủ bất khả chiến bại, có tố chất rất khác biệt so với người thường. Trần Thiệu Nhân mang thú tính tàn ác, khát máu trong màn đêm đen tối và trở thành một con người khi vừa rạng sáng. Khi người vợ của y có thai, tính người ngày càng chiếm ưu thế trong con người của Thiệu Nhân, cuối cùng nhận ra tội ác mình đã gây ra bấy lâu...</i></p>',0,0,18,0),(685,'Anh Hùng Xạ Điêu','https://img.ophim.live/uploads/movies/anh-hung-xa-dieu-1994-thumb.jpg','The Legend of the Condor Heroes','completed','35','45 phút/tập','1994','HD',NULL,'李添勝','張智霖, 朱茵, 羅嘉良, 關寶慧, 駱應鈞, 黎耀祥, 劉丹, Chu Tit-Wo, 林偉, 林嘉華','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc, Hồng Kông','Hoàng Dung là con gái của đảo chủ đảo Đào Hoa, Đông Tà Hoàng Dược Sư và Phùng Thị Mai Hương. Nàng mồ côi mẹ từ nhỏ và được cha nuôi nấng, truyền thụ võ nghệ. Tính cách Hoàng Dung khá giống với cha mình, nàng thông minh, nhanh trí, nhiều mưu kế nhưng cũng rất điêu ngoa, cổ quái, thường làm việc theo ý mình. Hoàng Dung vô cùng xinh đẹp nhưng võ công rất cao, trên người lại mặc Nhuyễn Vị Giáp khiến cho những kẻ háo sắc không thể đến gần. Môn võ công nổi tiếng của nàng là Đả Cẩu Bổng Pháp. Một lần Hoàng Dược Sư mắng nàng, Hoàng Dung liền bỏ đi. Trên đường đi nàng cải trang thành thằng bé ăn mày và gặp gỡ Quách Tĩnh. Hoàng Dung nhanh chóng bị thu hút bởi sự tốt bụng, thật thà, chất phác, lương thiện của Quách Tĩnh. Nàng đã sắp xếp cho Quách Tĩnh học võ công của Bắc Cái Hồng Thất Công. Bản thân nàng cũng học quyền pháp Tiêu Dao Du từ vị tiền bối này. Trên quá trình hành tẩu giang hồ, Hoàng Dung và Quách Tĩnh đã trải qua rất nhiều sóng gió, có lúc bị thương nặng, có lúc lạc nhau hàng tháng trời. Sau cùng hai người cũng vượt qua kết làm phu thê. Hoàng Dung là bang chủ đời thứ 19 của Cái Bang.',0,0,12,0),(686,'Sự Thật Của Bóng Tối','https://img.ophim.live/uploads/movies/su-that-cua-bong-toi-thumb.jpg','Shades of Truth','completed','25','43 phút/tập','2004','HD',NULL,'','張智霖, 黎姿, 王喜, 楊茜堯, 元華, 劉家輝, 譚小環, 盧宛茵, 羅冠蘭, 劉愷威','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','After a slight injury on the head, Dung Chung Cho gains his past memories as Wu Song 900 years ago and tries to convince TC that he is his long lost brother Lin Chong. Meanwhile, one of Sung Po\'s men, Kwan Lo (Derek Kwok) begins to suspect Dung Chung Cho as an undercover for the police and is also plotting to overthrow Sung Po\'s position in the gang. How come the police can never gather enough information to capture the triads for holding illegal businesses and charge them for attempting to murder so many people? It is then when Dung Chung Cho begins to realize that there is also an undercover in the police force working for the triads.',0,0,17,0),(687,'Huyền Thoại Lướt Sóng','https://img.ophim.live/uploads/movies/huyen-thoai-luot-song-thumb.jpg','Chasing Mavericks','completed','1','116 phút','2012','HD',NULL,'','Gerard Butler','Hành Động, Thể Thao, Phiêu Lưu','Âu Mỹ','<p>Chasing Mavericks (tên ban đầu là Of Men and Mavericks),&nbsp;phim&nbsp;được chỉ đạo bởi&nbsp;Curtis Hanson,&nbsp;Gerard Butler&nbsp;sẽ đóng vai người thầy của Moriarty (do diễn viên mới nổi&nbsp;Jonny Weston&nbsp;thủ vai), 1 tay lướt ván đã làm nên tên tuổi tại Mavericks ở Phía bắc California.</p>',0,0,11,0),(688,'Thục Sơn Kỳ Hiệp','https://img.ophim.live/uploads/movies/thuc-son-ky-hiep-thumb.jpg','The Gods And Demons Of Zu Mountain','completed','20','43 phút/tập','1990','HD',NULL,'Tiêu Sinh, Lý Huệ Dân','Eddie Kwan Lai-Kit, Pauline Yeung Bo-Ling, Anita Lee Yuen-Wah, Mimi Kung, Wong Yee Kam, Jimmy Au Shui-Wai, Aaron Kwok, Joanna Chan Pui-San, Danny Summer, 劉江','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','After becoming a Blood Shadow with evil powers, traitor Ding Yinwei poses a threat to the world. Emei martial artists Qiong, Yun, Jingwo, Lingyun, and Jinchang set out to find the two demon-slaying swords to defeat him. On their journey, they encounter a repentant Ping and join forces. Even after obtaining the swords, the group faces challenges, particularly due to romantic entanglements. Now, they must defeat Ding in a final showdown.',0,0,18,0),(689,'Vịnh Barron','https://img.ophim.live/uploads/movies/vinh-barron-thumb.jpg','Barron\'s Cove','completed','1','116 Phút','2025','HD',NULL,'Evan Ari Kelman','Garrett Hedlund, Hamish Linklater, Brittany Snow, Christian Convery, Tramell Tillman, Raúl Castillo, Stephen Lang, Marc Menchaca, Guy Lockard, Peter McRobbie','Hình Sự, Chính kịch','Âu Mỹ','<p>Khi cậu con trai nhỏ bị một bạn học sát hại dã man, người cha đau khổ với quá khứ bạo lực đã bắt cóc chính đứa trẻ gây tội. Hành động này châm ngòi cho một cuộc truy lùng điên cuồng, dẫn đầu bởi một chính trị gia đầy quyền lực — cũng chính là cha của cậu bé bị bắt cóc.</p>',0,0,17,0),(690,'Chệch hướng','https://img.ophim.live/uploads/movies/chech-huong-thumb.jpg','Off Track','completed','1','1g 49phút','2022','HD',NULL,'Mårten Klingberg','Fredrik Hallgren, Katia Winter, Rakel Wärmländer, Ulf Stenberg, Chatarina Larsson, Susanne Thorson, Leif Andrée, Kalle Moraeus, Maria Sid, Kelly Flogell, Peter Perski, Mårten Klingberg, Torkel Petersson, Tuva Børgedotter Larsen, Christian Wennberg, Anders Brink Madsen','Hài Hước, Thể Thao, Chính kịch','Thụy Điển','<p>Trong tuyệt vọng, một bà mẹ đơn thân thất thế phải lên đồ và nỗ lực trượt tuyết ở Vasaloppet cùng ông anh theo chủ nghĩa hoàn hảo (mà chẳng mấy hoàn hảo) của mình.</p>',0,0,11,0),(691,'Thục Sơn Kỳ Hiệp 2: Tiên Lữ Kỳ Duyên','https://img.ophim.live/uploads/movies/thuc-son-ky-hiep-2-tien-lu-ky-duyen-thumb.jpg','The Zu Mountain Saga','completed','20','45 phút/tập','1991','HD',NULL,'Tiêu Sinh','Trịnh Y Kiện, Trần Tùng Linh, Hồ Diệu Phong, Quan Lễ Kiệt, Chung Thục Huệ, Ân Thụy Vỹ','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Phim Thục Sơn Kỳ Hiệp 2: Tiên Lữ Kỳ Duyên - The Zu Mountain Saga 1991: Sau khi nguyên thần huyết ma đã ra khỏi thân sát của Thạch Sanh đã không bị tiêu diệt mà đã nhập vào thân sát con gái của thánh cô là Thánh Nữ và lần này huyết ma còn tàn hơn khi nằm trong thân sát của Thạch Sanh. Nhưng Thánh Nữ lại yêu sư huynh của Dư An Nam, mọi chuyện tưởng như sẽ kết thúc khi sư huynh của Dư An Nam quyết định tiêu diệt ác ma nhưng cuối cùng anh cũng không thể ra tay mà còn bị huyết ma giết chết, sau khi giết chết người mình yêu Thánh nữ trở nên ác độc hơn gấp bội lần....Hãy đón xem phim Thục Sơn Kỳ Hiệp 2 xem cuối cùng ai sẽ là người tiêu diệt được Huyết ma phim với những màn võ thuật vô cùng hấp dẫn.',0,0,18,0),(692,'Thiếu Tướng Quân Thú Cưng Của Tôi','https://img.ophim.live/uploads/movies/thieu-tuong-quan-thu-cung-cua-toi-thumb.jpg','Be My Cat','completed','16','35 phút/tập','2021','HD',NULL,'Wu Qiang','Xiao Kaizhong, 田曦薇, Sun Xizhi, Wang Xiran, Zhang Guansen, 刘贾玺, Wang Yimeng, Xu Qin','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc','Ở nước Thanh Khâu, bên hồ Thanh Sơn của vùng Giang Châu có một tiệm thú cưng của bà chủ dễ thương tinh nghịch Tô Tiểu Hà (Điền Hy Vy đóng). Cô ấy tình cờ nhặt được một viên Lam Hồn Châu, đánh thức Hoàng tử Mèo đến từ DW tinh cầu. Hoàng tử Mèo hóa thần thành soái ca ngôn tình cộng thêm vẻ ngoài thần bí với tên gọi Mạc Tu Nhiễm (Tiêu Khải Trung đóng). Cả 2 cùng kí kết một bản khế ước nô bộc, mở ra một câu chuyện tình yêu nhân thú xuyên không vũ trụ, đánh bật mọi giống loài, cùng khám phá ra bí mật sau màn sương.',0,0,12,0),(693,'Lady Scorpions','https://img.ophim.live/uploads/movies/lady-scorpions-thumb.jpg','Lady Scorpions','completed','1','96 Phút','2024','HD',NULL,'','','Hành Động, Hình Sự','Âu Mỹ','An ex-FBI agent\'s fight against a crime syndicate becomes personal when they kidnap her granddaughter. She and her daughter, both martial arts masters, form an unstoppable team. Together, they outmaneuver and defeat the syndicate\'s henchmen in a calculated game of cat and mouse, on a relentless mission to save her and topple the criminal empire.',0,0,17,0),(694,'Giải cứu bóng đá','https://img.ophim.live/uploads/movies/giai-cuu-bong-da-thumb.jpg','The Soccer Football Movie','completed','1','1g 13phút','2022','HD',NULL,'Mitch Schauer','Zlatan Ibrahimović, Megan Rapinoe, Weird Al Yankovic','Hài Hước, Thể Thao, Gia Đình','Âu Mỹ','<p>Bốn cô cậu mê bóng đá cùng hợp sức giúp các thần tượng của mình giành lại năng lực sau khi một nhà khoa học xấu xa và mưu mô đánh cắp tài năng của họ.</p>',0,0,11,0),(695,'Thập Tứ Nữ Anh Hào','https://img.ophim.live/uploads/movies/thap-tu-nu-anh-hao-thumb.jpg','Young\'s Female Warrior','completed','30','44 phút/tập','1981','HD',NULL,'Vương Thiên Lâm','Uông Minh Thuyên, Hạ Vũ, Phụng Bửu Bửu, Tương Y, Huỳnh Mẫn Nghi, Giang Nghị, Thượng Quan Ngọc, La Lan, Hàn Mã Lợi','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Trung Quốc - Triều đại Bắc Tống vào thế kỷ thứ 10, đỉnh điểm của hiểm họa chiến tranh đe dọa, là lúc nước nhà cần lắm những nhân tài anh dũng bảo vệ tổ quốc. Không hiếm những anh hùng oai liệt xuất hiện vào thời bấy giờ, nhưng những cái tên được trọng vọng nhất phải kể đến các nữ tướng của Dương gia, dòng họ danh tướng đã bao đời tận tụy với tổ quốc. Trong một cuộc huyết chiến khốc liệt, tướng quân tài giỏi Dương Tông Bảo, người đàn ông trụ cột duy nhất trong gia tộc họ Dương đã tử trận nơi chiến trường. Không chỉ là sự mất mát lớn lao đối với quốc gia, cái chết của Dương Tông Bảo còn để lại nỗi đau vô vàn cho người vợ Mộc Quế Anh, cũng như toàn bộ thành viên của gia tộc. Nhưng rồi, cố nén nỗi đau tận đáy lòng, Mộc Quế Anh đứng lên thay chồng thống lĩnh đại gia đình, cầm quân lãnh đạo đánh giặc ngoại xâm. Cùng các nàng dâu và con gái oai dũng của Dương Gia, Mộc Quế Anh đã viết nên trang sử mới đầy hào hùng của lịch sử Trung Hoa. Dương Môn nữ tướng là bản thiên hùng ca về các nữ chiến binh oai hùng của một trong những gia tộc được trọng vọng nhất trong lịch sử Trung Hoa...</i></p>',0,0,18,0),(696,'Thiếu Nữ Đại Nhân','https://img.ophim.live/uploads/movies/thieu-nu-dai-nhan-thumb.jpg','Maiden Holmes','completed','32','45 phút/tập','2020','HD',NULL,'Li Xiaojiang','陈瑶, 张凌赫, Zhang Jiading, 王艺哲, 王術一, Yu Lei, 陈明, Liu Xin','Hành Động, Hài Hước, Phiêu Lưu, Bí ẩn','Trung Quốc','Nạp quốc Phạn Duyên vượt biên giới vào xâm lấn, Tề vương Bùi Diễn Chi mười chín tuổi, lãnh mệnh lúc lâm nguy, hắn hăng hái chiến đấu đẫm máu xoay chuyển chiến tranh, vào giây phút cuối cùng lại trúng mai phục, toàn quân bị diệt. Tề Vương tìm được đường sống trong chỗ chết trở về lại bị Vân vương vấn tội, tước đi binh quyền. Đối mặt với Vân vương nâng đỡ ấu đế đăng cơ, ngầm đoạt hoàng quyền, Tề vương cùng Tiểu hoàng đế thỏa thuận cùng nhau, lựa chọn tạm thời nhượng bộ. Từ đó, Tề Vương không hỏi đến triều cương nữa, lén dùng tên giả là Bùi Chiêu, bắt đầu du hí nhân gian. Kì thật là đi âm thầm điều tra chân tướng bại trận năm đó.',0,0,12,0),(697,'Honey Đừng!','https://img.ophim.live/uploads/movies/honey-dung-thumb.jpg','Honey Don\'t!','completed','1','89 Phút','2025','HD',NULL,'Ethan Coen','Margaret Qualley, Aubrey Plaza, Chris Evans, Lera Abova, Jacnier, Gabby Beans, Talia Ryder, Charlie Day, Kristen Connolly, Josh Pafchek','Hài Hước, Hình Sự','Âu Mỹ, Anh','Honey O’Donahue, một nữ thám tử tư ở thị trấn nhỏ, bắt đầu điều tra hàng loạt cái chết kỳ lạ có liên quan đến một nhà thờ bí ẩn.',0,0,17,0),(698,'Blue Lock','https://img.ophim.live/uploads/movies/blue-lock-thumb.jpg','ブルーロック','ongoing','24','24 phút/tập','2022','HD',NULL,'','','Hành Động, Thể Thao, Học Đường','Nhật Bản','<p>Nhật Bản gặp khó khăn trở lại đường đua sau thảm họa World Cup 2018. nhưng liên tục cảm thấy như thể thiếu một cái gì đó? Vâng, họ có một tiền đạo không thể đánh bại, người có thể giúp họ giành chiến thắng. JFA cam kết sản xuất một tiền đạo khao khát cả mục tiêu và chiến thắng để anh ta có thể trở thành thành phần quan trọng trong việc phục hồi sau các trận thua. 300 cầu thủ xuất sắc nhất Nhật Bản và cầu thủ trẻ tài năng nhất đã được tập hợp cho mục đích này. Ai sẽ trở thành thành viên hàng đầu của nhóm lãnh đạo? Liệu họ có thể vượt qua được bắp tay và cái tôi của mọi người cản đường họ?</p>',0,0,11,0),(699,'Ma Đạo Tranh Bá 3: Duyên Kiếp Luân Hồi','https://img.ophim.live/uploads/movies/ma-dao-tranh-ba-3-duyen-kiep-luan-hoi-thumb.jpg','Vampire Expert III: Coincidentally','completed','15','90 Phút/Tập','1999','HD',NULL,'Lâm Chánh Anh','Lâm Chánh Anh, Lâm Văn Long, Dương Cung Như, Văn Tụng Nhàn, Doãn Thiên Chiếu','Võ Thuật, Kinh Dị','Hồng Kông','<p><i>Ma đạo Tranh bá 3: Duyên kiếp luân hồi là phần tiếp theo và dàn diễn viên của ma đạo tranh bá 2.Tuy nhiên phần này chú Lâm Chánh Anh chỉ đóng vai thứ chính Gồm nhiều diễn viên nổi tiếng: Lâm Chánh Anh, Lâm Văn Long, Dương Cung Như, Văn Tụng Nhàn, Doãn Thiên Chiếu...</i></p>',1,0,18,0),(700,'Khuấy Đảo Bollywood','https://img.ophim.live/uploads/movies/khuay-dao-bollywood-thumb.jpg','The Ba***ds of Bollywood','completed','7','42 phút/tập','2025','HD',NULL,'Aryan Khan','Lakshya Lalwani, Bobby Deol, Farhan Qureshii, Sahher Bambba, Mona Singh, Sara Ali Khan, Ibrahim Ali Khan, Ranbir Kapoor, Alia Bhatt, Raghav Juyal','Hành Động, Hài Hước, Phiêu Lưu','Ấn Độ','<p>Trong loạt phim chính kịch đầy rủi ro này, một kẻ ngoại đạo tham vọng cùng bạn bè xoay xở với thế giới Bollywood hỗn loạn, hoành tráng nhưng cũng đầy bất trắc.</p>',0,0,12,0),(701,'The Dead Girls','https://img.ophim.live/uploads/movies/the-dead-girls-thumb.jpg','The Dead Girls','ongoing','6','65 phút/tập','2025','HD',NULL,'','Arcelia Ramírez, Paulina Gaitán, Joaquín Cosío, Alfonso Herrera, Tenoch Huerta Mejía, Salvador Sánchez, Dagoberto Gama, Álex Perea, Mauricio Isaac, Fernando Bonilla','Hình Sự, Chính kịch','Mexico','<p>Chuyển thể từ tiểu thuyết của Jorge Ibargüengoitia, loạt phim này kể về cách chị em nhà Baladro xây dựng đế chế nhà thổ và trở thành những sát nhân tàn nhẫn ở Mexico thập niên 60.</p>',0,0,17,0),(702,'Redeem Team: Đội bóng rổ siêu sao','https://img.ophim.live/uploads/movies/redeem-team-doi-bong-ro-sieu-sao-thumb.jpg','The Redeem Team','completed','1','1g 38phút','2022','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Sau phần thể hiện gây sốc ở Thế vận hội 2004, đội tuyển bóng rổ nam Hoa Kỳ tìm cách chuộc lỗi khi họ nhắm đến huy chương vàng ở Thế vận hội Bắc Kinh 2008.</p>',0,0,11,0),(703,'Đại Đao Hào Hiệp','https://img.ophim.live/uploads/movies/dai-dao-hao-hiep-thumb.jpg','The Legendary Hero','completed','20','45 phút/tập','1990','HD',NULL,'Hứa Mỹ Quân','Liên Vỹ Kiện, Ngô Nguyên Tuấn, Dương Gia Nặc, Trương Tranh, La Liệt, Giang Đồ, lưu ngọc Đình, Châu Tú Lan, Ngô Đình Diệp','Võ Thuật, Cổ Trang','Hồng Kông','<p><i>Truyện mô tả vua Bình Tây Tào Quốc Uy vì có thù với bọn cướp Kim long Sơn, con gái của ông là Tào Thúy Nga (Cố Mị) bị bắt đi; Tào rất lo lắng và nhờ kiếm khách Nhạc Chấn Bắc (Đường Tinh) giúp đỡ. Nhạc ước tính rằng một mình vẫn chưa đủ, vì vậy anh đã mời em gái của 1 người bạn, Mã Kim Linh (Lý Tinh), cung thủ của Bách bộ xuyên dương. Họ tìm gặp người đánh cá Lý Tiểu Thất (Cốc Phong ); Lý cũng tiến cử người tiều phu Ngưu Mại (Tỉnh Miểu) dũng mãnh khỏe như trâu; Bốn người cẩn thận từng bước, trên đường đi gặp Lương Thượng Phi, một tên trộm đang bí mật hỗ trợ…</i></p>',0,0,18,0),(704,'Thiếu Niên Du Chi Một Tấc Tương Tư','https://img.ophim.live/uploads/movies/thieu-nien-du-chi-mot-tac-tuong-tu-thumb.jpg','Love in Between','completed','43','45 phút/tập','2020','HD',NULL,'毛鲲宇','张耀, 张雅钦, Zhou Tingwei, Deng Yuli, Zheng Hao, 石云鹏, Mengyuan Xu, Song Yagang, Hu Linxi, Shi Chenwei','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc','Thuở nhỏ, mẫu thân Tả Khanh Từ sống phận thiếp lẽ, bị vợ cả hạ độc nên dù là công tử độc nhất của Hầu phủ nhưng Tả Khanh Từ phải sống mai danh ẩn tích. Tô Vân Lạc mang trong mình dòng máu Hồ cơ, bị người Hán khinh rẻ, chỉ riêng sư phụ ở bên nuôi dưỡng, chăm sóc cho nàng. Sau này, sư phụ của Tô Vân Lạc phát điên, nàng trở thành sát thủ để kiếm tiền mua thuốc, mời thầy lang. Trong một lần tình cờ, Tả Khanh Từ gặp Tô Vân Lạc, cả hai nhanh chóng rơi vào lưới tình nhưng gặp nhiều sóng gió bởi cách biệt thân phận, bí ẩn quốc gia, thù hận giang hồ.',0,0,12,0),(705,'Yama no Susume Next Summit','https://img.ophim.live/uploads/movies/yama-no-susume-next-summit-thumb.jpg','Encouragement of Climb: Next Summit','ongoing','13','24 phút/tập','2022','HD',NULL,'','','Thể Thao','Nhật Bản','<p>New Yama no Susume anime.</p>',0,0,11,0),(706,'Thần Đao','https://img.ophim.live/uploads/movies/than-dao-thumb.jpg','The God of Sabre','completed','9','46 phút/tập','1979','HD',NULL,'Lý Đỉnh Luân','Lưu Tùng Nhân, Triệu Nhã Chi, Hàn Mã Lợi, Thạch Kiên','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Với sự góp mặt của 2 cái tên rất đáng chú ý của đài TVB trong thập niên 70 thế kỷ trước là Lưu Tùng Nhân và Triệu Nhã Chi, Thần Đao xứng đáng là một trong những dự án đáng chú ý của nhà đài trong năm 1979. Phim bắt đầu từ việc hiệp sĩ Đinh Bằng (Lưu Tùng Nhân) tìm Liễu Nhược Tùng thử kiếm tại Vạn Tùng Sơn Trang. Trên đường đi, Bằng bị vợ của Tùng giả làm Lý Khả Tiểu để gạt lấy kiếm phổ Thiên Ngoại Lưu Tinh, không những thế còn bị đánh trong thương, may mắn trốn được và trong lúc nguy ngập nhất đã được một thiếu nữ xinh đẹp tên Thanh Thanh (Triệu Nhã Chi) cứu giúp. Nàng đưa Bằng tới Cốc Vong Ưu, nơi cha cô đang làm cốc chủ, sau khi biết 2 người có tình cảm với nhau, ông liền hứa gả Thanh Thanh cho Bằng, hơn nữa còn tặng Bằng một con đao quý và dạy Bằng đao pháp chân truyền. Học được đao pháp, Bằng muốn tìm Nhược Tùng để trả mối thù ngày nào, sau khi giăng bẫy thành công, 2 người đã có một trận quyến chiến và Tùng và người bại trận. Võ công tiến bộ, Bằng lại đâm ra muốn thách đấu nhiều người hơn, người mà anh muốn đấu sau khi thắng Tùng chính là Tạ Liễu Phong của Thần Kiếm Sơn Trang, anh lấy làm tiếc khi chưa có dịp thử tài. Tuy nhiên, sau khi biết Phong không có ý quyết đấu, anh đã bỏ chuyện. Một ngày nọ, Bằng biết được con gái của Phong tên Tiểu Ngọc (Hàn Mã Lợi), chính là thủ lĩnh của Liên Vân Thập Tư Sát, Ngọc cho rằng cô chỉ mượn võ của Bằng để tiêu diệt họ và cũng cho anh biết một bí mật của Thanh Thanh, rằng nàng ta cũng là một phần tử của Ma giáo, điều này đã khiến Bằng hết sức ngạc nhiên…</i></p>',0,0,18,0),(707,'Người đàn ông của tù trưởng','https://img.ophim.live/uploads/movies/nguoi-dan-ong-cua-tu-truong-thumb.jpg','Mr. Fox and Miss Rose','completed','30','40 phút/tập','2020','HD',NULL,'Zhu Dong Ning','张雅钦, 任宥纶, Chen Xijun, Yu Hao Yang, Jie Bing, Zhang Han','Hành Động, Hài Hước, Phiêu Lưu','Trung Quốc','<p>Bộ phim kể về câu chuyện của một nữ tù trưởng đến từ một bộ lạc nguyên thủy bí ẩn và một người đàn ông thành thị thượng lưu. Hai người là hai “loài” hoàn toàn khác biệt, bất ngờ gặp gỡ và “thuần hóa” nhau.</p>',0,0,12,0),(708,'Nhiệm Vụ','https://img.ophim.live/uploads/movies/nhiem-vu-thumb.jpg','Task','ongoing','1','430 phút/tập','2025','HD',NULL,'','Mark Ruffalo, Tom Pelphrey, Emilia Jones, Jamie McShane, Sam Keeley, Thuso Mbedu, Fabien Frankel, Alison Oliver, Raúl Castillo, Martha Plimpton','Hình Sự, Chính kịch','Âu Mỹ','<p>Tại ngoại ô Philadelphia, một đặc vụ FBI dẫn đầu lực lượng đặc nhiệm điều tra chuỗi cướp bạo lực, do người đàn ông tưởng chừng hiền lành cầm đầu.</p>',0,0,17,0),(709,'Nhiệt huyết bóng bầu dục','https://img.ophim.live/uploads/movies/nhiet-huyet-bong-bau-duc-thumb.jpg','Gridiron Gang','completed','1','2g 5phút','2006','HD',NULL,'Phil Joanou','Dwayne Johnson,  Xzibit,  Kevin Dunn,  Leon Rippy,  Jade Yorker,  Setu Taase,  L. Scott Caldwell,  David V. Thomas,  Brandon Mychal Smith,  Jamal Mixon','Thể Thao, Chính kịch','Âu Mỹ','<p>Trong bộ phim chính kịch cảm động này, một nhân viên quản chế tại trại giam thanh thiếu niên hi vọng có thể rèn giũa những tội nhân ấy thành một đội bóng bầu dục cừ khôi.</p>',0,0,11,0),(710,'Hận Sầu Bàng','https://img.ophim.live/uploads/movies/han-sau-bang-thumb.jpg','The Folk Tales','completed','22','45 phút/tập','1996','HD',NULL,'','Dương Cung Như, Vương Diễm Na, Vương Vi, Văn Tụng Nhàn, Điền Nhụy Ni, Huỳnh Ái Dao, Viên Khiết Nghi, Quách Phong, Lý Nhuận Kỳ, Lưu Tích Hiền, Khương Hạo Văn, Long Quý Tường, Đỗ Văn Trạch, Nam Hồng, Đàm Bỉnh Văn','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Gồm 8 cốt truyện trong nhân gian: Bát Hỉ Đồ, Ngọc Cung Duyên, Ngọc Đường Xuân, Tạ Thế Ký, Tình Đời Ấm Cúng, Hoa Nhuệ Phu Nhân, Ngọc Quỉ Bào Tiên, Kẻ Đã Choàng Khăn Xanh</i></p>',0,0,18,0),(711,'Thế Hệ V (Phần 2)','https://img.ophim.live/uploads/movies/the-he-v-phan-2-thumb.jpg','Gen V (Season 2)','ongoing','5','55 phút/tập','2025','HD',NULL,'','Jaz Sinclair, Lizze Broadway, Maddie Phillips, London Thor, Derek Luh, Asa Germann, Sean Patrick Thomas, Hamish Linklater','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Âu Mỹ','As America adjusts to Homelander\'s reign, at Godolkin University, the new Dean preaches a course to make students more powerful than ever. Cate and Sam are heroes, while Marie, Jordan, and Emma return to class, after months of trauma. War is brewing between Humans and Supes and our crew learns of a secret program from the 60s that may be significant to today. And, somehow, Marie is a part of it.',0,0,12,0),(712,'Bí Mật Của Trái Tim','https://img.ophim.live/uploads/movies/bi-mat-cua-trai-tim-thumb.jpg','Secret of the Heart','completed','61','45 phút/tập','1998','HD',NULL,'','陳錦鴻, 羅嘉良, 宣萱, 蔡少芬, 黃日華, 張家輝, 郭藹明, 秦沛, 雪妮, 吳美珩','Hành Động, Hình Sự, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','<p>Bí Mật Trái Tim (Secret of the Heart) là một bộ phim của TVB năm 1998, phát sóng lần đầu từ ngày 16 tháng 2 năm 1998 đến ngày 10 tháng 5 năm 1998. Bộ phim quy tụ dàn diễn viên hùng hậu gồm La Gia Lương, Huỳnh Nhật Hoa, Quách Mỹ Tâm, Châu Nhuận Phát, Trần Tuệ Minh, Thái Thiếu Phân, Tuyên Huyên và Trương Gia Huy. Phim đã giành được ba giải thưởng thường niên của TVB, bao gồm Nam diễn viên chính xuất sắc nhất cho La Gia Lương, Nữ diễn viên chính xuất sắc nhất cho Thái Thiếu Phân và Giải thưởng Diễn xuất xuất sắc nhất cho Trương Gia Huy. Phim cũng được phát lại vào giờ khuya trong các năm 2003 và 2010. Phim đã được làm lại kỹ thuật số cho lần phát lại năm 2010.</p>',0,0,17,0),(713,'Kuroko - Tuyển thủ vô hình: Cúp mùa đông: Bước qua cánh cửa','https://img.ophim.live/uploads/movies/kuroko-tuyen-thu-vo-hinh-cup-mua-dong-buoc-qua-canh-cua-thumb.jpg','Kuroko’s Basketball: Winter Cup Highlights  ~Crossing the Door~','completed','1','1g 28phút','2016','HD',NULL,'Tada Shunsuke','Ono Kensho,  Ono Yuki,  Saito Chiwa,  Hosoya Yoshimasa,  Hamada Kenji,  Nojima Hirofumi,  Ono Daisuke,  Suzuki Tatsuhisa,  Kamiya Hiroshi,  Hatano Wataru,  Kimura Ryohei,  Suwabe Junichi,  Suzumura Kenichi','Thể Thao, Chính kịch','Nhật Bản','<p>Khi Shutoku thua trận bán kết, Kuroko và đồng đội đối đầu với Akashi Seijuro bất khả chiến bại của trường Trung học Rakuzan trong trận đấu cuối cùng của Cúp mùa đông.</p>',0,0,11,0),(714,'Lữ Khách Cô Đơn','https://img.ophim.live/uploads/movies/lu-khach-co-don-thumb.jpg','The Maverick','completed','20','42 phút/tập','1982','HD',NULL,'Ngũ Nhuận Toàn','Châu Nhuận Phát, Trang Tịnh Nhi, Âu Dương Phối San, Tuyết Ly','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Thành chủ của Thiên Hạ Đệ Nhất Thành - Âu Dương Khiêm có một đứa con rơi tên Liễu Trì .Vào đúng ngày sinh của Trì, có lời sấm truyền Hung Tinh hạ thế, nên Âu Dương Khiêm hạ lệnh giết chết toàn bộ những đứa bé sơ sinh được sinh ra trong ngày đó. Trì may mắn thoát khỏi họa sát thân, lớn lên trở về Đệ Nhất Thành ngăn cản mưu đồ bá nghiệp của Âu Dương Mộng Phi...</i></p>',0,0,18,0),(715,'Kuroko - Tuyển thủ vô hình: Cúp mùa đông: Tận cùng giọt lệ','https://img.ophim.live/uploads/movies/kuroko-tuyen-thu-vo-hinh-cup-mua-dong-tan-cung-giot-le-thumb.jpg','Kuroko’s Basketball: Winter Cup Highlights  ~Beyond the Tears~','completed','1','1g 27phút','2016','HD',NULL,'Tada Shunsuke','Ono Kensho,  Ono Yuki,  Saito Chiwa,  Hosoya Yoshimasa,  Hamada Kenji,  Nojima Hirofumi,  Kimura Ryohei,  Hoshi Soichiro,  Suzumura Kenichi,  Taniyama Kisho,  Ono Daisuke,  Suwabe Junichi,  Kamiya Hiroshi','Thể Thao, Chính kịch','Nhật Bản','<p>Trường Trung học Seirin tiếp tục hành trình ở Cúp mùa đông khi đối mặt với các đội kình địch do các cầu thủ thuộc Thế hệ Kỳ tích dẫn dắt.</p>',0,0,11,0),(716,'Sứ Đồ Hành Giả','https://img.ophim.live/uploads/movies/su-do-hanh-gia0-2014-thumb.jpg','Line Walker','completed','31','42 phút/tập','2014','HD',NULL,'','林峯, 馬國明, 許紹雄, 苗僑偉, 袁偉豪, 蔡思貝, 張振朗, 黃翠如, 黃智雯, 江美儀','Hình Sự','Trung Quốc, Hồng Kông','<p>Bộ phim xoay quanh cuộc sống của những cảnh sát chìm phải sống hai mặt trong bí mật. Không biết khi nào mới có thể trở lại cuộc sống bình thường, họ còn phải chịu đựng nỗi sợ hãi thường trực bị phát hiện bởi những người họ được giao nhiệm vụ thâm nhập. Tuy nhiên, lần này, tính mạng của họ bị đe dọa khi phát hiện ra một nội gián sống trong lực lượng cảnh sát.</p>',0,0,17,0),(717,'Võ Lâm Thế Gia','https://img.ophim.live/uploads/movies/vo-lam-the-gia-thumb.jpg','The Fallen Family','completed','20','42 phút/tập','1985','HD',NULL,'Lý Đình Luân','Trương Quốc Vinh, Trương Mạn Ngọc, Tạ Hiền, Dương Trạch Lâm, Lưu Giang, Lý Quốc Lân, Quan Lễ Kiệt, Âu Dương Chấn Hoa','Chính kịch, Võ Thuật','Trung Quốc, Hồng Kông','<p><i>Cuối đời nhà Minh, gia đình họ Phương nổi tiếng nhất về chế tạo vũ khí. Con cả của gia đình này là Phương Tuấn Nhân biết tin công chúa Đoàn Liễu Nhi (Trương Mạn Ngọc) sắp sửa tới trung nguyên mua binh khí nên sai con riêng của ông là Phương Hạo Thiên (Trương Quốc Vinh) tới giao tiếp. Trong một cuộc tai nạn Hạo Thiên đã cứu mạng Liễu Nhi, nên hai người bắt đầu thương nhau. Họ Phương chiếm đoạt một tiểu trang, vì muốn trả thù họ đã bắt cóc em của Hạo Thiên, được Hạo Thiên xả thân tương cứu. Liễu Nhi bị mất một số vàng và Hại thiên bị chú ba là Tống Trí (Lưu Giang) đổ tội, Hạo Thiên bị Tống Trí ép hại nên Tống Trí đã lặp âm mưu với người thân gia đình mình là nhà họ Khưu để ép hại Hạo Thiên...</i></p>',0,0,18,0),(718,'Cuộc Chiến Nữ Quyền','https://img.ophim.live/uploads/movies/cuoc-chien-nu-quyen-2018-thumb.jpg','The Forgotten Valley','completed','20','45 phút/tập','2018','HD',NULL,'','黃浩然, Grace Chan, 蘇玉華, 劉江, 呂珊, 朱晨麗, 龔嘉欣','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','Lục Thủy Phong (do Vương Hạo Nhiên đóng) và La Quế Tư (do Trần Khải Lâm giữ vai) là đôi vợ chồng muốn thay đổi và xây dựng quê hương phong kiến và lạc hậu của mình, nhưng họ bị cản trở bởi sự cai trị của Lục Kim Cốc (do Lưu Giang thủ vai), người cha cũng là trưởng thôn, và bị cuốn vào chuyện hồn ma tân nương giết người, bắt cóc. Một nhóm phụ nữ bị áp bức, bao gồm ba cô vợ lẻ của Kim Cốc và nhiều chị em khác, không cam tâm tiếp tục bị đối đãi bất công từ cánh đàn ông, lén lút tổ chức một liên minh nhằm bảo vệ các chị em trong làng bị bức hại. Cuộc chiến của phái yếu chống lại phái mạnh đã diễn ra ngày càng khốc liệt, và tình cảm giữa hai vợ chồng Phong và Tư cũng gặp nhiều thử thách. Trong phim còn có sự tham gia của các diễn viên như Tô Ngọc Hoa, Chu Lệ Thần, Cung Gia Hân, Nguyễn Triệu Tường.',0,0,12,0),(719,'Kuroko - Tuyển thủ vô hình: Cúp mùa đông: Bóng tối và ánh sáng','https://img.ophim.live/uploads/movies/kuroko-tuyen-thu-vo-hinh-cup-mua-dong-bong-toi-va-anh-sang-thumb.jpg','Kuroko’s Basketball: Winter Cup Highlights  ~Shadow and Light~','completed','1','1g 27phút','2016','HD',NULL,'Tada Shunsuke','Ono Kensho, Ono Yuki, Saito Chiwa, Hosoya Yoshimasa, Hamada Kenji, Nojima Hirofumi, Suwabe Junichi, Nakai Kazuya, Orikasa Fumiko, Kimura Ryohei, Ono Daisuke, Suzumura Kenichi, Kamiya Hiroshi','Thể Thao, Chính kịch','Nhật Bản','<p>Cao Trung Seirin đối đầu với Học viện Touou và Aomine – đồng đội cũ của Kuroko – trong vòng đầu tiên của Cúp Mùa Đông. Trước đây là bạn bè, nhưng giờ họ là đối thủ.</p>',0,0,11,0),(720,'Nữ Hoàng Lừa Đảo','https://img.ophim.live/uploads/movies/nu-hoang-lua-dao-kr-thumb.jpg','Confidence Queen','ongoing','14','61 phút/tập','2025','HD',NULL,'Nam Ki-hoon','박민영, 박희순, 주종혁, 현봉식','Hài Hước, Hình Sự','Hàn Quốc','<p>Ba tên lừa đảo với xuất thân khác nhau, hợp sức thực hiện một kế hoạch trả thù táo bạo và đầy mạo hiểm chống lại những kẻ phản diện của thời đại này. Yun I Rang, một tên lừa đảo với chỉ số IQ 165 và trí tuệ thiên tài thuộc top 1%, dẫn dắt nhóm với tư cách là một thủ lĩnh tự tin và lôi cuốn với lối suy nghĩ 4 chiều. Myung Gu Ho, một tên lừa đảo kỳ cựu với khiếu hài hước và dí dỏm, thể hiện bộ kỹ năng đa dạng của một kẻ lừa đảo bậc thầy. James, thành viên nhỏ tuổi nhất của nhóm, với tính cách trong sáng và chính trực, toát lên vẻ đáng yêu của một thành viên nhỏ tuổi vui tươi và tình cảm.</p>',0,0,17,0),(721,'Du Kiếm Giang Hồ','https://img.ophim.live/uploads/movies/du-kiem-giang-ho-thumb.jpg','Vagabond Vigilante','completed','40','45 phút/tập','2006','HD',NULL,'Đường Cơ Minh','Hà Gia Kính, Quách Thiện Ni, Trần Cẩm Hồng, Trần Long, Trần Di Dung, Lý Thiên Tường, Dương Tuyết','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Vừa biết tin Mạnh Nguyên Siêu (do Trần Long đóng) bị giết chết, tổng tiêu đầu Dương Mục (do Trần Cẩm Hồng đóng) lập tức mang sính lễ đến hỏi cưới Vân Tử La (do Quách Thiện Ni đóng). Lúc này, La đã mang cốt nhục của Siêu. Để bảo toàn tính mạng đứa bé, cô đành nhận lời lấy Mục. Thật ra, Siêu đã thoát chết trong gang tấc. Anh định trở về hội ngộ cùng La nhưng đã quá muộn. Siêu đành lặng lẽ bỏ đi, dồn hết tâm sức để thực hiện di nguyện của cha – liên minh tiêu cục của 18 tỉnh. Ước vọng của Siêu gặp nhiều sóng gió vì sự xuất hiện của phái Phù Tang mà người đứng đầu là Mưu Tông Đào (do Lý Thiên Tường đóng). Vì Siêu vô tình giúp sư muội Lâm Vô Song (do Trần Di Dung đóng) đoạt được ngôi vị tôn chủ của phái Phù Tang, nên Đào càng căm hận Siêu. Trong khi đó, Mục lo sợ mất La, đã vu cho Siêu tội thông dâm, khiến anh thân bại danh liệt. Tổ chức liên minh chưa kịp ra đời đã bị chết yểu. Thừa cơ hội này, Đào cấu kết với tổng lệnh ngự lâm quân Bắc Cung Vọng (do Lưu Vệ Hoa đóng), mua chuộc Mục, tiếp tục dồn Siêu vào con đường cùng. May thay, bên cạnh Siêu còn có Mậu Trường Phong (do Hà Gia Kính đóng). Chẳng những ngưỡng mộ đạo pháp của Mạnh gia, Phong còn yêu thầm La từ rất lâu. Cho nên, anh nguyện bất chấp tất cả để giúp đỡ Siêu và La, kể cả phải hy sinh tính mạng của mình.</i></p>',0,0,18,0),(722,'Lực Lượng Đặc Biệt','https://img.ophim.live/uploads/movies/luc-luong-dac-biet-1999-thumb.jpg','Anti-Crime Squad','completed','22','40 phút/tập','1999','HD',NULL,'','陳浩民, 吳毅將, 邵美琪, 何韻詩, 黎耀祥, 蘇玉華, 楊婉儀, 馬蹄露, 魏駿傑, 謝天華','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','Cao Hỷ là một nhân viên trong lực lượng đặc biệt chống tội phạm, anh có cá tính cứng rắn và không bao giờ thỏa hiệp. Hỷ đã phá nhiều vụ án phức tạp, nhưng lại có thói quen làm việc một cách độc đoán, không thích hợp tác với các đồng nghiệp khác trong đội, đặc biệt là đối với Phàm - cấp trên của anh - và Đường Kiện Khang, một nhân viên vừa mới tham gia lực lượng, do đó Khang nảy sinh ý định muốn rút lui. Về sau, nhiều lần hợp tác làm việc, Hỷ và Khang tỏ ra hiểu nhau hơn và trở thành một cặp bài trùng. Khang đã giúp Hỷ tìm lại được năng lực và ý chí chiến đấu ban đầu để cùng với các đồng nghiệp khác như Chu Lai Đệ, \"Con cào cào\", Phật Gia phá tan nhiều vụ trọng án: \"Tử Vân Sơn Bá Vương\", \"Bão Táp Học Đường\", \"Phong Ba Ngư Trường\" và \"Anh Hùng Ảo Ảnh\".',0,0,12,0),(723,'Tội lỗi của người mẹ','https://img.ophim.live/uploads/movies/toi-loi-cua-nguoi-me-thumb.jpg','Sins of Our Mother','completed','3','50 phút/tập','2022','HD',NULL,'Skye Borgman','','Hành Động, Thể Thao, Phiêu Lưu, Tài Liệu','Âu Mỹ','<p>Cuộc tìm kiếm các con mất tích của Lori Vallow hé lộ dấu vết của một loạt cái chết đáng ngờ, người chồng mới của cô có chung quan điểm về ngày tận thế – và án mạng.</p>',0,0,11,0),(724,'Thiết Mã Gặp Chiến Xa','https://img.ophim.live/uploads/movies/thiet-ma-gap-chien-xa-thumb.jpg','Speed of Life','completed','20','45 phút/tập','2016','HD',NULL,'','黃德斌, 袁偉豪, 馬蹄露, 吳家樂, 唐詩詠, 蔡思貝, 簡慕華, 曹永廉, 敖嘉年, 胡諾言','Hành Động, Hình Sự, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','<p>Thanh tra giao thông và an toàn giao thông Hồng Kông, To Cheuk Fung, tận tụy với nhiệm vụ của mình. Anh và cấp dưới thường xuyên hoạt động bí mật để có thể dễ dàng truy tố những kẻ chạy quá tốc độ, lái xe khi say rượu và có bằng lái xe bất hợp pháp. Cheuk Fung là một người cực kỳ lạnh lùng, nghiêm túc trong lời nói và hành vi, nhưng anh lại là bạn thân một cách kỳ lạ với Sze Ma, một cảnh sát ồn ào của đội điều tra. Bộ đôi này không nói nên lời khi gặp cảnh sát tân binh Bui Sam Yau, người mà họ cho rằng sẽ không thể chịu được những yêu cầu khắt khe của Cheuk Fung. Nhưng sau khi Sam Yau giúp Cheuk Fung xua tan nỗi lo lắng mà anh đã giữ kín trong lòng nhiều năm, hai người trở nên cực kỳ thân thiết, hình thành nên mối quan hệ cha con giả tạo. Màn trình diễn xuất sắc của Sam Yau đã thu hút sự chú ý của Sze Ma, người đã thuyết phục cô gia nhập đội của anh. Sze Ma không mấy hài lòng với cấp dưới của mình là Yiu Yiu, người thích làm mọi thứ theo sách vở và không thể theo kịp phong cách điều tra tỉ mỉ của Sze Ma. Trong khi đó, một băng đảng đua xe đang gây náo loạn trên đường phố, gửi những thông điệp khiêu khích đến cảnh sát. Cheuk Fung và đồng đội được bật đèn xanh để truy tìm chúng, nhưng cuối cùng anh lại bước vào ranh giới nguy hiểm. Một màn sương đen mà anh luôn né tránh lại hiện ra trước mắt anh.</p>',0,0,17,0),(725,'Mộc Phủ Phong Vân','https://img.ophim.live/uploads/movies/moc-phu-phong-van-thumb.jpg','Mộc Phủ Phong Vân','completed','40','45 phút/tập','2012','HD',NULL,'Vu Vinh Quang','Phan Hồng, Châu Hiểu Ngư, Chu Ja Hyun, Lữ Lương Vỹ, Vu Vinh Quang','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>\"Mộc phủ phong vân\" nói về Mộc phủ thời nhà Minh ở Vân Nam do Thổ ty Mộc thị người Nạp Tây thống trị và những ân oán tình thù, tranh giành địa vị quyền lực bên trong Mộc phủ.</i><br><i>Phim lấy bối cảnh thành phố Lệ Giang (thành cổ Lệ Giang), bày ra những biến hóa lịch sử của Mộc thị, lấy bối cảnh là Mộc phủ và Lệ Giang phong cảnh hữu tình, ưu tú tráng lệ cùng với nét đẹp văn hóa dân tộc đầy màu sắc rực rỡ.</i><br><i>Mộc Phủ - Lệ Giang, vùng cổ trấn tuyệt đẹp của Trung Hoa. Được ví như Tử Cấm thành của phương nam, Mộc phủ là công trình phủ đệ lớn nhất còn lại sau bao nhiêu năm biến cố đổi thay Chủ nhân của Mộc phủ là dòng họ người Nạp Tây, sau đó quy thuận nhà Minh, nên Minh Thái tổ ban cho \"họ Mộc\" của người Hán, trở thành họ chính thức và họ cũng học theo văn hóa Hán.</i><br><i>Trong 470 năm tồn tại cực thịnh, dòng họ Mộc đã trải qua 3 triều đại phong kiến (Nguyên /Minh/Thanh) của Trung Hoa và Tộc truyền được tổng cộng 22 đời. Dẫu chỉ là Thổ ti ở vùng Lệ Gia nhưng họ Mộc đã đạt tới uy quyền và sự giàu sang đủ để vượt xa không ít vương công, đại thần Tòa phủ đệ của dòng họ này nằm ở phía Nam thành cổ Lệ Giang hiện nay là một công trình xa hoa và tráng lệ vào loại bậc nhất ở khu vực Tây Nam của Trung Quốc.</i></p>',0,0,18,0),(726,'Trường Học Mật Cảnh','https://img.ophim.live/uploads/movies/truong-hoc-mat-canh-thumb.jpg','Yes, Sir. Sorry, Sir!','completed','30','45 phút/tập','2011','HD',NULL,'','陳豪, 楊茜堯, 鐘嘉欣, 吳卓羲, 朱慧敏, 蔣志光, 羅樂林, 李國麟, 曾偉權, 周驄','Hành Động, Phiêu Lưu','Trung Quốc, Hồng Kông','<p>Quay lại công việc cũ có khó khăn đến mức nào? La Diệu Hoa (Trần Mưu) từng là giáo viên tại một trường trung học nguy hiểm trước khi bị buộc thôi việc vì một vụ bê bối nhìn trộm. La Diệu Hoa trở thành cảnh sát nhưng sau đó được yêu cầu quay lại trường trung học cũ để điều tra một đường dây ma túy của Hội Tam Hoàng tại trường.</p>',0,0,12,0),(727,'Đỉnh Broad','https://img.ophim.live/uploads/movies/broad-peak-thumb.jpg','Broad Peak','completed','1','1g 42phút','2022','HD',NULL,'Leszek Dawid','Ireneusz Czop,  Maja Ostaszewska,  Tomasz Sapryk,  Piotr Głowacki,  Łukasz Simlat,  Dawid Ogrodnik,  Maciej Raniszewski,  Maciej Kulig','Thể Thao, Chính kịch','Ba lan','<p>Sau khi leo lên ngọn núi Broad Peak, Maciej Berbeka nhận ra hành trình lên đỉnh núi của mình chưa toàn vẹn. 25 năm sau, ông lên đường hoàn thành việc mình đã bắt đầu.</p>',0,0,11,0),(728,'Trường Sinh Giới','https://img.ophim.live/uploads/movies/truong-sinh-gioi-thumb.jpg','World of Immortals','completed','26','25 phút/tập','2024','HD',NULL,'','','Hành Động, Võ Thuật, Viễn Tưởng','Trung Quốc','<p>Trên đời này liệu có ai bất tử? Dù có tài hoa tuyệt đỉnh, nổi tiếng thiên hạ, cuối cùng cũng phải hóa thành đống xương khô; Dù có là con của trời, nắm trong tay vạn dặm giang sơn, cuối cùng cũng sẽ biến thành một nắm hoàng thổ. Câu chuyện kể về Tiêu Thần bị thiên nữ hoàng gia Triệu Lâm Nhi truy sát, vô tình lạc vào Đảo Rồng hoang dã ở Trường Sinh Giới. Đây là một con đường cụt không có lối về nhà, phải đối mặt với đầy rẫy quái thú và kẻ thù. Sự lưu luyến với người thân, bằng hữu và cố hương luôn là điểm tựa để Tiêu Thần đứng vững chiến đấu với quái thú và kẻ thù ở vùng đất kỳ lạ này. Trong cuộc chiến cuồng nhiệt, sự cám dỗ của cảm xúc và dục vọng, Tiêu Thần đi theo bước chân của những người trường sinh bất tử, từ từ vén lên bức màn bí ẩn về một thế giới thần thoại cổ xưa bị cát bụi phong</p>',0,0,18,0),(729,'Tình yêu bóp nghẹt','https://img.ophim.live/uploads/movies/tinh-yeu-bop-nghet-thumb.jpg','No Limit','completed','1','1g 58phút','2022','HD',NULL,'David M. Rosenthal','Camille Rowe,  Sofiane Zermani,  César Domboy,  Laurent Fernandez,  Zacharie Chasseriaud','Tình Cảm, Thể Thao, Chính kịch','Pháp','<p>Trong bộ phim chính kịch lãng mạn mãn nhãn này, một phụ nữ trẻ siêu phàm tìm thấy tình yêu mãnh liệt nhưng độc hại với người giáo viên lặn tự do đang giữ kỷ lục.</p>',0,0,11,0),(730,'Quan Trường Sóng Gió','https://img.ophim.live/uploads/movies/quan-truong-song-gio-thumb.jpg','An Elite\'s Choice','completed','20','44 phút/tập','1990','HD',NULL,'','Lưu Tích Minh, Trương Triệu Huy, Thiệu Mỹ Kỳ, Tạ Ninh, Quan Hải Sơn, Lưu Giang','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Quan Trường Sóng Gió-An Elite\'s Choice (1990) [HD-Lồng Tiếng]',0,0,18,0),(731,'Tây Du Ký','https://img.ophim.live/uploads/movies/tay-du-ky-thumb.jpg','Journey to the West','completed','30','44 phút/tập','1996','HD',NULL,'','江華, 黎耀祥, 麥長青, 陳浩民, 馬德鐘, 李龍基, 華忠男, 張英才, 郭德信, 遊飈','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Trung Quốc, Hồng Kông','Bộ phim này là lần đầu tiên TVB sản xuất phim Tây Du Ký do Lưu Sĩ Du làm nhà sản xuất. Bộ phim nhận được sự khen chê khác nhau, thế nhưng cốt truyện phiên bản 1996 là phiên bản thay đổi rất nhiều so với nguyên tác. Bộ phim đã đưa tên tuổi Trương Vệ Kiện đến với công chúng. Bộ phim nằm trong tiết mục TVB hay xuất chú