24','HD',NULL,'Shengyao Chen','Yang Zai, Meme Yan','Võ Thuật, Cổ Trang','Trung Quốc','Trăm dặm giết một người, mười bước không muốn đi.\n\nTa chính là kiếm.\n\nTrăm dặm giết một người, mười bước không muốn đi.\n\nTrăm dặm giết một người, mười bước không thể đi.\n\nTrăm dặm giết một người, mười bước? Không thể!\n\nTrong ta có kiếm, trong kiếm có ta.\n\nĐại Đạo Triều Thiên, tất cả chấp nhất kiếm.',0,0,18,0),(743,'Club América vs. Club América','https://img.ophim.live/uploads/movies/club-america-vs-club-america-thumb.jpg','Club América vs. Club América','completed','6','49 phút/tập','2022','HD',NULL,'','Carlos Ballarta','Thể Thao, Tài Liệu','Mexico','<p>Loạt phim tài liệu đi sâu vào quá khứ, hiện tại và tương lai của América – câu lạc bộ bóng đá thành công và gây tranh cãi nhất ở Mexico – và bản sắc của các cầu thủ.</p>',0,0,11,0),(744,'Thánh Ma Túy','https://img.ophim.live/uploads/movies/thanh-ma-tuy-2025-thumb.jpg','King Ivory','completed','1','130 Phút','2025','HD',NULL,'John Swab','Ben Foster, Michael Mando, James Badge Dale, Graham Greene, Rory Cochrane, Melissa Leo, Ritchie Coster, George Carroll, Sam Quartin, Nikki Dixon','Hình Sự, Chính kịch','Âu Mỹ','<p>King Ivory (2025) khắc họa cuộc chiến khốc liệt chống lại nạn buôn bán fentanyl tại Oklahoma, nơi một cảnh sát có con trai nghiện ma túy, một tay buôn cartel Mexico, và một tên tội phạm vừa ra tù vướng vào vòng xoáy bạo lực. Ba tuyến đời dồn nén, đan xen, tạo nên bức tranh u ám và ám ảnh về một cuộc chiến không lối thoát.</p><p>&nbsp;</p>',0,0,17,0),(745,'Tiên Nữ Núi Linh Sơn','https://img.ophim.live/uploads/movies/tien-nu-nui-linh-son-thumb.jpg','Tiên Nữ Núi Linh Sơn','completed','39','45 phút/tập','1995','HD',NULL,'','Tiêu Tường, Lưu Tích Minh, Tống Dật Dân, Quý Cần, Lưu Tuyết Hoa, Phàn Nhật Hành, Lý Cần, Lâm Tiểu Lâu','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Xoay quanh chuyện một nàng tiên nữ ở trên núi Linh Sơn, vì nhiệm vụ bảo vệ Linh Chi Thảo Nhân mà đã vô tình giết chết Pháp hậu khiến Pháp sư của nước Thiên Long nổi giận, niệm thần chú khi ban ngày cô biến thành người nhưng cứ những đêm trăng tròn cô phải hóa thành sói, có một tình yêu thật đẹp nhưng cũng lắm gian nan bên thư sinh Trương Tường...</i></p>',0,0,18,0),(746,'Tay Bịp Hollywood','https://img.ophim.live/uploads/movies/tay-bip-hollywood-thumb.jpg','I Bet Your Pardon','completed','30','40 phút/tập','2019','HD',NULL,'','鄭則仕, 秦沛, 金燕玲, 李施嬅, 湯鎮業, 陳百祥, 杜燕歌, 黃柏文, 何浩文, BabyJohn Choi','Hành Động, Hài Hước, Phiêu Lưu','Trung Quốc, Hồng Kông','Long Tứ (Trịnh Tắc Sỹ), một tay cờ bạc khét tiếng với nhiều dấu mốc kinh điển. Sau đó, anh bị chính đại sự huynh Bàng Phong hãm hại, buộc phải ngồi tù, mất đi cả người tình hết mực yêu thương. Sau khi được ra tù, Long Tứ quyết định làm lại cuộc đời, anh trở thành một nhà sản xuất phim tài hoa, dần xây dựng được tên tuổi và danh vọng. Duyên phận sắp đặt Long Từ và người yêu cũ gặp nhau một lần nữa nhưng giờ cô đã là vợ của kẻ đã gài bẫy anh, mọi chuyện rồi sẽ ra sao',0,0,12,0),(747,'Bí mật giới thể thao: Lỗi cố ý','https://img.ophim.live/uploads/movies/bi-mat-gioi-the-thao-loi-co-y-thumb.jpg','Untold: Operation Flagrant Foul','completed','1','1g 17phút','2022','HD',NULL,'David Terry Fine','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Nhiều năm sau khi cá cược trên các trận đấu ông chủ trì, cựu trọng tài NBA, Tim Donaghy, nhìn lại vụ bê bối gây chấn động giải đấu này.</p>',0,0,11,0),(748,'Singham Again','https://img.ophim.live/uploads/movies/singham-again-thumb.jpg','Singham Again','completed','1','145 Phút','2024','HD',NULL,'Rohit Shetty','Ajay Devgan, अक्षय कुमार, Ranveer Singh, Tiger Shroff, Kareena Kapoor Khan, Deepika Padukone, Arjun Kapoor, जय किशन श्राफ, Shweta Tiwari, Dayanand Shetty','Hành Động, Hình Sự, Chính kịch','Ấn Độ','The cop universe expands with newer additions while the old ones return led by Bajirao Singham. Singham Again interweaves the mythological epic Ramayana\'s good vs evil narrative when his wife Avni Kamath gets abducted by Danger Lanka setting Bajirao and his gang of Sangram Bhalerao and Veer Sooryavanshi along with Satya and Shakti Shetty on a mission to rescue her.',0,0,17,0),(749,'Thần Thám Lý Thuần Phong','https://img.ophim.live/uploads/movies/than-tham-ly-thuan-phong-thumb.jpg','Intelligent Detective','completed','26','45 phút/tập','2012','HD',NULL,'','Nhậm Thiên Dã, Trần Hạo Dân, Triệu Kha, Khang Khải, Trương Á Khôn, Khang Phúc Chấn, Hạ Phong','Chính kịch, Bí ẩn, Võ Thuật, Cổ Trang','Trung Quốc','Chuyện phim Thần Thám Lý Thuần Phong nói về những năm đầu của thời nhà Đường, thành Trường An thường xuyên xảy ra nhiều vụ án, ban đâù là các vụ giết người xảy ra bên ngoài Khai Viễn Môn, và sau đó là sự tái xuất hiện của những truyền nhân của thời nhà Hán bị lưu lạc trở thành những tay giang hồ giết người, lợi dụng những người thật thà để thao túng quyền lực trong triều đình , huynh đệ tương tàn . Sau cùng tại Nam Sơn xuất hiện hàng loạt hiện tượng kỳ lạ , cũng như hàng loạt những chuyện lạ diễn ra trong triều đình và các câu chuyện bí mật hậu cung thường xuyên xuất hiện.',0,0,18,0),(750,'Luís Figo: Vụ chuyển nhượng thay đổi giới bóng đá','https://img.ophim.live/uploads/movies/luis-figo-vu-chuyen-nhuong-thay-doi-gioi-bong-da-thumb.jpg','The Figo Affair: The Transfer that Changed Football','completed','1','1g 44phút','2022','HD',NULL,'David Tryhorn,  Ben Nicholas','','Thể Thao, Tài Liệu','Tây Ban Nha','<p>Phim tài liệu xoay quanh một trong những thương vụ gây tranh cãi nhất lịch sử bóng đá và cầu thủ phi thường ở giữa tâm bão: Luís Figo.</p>',0,0,11,0),(751,'Họng Súng Vô Hình','https://img.ophim.live/uploads/movies/hong-sung-vo-hinh-thumb.jpg','The Naked Gun','completed','1','85 Phút','2025','HD',NULL,'Akiva Schaffer','Liam Neeson, Pamela Anderson, Paul Walter Hauser, Danny Huston, CCH Pounder, Kevin Durand, Liza Koshy, Eddie Yu, Michael Beasley, Moses Jones','Hành Động, Hài Hước, Hình Sự','Âu Mỹ','Họng Súng Vô Hình là phần tiếp theo của thương hiệu hài giả tội phạm đình đám The Naked Gun, lần này nhân vật trung úy Frank Dreb