Lưu, Chính kịch','Trung Quốc, Âu Mỹ, Hồng Kông','<p>Thám Tử Hình Sự II (The Criminal Investigator II) là một bộ phim truyền hình về thủ tục tố tụng hình sự của cảnh sát Hồng Kông năm 1996. Do Jonathan Chik sản xuất và Châu Nhuận Minh cùng Triệu Thanh Dũng biên tập, bộ phim là sản phẩm của TVB và là phần tiếp theo trực tiếp của Thám Tử Hình Sự năm 1995. Câu chuyện xoay quanh một nhóm điều tra viên thuộc Cục Tội phạm có tổ chức và Hội Tam Hoàng thuộc Lực lượng Cảnh sát Hoàng gia Hồng Kông.</p><p>&nbsp;</p>',0,0,17,0),(755,'Y Quán Tiếu Truyện (Phần 2)','https://img.ophim.live/uploads/movies/y-quan-tieu-truyen-phan-2-thumb.jpg','Medical Shop (Season 2)','completed','48','45 phút/tập','2016','HD',NULL,'','Khương Nghiên, Lý Giai Hàng, Lý Kim Minh, Trương Hâm, Vương Ngạn Lâm','Hài Hước, Võ Thuật, Cổ Trang','Trung Quốc','Y Quán Tiếu Truyện (Phần 2)-Medical Shop (Season 2) (2016) [HD-Lồng Tiếng]',0,0,18,0),(756,'Bí mật giới thể thao: Cô bạn gái không tồn tại','https://img.ophim.live/uploads/movies/bi-mat-gioi-the-thao-co-ban-gai-khong-ton-tai-thumb.jpg','Untold: The Girlfriend Who Didn\'t Exist','completed','2','1g 4phút/tập','2022','HD',NULL,'Ryan Duffy,  Tony Vainuku','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Từ Notre Dame đến NFL, Manti Te\'o có một tương lai hứa hẹn với bóng bầu dục cho đến khi một mối quan hệ bí mật trên mạng làm đảo lộn cuộc sống và sự nghiệp của anh.</p>',0,0,11,0),(757,'Đoản Đao Hiệp Sĩ','https://img.ophim.live/uploads/movies/doan-dao-hiep-si-thumb.jpg','Swordman','completed','15','45 phút/tập','1998','HD',NULL,'Cúc Giác Lượng, Phố Đằng Tấn','Trương Vệ Kiện, Lưu Ngọc Đình, Long Thiên Tường, Huỳnh Văn Hào, Hà Mỹ Điền, Lâm Vĩ, Tiêu Ân Tuấn, Giả Tịnh Văn, Lê Mỹ Nhàn','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Thanh Y Thập Tam Lầu là một tổ chức tà ác, nhưng rất lớn mạnh, không ai dám đối đầu, trừ võ lâm minh chủ Thẩm Ngọc Môn – chủ nhân của Kim Lăng Mai Tuyệt Lĩnh Thẩm Gia. Trong một lần quyết chiến với tổng lầu chủ Thanh Y Thập Tam Lầu Trần Sĩ Nguyên, Thẩm Ngọc Môn đã bị thương nặng, không bao lâu sau thì qua đời, nhưng người của Thanh Y Lầu không biết Thẩm Ngọc Môn đã chết, nên vẫn cho người truy sát. Tổng quản Thạch Bửu Sơn và Thủy Tiên đã dùng Mạnh Tiểu Hoa – một người giống hệt Thẩm Ngọc Môn – để che mắt mọi người, ngăn chặn cuộc chiến trong võ lâm. Mạnh Tiểu Hoa là một thanh niên làm nghề nấu ăn của Nhất Phẩm Cư, ngày Mạnh Tiểu Hoa được sư phụ cho ra nghề cũng là ngày Mạnh Tiểu Hoa bị Thạch Bửu Sơn và Thủy Tiên bắt đi làm “võ lâm minh chủ”. Trên đường đi Mạnh Tiểu Hoa đã quen với Giải Hồng Mai – người đi tìm Thẩm Ngọc Môn để trả thù cho cha. Thạch Bửu Sơn và Thủy Tiên nhờ thần y Mai đại tiên sinh hóa trang cho Mạnh Tiểu Hoa thật giống với Thẩm Ngọc Môn từ những vết sẹo trên thân thể và đưa về Thẩm gia, bắt Mạnh Tiểu Hoa – người không biết một chữ cắn đôi phải ngủ trong thư phòng và học tứ thư ngũ kinh… Ở đây, Mạnh Tiểu Hoa phải đối phó với người vợ lạnh nhạt, và những người tình trước kia của Thẩm Ngọc Môn, rồi nào là tiểu đệ và những huynh đệ kết nghĩa của Thẩm Ngọc Môn… Chỉ là một đầu bếp yêu nghề quen sử dụng con dao thái thức ăn, giờ đây Mạnh Tiểu Hoa phải làm quen với đao kiếm của người giang hồ và những cảnh đầu rơi máu chảy, một thanh niên chất phác như Mạnh Tiểu Hoa thật sự không chịu đựng nổi. Nhưng rồi mọi chuyện cũng trôi qua, cuối cùng, với tấm lòng nhân hậu, Mạnh Tiểu Hoa cũng có thể làm một võ lâm minh chủ thực thụ và đã dùng “lục chiêu” của con dao nhà bếp đánh bại Trần Sĩ Nguyên, rồi cùng Giải Hồng Mai rời bỏ chốn thị phi giang hồ.</i></p>',0,0,18,0),(758,'Huấn Luyện Viên Tinh Thần Je Gal Gil','https://img.ophim.live/uploads/movies/mental-coach-jegal-thumb.jpg','Mental Coach Jegal','completed','16','65 phút/tập','2022','HD',NULL,'Son Jung Hyun','Jung Woo,  Lee Yoo Mi,  Kwon Yool,  Park Se Young,  Yoon Joo Sang,  Moon Sung Geun,  Gil Hae Yeon','Thể Thao','Hàn Quốc','<p>Bộ truyện kể về một vận động viên Taekwondo bị cấm thi đấu vĩnh viễn trong đội tuyển quốc gia và trở thành một huấn luyện viên tinh thần để giúp những người chơi sa sút phong độ, chữa lành các vận động viên đã nghỉ hưu và chiến đấu một trận đấu thực sự chống lại thế giới vô lý của kẻ thắng người thua.</p>',0,0,11,0),(759,'Bá Vương Kiều Hoa','https://img.ophim.live/uploads/movies/ba-vuong-kieu-hoa-thumb.jpg','Yang\'s Women Warriors','completed','20','45 phút/tập','1993','HD',NULL,'','邵美琪, 羅嘉良, 盧宛茵, 何寶生, 駱應鈞, 蘇杏璇, Terence Choi, Amy Wu Mei-Yee, Sheila Chan Suk-Lan','Hình Sự','Trung Quốc, Hồng Kông','<p>Câu chuyện diễn ra tại Dương Lạc Vi, một ngôi làng hẻo lánh ở Tân Giới, Hồng Kông. Bà Vu ​​Mỹ Quân (Tô Hạnh Hiên), sống chung một nhà bốn đời, sống một cuộc sống yên bình, êm ả bên chồng, con dâu và con dâu. Làm sao có thể ngờ rằng trong một chiến dịch truy bắt tội phạm, tất cả đàn ông trong gia đình từng làm cảnh sát đều bị giết hại, còn góa phụ thì lại cô đơn, góa bụa, bỗng dưng mất đi chỗ dựa. Những người phụ nữ buộc phải tự lập, nhưng vì tư tưởng truyền thống và hành vi bảo thủ, họ trở nên lạc lõng với xã hội hiện đại, dẫn đến hàng loạt tình tiết hài hước.</p><p>&nbsp;</p>',0,0,17,0),(760,'Dragon Ball Daima','https://img.ophim.live/uploads/movies/dragon-ball-daima-thumb.jpg','Dragon Ball DAIMA','completed','20','24 phút/tập','2024','FHD',NULL,'','','Hành Động, Hài Hước, Viễn Tưởng, Võ Thuật, Phiêu Lưu','Nhật Bản','<p>Biến đổi một cách bí ẩn thành phiên bản nhỏ của chính mình, Goku và những người bạn của mình du hành đến Vương quốc Quỷ để khám phá sự thật và tìm ra phương pháp chữa trị.</p>',0,0,18,0),(761,'Đỉnh cao tốc độ','https://img.ophim.live/uploads/movies/dinh-cao-toc-do-thumb.jpg','Hitting the Apex','completed','1','2g 18phút','2015','HD',NULL,'Mark Neale','Brad Pitt,  Jorge Lorenzo,  Dani Pedrosa,  Valentino Rossi','Thể Thao, Tài Liệu','Âu Mỹ','<p>Brad Pitt dẫn chuyện cho bộ phim xoay quanh sáu trong số những tay đua MotoGP nhanh nhất cùng hành trình căng thẳng của họ khi tranh chức vô địch thế giới.</p>',0,0,11,0),(762,'Vụ Cướp Thế Kỷ (Phần 2)','https://img.ophim.live/uploads/movies/vu-cuop-the-ky-phan-2-thumb.jpg','The Gold','completed','6','58 phút/tập','2025','HD',NULL,'','Hugh Bonneville, Tom Cullen, Charlotte Spencer, Emun Elliott, Stefanie Martini, Sam Spruell, Stephen Campbell Moore','Hình Sự, Chính kịch','Anh, Âu Mỹ','<p>Bộ phim \"The Gold\" phần 2 tiếp tục khai thác câu chuyện về vụ cướp Brink\'s-Mat khét tiếng năm 1983. Trong khi phần 1 tập trung vào việc xử lý một nửa số vàng bị đánh cắp, phần 2 xoay quanh số vàng còn lại và những âm mưu rửa tiền, buôn lậu quốc tế phức tạp. Phần 2 của \"The Gold\" đào sâu vào những khía cạnh ít được biết đến của vụ án, đi từ những câu chuyện có thật đến những giả thuyết về số phận của nửa còn lại của số vàng bị cướp. Bộ phim đưa khán giả theo chân các nhân vật từ Anh đến những địa điểm quốc tế như Tenerife và Quần đảo Virgin, hé lộ cách mà số vàng đã tài trợ cho các hoạt động tội phạm lớn, bao gồm cả việc tạo ra một kỷ nguyên mới của hoạt động rửa tiền quốc tế.</p>',0,0,17,0),(763,'Yến Hoa Tuyệt Kiếm','https://img.ophim.live/uploads/movies/yen-hoa-tuyet-kiem-thumb.jpg','The Spirit of the Sword','completed','19','45 phút/tập','1979','HD',NULL,'Tiêu Sinh','Trương Quốc Vinh, Văn Tuyết Nhi, Trần Huệ Mẫn, Vương Vỹ, Chu Thiết Hòa','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Mở đầu phim với một tay kiếm bí ẩn Nhật Bản Bai Yi Ren (Chan Wai Man), người đã đi đến Trung Quốc để thách thức những bậc thầy võ thuật. Nhiều người đàn ông tuyệt vời đã rơi vào tay thanh kiếm nhanh nhẹn và tàn nhẫn của Bai Yi Ren, bao gồm vị thầy Bai San Kong (Chen Chen Hua). Cháu trai Bảo Er của ông sau đó được đưa về Biển Đông để tìm sự giúp đỡ từ Zi Yi Hou (Wong Wai), người hầu như không chiến thắng được Bai Yi Ren. Tuy nhiên, cuộc đấu tay đôi đã khiến Zi bị thương nghiêm trọng và anh đã qua đời với lời thề của Bai Yi Ren quay trở lại trong bảy năm sau tai. Nhiệm vụ phải đối mặt với Bai Yi Ren trong 7 năm, do đó rơi vào tay của Bảo Er, 13 tuổi, người quyết tâm nghiên cứu võ thuật. Năm năm sau, Bảo Er (Leslie Cheung) trở về từ biển Đông, đúng lúc để bắt đầu cuộc thi tuyệt vời để xác định tay kiếm hàng đầu. Cả hai người được tôn trọng và riff-raff của võ thuật thế giới đã tụ tập ở một nơi để thi đấu.</i></p>',0,0,18,0),(764,'Xác Sống: Daryl Dixon (Phần 3)','https://img.ophim.live/uploads/movies/xac-song-daryl-dixon-phan-3-thumb.jpg','The Walking Dead: Daryl Dixon','ongoing','5','61 phút/tập','2025','HD',NULL,'','Norman Reedus, Melissa McBride, Clémence Poésy, Louis Puech Scigliuzzi, Laïka Blanc-Francard, Anne Charrier, Romain Levi','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Âu Mỹ','<p>Mùa 3 của The Walking Dead: Daryl Dixon sẽ đưa khán giả đến một vùng đất hoàn toàn mới - Tây Ban Nha. Sau hành trình đầy gian nan ở Pháp, Daryl và Carol giờ đây phải đối mặt với một thế giới hậu tận thế với những quy tắc riêng biệt mới mẻ. Cốt truyện tập trung vào hành trình trở về nhà đầy chông gai của cả hai, giữa khung cảnh vùng quê đầy cảm hứng điện ảnh của khung cảnh hoang dã Tây Ban Nha. Họ gặp gỡ những nhân vật thú vị như một người Anh hài hước, một người tình mới của Carol, và một cao bồi nữ biểu tượng – Paz. Mùa phim này được đánh giá là “Một trong những mùa hay nhất của cả thương hiệu đình đám The Walking Dead ”, và cái kết mở hứa hẹn một mùa cuối đầy cao trào, kịch tính.</p>',0,0,12,0),(765,'Thăng bằng trên ván trượt: Câu chuyện của Leo Baker','https://img.ophim.live/uploads/movies/thang-bang-tren-van-truot-cau-chuyen-cua-leo-baker-thumb.jpg','Stay on Board: The Leo Baker Story','completed','1','1g 13phút','2022','HD',NULL,'Giovanni Reda,  Nicola Marsh','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Ngôi sao trượt ván Leo Baker trải lòng về con đường thành danh cũng như những xung đột giữa sự nghiệp và hành trình tự khám phá bản thân của một người chuyển giới nam.</p>',0,0,11,0),(766,'Đấng Tối Cao','https://img.ophim.live/uploads/movies/dang-toi-cao-thumb.jpg','Sovereign','completed','1','100 Phút','2025','HD',NULL,'Christian Swegal','Nick Offerman, Jacob Tremblay, Dennis Quaid, Kezia Dacosta, Terry J. Nelson, Bobby Gilchrist, Megan Mullally, Ruby Wolf, Buddy Campbell, Tommy Kramer','Hình Sự, Chính kịch','Âu Mỹ','<p>Dựa trên vụ việc có thật gây chấn động năm 2010, phim kể về Jerry Kane và cậu con trai Joe – những kẻ theo phong trào “công dân có chủ quyền”, luôn chống đối và phủ nhận thẩm quyền của chính phủ. Khi họ chạm trán cảnh sát trưởng John Bouchart, cuộc va chạm tưởng chừng nhỏ lẻ đã biến thành chuỗi truy đuổi căng thẳng, đẫm máu.&nbsp;</p>',0,0,17,0),(767,'Hiệp Sĩ Mù','https://img.ophim.live/uploads/movies/hiep-si-mu-thumb.jpg','Hiệp Sĩ Mù','completed','30','45 phút/tập','2005','HD',NULL,'','Giang Mỹ Ngân, Hà Nhuận Đông, Hân Tuyết, Trần Triển Bằng, Trịnh Tắc Sĩ, Trương Đình','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Phim nói về một hiệp khách võ công cao cường chuyên săn bắt những tên tội phạm để lấy tiền thưởng kiếm sống nhưng điều bất lợi của ông đó chính là ông bị mù.</i><br><i>Bên cạnh ông lúc nào cũng có cô gái tên Kim Ngư, cô là con gái của kẻ bị ông giết chết trước kia nên cô luôn coi ông vừa là sư phụ vừa là kẻ thù.</i><br><i>Phim Hiệp Sĩ Mù còn có mẹ con của hồng nhan tri kỷ hiệp sĩ mù là Tỷ Tỷ và Chu Xung Hiền, Xung Hiền là con riêng của chồng trước Tỷ Tỷ.</i><br><i>Dù luôn sát cánh cùng nhau nhưng hiệp sĩ mù lúc nào cũng đề phòng Xung Hiền vì ông nghi ngờ cậu ta chính là sát thủ Phi Thiên Chư – người mà ông đang đuổi bắt…</i></p>',0,0,18,0),(768,'Con Đường Vinh Quang','https://img.ophim.live/uploads/movies/con-duong-vinh-quang-thumb.jpg','Glory Road','completed','1','118 Phút','2006','HD',NULL,'James Gartner','Josh Lucas, Derek Luke, Jon Voight, Austin Nichols, Evan Jones','Thể Thao, Chính kịch','Âu Mỹ','<p>Năm 1966, huấn luyện viên Don Haskins của Texas Western dẫn đầu đội hình xuất phát toàn đen đầu tiên cho một đội bóng rổ đại học đến chức vô địch quốc gia NCAA.</p>',0,0,11,0),(769,'Hai Ngôi Mộ','https://img.ophim.live/uploads/movies/hai-ngoi-mo-thumb.jpg','Two Graves','completed','3','52 phút/tập','2025','HD',NULL,'','Álvaro Morte, Hovik Keuchkerian, Kiti Mánver, Zoe Arnao, Nonna Cardoner','Hình Sự, Chính kịch, Bí ẩn','Tây Ban Nha','<p>Khi vụ mất tích của hai cô gái tuổi teen gây chấn động thị trấn ven biển yên bình nọ, một người bà đau khổ mạo hiểm tất cả để lật mở sự thật và trả thù.</p><p>&nbsp;</p>',0,0,17,0),(770,'Anh Hùng Quảng Đông Thập Hổ','https://img.ophim.live/uploads/movies/anh-hung-quang-dong-thap-ho-thumb.jpg','Ten Tigers Of Guangdong','completed','40','45 phút/tập','1999','HD',NULL,'Tăng Cẩm Xương','Âu Cẩm Đường, Trần Vỹ, Huỳnh Trọng Côn, Văn Tụng Nhàn, Lâm Chí Hào, Cao Hùng','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Phim Anh Hùng Quảng Đông Thập Hổ phim kể về vào cuối đời Mãn Thanh, chính phủ hủ bại, Trung Quốc bị các cường quốc tranh giành xâu xé. Dưới cảnh nội ưu ngoại hoạn, dân chúng lầm than khổ sở. Thời thế tạo anh hùng, xuất hiện mười vị đại trượng phu trọng tình trọng nghĩa, trung can nghĩa đảm, vì quốc gia, họ chấp nhận hy sinh tất cả. Họ đã thêu dệt nên một sự tích anh hùng, trở thành câu chuyện Quảng Đông Thập Hổ được lưu truyền sau này.',0,0,18,0),(771,'Võ Lâm Phục Sinh','https://img.ophim.live/uploads/movies/vo-lam-phuc-sinh-thumb.jpg','Birth of a Hero','completed','20','43 phút/tập','2018','HD',NULL,'','蕭正楠, Grace Chan, 簡慕華, 黃智賢, 姜大衛, 翟凱泰, 楊詩敏, Roxanne Tong, 阮政峯, 馮素波','Hành Động, Hài Hước, Phiêu Lưu','Trung Quốc, Hồng Kông','Phim Võ Lâm Phục Sinh mang bối cảnh vào thời nhà Minh, lúc mà cả nước khá yên bình, bao gồm cả nhiều trường phái trong võ lâm đồng đáy, dốc mức độ góp sức mang lại triều đình. Tuy nhiên, sự desgin của Đông Xưởng vẫn khiến chưa ít nhân sĩ bỏ xác oan uổng, đây chính là một cố gắng lực khôn xiết bự trong triều and trường hợp ai dị đồng có công ty này sẽ ảnh hưởng truy nã cùng tiêu diệt tận ngay mau chóng. Và chị em Ngọc Kiều Phượng and Ngọc Vân rồng khi là một trong những số nhiều người nhà phải trốn chạy, ở ẩn dật dưới nghề kinh doanh buôn bán cửa hàng trọ.',0,0,12,0),(772,'Kẻ yếu thế: Câu chuyện về Kurt Warner','https://img.ophim.live/uploads/movies/ke-yeu-the-cau-chuyen-ve-kurt-warner-thumb.jpg','American Underdog: The Kurt Warner Story','completed','1','1g 52phút','2021','HD',NULL,'Andrew Erwin,  Jon Erwin','Zachary Levi,  Anna Paquin,  Dennis Quaid,  Ser\'Darius Blain,  Bruce McGill,  Hayden Zaller,  Chance Kelly,  Adam Baldwin,  Cindy Hogan','Thể Thao, Chính kịch','Âu Mỹ','<p>Một nhân viên siêu thị có cơ hội tỏa sáng ở Siêu Cúp Bóng Bầu Dục sau khi anh được tuyển mộ vào hàng ngũ bóng bầu dục chuyên nghiệp của Mỹ. Dựa trên câu chuyện có thật.</p>',0,0,11,0),(773,'Câu lạc bộ án mạng ngày thứ Năm','https://img.ophim.live/uploads/movies/cau-lac-bo-an-mang-ngay-thu-nam-thumb.jpg','The Thursday Murder Club','completed','1','118 Phút','2025','HD',NULL,'Chris Columbus','Helen Mirren, Pierce Brosnan, Ben Kingsley, Celia Imrie, David Tennant, Jonathan Pryce, Naomi Ackie, Daniel Mays, Henry Lloyd-Hughes, Richard E. Grant','Hài Hước, Hình Sự, Chính kịch, Bí ẩn','Âu Mỹ','Trong bộ phim hài tội phạm chuyển thể từ tiểu thuyết này, một nhóm thám tử cao niên đam mê phá giải những vụ án còn bỏ ngỏ bị cuốn vào vụ án mạng bí ẩn ngoài đời thật.',0,0,17,0),(774,'Lục Chỉ Cầm Ma','https://img.ophim.live/uploads/movies/luc-chi-cam-ma-thumb.jpg','The Possessed','completed','25','40 phút/tập','1985','HD',NULL,'Ngũ Nhuận Tuyền','Ngô Khải Hoa, Lam Khiết Anh, Thạch Tu, Đặng Tuỵ Vân, Ngô Chấn Vũ, Quan Hải Sơn','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','Lục Chỉ Cầm Ma-The Possessed (1985) [HD-Lồng Tiếng]',0,0,18,0),(775,'Bagheera','https://img.ophim.live/uploads/movies/bagheera-thumb.jpg','Bagheera','completed','1','158 Phút','2024','HD',NULL,'Dr Suri','Sriimurali, Rukmini Vasanth, Prakash Raj, Rangayana Raghu, Achyuth Kumar, Ramachandra Raju, Avinash, Pramod Shetty, Sudha Rani, Sharath Lohitashwa','Hành Động, Phiêu Lưu','Ấn Độ','Dismayed by corruption and violence, a virtuous police officer becomes a masked vigilante to dliver lethal justice to criminals and crooked cops alike.',0,0,12,0),(776,'Bàn thắng tình yêu','https:/