 phút/tập','2004','HD',NULL,'','黃子華, 蔡少芬, 魏駿傑, 蔣志光, 雪妮, 唐文龍, 胡楓, 韓君婷, 伍文生, 王俊棠','Hài Hước, Hình Sự','Trung Quốc, Hồng Kông','<p>Một bộ phim hài xoay quanh thiên tài điều tra viên Mok Tsok Tung và Vivi Lee Wai Wai, một nhân viên bảo hiểm.</p>',0,0,17,0),(784,'Phụng Hoàng Thần Nữ','https://img.ophim.live/uploads/movies/phung-hoang-than-nu-thumb.jpg','Phoenix The Myth','completed','40','45 phút/tập','1990','HD',NULL,'Ông Đông Hưng','Miêu Kiều Vỹ, Phan Nghinh Tử, Tiêu Tường, Cố Quán Trung','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Phượng Hoàng Lửa kể về cuộc chiến giữa Thiên Ma tộc và Bái Điểu tộc. ‟Song đầu quái thú‟ thao túng Thiên Ma tộc tiến công Bái Điểu tộc, khiến cho Bái Điểu tộc thương vong nặng nề. Thần nhân Ảo Ba công tử liền đánh thức ‟Thiên niên thần thú‟ Đô Đô đang ngủ say trong hồ tỉnh dậy để bảo vệ Phụng Hoàng Thần nữ là thần hộ mệnh của Bái Điểu tộc, nhưng Đô Đô lại vô tình bị ‟Hiệp đạo‟ Chung Hào (Miêu Kiều Vỹ đóng) bắt giữ. Ngoài ra, Phụng Hoàng Thần nữ Mai Cơ do đang mang thai sắp sinh nên suy giảm công lực, sau khi vội sinh ra 1 quả trứng trong chiến loạn, đã phạm vào cấm kỵ không phải đêm trăng tròn mà buộc phải lột xác thành Hỏa Phụng Hoàng để quyết chiến 1 trận sinh tử với Thiên Ma. Hỏa Phụng Hoàng cố gắng hết sức đánh lui Thiên Ma, làm y bị thương nhốt vào mạng nhện, Thiên Ma muốn phá kén ra ngoài, nhất thiết phải uống máu phụng hoàng, vì vậy con gái của Phụng Hoàng Thần nữ trở thành mục tiêu của Thiên Ma. Con gái mới sinh của Phụng Hoàng Thần Nữ là Mai Ngâm Sương (Phan Nghinh Tử đóng) được trưởng lão Bái Điểu tộc hiệp trợ chạy trốn, trên đường gặp phải sự truy đuổi của Thiên Ma tộc, trước khi chết trưởng lão phó thác con gái Phụng Hoàng Thần nữ cho con trai nuôi tên A Hồng. Không ngờ A Hồng bị Xà Ma nữ của Thiên Ma tộc khống chế nên ngộ thương Mai Ngâm Sương rồi bỏ đi. Mai Ngâm Sương vì muốn truy tìm A Hồng mà tình cờ rơi vào ổ cường đạo của Chung Hào...</i></p>',0,0,18,0),(785,'RuPaul’s Drag Race – Cuộc chiến giày cao gót: Hậu trường (Phần 12)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-hau-truong-phan-12-thumb.jpg','RuPaul’s Drag Race: Untucked! (Season 12)','completed','12','20phút/tập','2021','HD',NULL,'','','Hài Hước, Thể Thao, Phiêu Lưu','Anh','<p>Mùa mới đã đến và kéo theo đó là nhiều câu chuyện hậu trường cùng nhiều vị khách đặc biệt hơn! Hãy tụ họp với các nữ hoàng ở hậu trường sau buổi diễn mỗi tuần.</p>',0,0,11,0),(786,'Trường Kiếm Tương Tư','https://img.ophim.live/uploads/movies/truong-kiem-tuong-tu-thumb.jpg','Trường Kiếm Tương Tư','completed','35','45 phút/tập','2005','HD',NULL,'Lý Tuệ Dân','Trần Khôn, Lý Băng Băng, Lý Thanh, Huỳng Giác, Hàn Hiểu, Vương Á Nam, Thiên Tâm','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Được chuyển thể từ tiểu thuyết võ hiệp cùng tên của nhà văn Tiêu Dật Thời Minh, triều Chính Đức, Trung nguyên gặp đại hạn, dân chúng lưu lạc, bọn hoạn quan chuyên quyền, thừa cơ muốn huyết tẩy giang hồ. Thế lực ác nhân trong giang hổ cũng thừa cơ làm loạn nhân gian, đề xướng \" diệt thiện , kích ác \", công nhiên khiêu chiến thiên hạ. Chính trong thời khắc nguy cấp này, xuất hiện một chàng thiếu niên bí ẩn, chàng mang trên mình gánh nặng của mối huyết hải thâm thù của \" Yến Gia bảo \", chàng chính là Yến Truy Vân.Từ đó, chàng đã đi khắp nơi hành hiệp, diệt ác, gây nên những sự việc làm bọn giang hồ ác nhân kinh tâm táng đởm. 2 phái chính tà bắt đầu triển khai 1 trường tranh đấu kinh tâm động phách...</i></p>',0,0,18,0),(787,'Thế Giới Không Lối Thoát (Phần 3)','https://img.ophim.live/uploads/movies/the-gioi-khong-loi-thoat-phan-3-thumb.jpg','Alice in Borderland (Season 3)','ongoing','6','81 phút/tập','2025','HD',NULL,'','山﨑賢人, 土屋太鳳, 村上虹郎, 朝比奈彩, 森永悠希','Hành Động, Phiêu Lưu, Chính kịch, Bí ẩn','Nhật Bản','Một game thủ lông bông cùng hai người bạn nhận ra họ đã lọt vào thế giới Tokyo song song, nơi họ buộc phải thi đấu trong một loạt trò chơi tàn bạo để tồn tại.',0,0,12,0),(788,'RuPaul\'s Drag Race – Cuộc chiến giày cao gót: Hậu trường (Phần 11)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-hau-truong-phan-11-thumb.jpg','RuPaul’s Drag Race: Untucked! (Season 11)','completed','12','20phút/tập','2020','HD',NULL,'','','Hài Hước, Thể Thao, Phiêu Lưu','Anh','<p>Những tranh đấu, bí mật và cả góc khuất. Hãy bước vào hậu trường của \"Cuộc chiến giày cao gót\" và xem điều gì đang xảy ra trong cuộc đua giữa các thí sinh ở mỗi tập.</p>',0,0,11,0),(789,'Độc Cô Cầu Bại','https://img.ophim.live/uploads/movies/doc-co-cau-bai-thumb.jpg','Độc Cô Cầu Bại','completed','21','44 phút/tập','1990','HD',NULL,'Trang Vỹ Kiện','Huỳnh Nhật Hoa, Ngô Đại Dung, Thiệu Mỹ Kỳ, Văn Tuyết Nhi, Thái Gia Lợi, Lưu Gia Huy, Trịnh','Võ Thuật, Cổ Trang','Hồng Kông','<p><i>Vợ chồng Độc Cô Thiên Phong do xích mích với võ lâm bị giang hồ truy sát dẫn theo 2 đứa con trai sinh đôi trốn trách khắp nơi. Đến đường cùng đã bị rơi xuống vực không rõ sống chết.Một trong 2 đứa con là Độc Cô Khang được gia đình nông dân nuôi dưỡng đổi tên là Lâm Khang. Mười năm sau Lâm Khang lớn lên gặp được cơ duyên trở thành cao thủ võ lâm, truy tìm tung tích kẻ thù ngày trước. Trên con đường trả thù, Lâm Khang quen biết 2 cô gái Lãnh Tử Yên và Liễu Ngạo Sương tạo nên mối quan hệ phức tạp của tình cảm…</i></p>',0,0,18,0),(790,'RuPaul\'s Drag Race: Người nổi tiếng','https://img.ophim.live/uploads/movies/rupauls-drag-race-nguoi-noi-tieng-thumb.jpg','RuPaul\'s Secret Celebrity Drag Race','completed','4','1g 2phút/tập','2020','HD',NULL,'Nick Murray','Rupaul Andre Charles,  Michelle Visage,  Carson Kressley,  Ross Mathews','Hài Hước, Thể Thao, Phiêu Lưu','Anh','<p>Người nổi tiếng mở cửa trái tim cho sức mạnh biến đổi của drag và thi đấu trong các thử thách đặc trưng của \"Cuộc chiến giày cao gót\" — với sự giúp đỡ từ các thí sinh cũ.</p>',0,0,11,0),(791,'Retro','https://img.ophim.live/uploads/movies/ரெட்ரோ-thumb.jpg','Retro','completed','1','162 Phút','2025','HD',NULL,'Karthik Subbaraj','Suriya, Pooja Hegde, Joju George, Jayaram, Vidhu, Nassar, Prakash Raj, Sujith Sankar, Singampuli, Swasika','Hành Động, Hình Sự, Chính kịch','Ấn Độ','Raised by a criminal father, Paarivel Kannan leaves behind his adoptive family to build a quiet life with his love, Rukmini. But his violent past won\'t let him go.',0,0,17,0),(792,'Madam White Snake','https://img.ophim.live/uploads/movies/madam-white-snake-thumb.jpg','Madam White Snake','completed','46','45 phút/tập','2001','HD',NULL,'Lại Thủy Thanh','Phạm Văn Phương, Tiêu Ân Tuấn, Lý Minh Thuận, Lý Lập Quần, Trương Ngọc Yến','Võ Thuật, Cổ Trang','Đài Loan','The television serial was based on a legendary folk tale, involving a snake spirit and her male human lover, but was adapted in this version to include the presence of a black snake who is the snake spirit\'s mentor and the White Snake Spirit being trapped under the pagoda for 20 years, when in the original tale she was trapped under the tower for centuries.\n\nAs for the green snake, the white snake imprisons her for a short time before releasing her, unlike the original where she imprisoned her for three centuries. Xu Xian is also initially a good-for-nothing who, under the white snake\'s guidance, becomes an official.',0,0,18,0),(793,'Danh Sách Tử Thù: Sói Bóng Đêm','https://img.ophim.live/uploads/movies/danh-sach-tu-thu-soi-bong-dem-thumb.jpg','The Terminal List: Dark Wolf','completed','7','57 phút/tập','2025','HD',NULL,'','Taylor Kitsch, Tom Hopper','Hành Động, Phiêu Lưu, Chính kịch','Âu Mỹ','<p>Đây là phần phim tiền truyện của The Terminal List - Danh Sách Tử Thù (2022). Câu chuyện tập trung vào Ben Edwards (Taylor Kitsch), từ một Lính SEAL trở thành đặc vụ CIA, đối mặt với các mâu thuẫn đạo đức và thử thách nội tâm dẫn đến bi kịch sau này. Bối cảnh phim diễn ra khoảng 5–7 năm trước các sự kiện tại loạt phim gốc, làm rõ quá khứ đầy biến động của Ben, mối quan hệ với James Reece (Chris Pratt) và con đường dẫn đến việc phản bội sau này.&nbsp;</p><p>Sự ra đời của series xuất phát từ phản ứng mạnh mẽ của khán giả với một cảnh kết trong phần đầu của The Terminal List, khiến ê-kíp quyết định đào sâu vào quá khứ và tâm lý của Ben. Đây là bộ phim mạnh về tính hành động kịch tính, bạo lực cao, không khí căng thẳng, bắn súng dữ dội. Khám phá gốc rễ của “con sói” trong lòng Ben Edwards — từ người lính cam kết đến đặc vụ ở giữa ranh giới, The Terminal List: Dark Wolf hé lộ hành trình đầy bi kịch và sự phản bội không thể bỏ qua.</p>',0,0,12,0),(794,'RuPaul\'s Drag Race: Minh Tinh hội tụ (Phần 6)','https://img.ophim.live/uploads/movies/rupauls-drag-race-minh-tinh-hoi-tu-phan-6-thumb.jpg','RuPaul’s Drag Race: All Stars (Season 6)','completed','12','59phút/tập','2021','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Carson Kressley,  Ross Mathews','Hài Hước, Thể Thao, Phiêu Lưu','Anh','<p>Trinity K. Bonet, Pandora Boxx, Jan, Kylie Sonique Love cùng 9 nữ hoàng khác trở lại với hy vọng giành được một vị trí trong Sảnh danh vọng Drag Race.</p>',0,0,11,0),(795,'Săn Diều Hâu','https://img.ophim.live/uploads/movies/san-dieu-hau-thumb.jpg','The Emissary','completed','20','45 phút/tập','1982','HD',NULL,'','劉德華, 秦沛, 劉江, 葉德嫻, 陳敏兒, 梁朝偉, 劉兆銘, 許紹雄, 關菊英, 李國麟','Hình Sự','Trung Quốc, Hồng Kông','<p>Kong Tai-wai là một sinh viên đại học lý tưởng quyết định gia nhập lực lượng cảnh sát và sau đó trở thành một thám tử ngầm cải trang thành trợ lý chính của một trùm buôn bán ma túy lớn.</p>',0,0,17,0),(796,'Hiệp Nữ Lữ Tứ Nương','https://img.ophim.live/uploads/movies/hiep-nu-lu-tu-nuong-thumb.jpg','Lu Siniang: Legend of Ching Lady','completed','25','45 phút/tập','1985','HD',NULL,'Chiêu Chấn Cường','Trịnh Du Linh, Lữ Lương Vỹ, Nhậm Đạt Hoa, Lâm Kiến Minh, Huỳnh Tạo Thời, Huệ Thiên Tứ, Trang Tịnh Nhi, Bào Phương','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Vào triều đại nhà Thanh, trong nhân gian xuất hiện một vị nữ hiệp tên là Lữ Tứ Nương (Trịnh Du Linh). Người mà từ nhỏ đã lớn lên trong một gia đình giàu sang, nhưng vì tính khí bất bình nên nhiều lần chống đối nhà Thanh. Đó cũng là nguyên nhân khởi nguồn cho việc cả gia đình cô bị tru di. Từ đó Tứ Nương đã hận nay còn ôm mối hận lớn hơn rất nhiều lần ở trong lòng. Nhưng sau đó, trớ trêu là cô đã yêu một người con của Khang Hy là Ung Chính. Lúc này ông ta còn là một vị A Ca nên Tứ Nương đã không ra tay sát hại. Sau vì Ung Chính bất chấp đạo nghĩa nên Tứ Nương lần này dứt bỏ tình riêng, hành thích hoàng đế…</i></p>',0,0,18,0),(797,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 13)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-13-thumb.jpg','RuPaul\'s Drag Race (Season 13)','completed','14','44phút/tập','2021','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>Mười ba nữ hoàng mới bước lên sàn diễn – và Ru có một bất ngờ lớn cho họ! Loạt chương trình đoạt giải Emmy trở lại cùng thêm nhiều thị phi, thời trang và đầy đanh đá.</p>',0,0,11,0),(798,'Truyện Từ Thế Giới Bên Kia','https://img.ophim.live/uploads/movies/truyen-tu-the-gioi-ben-kia-thumb.jpg','Tales From Beyond','completed','12','44 phút/tập','1992','HD',NULL,'','Ng Gong','Hành Động, Hình Sự','Trung Quốc, Hồng Kông','Truyện Từ Thế Giới Bên Kia-Tales From Beyond (1992) [HD-Lồng Tiếng]',0,0,17,0),(799,'Biên Thành Lãng Tử','https://img.ophim.live/uploads/movies/bien-thanh-lang-tu-thumb.jpg','The Black Sabre','completed','20','44 phút/tập','1991','HD',NULL,'Vương Thiên Lâm','Trương Triệu Huy, Ngô Đại Dung, Tăng Hoa Thiên, Âu Thoại Vỹ, Tạ Ninh, Lương Bội Linh, Tần Bái, Cao Hùng','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>20 năm trước, thần đao Bạch Thiên Vũ ngồi uống rượu ngắm tuyết rơi cùng Mã Không Quần tại Mai Hoa Âm bị nhóm sát thủ bịt mặt tập kích mà chết. 20 năm sau nhận lệnh của mẹ, Phó Hồng Tuyết lên đường đến Biên Thành tìm kiếm hung thủ trả thù cho Bạch Thiên Vũ.Diệp Khai là là anh hùng thiếu niên cơ trí nhanh nhẹn nhưng không biết về thân thế mình, Diệp Khai chỉ biết cha mình có liên quan đến cây đao màu đen.Đến Biên Thành, Diệp Khai gặp Phó Hồng Tuyết đeo cây đao màu đen không rời nên bám sát Phó Hồng Tuyết. Diệp Khai quen biết với Mã Phương Linh con gái của Mã Không Quần, tiểu nữ của gia trang Vạn Mã Đường thế lực nhất Biên Thành. Diệp Khai vốn tính lãng tử khó xử đứng giữa 2 hồng nhan Mã Phương Linh &amp; người bạn thân Đinh Lan Lâm.Biên Thành có hai giai nhân xinh đẹp nhất, ngoài Mã Phương Linh còn có kỳ nữ Thúy Long. Thúy Long thật ra vì nợ ân tình nên làm người liên lạc giúp Phó Hồng Tuyết. Thúy Long &amp; Phó Hồng Tuyết thật lòng yêu nhau nhưng Phó Hồng Tuyết luôn mặc cảm chân bị què, trong lòng chỉ có hận thù phải trả, nhiều lần bỏ rơi Thúy Long. Đến Biên Thành Phó Hồng Tuýêt &amp; Diệp Khai lần lượt bị cuốn vào nhiều sự kiện kỳ lạ, nhiều người chết đều có liên quan đến vụ án năm xưa. Mã Không Quần biết Phó Hồng Tuyết tìm đến trả thù nên mướn sát thủ Lộ Tiểu Giai giết Phó Hồng Tuyết nhưng không thành. Mã Không Quần bỏ trốn. Phó Hồng Tuyết lần lượt tìm đến thanh toán nợ máu với 8 người năm xưa có phần tham gia trong vụ ‟Mai Hoa Âm‟. Đến gia đình cuối cùng lại chính là Đinh Gia Trang của Đinh Lan Lâm…</i></p>',0,0,18,0),(800,'Tử Mạch Hồng Trần','https://img.ophim.live/uploads/movies/tu-mach-hong-tran-thumb.jpg','Kill to Love','completed','12','35 phút/tập','2025','HD',NULL,'','张哲旭, 弭金, 程子昕, 王鼎, Li Yi Xiang, 杨舒维, Luo Datao','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc','<p>Một hoàng tử lưu vong và sát thủ đã cứu anh ta yêu nhau, chỉ để đoàn tụ nhiều năm sau với tư cách là hoàng đế đối địch - buộc phải lựa chọn giữa quyền lực và nhau.</p>',0,0,12,0),(801,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 12)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-12-thumb.jpg','RuPaul\'s Drag Race (Season 12)','completed','14','44phút/tập','2020','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>Mười ba thí sinh. Một vương miện. Ru và cả đội đã trở lại với mùa mới gồm các màn hát nhép khốc liệt, dàn giám khảo khách mời hạng A và phong cách thời trang lộng lẫy.</p>',0,0,11,0),(802,'Con Tin','https://img.ophim.live/uploads/movies/con-tin-2025-thumb.jpg','Hostage','completed','5','42 phút/tập','2025','HD',NULL,'','Suranne Jones, Julie Delpy, Corey Mylchreest, Lucian Msamati, Ashley Thomas, James Cosmo, Jehnny Beth','Hình Sự, Chính kịch','Anh','<p>Khi phu quân của Thủ tướng Anh bị bắt cóc và Tổng thống Pháp bắt đầu nhận được những lời đe dọa, cả hai nhà lãnh đạo buộc phải đối mặt với một lựa chọn không tưởng.</p>',1,0,17,0),(803,'Nam Quyền Bắc Cước','https://img.ophim.live/uploads/movies/nam-quyen-bac-cuoc-thumb.jpg','Fist of Power','completed','20','47 phút/tập','1995','HD',NULL,'Dương Cẩm Tuyền','Phàn Thiếu Hoàng, Lý Tái Phụng, Lương Tiểu Băng, Đàm Diệu Văn, Tống Ỷ Văn, Mạch Trường Thanh, Trần Hồng Liệt, Vương Vỹ','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Hoàng Kỳ Anh theo sư phụ tập võ từ nhỏ, võ nghệ cao cường. Trong lúc quân chủ Hà Bắc Nghiêm Bá Sơn kết với Vương Miêu Phong đàn áp các võ quán miền Nam, anh đứng ra chống đỡ, mở màn nhiều trận ác chiến Nam Nắc. Đồng thời anh hạ giáo chủ Hồng Liên Giáo, gian thần Cổ Cách Nhĩ, sau cùng còn tự sáng ra Hổ Hạc Song lâm. Về mặt tình cảm, sau nhiều hoạn nạn chàng và cô Nam dần dần nảy sinh tình cảm. Mặt khác cô Vân cũng có tình sâu nghĩa nặng với chàng, khiến chàng không biết nên lựa chọn ra sao?</i></p>',0,0,18,0),(804,'Hầu Tửu Quyền','https://img.ophim.live/uploads/movies/hau-tuu-quyen-thumb.jpg','Drunken Monkey','completed','1','97 Phút','2003','HD',NULL,'','','Hành Động, Phiêu Lưu, Hài Hước','Trung Quốc, Hồng Kông','Ca Thủ là công tử của thương gia họ Trần chốn kinh thành. Y không ham chữ nghĩa, chỉ yêu thích hội họa, đặc biệt là khát khao xuất bản cuốn sách vẽ thế võ hầu quyền lưu danh trong thiên hạ. Tuấn là một thanh niên có thân thể dẻo dai, cường tráng, đam mê luyện võ. Tuấn là người hầu và cũng là ông cậu Ca Thủ bởi một mối quan hệ rất đỗi lằng nhằng trong gia tộc. Nhân một lần cả hai bị trục xuất khỏi trường học bởi một trò quậy phá, Tuấn và Ca Thủ quyết tâm lên đường tìm kiếm người anh hùng Mã Bình. Vị trưởng môn Chung Vũ Tiêu Cục này từng nổi danh trong chốn giang hồ với ngón võ hầu quyền độc nhất. Nhưng một người mai danh ẩn tính thật không dễ gì tìm kiếm, cho đến khi họ may mắn gặp được Mẫn, một cô gái xinh đẹp, cá tính và được trang bị những ngón võ hầu quyền điêu luyện.',0,0,12,0),(805,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 11)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-11-thumb.jpg','RuPaul\'s Drag Race (Season 11)','completed','14','44phút/tập','2019','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>14 thí sinh mới -- cùng \"thánh meme\" của mùa 10 Vanessa Vanjie Mateo -- cùng so tài giành danh hiệu quán quân của Siêu sao Drag Mỹ Tiếp theo.</p>',0,0,11,0),(806,'Cuộc Chiến Mafia','https://img.ophim.live/uploads/movies/cuoc-chien-mafia-thumb.jpg','Mafia Wars','completed','1','98 Phút','2024','HD',NULL,'Scott Windhauser','Tom Welling, Cam Gigandet, Chris Mullinax, Cher Cosenza, Desiree Hall, Luca Malacrino, Alessia Alciati, Ludovica Frasca, Al Linea, Sidhartha Mallya','Hành Động, Hình Sự','Âu Mỹ','\"Mafia Wars\" (2024) kể về Terry Jacobs (do Tom Welling thủ vai), một cựu tù nhân được thả sớm với điều kiện anh phải tham gia vào một đơn vị cảnh sát chìm gồm sáu người, nhằm điều tra một trùm ma túy khét tiếng người Ý. Tuy nhiên, ngay trong ngày đầu tiên, năm thành viên khác của đơn vị bị giết hại, khiến Terry phải đối mặt trực tiếp với những tên mafia mà anh được giao nhiệm vụ theo dõi, mà không biết liệu chúng có nhận ra danh tính thực sự của anh hay không.',0,0,17,0),(807,'Phi Ưng Đại Hiệp','https://img.ophim.live/uploads/movies/phi-ung-dai-hiep-thumb.jpg','The Hawk','completed','20','45 phút/tập','1981','HD',NULL,'Lý Đình Luân','Trịnh Thiếu Thu, Đổng Vĩ, Triệu Nhã Chi, Trần Ngọc Liên, Quan Hải Sơn, Lý Đạo Hồng, Huỳnh Mạn Ngưng, Diêu Vỹ, Quách Phong, Trần Hữu Hậu, Miêu Kiều Vỹ, Tô Hạnh Tuyền, Lưu Đan Thể loại: Võ Thuật - Kiếm Hiệp, Cổ Trang','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Đinh gia nhiều đời làm nghề truy nã tội phạm, truyền nhân tôn xưng là Phi Ưng. Một người thần bí bỏ ra số tiền lớn ủy thác Đinh Lam truy bắt tàn dư của Bái Nguyệt Giáo. Trong lúc điều tra Lam bị rơi vào sự an bài ép cùng tiểu thư Nghê Thiên Nhi, ngược với dự đoán Lam, Lam đã tìm cách bỏ trốn. Lam gặp được tuyệt sắc danh kỹ Tố Tố, đem lòng yêu thương cuối cùng mới biết nàng chính là người thần bí. Trong ngày Lam và Tố Tố thành thân, Nghê Lão bị Tứ Đại Ác Nhân giết chết, lúc này Tố Tố mới biết mình chính là truyền nhân của Bái Nguyệt Giáo. Mang nối huyết thù nàng luyện thành Tuyệt Tình Đao, cuối cùng bị danh sĩ truy sát. Lam vì cứu nàng bị quy tội cấu kết ma giáo khiến nhà tan cửa nát…</i></p>',0,0,18,0),(808,'Giang Sơn Mỹ Nhân','https://img.ophim.live/uploads/movies/giang-son-my-nhan-1994-thumb.jpg','The Last Conquest','completed','20','45 phút/tập','1994','HD',NULL,'','羅嘉良, 李麗珍, 韓馬利, 黎耀祥, 鮑方, 吳詠紅, 鐘淑慧, Amy Wu Mei-Yee, 黎漢持, 劉江','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','Giang Sơn Mỹ Nhân-The Last Conquest (1994) [HD-Lồng Tiếng]',0,0,12,0),(809,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 10)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-10-thumb.jpg','RuPaul\'s Drag Race (Season 10)','completed','11','44phút/tập','2018','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>14 thí sinh ôm hi vọng, gồm cả một thí sinh cũ, cạnh tranh cho danh hiệu cao nhất trong mùa giải mới tràn ngập sự quyến rũ, chỉ trích và dàn giám khảo khách mời siêu sao.</p>',0,0,11,0),(810,'Thầm Thám CID','https://img.ophim.live/uploads/movies/tham-tham-cid-thumb.jpg','Siblings of The Vice and Virtue','completed','20','43 phút/tập','1986','HD',NULL,'','曾江, 張兆輝, 李國麟, 陳敏兒, 戴志偉, 韓馬利','Hành Động, Hình Sự','Trung Quốc, Hồng Kông','Thầm Thám CID-Siblings of The Vice and Virtue (1986) [HD-Lồng Tiếng]',0,0,17,0),(811,'Thiên Kiếm Tuyệt Đao','https://img.ophim.live/uploads/movies/thien-kiem-tuyet-dao-thumb.jpg','Paragon of Sword & Knife','completed','8','25 phút/tập','1989','HD',NULL,'Lý Nguyên Khoa','Bành Văn Kiên, Ban Ban, Kim Đồng, Miêu Kim Phụng, Châu Tú Lan, Âu Diễm Liên, Dương Gia Nặc','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Bảo chủ của Bạch Hạc Bảo - Tả Giám Bạch là người trung nghĩa, ông có hai người con, con trai là Tả Thiếu Bạch, con gái là Tả Văn Quyên. Ông bị vu oan đã giết bốn vị chưởng trên Yên Vũ Phong nên bị người các môn phái truy đuổi giết, không may ông và vợ là Kim Quắc Lệ qua đời, Tả Văn Quyên thì bị thất lạc, Tả Thiếu Bạch may mắn thoát chết và lạc vào Sinh Tử Kiều , nơi mà người giang hồ đồn rằng huyền bí và không ai có thể qua được cầu này, tại đây chàng gặp hai vị cao nhân chỉ điểm và học được một thân võ công tuyệt thế. Khi trở lại giang hồ để điều tra ai là chủ mưu đã hãm hại gia đình mình thì anh quen biết hai hồng nhan là Trương Ngọc Dao và cô gái mù tên Phạm Tuyết Quân, liệu anh có tìm ra kẻ chủ mưu là ai ...</i></p>',0,0,18,0),(812,'12 Con Giáp','https://img.ophim.live/uploads/movies/12-con-giap-2025-thumb.jpg','Twelve','completed','16','50 phút/tập','2025','HD',NULL,'Kang Dae-gyu','마동석, 박형식, 서인국, 이주빈, 고규필, 강미나, 성유빈, 안지혜, 雷嘉汭, 성동일','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Hàn Quốc','<p>12 loài vật nhận được lời kêu gọi từ thiên đàng và xuống trần gian để cứu thế giới loài người. Mỗi loài được ban cho sức mạnh riêng để bảo vệ loài người và được tái sinh thành 12 thiên thần. Dưới sự lãnh đạo của thiên thần hổ Tae San, thủ lĩnh của các thiên thần, 12 thiên thần đã chiến đấu trong một trận chiến đẫm máu chống lại Asura, vua của loài quỷ bị Chúa trời căm ghét và trục xuất, cùng với lũ quỷ để bảo vệ thế giới loài người.</p>',1,0,12,0),(813,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 9)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-9-thumb.jpg','RuPaul\'s Drag Race (Season 9)','completed','14','44phút/tập','2017','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>Các thí sinh cạnh tranh để giành 100.000 USD cùng danh hiệu Siêu sao Drag Mỹ Tiếp theo trong một mùa giải đầy những bất ngờ lớn cùng dàn giám khảo khách mời cực khủng.</p>',0,0,11,0),(814,'Đông Du Ký','https://img.ophim.live/uploads/movies/dong-du-ky-thumb.jpg','Legend of the Eight Immortals','completed','30','45 phút/tập','1998','HD',NULL,'Tạ Ích Văn','Mã Cảnh Đào, Quách Phi Lệ, Tạ Thiều Quang, Trịnh Tú Chân, Lâm Tương Bình','Viễn Tưởng, Võ Thuật, Cổ Trang','Trung Quốc, Nga, Singapore','Đông Du Ký là một bộ phim truyền hình Singapore dựa trên những câu chuyện về Tám  tiên trong thần thoại Trung Quốc và được chuyển thể từ tiểu thuyết Trung Quốc Đông Du Ký vào thế kỷ 16 của  Ngô Nguyên Thái. Đặc biệt có sự góp mặt nam diễn viên Đài Loan nổi tiếng Mã Cảnh Đào trong vai Lữ Động Tân.',0,0,18,0),(815,'Hồng Ân Thái Cực Quyền','https://img.ophim.live/uploads/movies/hong-an-thai-cuc-quyen-thumb.jpg','The Master of Tai Chi','completed','25','45 phút/tập','2008','HD',NULL,'','赵文卓, 林峯, 吳美珩, 胡杏兒, 馬國明, 李施嬅, 秦沛, 郭政鴻, 姜大衛, 劉兆銘','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','The Master Of Tai Chi (Hồng Ân Thái Cực Quyền) kể về cuộc đời của vị sư phụ đã đạt tới cảnh giới cao nhất của Thái Cực Quyền - Vu Mã. Bị cha mẹ bỏ rơi từ nhỏ Vu Mã đã cùng sư phụ vào rừng ở và tập thái cực. Để giúp Mã xóa bỏ thù hận trong lòng, sư phụ Mã đã không ngại xả thân vì nghĩa. Để báo đáp sư phụ, đồng thời hoàn thành tâm nguyện hoằng dương võ đạo của cha, Mã bước vào con đường theo đuổi cảnh giới cao nhất của Thái Cực. Mã khiêu chiến với Đoạn Hiểu Tinh, trưởng môn của phái Thương Long - thiên hạ đệ nhất ban phái, kết cuộc Mã bị bại trận. Kể từ đó Mã đặt ra mục tiêu phải đánh Bại Tinh. Hai người cũng không tránh khỏi những cuộc chiến triền miên gây nên bởi cô gái Ngôn Tử Quy và một cao thủ có dã tâm ghê gớm Lư Khâu Ngạo. Mặt khác, vì thực hiện lý tưởng của mình, mà khoảng cách giữa Mã và hồng nhan tri kỷ Tang Thanh cứ ngày càng xa…',0,0,12,0),(816,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 8)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-8-thumb.jpg','RuPaul\'s Drag Race (Season 8)','completed','10','44phút/tập','2016','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>Mười hai nữ hoàng drag mới xuất hiện với nhiều phong cách khác nhau. Họ có chung một mục tiêu: giải thưởng 100.000 USD của mùa 8 và danh hiệu Siêu sao Drag Mỹ Tiếp theo.</p>',0,0,11,0),(817,'Thân Chủ','https://img.ophim.live/uploads/movies/than-chu-1994-thumb.jpg','The Client','trailer','1','119 Phút','1994','HD',NULL,'Joel Schumacher','Brad Renfro, Susan Sarandon, Tommy Lee Jones, Mary-Louise Parker, Anthony LaPaglia, Bradley Whitford, Will Patton, Anthony Edwards, J. T. Walsh, Anthony Heald','Hình Sự, Chính kịch, Bí ẩn','Âu Mỹ','Một đứa trẻ thông thái trên đường phố, Mark Sway, chứng kiến ​​vụ tự sát của Jerome Clifford, một luật sư nổi tiếng của Louisiana, mà thân chủ hiện tại là Barry \'The Blade\' Muldano, một sát thủ của Mafia.  Trước khi Jerome tự sát, anh ta nói với Mark nơi chôn thi thể của một Thượng nghị sĩ.  Clifford tự bắn mình và Mark được tìm thấy tại hiện trường, cả FBI và Mafia đều nhanh chóng nhận ra rằng Mark có lẽ biết nhiều hơn những gì cậu ta nói.',0,0,17,0),(818,'Song Hùng Gan Dạ','https://img.ophim.live/uploads/movies/song-hung-gan-da-thumb.jpg','Guts of Man','completed','20','43 phút/tập','2005','HD',NULL,'Lương Tài Viễn','Ngô Trác Hy, Trần Kiện Phong, Tào Mẫn Lợi, Cái Minh Huy, Nguyên Hoa, Tô Ngọc Hoa','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Mười mấy năm về trước, cha của chị em Đổng Lam và Đổng Phi - một danh y tài giỏi - đã vướng phải trọng tội vì làm chết Âu Dương phu nhân trong lúc chữa trị. May thay, mẹ con Đổng Lam trốn thoát đến Đào Hoa Thôn hẻo lánh, sống cuộc đời mai danh ẩn tích. Cùng lúc đó, trên giang hồ thường xuyên xảy ra nhiều vụ cướp của giết người nguy hiểm do bọn \"Ngũ quỷ Thương Châu\" gây ra. Suốt mười mấy năm trời, quan phủ không hề bắt được bọn chúng và cũng chẳng điều tra được bọn chúng thật sự là ai? Từ nhỏ, Đổng Lam đã siêng năng, cần mẫn. Cô học được y thuật của cha và cả võ công của mẹ. Bây giờ, mỗi khi ra ngoài, cô thường cải nam trang và bắt Đổng Phi phải gọi cô là sư huynh để che dấu thân phận...</i></p>',0,0,18,0),(819,'Người Hòa Giải (Phần 2)','https://img.ophim.live/uploads/movies/nguoi-hoa-giai-phan-2-thumb.jpg','Peacemaker (Season 2)','ongoing','7','45 phút/tập','2025','HD',NULL,'','John Cena, Danielle Brooks, Freddie Stroma, Jennifer Holland, Steve Agee','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học, Chính kịch','Âu Mỹ','In season 2, Peacemaker discovers an alternate world where life is everything he wishes it could be. But this discovery also forces him to face his traumatic past and take the future into his own hands.',1,0,12,0),(820,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 6)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-6-thumb.jpg','RuPaul\'s Drag Race (Season 6)','completed','14','44phút/tập','2014','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>RuPaul đón 14 thí sinh tham gia cuộc thi mặc đồ nữ mới đầy ấn tượng, từ những cô gái lộng lẫy đến những nữ hoàng phong cách cổ điển thanh lịch hay thí sinh mới hăng hái.</p>',0,0,11,0),(821,'Tiết Bình Quý Và Vương Bảo Xuyến','https://img.ophim.live/uploads/movies/tiet-binh-quy-va-vuong-bao-xuyen-thumb.jpg','Love Amongst War','completed','55','30 phút/tập','2012','HD',NULL,'Đồng Lực','Trương Lượng, Trần Hạo Dân, Tuyên Huyên, Tiến Vinh','Võ Thuật, Cổ Trang','Trung Quốc','Nhà đường niên đại Túc Tông, cung đình tranh đấu thái tử lưu lạc bên ngoài nên đổi tên là Tiết Bình Quý. Bình Quý sau khi lớn lên đến Trường An thì gặp được thiên kim của Tướng gia là Vương Bảo Xuyến. Vương tướng quốc được Hoàng thượng ra lệnh chiêu hôn cho Bảo Xuyến, Bảo Xuyến vì chung tình với Bình Quý tuyệt tình nghĩa với phụ thân bằng tam kích chưởng, sau đó cùng Bình Quý kết thành vợ chồng.\n\nHai quân giao chiến, công chúa nước địch gặp và được Bình Quý tha mạng nên đem lòng cảm kích. Công chúa đại chiến được gã cho Bình Quý, Bình Quý kế thừa vương vị sau thiết lập hòa bình giữa hai nước, mở ra thông thương giao dịch đẩy mạnh cuộc sống người dân. Bảo Xyến biết được sự việc này hỉu lầm Bình Quý hai người phát sinh mâu thuẫn. Sau này, Bình Quý giải thích rõ ràng mọi chuyện, hai người lại thông hiểu cho nhau cho nên một nhà đoàn viên.',0,0,18,0),(822,'Cục 749','https://img.ophim.live/uploads/movies/cuc-749-thumb.jpg','Bureau 749','completed','1','123 Phút','2024','HD',NULL,'陆川','王俊凯, 苗苗, 鄭愷, 任敏, 辛柏青, 李晨, 張鈞甯, 杨皓宇, Yu Kailei, 李梦','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc','Một chàng trai trẻ bị tổn thương với những bất thường về thể chất buộc phải gia nhập một văn phòng bí ẩn để đối mặt với thảm họa lan rộng khắp trái đất do một sinh vật vô danh gây ra. Anh dấn thân vào một cuộc phiêu lưu khám phá những bí ẩn về cuộc đời mình.',0,0,12,0),(823,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 5)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-5-thumb.jpg','RuPaul\'s Drag Race (Season 5)','completed','14','44phút/tập','2013','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>Alaska, bạn diễn của Nhà vô địch Mùa 4 - Sharon Needles, người giành giải trực tuyến Penny Tration và 12 người khác tham gia thử thách đi giày cao gót của RuPaul năm nay.</p>',0,0,11,0),(824,'Mật Mã Hỗn Loạn','https://img.ophim.live/uploads/movies/mat-ma-hon-loan-thumb.jpg','Serial Homicide','completed','22','30 phút/tập','2025','HD',NULL,'','牛駿峰, 嘉羿, Dong Yong, 苏倩薇, Su Yu Jie, Lu Yiding, 卢杉, 陈怡贞, 赵柯','Hình Sự, Bí ẩn','Trung Quốc','<p>Sự yên bình của thành phố Lộc Châu bị phá vỡ bởi một vụ án giết người hàng loạt được cho là nhằm \"trừng trị cái ác, đề cao cái thiện\". Cơ quan công an đã thành lập \"Tổ chuyên án 909\" để điều tra. Trải qua muôn vàn khó khăn, tổ chuyên án đã từng bước bóc tách, lật mở từng lớp sự thật kinh hoàng đằng sau kế hoạch trả thù bằng cách trao đổi giết người mang tên \"Erinyes\".</p>',0,0,17,0),(825,'Tuyết Hoa Thần Kiếm','https://img.ophim.live/uploads/movies/tuyet-hoa-than-kiem-thumb.jpg','The Snow is Red','completed','40','45 phút/tập','1997','HD',NULL,'Tiêu Sinh','Mễ Tuyết, Khương Đại Vệ, Dương Cung Như, Trần Vĩ, Viên Văn Kiệt, Cung Từ Ân, Từ Thiếu Cường, Chân Chí Cường, Cao Hùng','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Vào cuối thời Nam Tống, thiên hạ nhiễu nhương vì sự tranh giành trục lợi của chánh tà hai phái. Tất cả đều bắt nguồn từ việc muốn làm chủ tấm bản đồ tiềm tàng nhiều thánh vật. Lòng tham lam, sự hung tàn đã tạo nên bao phong ba bão táp khiến cho bao người vô tội phải tắm trong bể máu, bao kẻ hiền lương phải thịt nát xương tan vì mưu đồ của những kẻ cuồng vọng. Chồng thù vợ, cha nghịch con, em giết anh, trò phản bội thầy. Luân lý xã hội bị thay thế bằng những thủ đoạn tàn bạo, những trò bán rẻ lương tâm. Vì an nguy của cả võ lâm, các bang phái trên giang hồ quyết tâm truy sát Nhiếp Mỵ Nương – một nữ ma đầu có võ công cái thế ôm mộng khôi phục Thánh Giáo…. Cái chết thương tâm của Nhiếp Mỵ Nương đã khiến cho Nhiếp Tiểu Phụng- đứa con gái duy nhất của ả, cũng là tàn dư cuối cùng của Thánh Giáo khắc cốt một mối thâm thù. Mười sáu năm sau, với tất cả những ân, oán, tình, thù, Tiểu Phụng đã khiến giang hồ một lần nữa chìm trong biển máu với những cuộc tàn sát vô cùng thảm khốc…</i></p>',0,0,18,0),(826,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 4)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-4-thumb.jpg','RuPaul\'s Drag Race (Season 4)','completed','14','44phút/tập','2012','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Thể Thao, Phiêu Lưu','Anh','<p>RuPaul trở lại cùng những nữ hoàng hoàn toàn mới trong trang phục sequin, lấp lánh lộng lẫy và giải thưởng lớn nhất trong lịch sử Cuộc chiến giày cao gót - 100.000 USD</p>',0,0,11,0),(827,'Ngự Tiền Tứ Bảo','https://img.ophim.live/uploads/movies/ngu-tien-tu-bao-thumb.jpg','Imperial Four Treasures','completed','44','47 phút/tập','2004','HD',NULL,'Hoàng Tổ Quyền','Triệu Văn Trác, Lưu Nghi Vĩ, Lô Tinh Vũ','Hài Hước, Chính kịch, Võ Thuật','Trung Quốc','<p><i>Triệu Văn Trác, một trong những ngôi sao võ thuật hàng đầu của làng điện ảnh hoa ngữ. Anh được khán giả Việt biết đến từ bộ phim truyền hình Phong Vân với vai Nhiếp Phong. Ngoài ra, anh còn tham gia hàng loạt dự án đình điện ảnh đám như: Tô Khất Nhi, Chiến Lang hay Tân Bạch Phát Ma nữ,…Không chỉ vậy, Triệu Văn Trác còn rất tích cực tham gia các bộ phim truyền hình, với nhiều thể loại khác nhau, nhưng đa số là phim võ thuật. Ngự Tiền Tứ Bảo là một trong số ít những bộ phim không thuộc thể loại võ thuật do anh tham gia. Phim có tựa đề tiếng anh là Imperial First Four Treasures, do đạo diễn kỳ cựu Hoàng Tổ Quyền chỉ đạo nội dung, với sự tham gia của nhiều diễn viên nổi tiếng như: Triệu Văn Trác, Lưu Nghi Vĩ, Lô Tinh Vũ,…phim thuộc thể loại cổ trang hài hước, được phát sóng lần đầu tiên vào năm 2004. Nội dung phim xoay quanh câu chuyện hài hước của 4 người được mệnh danh là ngự tiền tứ bảo\" của vua Khang Hy. Trong 4 người này có 2 người có thân phận là ăn mày nhưng được Quái Tăng (chính là cha của vua Khang Hy) điểm hóa thành 2 đại thần quan trọng trong triều đình. Hai người còn lại là Nạp Lan Dung Nhược và Thi Sĩ Luân, cả 4 người đều là đại thần thân cận bên cạnh vua. Không chỉ là những cánh tay đắc lực của Khang Hy, họ còn là những người được nhân dân yêu quý bậc nhất. Tuy rằng, tính cách mỗi người một kiểu, suốt ngày cãi cự và xung đột nhau nhưng khi có việc quan trọng thì họ không ngừng giúp đỡ lẫn nhau. Sau cùng, 4 người cùng nhau loại bỏ những tên gian thần trong triều, đồng thời ra sức cải thiện cuộc sống cho nhân dân.</i></p>',0,0,18,0),(828,'RuPaul\'s Drag Race: Minh Tinh hội tụ (Phần 5)','https://img.ophim.live/uploads/movies/rupauls-drag-race-minh-tinh-hoi-tu-phan-5-thumb.jpg','RuPaul’s Drag Race: All Stars (Season 5)','completed','8','59phút/tập','2020','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Carson Kressley,  Ross Mathews','Thể Thao, Phiêu Lưu','Anh','<p>Shea Couleé, Ongina, Jujubee, Miz Cracker, Alexis Mateo và năm nữ hoàng được yêu thích khác trở lại cho một mùa đình đám mới — với một bước ngoặt chấn động mới.</p>',0,0,11,0),(829,'Lần Theo Dấu Vết','https://img.ophim.live/uploads/movies/lan-theo-dau-vet-2006-thumb.jpg','Summer Heat','completed','20','45 phút/tập','2006','HD',NULL,'','滕麗名, 馬德鐘, 郭耀明, 莫家堯, 曹永廉, 魯文傑, 鍾麗淇, 郭鋒, Carlos Koo, 鄧浩光','Hình Sự, Chính kịch, Bí ẩn','Trung Quốc, Hồng Kông','Summer Heat is a TVB modern suspense series released overseas in January 2004 and broadcast on TVB Jade Channel in June 2006.',1,0,17,0),(830,'Chuyện Tình Cô Gái Tóc Bạc','https://img.ophim.live/uploads/movies/chuyen-tinh-co-gai-toc-bac-thumb.jpg','The Romance of the White Hair Maiden','completed','20','45 phút/tập','1995','HD',NULL,'Lưu Gia Hào','Thái Thiếu Phân, Hà Bửu Sinh, Lý Quế Anh, La Mãnh, Trần Gia Huy, Lý Thành Xương, Trần Bội San, Mã Đức Chung, Vũ Phong, Vương Vỹ, Lê Hán Trì, Tần Hoàng','Chính kịch, Cổ Trang, Võ Thuật','Trung Quốc, Hồng Kông','<p><i>Chuyện Tình Cô Gái Tóc Bạc là một tác phẩm kiếm hiệp vào loại nổi tiếng nhất của Lương Vũ Sinh, bằng chứng là nó đã được chuyển thể thành phim điện ảnh và truyền hình rất nhiều lần ... Trác Nhất Hàng là đại đệ tử của phái Võ Đang với tài nghệ vào loại hàng đầu trong Bát đại môn phái. Anh là niềm hy vọng của cả phái Võ Đang và giang hồ trong cảnh loạn lạc cuối đời nhà Minh. Tuy nhiên Nhất Hàng lại chẳng màng chức vị hay danh tiếng, anh chỉ thích đối tửu cùng người bạn lâu năm Ngô Tam Quế và tơ tưởng tới người trong mộng của anh - Ngọc La Sát xinh đẹp, đệ nhất sát thủ của Thần Cung giáo - kẻ địch của Bát đại môn phái. Và rồi Nhất Hàng cùng Ngọc La Sát cũng đến được với nhau, Nhất Hàng đặt tên cho người yêu của mình là Luyện Nghê Thường, còn nàng Nghê Thường bắt người yêu phải thề rằng anh sẽ luôn tin tưởng vào cô bất kể chuyện gì xảy ra. Và tất nhiên với một mối tình ngang trái kiểu Romeo và Juliette thì sẽ có rất nhiều thứ ập đến với Nhất Hàng và Nghê Thường, đó là sự ngăn cản từ phía phái Võ Đang với Nhất Hàng, từ phía Cơ Vô Song giáo chủ Thần Cung giáo, đó là sự kiện nhà Thanh xâm chiếm Trung Quốc nhờ sự tiếp tay của Ngô Tam Quế. Kết quả thì như tất cả những ai yêu kiếm hiệp đều đã biết, nàng Nghê Thường biến thành Bạch phát ma nữ với mái tóc trắng xóa, còn Nhất Hàng suốt phần đời còn lại đứng canh trên đỉnh núi tuyết trắng để tìm thứ thảo dược giúp hồi sinh mái tóc của nàng Nghê Thường. Nhưng cái người xem quan tâm là bi kịch nào đã đẩy Nghê Thường và Nhất Hàng tới số phận đau khổ như vậy.</i></p>',0,0,18,0),(831,'Những Dòng Sông Vận Mệnh','https://img.ophim.live/uploads/movies/nhung-dong-song-van-menh-thumb.jpg','Rivers of Fate','completed','4','42 phút/tập','2025','HD',NULL,'','Domithila Catete, Lucas Galvino, Marleyda Soto, Bruno Goya, Claudio Jaborandy, Ricardo Teodoro, Wesley Guimarães, Sandro Guerra, Ademara Barros','Hành Động, Phiêu Lưu, Chính kịch','Brazil','<p>Khi một thiếu nữ bị đường dây buôn bán tình dục bắt cóc, một kẻ cướp sông và một người mẹ quyết liệt thực hiện những nhiệm vụ riêng để tìm cô gái. Rồi họ vô tình gặp nhau.</p>',0,0,12,0),(832,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 3)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-3-thumb.jpg','RuPaul\'s Drag Race (Season 3)','completed','16','44phút/tập','2011','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Tình Cảm, Thể Thao','Anh','<p>Trong Mùa 3, RuPaul tiếp tục tìm kiếm tài năng mặc trang phục khác giới bằng cách dàn dựng một cảnh chụp ảnh Giáng Sinh trên tấm bạt lò xo và nhiều thử thách khác.</p>',0,0,11,0),(833,'Cám Dỗ Chết Chóc (Phần 2)','https://img.ophim.live/uploads/movies/cam-do-chet-choc-phan-2-thumb.jpg','Fatal Seduction (Season 2)','completed','10','35 phút/tập','2025','HD',NULL,'','','Hình Sự, Chính kịch, Bí ẩn','Nam Phi','Một giáo sư đã có gia đình bị kéo vào cuộc tình say đắm với người đàn ông trẻ hơn, cũng là người lật mở bi kịch và sự phản bội của những người thân thiết nhất đối với cô.',0,0,17,0),(834,'Bình Tung Hiệp Ảnh','https://img.ophim.live/uploads/movies/binh-tung-hiep-anh-thumb.jpg','Heroic Legend','completed','35','45 phút/tập','2003','HD',NULL,'He Qun','Huang Haibing, Fan Bingbing, Sun Hao, Han Xue, Feifei Sun, Sun Chenxi, Zhang Jiayi, Da Shichang, Shen Junyi','Cổ Trang, Võ Thuật','Trung Quốc','<p>Bình Tung Hiệp Ảnh kể về một vị sứ thần Đại Minh tên Vân Tĩnh, bị hữu thừa tướng nước Ngõa Trì Trương Tôn Châu bắt chăn dê 20 năm ở quan ngoại. Khi được trở về, ông lại bị triều đình nghi là phản thần và ép tự vẫn. Cháu gái ông Vân Lỗi được Cửu Thiên Huyền Nữ Diệp Doanh Doanh thu làm đồ đệ, 10 năm sau quay lại Ngõa Trì tìm Trương Tôn Châu báo thù, không ngờ rơi vào ái tình với con trai Trương Tôn Châu là Trương Đan Phong. Đi cùng với đó là những âm mưu thâm hiểm chốn giang hồ, nhằm chiếm đoạt một kho báu rất lớn của Trương Sĩ Thành, tổ tiên Trương Đan Phong để lại.</p>',0,0,18,0),(835,'Rupaul\'s Drag Race - Cuộc chiến giày cao gót (Phần 2)','https://img.ophim.live/uploads/movies/rupauls-drag-race-cuoc-chien-giay-cao-got-phan-2-thumb.jpg','RuPaul\'s Drag Race (Season 2)','completed','12','44phút/tập','2010','HD',NULL,'','RuPaul Charles,  Michelle Visage,  Ross Mathews,  Carson Kressley,  Santino Rice,  Merle Ginsberg,  Billy B','Tình Cảm, Thể Thao','Anh','<p>Có hàng tá nữ hoàng drag mới – gồm có Raven, Tyra Sanchez và Pandora Boxx – cùng tự tin bước lên sàn catwalk trong một cuộc thi theo thể thức loại trực tiếp.</p>',0,0,11,0),(836,'Marco','https://img.ophim.live/uploads/movies/മാർക്കോ-thumb.jpg','Marco','completed','1','145 Phút','2024','HD',NULL,'Haneef Adeni','Unni Mukundan, Siddique, Ishan Shoukath, Jagadish, Abhimanyu Thilakan, Kabir Duhan Singh, Anson Paul, Ajith Koshy, Durva Thaker, Yukti Thareja','Hành Động, Hình Sự','Ấn Độ','The adoptive son of the Adattu family, Marco, sets off on a ruthless quest for vengeance after his brother is brutally murdered, finding only betrayal, loss and unimaginable brutality at every step.',0,0,17,0),(837,'Elio: Cậu Bé Đến Từ Trái Đất','https://img.ophim.live/uploads/movies/elio-cau-be-den-tu-trai-dat-thumb.jpg','Elio','completed','1','98 Phút','2025','HD',NULL,'Domee Shi, Madeline Sharafian','Yonas Kibreab, Zoe Saldaña, Remy Edgerly, Brandon Moon, Brad Garrett, Jameela Jamil, Young Dylan, Jake T. Getman, Matthias Schweighöfer, Ana de la Reguera','Hài Hước, Viễn Tưởng, Phiêu Lưu, Khoa Học, Gia Đình','Âu Mỹ','Gặp Elio, một cậu bé có khả năng dịch chuyển xuyên vũ trụ và bị nhận nhầm thành Đại sứ thiên hà của Trái đất. Phim có America Ferrera đảm nhận lồng tiếng cho nhân vật Olga Solis, Yonas Kibreab lồng tiếng cho Elio. Phim được đạo diễn bởi Adrian Molina và sản xuất bởi Mary Alice Drumm. Elio từ Disney và Pixar dự kiến khởi chiếu vào mùa xuân 2024.',0,0,12,0),(838,'Thập Hổ Thích Kiều Tam','https://img.ophim.live/uploads/movies/thap-ho-thich-kieu-tam-thumb.jpg','Thập Hổ Thích Kiều Tam','completed','40','45 phút/tập','2014','HD',NULL,'','Ji Chunhua, Thích Tiểu Long, Tommy Sik','Cổ Trang, Võ Thuật','Trung Quốc','<p>Phim <a href=\"https://tvphim.us/thap-ho-thich-kieu-tam/\">Thập Hổ Thích Kiều Tam</a> dài 40 tập tên tiếng anh là Invincible Iron Bridge được diễn viên nổi tiếng Thích Tiểu Long đảm nhiệm nhân vật chính trong phim, Thập Hổ Thích Kiều Tam nói về sự ra đời các môn võ thuật kiêu gọi các bậc thầy võ thuật tự hội lại để tranh giành quyền lực…</p>',0,0,18,0),(839,'Vũ Điệu Tình Yêu','https://img.ophim.live/uploads/movies/vu-dieu-tinh-yeu-thumb.jpg','Step Up','completed','1','Đang cập nhật','2006','HD',NULL,'Anne Fletcher','Channing Tatum,  Jenna Dewan-Tatum,  Damaine Radcliff','Tình Cảm, Tâm Lý, Thể Thao','Âu Mỹ','<p>Tyler vốn là một chàng trai trẻ mang đầy tính cách nổi loạn ở vùng Baltimore. Ngược lại với anh là Nora, một cô gái học khiêu vũ đang hy vọng sẽ đậu vào trường nghệ thuật Maryland nổi tiếng và điều Nora cần là một bạn nhảy giỏi. Khi hai người họ gặp nhau, Tyler nhận ra rằng đây chính là cơ hội để anh thoát khỏi những rắc rối và bắt đầu lại cuộc sống cho mình...</p>',0,0,11,0),(840,'Màn đêm luôn tới','https://img.ophim.live/uploads/movies/man-dem-luon-toi-thumb.jpg','Night Always Comes','completed','1','108 Phút','2025','HD',NULL,'Benjamin Caron','Vanessa Kirby, Jennifer Jason Leigh, Zack Gottsagen, Stephan James, Julia Fox, Randall Park, Michael Kelly, J. Claude Deering, Dana Millican, Curtis McGann','Hình Sự, Chính kịch','Âu Mỹ, Anh','Sắp mất nhà giữa một thành phố mà gia đình không còn đủ tiền để lưu lại, suốt đêm cô gái nọ tuyệt vọng xoay xở và ngày càng lún sâu vào nguy hiểm hòng kiếm đủ 25.000 đô la.',0,0,17,0),(841,'PiCNiC','https://img.ophim.live/uploads/movies/picnic-thumb.jpg','Picnic','completed','1','72 Phút','1996','HD',NULL,'岩井俊二','浅野忠信, 橋爪浩一, 六平直政, 山本ふじこ, 山口詩史, 伊藤かずえ, 佐山真理, 武藤寿美, 島村日出夫, 久野優理','Phiêu Lưu, Chính kịch','Nhật Bản','Believing that the world will end that very day, three mental patients Coco, Tsumuji, and Satoru set out upon a journey. Walking upon the tops of the walls of the city, they seek to find a picnic spot with the best vantage point to view the final event.',0,0,12,0),(842,'Sword Stained with Royal Blood','https://img.ophim.live/uploads/movies/sword-stained-with-royal-blood-thumb.jpg','Sword Stained with Royal Blood','completed','30','45 phút/tập','2007','HD',NULL,'Du Ji Gong','Feifei Sun, Jiao Vincent, Huang Shengyi, 竇智孔, Hsiao Shu-shen, Ma Su, Gao Hu, Wang Weiguo','Võ Thuật, Cổ Trang','Trung Quốc','Bích huyết kiếm là tác phẩm thứ hai của Kim Dung, được viết vào năm 1956, lấy bối cảnh triều chính rối ren cuối thời nhà Minh ở Trung Hoa. Mang trong mình nỗi oan khuất của người cha anh hùng mà bạc mệnh, cậu bé Viên Thừa Chí lớn lên dưới sự bảo bọc của những thuộc hạ trung thành như Viên Sùng Hoán và người thầy kì quái Bát Tí Viên Hầu – chưởng môn phái Hoa Sơn. Tình cờ mà cậu có được cây Kim xà kiếm và bí quyết võ công thượng thừa. Nhưng cũng từ đó, cuộc đời cậu đã đổi khác : trở thành kẻ thù của một thế lực lớn trên giang hồ – phái Thạch Lương của Ôn Gia Bảo. Mọi chuyện ghê tởm, đáng khinh bỉ năm xưa lần lượt được phơi bày. Ôn Gia Bảo và Kim xà lang quân Hạ Tuyết Nghi có ân oán gì? Viên Thừa Chí sẽ xử trí ra sao trước tình cảm của Ôn Thanh – người con gái tội nghiệp của Kim xà lang quân, vị sư phụ chưa từng biết mặt của chàng và A Cửu – con gái của Sùng Trinh, kẻ đã trực tiếp hạ lệnh sát hại cha chàng?',1,0,18,0),(843,'Slam Dunk: Roar!! Basket Man Spirit','https://img.ophim.live/uploads/movies/slam-dunk-roar-basket-man-spirit-thumb.jpg','スラムダンク 吠えろバスケットマン魂!!花道と流川の熱き夏','completed','1','40 phút','1995','HD',NULL,'','','Thể Thao, Học Đường','Nhật Bản','<p>Ichiro Mizusawa, một cầu thủ từ trường trung học cơ sở cũ của Rukawa, Tomigoaka, được chẩn đoán là bị tật ở chân và muốn chơi một trận cuối cùng với Rukawa. Hanamichi lên đường giúp cậu bé và hoàn thành ước nguyện của cậu.</p>',0,0,11,0),(844,'Dưới Lớp Bùn','https://img.ophim.live/uploads/movies/duoi-lop-bun-thumb.jpg','In the Mud','completed','8','60 phút/tập','2025','HD',NULL,'','Ana Garibaldi, Valentina Zenere, Rita Cortese, Lorena Vega, Marcelo Subiotto, Carolina Ramírez, Ana Rujas, Gerardo Romano, Cecilia Rossetto, Juana Molina','Hình Sự, Chính kịch','Âu Mỹ, Argentina','<p>Năm nữ tù nhân hình thành sợi dây gắn kết đặc biệt sau vụ tai nạn chết người... cho đến khi sự thối nát và cuộc chiến giành địa bàn trong một nhà tù tàn khốc đe dọa hủy hoại họ.</p>',0,0,17,0),(845,'Lazarus','https://img.ophim.live/uploads/movies/lazarus-thumb.jpg','Lazarus','completed','21','25 phút/tập','2025','HD',NULL,'','宮野真守, 古川慎, 内田真礼, 内田雄馬, 石見舞菜香, 林原めぐみ','Hành Động, Viễn Tưởng, Phiêu Lưu, Khoa Học','Nhật Bản, Âu Mỹ','<p>Năm 2055, một loại thuốc thần kỳ tưởng chừng sẽ cứu rỗi giờ lại có thể hủy diệt nhân loại. Đội đặc nhiệm \"Lazarus\" phải tìm ra vị tiến sĩ nắm giữ câu trả lời trước khi quá muộn.</p><p>&nbsp;</p>',1,0,12,0),(846,'Kinnikuman: Hoàn Mỹ Thủy Tổ','https://img.ophim.live/uploads/movies/kinnikuman-hoan-my-thuy-to-thumb.jpg','Kinnikuman Perfect Origin Arc','completed','12','24 phút/tập','2024','HD',NULL,'','','Hành Động, Võ Thuật','Nhật Bản','<p>Kinnikuman trở lại võ đài trong trận chiến tay ba hoành tráng giữa các phe Công lý, Ác quỷ và Chojin hoàn hảo, đồng thời tiết lộ nguồn gốc của Chojin.</p>',0,0,18,0),(847,'Tay Đấm Huyền Thoại 2','https://img.ophim.live/uploads/movies/tay-dam-huyen-thoai-2-1979-thumb.jpg','Rocky II','completed','1','Đang cập nhật','1979','HD',NULL,'Sylvester Stallone','Sylvester Stallone,  Talia Shire,  Burt Young','Tâm Lý, Thể Thao','Âu Mỹ','<p>Sau khi võ sỹ đấm bốc Rocky Balboa tiến xa với chức vô địch thế giới hạng nặng, người hâm mộ đấm bốc kêu gọi một trận tái hợp. Nhưng Rocky, vì phải chịu những chấn thương nặng trong 1 trận so găng, đã tuyên bố giải nghệ. Mặc dù, anh ta để cố gắng tạo dựng một cuộc sống mới, Rocky nhận ra anh không thể trốn chạy cảm xúc đích thực. Tiếng chuông vang lên một lần nữa, và “Con Ngựa Giống Ý” phải sẵn sàng cho trận đấu của đời mình.</p>',0,0,11,0),(848,'Cánh Bướm Gián Điệp','https://img.ophim.live/uploads/movies/canh-buom-gian-diep-thumb.jpg','Butterfly','completed','6','49 phút/tập','2025','HD',NULL,'','Daniel Dae Kim, Reina Hardesty, Piper Perabo, Louis Landau, 김태희, Sean Dulake, Charles Parnell, 김지훈, 박해수','Hành Động, Phiêu Lưu, Chính kịch','Âu Mỹ','<p>David Jung – cựu đặc vụ CIA từng giả chết để bảo vệ gia đình – bất ngờ tái xuất từ bóng tối khi quá khứ ám ảnh anh. Con gái Rebecca, giờ là sát thủ thượng thặng thuộc tổ chức gián điệp Caddis, được giao nhiệm vụ tiêu diệt cha mình. Cuộc gặp táo bạo giữa hai thế giới dẫn đến hành trình vượt qua niềm đau.</p>',0,0,12,0),(849,'Nộ Kiếm Trảm Gian Hùng','https://img.ophim.live/uploads/movies/no-kiem-tram-gian-hung-thumb.jpg','Hai Rui & Yan Song','completed','12','40 phút/tập','1999','HD',NULL,'','Trần Đình Oai, Thạch Tú, Hà Bửu Sinh, Trần Vỹ, Diêu Gia Ni, Lưu Vĩnh, Châu Yến Trân','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Nhiệm Tùng là một gian thần hiểm ác đời nhà Tồng, đã lộng hành thao túng quyền lực trong triều đình, ngay cả Vua cũng phải kiêng nể. Trong khi đó lại có một đại thần trung can nghĩa đảm là Ông Hải Thoại vì nước vì dân bất mãn với hành vi ngang tàng của Nghiêm Tùng, tà không thể thắng chánh nên cuối cùng Nghiêm Tùng cũng bị chém đầu trị tội...</i></p>',0,0,18,0),(850,'Gia Đình Võ Thuật','https://img.ophim.live/uploads/movies/gia-dinh-vo-thuat-thumb.jpg','The Kick','completed','1','Đang cập nhật','2011','HD',NULL,'Prachya Pinkaew','Jae-hyeon Jo,  Ji-won Ye,  Petchtai Wongkamlao','Hành Động, Thể Thao, Phiêu Lưu','Hàn Quốc, Thái Lan','<p>Phim kể về 1 gia đình Hàn Quốc nhập cư sang Thái Lan và mở 1 lớp dạy Taewondo. Có 1 băng nhóm XHĐ Thái Lan đã đánh cướp \'\'Thanh kiếm thần của vị vua cuối cùng của Thái La \'\'được triển lãm ở Bảo tàng Quốc gia. Bằng võ nghệ cao cường, gia đình Moon dành lại báu vật trên tay bọn chúng và trở thành những người hùng của Thái Lan. Nhưng điều đó làm bọn tội phạm càng giận dữ. Chúng bắt cóc cậu con trai út và đòi lấy Thanh kiếm của Đức vua để trao đổi.</p>',1,0,11,0),(851,'Tòa Án Lương Tâm 1996','https://img.ophim.live/uploads/movies/toa-an-luong-tam-1996-thumb.jpg','Outburst','completed','25','44 phút/tập','1996','HD',NULL,'','温兆倫, 吳啟華, 宣萱, 關菁, 莫可欣, 羅君左, 梁詠琳','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông, Canada','Hoi (Deric Wan) was once a cop, but his hot temper cost him his job.  He then joined a security company as the head investigator.  Ching (Ng Kai Wah), Hoi’s partner in the police force, on the other hand, was always cool-minded.  Though Hoi had left the force, he still worked closely with Ching and they solved many tough cases like “Killing with Arrows”, “Vanishing Art Director”, “Corpse in the Sack” and “Homicide in a Sealed Room”.\n\nThen, the two friends fell for the charming Sai (Jessica Hester Hsuan) together.  Sai chose Ching after she broke up with Hoi.  Hoi went back to his ex-girlfriend Man (Mok Ho Yan), but he was immediately caught up in the case “Poisonous Wedding”.  Man was murdered at the wedding and Sai and Hoi were suspects…',0,0,17,0),(852,'Số Phận Bị Lãng Quên','https://img.ophim.live/uploads/movies/so-phan-bi-lang-quen-thumb.jpg','Doomed to Oblivion','completed','30','45 phút/tập','2005','HD',NULL,'','王喜, 黎姿, 陳松伶, 麥長青, 莫家堯, 林韋辰, 胡杏兒, 曾偉權, 曹永廉, 秦沛','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','The series revolves around the ups and downs of the life of a painter during the Qing dynasty, Cheng Ban Kiu. Through many endeavours to prove his painting skills, Ban Kiu became a celebrated painter and expert in drawing bamboos (in which is a shared interest with the emperor, who went in search for the best bamboo painting to be buried with him when he passes away). Ban Kiu was also famous for his quote, \"Ignorance is Bliss\", which in the end can ironically cause him many troubles.',0,0,12,0),(853,'Đao Kiếm Lưu Tình','https://img.ophim.live/uploads/movies/dao-kiem-luu-tinh-thumb.jpg','The Executioner','completed','26','45 phút/tập','2015','HD',NULL,'La Trấn Nhạc','Huỳnh Đức Bân, Thiệu Mỹ Kỳ, Cung Gia Hân, Dương Minh, Trần Sơn Thông, Diêu Tử Linh, Khang Hoa','Võ Thuật, Cổ Trang','Hồng Kông','<p><i>Diệp Thường Lục (do Huỳnh Đức Bân thủ vai) là một đao phủ pháp trường từng giết vô số người. Trên đường đến kinh thành nhận nhiệm vụ thì cơ duyên trùng hợp xui khiến Thường Lục gặp gỡ và tá túc tại nhà bà đỡ nổi tiếng của kinh thành, Hoa Nhị Hồng (do Thiệu Mỹ Kỳ đóng vai). Từ đây họ cùng chứng kiến một vụ án mạng ly kì. Tình huống nguy cấp, Nhị Hồng đã ép Thường Lục dùng cây đao Quỷ Đầu mổ bụng nạn nhân cứu một sinh mạng nhỏ. Nào ngờ cậu bé sơ sinh này đã khiến cho Thường Lục và Nhị Hồng vướng vào vòng xoáy chính trị của triều đình, đối mặt với vòng quay sinh tử cận kề. Hai người từ chỗ nghi kỵ, lạnh lùng rồi dần nảy sinh tình cảm yêu thương trong hoạn nạn... Sự xuất hiện của nhiều nhân vật bí ẩn khiến cho quan hệ giữa mọi người rất phức tạp. Và khi thân phận của cậu bé sơ sinh dần được hé lộ cũng là lúc tiếng chuông tử thần vang lên...mở màn cho những cuộc chiến thanh trừng đẫm máu tranh giành quyền lực nơi cung cấm. Liệu tình cảm sâu nặng và cơ duyên trùng hợp có giữ cho Thường Lục và Nhị Hồng được bình yên bên nhau mãi mãi? Hay chỉ như Hoa Bỉ Ngạn – loài hoa duy nhất nở rộ trên đường Hoàng Tuyền. Khi hoa nở thì không có lá, khi có lá thì hoa không nở. Hoa và lá luôn luôn không gặp nhau...</i></p>',0,0,18,0),(854,'Kẻ Bạo Loạn','https://img.ophim.live/uploads/movies/ke-bao-loan-thumb.jpg','Goon','completed','1','Đang cập nhật','2012','HD',NULL,'Michael Dowse','Seann William Scott,  Jay Baruchel,  Alison Pill','Thể Thao','Âu Mỹ, Canada','<p>Bị gia đình xa lánh do những khác biệt của bản thân. Một vận động viên khúc côn cầu đã đảo ngược tỉ lệ cá cược khi dẫn dắt một đội tuyển phong độ kém cỏi đạt được vinh quang của giải khúc côn cầu bán chuyên nghiệp, đánh bại mọi khó khăn bày ra trước mắt mình.</p>',0,0,11,0),(855,'Kẻ Săn Ong','https://img.ophim.live/uploads/movies/ke-san-ong-thumb.jpg','Under the Cover','trailer','1','16 phút/tập','2025','HD',NULL,'','','Chính kịch, Hình Sự','Trung Quốc','Để tìm em gái mất tích, cảnh sát Hàn Xuyên cải trang thành \"Thập Tam Ca\" - một tên lừa đảo huyền thoại, đột nhập vào hòn đảo biệt lập đầy rẫy cạm bẫy lừa đảo. Từ việc cứu em gái đến tiêu diệt tận gốc tội ác, trong vòng xoáy đan xen giữa tình huynh đệ, lợi ích, mưu mô, chân tình, chính nghĩa và tội ác, Hàn Xuyên dần dần khám phá ra sự thật đen tối bị che giấu trong khu vực này.',0,0,17,0),(856,'Zombies 4 - Dawn of the Vampires','https://img.ophim.live/uploads/movies/zombies-4-dawn-of-the-vampires-thumb.jpg','Zombies 4 - Dawn of the Vampires','completed','1','88 Phút','2025','HD',NULL,'Paul Hoen','Meg Donnelly, Milo Manheim, Chandler Kinney, Kylee Russell, Freya Skye, Malachi Barton, Julian Lerner, Swayam Bhatia, Mekonnen Knife, Jonno Roberts','Hài Hước, Phiêu Lưu, Gia Đình','Âu Mỹ, Canada','<p>Một cuộc phiêu lưu mới bắt đầu cho Zed và Addison khi chuyến đi đường mùa hè của họ bất ngờ rẽ sang hướng khác, đưa họ vào giữa một cuộc chiến quái vật khác: Daywalker đấu với Ma cà rồng. Căng thẳng bùng phát khi Zed và Addison nhận ra mình đang đóng vai trò cố vấn trại giữa hai phe siêu nhiên đối địch. Với sự giúp đỡ của Eliza và Willa, họ phải thuyết phục hai kẻ thù không đội trời chung Nova và Victor cố gắng thống nhất hai thế giới đang đối đầu nhau trước khi một mối đe dọa thậm chí còn lớn hơn đe dọa tất cả.</p>',0,0,12,0),(857,'Đới Đao Nữ Bộ Khoái','https://img.ophim.live/uploads/movies/doi-dao-nu-bo-khoai-thumb.jpg','Female Detective Knives','completed','34','45 phút/tập','2011','HD',NULL,'Quảng Nghiệp Sinh','Âu Dương Chấn Hoa, Xa Thi Mạn, Dương Côn, Khương Hồng, Tư Mẫn, Hề Mỹ Quyên Thể loại: Võ Thuật - Kiếm Hiệp, Cổ Trang','Võ Thuật, Cổ Trang','Hồng Kông','<p><i>Phim là tác phẩm hợp tác giữa Đại Lục và HK. Tham gia cùng với Xa Thi Mạn và Âu Dương Chấn Hoa còn có nhiều diễn viên Trung Quốc như người đẹp Khương Hồng, Dương Côn, Tư Mẫn…. Phim là một chuỗi những câu chuyện phá án hấp dẫn giữa nữ bổ khoái Liễu Minh Nguyệt (Xa Thi Mạn) và trạng sư giỏi giang Âu Dương Đông (Âu Dương Chấn Hoa thủ vai). Hai con người tài giỏi với hai tính cách trái ngược nhau sẽ tạo nên vô số câu chuyện hài hước.</i></p>',0,0,18,0),(858,'Tay Đấm Huyền Thoại 3','https://img.ophim.live/uploads/movies/tay-dam-huyen-thoai-3-thumb.jpg','Rocky III','completed','1','Đang cập nhật','1982','HD',NULL,'Sylvester Stallone','Sylvester Stallone,  Talia Shire,  Burt Young','Hành Động, Tâm Lý, Thể Thao, Phiêu Lưu','Âu Mỹ','<p>Khi Rocky Balboa tìm được chỗ đứng trong trái tim của hàng triệu người hâm mộ, cuộc sống không còn gì có thể tốt đẹp hơn. Anh giành được chiến thắng 10 trận liên tiếp, giành được những hợp đồng béo bở và ngày càng nổi tiếng trên toàn thế giới. Nhưng khi Rocky bị đánh bại, dường như hào quang đã tắt. Đã xem xét đến chuyện treo găng, Rocky lại nhận được sự cổ vũ động viên của một người không ngờ tới: Đối thủ cũ, Apollo Creed. Với sự giúp đỡ của Apollo, Rocky cố gắng để lấy lại danh hiệu trong trận đối đầu với Clubber trong trận đấu khốc liệt tranh chức vô địch.</p>',0,0,11,0),(859,'Đội Tình Báo CIB','https://img.ophim.live/uploads/movies/doi-tinh-bao-cib-thumb.jpg','C.I.B. Files','completed','20','45 phút/tập','2006','HD',NULL,'','林保怡, 王喜, 邵美琪, 伍詠薇, 黃德斌, 陳鴻烈','Hình Sự, Chính kịch, Bí ẩn','Trung Quốc, Hồng Kông','C.I.B. Files or Criminal Investigation Bureau Files is a TVB modern drama series broadcast in August 2006.',0,0,17,0),(860,'Giấc Mộng Hiệp Sĩ','https://img.ophim.live/uploads/movies/怪俠一枝梅-thumb.jpg','The Vigilante In The Mask','completed','20','60 phút/tập','2005','HD',NULL,'','温兆倫, 楊茜堯, 蔣雅文, 陳鍵鋒, 關禮傑, 成奎安, 夏萍, 阮德鏘, 李焯寧, 杜港','Hành Động, Hài Hước, Phiêu Lưu, Chính kịch, Bí ẩn','Trung Quốc, Hồng Kông','<p>Lai Chi Kok là một viên quan ở quê nhà, nhưng vì một bí mật đen tối nào đó, anh buộc phải tỏ ra vô dụng và mất đi sự ủng hộ của dân làng. Cách duy nhất để bù đắp cho tình hình là cải trang thành một người tự xưng là cảnh sát đeo mặt nạ. Chung Wan và Chi Kok đã đính hôn, nhưng cô chỉ đồng ý kết hôn với anh nếu anh sẵn sàng trở thành một viên quan vĩ đại. Bo Lum đến từ giới võ thuật, tìm kiếm Chi Kok để kết hôn vì một trò đùa. Lok Fu là bạn thân của cả Wan và Chi Kok. Tuy nhiên, anh phát hiện ra mình mắc một căn bệnh hiểm nghèo.</p>',0,0,12,0),(861,'Oan Gia Kiếm Khách','https://img.ophim.live/uploads/movies/oan-gia-kiem-khach-thumb.jpg','The Sentimental Swordsman','ongoing','35','45 phút/tập','2014','HD',NULL,'Lưu Phùng Thanh','Lý Dịch Phong, Từ Đông Đông, Dĩnh Nhi, Diệp Tổ Tân, Chu Huệ Trân, Dương Hiểu Dung, Lạc Tang Niệm Trát, Ngô Thiên Ngữ, ','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Oan Gia Kiếm Khách là bộ phim xoay quanh câu chuyện của ba chị em bị phân ly từ nhỏ. Họ lớn lên trong những hoàn cảnh khác nhau nên đã hình thành lên trong họ ba tính cách hoàn toàn khác biệt.</i></p>',0,0,18,0),(862,'Đi Tìm Eric','https://img.ophim.live/uploads/movies/di-tim-eric-thumb.jpg','Looking for Eric','completed','1','Đang cập nhật','2009','HD',NULL,'Ken Loach','Steve Evets,  Eric Cantona,  Stephanie Bishop','Tâm Lý, Thể Thao, Viễn Tưởng, Khoa Học','Anh, Pháp, Tây Ban Nha, Ý, Bỉ','<p>Looking for Eric là một bộ phim hài hước nói về tầm ảnh hưởng của những ngôi sao sân cỏ đối với những fan hâm mộ. Nhân vật chính của phim là một anh chàng tên Eric Bishop, một người đưa thư cuồng bóng đá tới mức “bỏ mặc” vợ con. Sau khi tự tử bất thành, anh ta bị ám ảnh rằng thần tượng Eric Cantona giúp đỡ anh, đưa cho anh những lời khuyên trong cuộc sống...</p>',0,0,11,0),(863,'Vụ Cướp Thế Kỷ (Phần 1)','https://img.ophim.live/uploads/movies/vu-cuop-the-ky-phan-1-thumb.jpg','The Gold','completed','6','58 phút/tập','2023','HD',NULL,'','Hugh Bonneville, Tom Cullen, Charlotte Spencer, Emun Elliott, Stefanie Martini, Sam Spruell, Stephen Campbell Moore','Hình Sự, Chính kịch','Âu Mỹ, Anh','<p>Bộ phim được dựa trên sự kiện có thật, tái hiện vụ cướp vàng Brink’s-Mat năm 1983 - một trong những vụ trộm gây chấn động lịch sử nước Anh. Năm 1983, tại kho Brink’s-Mat gần sân bay Heathrow, sáu tên cướp vũ trang xông vào, định lấy tiền mặt nhưng vô tình phát hiện gần 7.000 thanh vàng thỏi nặng tổng cộng hơn nửa tấn, trị giá khoảng 26 triệu bảng Anh thời đó (tương đương hàng trăm triệu bảng hiện nay). Đây là vụ trộm gây chấn động lịch sử Anh, được mệnh danh là “Vụ cướp thế kỷ”.&nbsp;</p><p>Số vàng bị đánh cắp quá lớn, buộc bọn tội phạm phải tìm cách rửa tiền và hợp thức hóa trong nền kinh tế. Thực tế, người ta ước tính rằng nếu bạn mua hoặc sở hữu vàng ở Anh sau năm 1984, khả năng rất cao là trong đó có một phần vàng từ vụ Brink’s-Mat. Điều này cho thấy tầm ảnh hưởng rộng khắp và lâu dài của vụ án đối với thị trường vàng cũng như tội phạm tài chính tại Anh.</p><p>Đây là bộ phim được giới chuyên môn đánh giá rất cao vì đã tái hiện đầy đủ và sinh động vụ án dựa trên sự kiện có thật với nhiều chi tiết lịch sử chính xác. Khắc họa rõ hậu quả của vụ án: không chỉ mất vàng mà còn tạo ra thế hệ mới của tội phạm rửa tiền. Bối cảnh London thập niên 80 thời Thatcher được tái hiện tỉ mỉ, phản ánh sự thay đổi kinh tế – xã hội. Dàn diễn viên thực lực, kết hợp diễn xuất kịch tính và chiều sâu tâm lý.</p>',0,0,17,0),(864,'Tiên Hạc Thần Châm','https://img.ophim.live/uploads/movies/tien-hac-than-cham-thumb.jpg','Mythical Crane and Magical Needle','completed','30','48 phút/tập','1992','HD',NULL,'','米雪, 苑瓊丹, 尹天照, 劉丹, 翁虹, 林祖辉, 高雄, Tiffany Lau Yuk-Ting','Hành Động, Phiêu Lưu, Chính kịch','Trung Quốc, Hồng Kông','Lam Hải Bình ẩn cư nơi núi Quát Thương, đổi tên con gái thành Bạch Vân Phi. Vợ là Thuý Điệp vì bất mãn đã trộm bí kíp, dẫn con gái Tiểu Điệp bỏ đi. Võ lâm rối loạn khi chưởng môn Thiếu Lâm, Võ Đang mất tích. Huyền Thanh phái cử Quân Võ và Thanh Loan đi báo tin. Quân Võ gặp Phi Phụng và Tào Hùng, kết nghĩa huynh đệ với Hùng. Tào Hùng nổi tà tâm, âm mưu hại Quân Võ. Lúc này, tin đồn Quy Nguyên bí kíp tái xuất, dẫn đến âm mưu diệt võ lâm của Cái Thiên Giáo.',0,0,12,0),(865,'Anh Hùng Lãng Tử','https://img.ophim.live/uploads/movies/anh-hung-lang-tu-thumb.jpg','Romantic Heroes of the Tang Dynasty','completed','38','45 phút/tập','2013','HD',NULL,'Fan Xiaotian, Zheng Weiwen','Alex Fong Lik-Sun, Chrissie Chau, Meng Li, Andy Chen, Kris Shen, Wu Chien-Lien','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Anh Hùng Lãng Tử - Romantic Heroes Of The Tang Dynasty kể về một đội hộ vệ trung thành thời nhà Đường chuyên trừ gian diệt ác, tạo phước cho dân, giúp bá tánh thiên hạ được an cư lạc nghiệp, giữ cho quốc thái dân an, từ đó ngày càng trưởng thành và giúp triều đình dẹp những mối họa hại dân hại nước.</i></p>',0,0,18,0),(866,'Vũ Khúc Vinh Quang','https://img.ophim.live/uploads/movies/vu-khuc-vinh-quang-thumb.jpg','Blades of Glory','completed','1','Đang cập nhật','2007','HD',NULL,'Josh Gordon,  Will Speck','Will Ferrell,  Jon Heder,  Amy Poehler','Thể Thao','Âu Mỹ','<p>Cách đây 3 năm rưỡi, họ,Chazz Michael Michaels (Will Ferrell) và Jimmy MacElroy (Jon Heder), từng là đôi nam trượt băng nghệ thuật nổi tiếng nhất, chiếc huy chường vàng giải Vô địch Thế Giới gần như trong tầm tay họ nhưng rồi chỉ vì một mâu thuẫn nhỏ nhoi đã khiến mọi thứ vuột ra khỏi tầm tay, ẩu đả tại giải khiến họ bị ban tổ chức cấm thi đấu vô thời hạn. Nay, một cơ hội vàng đã đến, họ lại có thể cùng nhau kết hợp giành lại những vinh quang trên sân băng khi lệnh cấm thi đấu của họ được bãi bỏ và việc đầu tiên là họ phải cùng dẹp bỏ thói tị nạnh với nhau...</p>',0,0,11,0),(867,'Thị Trấn Trong Cơn Dịch','https://img.ophim.live/uploads/movies/thi-tran-trong-con-dich-thumb.jpg','Eddington','completed','1','149 Phút','2025','HD',NULL,'Ari Aster','Joaquin Phoenix, Pedro Pascal, Luke Grimes, Micheal Ward, Deirdre O\'Connell, Emma Stone, Austin Butler, Matt Gomez Hidaka, Cameron Mann, Amélie Hoeferle','Hài Hước, Hình Sự','Âu Mỹ, Phần Lan','<p>Giữa đại dịch COVID-19, thị trấn nhỏ Eddington, New Mexico chìm trong hỗn loạn khi cuộc tranh chấp giữa cảnh sát trưởng Joe Cross phản đối đeo khẩu trang và thị trưởng Ted Garcia ủng hộ xây trung tâm dữ liệu AI leo thang thành chiến tuyến chính trị, cuốn cả gia đình, cộng đồng vào vòng xoáy cực đoan, bạo lực và tan rã – phản chiếu một nước Mỹ chia rẽ&nbsp;</p>',0,0,17,0),(868,'Thức Tỉnh Phải Lúc','https://img.ophim.live/uploads/movies/thuc-tinh-phai-luc-thumb.jpg','The Price to Pay','completed','20','46 phút/tập','1996','HD',NULL,'','鄧一君, 雪梨, 林敬剛, 吳家樂, 劉家輝, 鄺文洵, 蔣克, 莫家堯, 劉江, 韓馬利','Phiêu Lưu','Trung Quốc, Hồng Kông','<p>Thức Tỉnh Phải Lúc (The Price To Pay) 1996</p>',0,0,12,0),(869,'Vô Ảnh Kim Đao','https://img.ophim.live/uploads/movies/vo-anh-kim-dao-thumb.jpg','The Revelation of the Last Hero','completed','30','50 phút/tập','1992','HD',NULL,'Trang Vĩ Kiện','Quách Phú Thành, Viên Khiết Doanh, Lương Tiểu Băng, Lâm Văn Long, Thái Thiếu Phấn, Lương Gia Nhân, Quách Chính Hồng','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Quyết chiến của 2 cao thủ Tư Mã Tung Hoành và Hồng Chân, Hồng Chân thua, võ công bị phế đày tới đảo Vô Ngã. Hoàng Cực Thần Toán Dao Khan Tiết đoán biết Hoành sẽ xưng bá gây họa cho võ lâm. Hoành toan tính giết Dao Khan Tiết để bịt đầu mối. Tiết mang theo con gái là Bình trốn trên thuyền của Hoành , và cùng Chân hướng về đảo Vô Ngã. Trên đường gặp bão, thuyền bị chìm, Hoành tưởng mọi người đã chết, nhưng thật sự đã thoát nạn và trôi dạt vào 1 đảo khác. Bảy năm sau, Bình trở về trả thù. Chàng trai trẻ Lạc Phong vô tình bị lôi cuốn vào cuộc ân oán này.Vì giữ mạng cho chàng, phải nhờ đến sứ giả Hồng Bào Hiệp Nguyên Thuật. Sau đó, cùng quen biết với Bình, Hách Liên Bột Bột và Lăng Tương. Đồng thời, trong giang hồ nổi tiếng về uy lực của thanh Phong chi đao. Ai sở hữu được nó sẽ hùng bá thiên hạ. Chính vì thế, cuộc truy tìm thanh đao này đã khiến giang hồ nổi lên bao sóng gió. Sau khi Tương vì thất tình, nên đã ngã vào vòng tay của Lực Hành - con trai của Khan Tiết - có tính tình quái lạ, vì danh lợi làm những việc bại hoại võ lâm. Phong, Bình và Bột đành phải liên kết đối phó, nhiều trận ác chiến liên tiếp xảy ra.</i></p>',0,0,18,0),(870,'Cơ hội cuối cùng (Phần 5)','https://img.ophim.live/uploads/movies/co-hoi-cuoi-cung-phan-5-thumb.jpg','Last Chance U (Season 5)','completed','8','55phút/tập','2020','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Loạt phim tài liệu đến với Cao đẳng Laney, Oakland. Ở đó, huấn luyện viên John Beam thúc đẩy học trò vượt qua nghịch cảnh, đặt mục tiêu cao hơn cả trên và ngoài sân cỏ.</p>',0,0,11,0),(871,'Lực Lượng Phản Ứng - phần 2','https://img.ophim.live/uploads/movies/luc-luong-phan-ung-phan-2-thumb.jpg','Armed Reaction (Season 2)','completed','32','45 phút/tập','2000','HD',NULL,'','滕麗名, 陳豪, 宣萱, 鄧佩儀, 羅子溢, 許紹雄, 洪永城, 鄭俊弘, 海俊傑, 關曜儁','Hài Hước, Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Là một bộ phim truyền hình hiện đại của Hong Kong năm 1998 lấy đề tài về nữ cảnh sát được sản xuất bởi đài TVB với sự tham gia của Âu Dương Chấn Hoa, Quan Vịnh Hà, Đằng Lệ Danh, Ngụy Tuấn Kiệt, Chu Mễ Mễ.  Sau thành công của phần đầu tiên, phim được làm tiếp thêm 3 phần (Lực Lượng Phản Ứng II, Lực Lượng Phản Ứng III và Lực Lượng Phản Ứng IV).  Phim lấy bối cảnh trước khi Hong Kong được trao trả lại cho Trung Quốc và xoay quanh cuộc sống của 2 nữ cảnh sát là Chu Tố Nga và Trần Tam Nguyên tại Sở Cảnh sát Hong Kong.',1,0,17,0),(872,'Bích Huyết Thanh Thiên Dương Gia Tướng','https://img.ophim.live/uploads/movies/bich-huyet-thanh-thien-duong-gia-tuong-thumb.jpg','Heroic Legend of The Yang\'S Family','completed','30','42 phút/tập','1994','HD',NULL,'','Jin Chao-Chun, 李香琴, 麦景婷, 楊玉梅, Chan Lai-Sze, 徐少強, Raymond Choi, Kylie Wong Yim-Na, 呂頌賢, 苑瓊丹','Hành Động, Phiêu Lưu','Trung Quốc, Hồng Kông','<p>Dương Diên Chiêu bị Bàng Long phản bội, tử trận. Con trai của Diên Chiêu là Dương Tông Bảo đối đầu với Bàng Long Công Đường, hai bên quyết đấu với nhau, Ân Bảo Chính ở phủ Khai Phong đã bày mưu hại Bàng Long, Bàng Long bị xử tử bằng long đầu sâm. Thái sư Bàng Hùng đau buồn thề sẽ giết chết Bao Chửng và tướng quân nhà họ Dương, nhà họ Dương sẽ liên thủ với Bao Chửng để chống lại Bàng Thái sư...</p>',0,0,12,0),(873,'Đại Địa Phi Ưng','https://img.ophim.live/uploads/movies/dai-dia-phi-ung-thumb.jpg','Land Of The Condors','completed','20','45 phút/tập','1992','HD',NULL,'','Ngô Trấn Vũ, Lê Mỹ Nhàn, Lưu Gia Huy, Thiệu Trọng Hành, Ngô Cương','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Phim võ thuật Hồng Kong - Trung Quốc sản xuất năm 1992 với những màn võ thuật đẹp mắt với phần thể hiện của các diễn viên Lê Mỹ Nhàn, Trịnh Lợi, Lương Gia Huy, Chu Khiết Nghi, Thiệu Trong Hanh, Ngô Trấn Vũ, Hồ Tiết Sơn, Ngô Cương, Lưu Tú Bình. Phim Đại Địa Phi Ưng xoay quanh những người sống ở đại mạc tin tưởng vào thần linh thánh mẫu, nhưng rồi cuộc sống bình yên của họ cũng không thể tiếp tục duy trì, các thị tộc tranh giành quyền trượng chém giết lẫn nhau và những nhân sĩ trong giang hồ cũng tìm đến.</i></p>',0,0,18,0),(874,'Cơ hội cuối cùng (Phần 4)','https://img.ophim.live/uploads/movies/co-hoi-cuoi-cung-phan-4-thumb.jpg','Last Chance U (Season 4)','completed','8','55phút/tập','2019','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Huấn luyện viên Jason Brown chịu nhiều tai tiếng hơn bao giờ hết khi dẫn dắt đội bóng ICC với nhiều tài năng bước vào mùa bóng được kì vọng sẽ mang về danh hiệu quốc gia.</p>',0,0,11,0),(875,'Sát Thủ Ẩn Danh (Phần 1)','https://img.ophim.live/uploads/movies/sat-thu-an-danh-phan-1-thumb.jpg','The Assassin','completed','6','50 phút/tập','2025','HD',NULL,'','Freddie Highmore, Keeley Hawes, David Dencik, Shalom Brune-Franklin, Gerald Kyd, Devon Terrell, Gina Gershon, Ibraim Cândido, Aurora Marion, Elie Haddad','Hình Sự, Chính kịch, Bí ẩn, Hành Động','Anh, Đức, Úc, Âu Mỹ','<p>Julie – một sát thủ đã rửa tay gác kiếm, chọn cuộc sống bình yên trên quần đảo Hy Lạp, cho đến khi con trai của cô, Edward, xuất hiện cùng hàng loạt câu hỏi về quá khứ. Chuyến thăm bất ngờ này nhanh chóng biến thành cuộc chạy trốn sinh tử, khi cả hai bị cuốn vào âm mưu đen tối và những kẻ săn lùng không khoan nhượng.<br>Gay cấn, thông minh và thấm đẫm chất hài hước, The Assassin đưa bạn đi từ những màn đấu súng nghẹt thở đến những câu thoại châm biếm đầy duyên dáng.<br>Bộ phim được đánh giá rất cao, nổi bật bởi sự cân bằng giữa hơi thở hài hước và hành động mãn nhãn, cùng diễn xuất ấn tượng của Keeley Hawes và Freddie Highmore.</p>',0,0,17,0),(876,'Đua Xe Bắn Súng (Phần 2)','https://img.ophim.live/uploads/movies/dua-xe-ban-sung-phan-2-thumb.jpg','Twisted Metal','ongoing','12','32 phút/tập','2025','HD',NULL,'','Anthony Mackie, Stephanie Beatriz, Nuufolau Joel Seanoa, Will Arnett, Anthony Carrigan','Hành Động, Hài Hước, Phiêu Lưu','Âu Mỹ','<p>Mùa 2 của \"Twisted Metal\" (2023) là phần tiếp theo của loạt phim hành động phiêu lưu hậu tận thế dựa trên tựa game đình đám cùng tên của PlayStation, mở ra giải đấu \"Twisted Metal\" đầy bạo lực - một cuộc đua xe, nơi các tay đua chiến đấu để nhận một điều ước cuối cùng từ nhân vật bí ẩn, Calypso.<br>Cốt truyện phần 2 xoay quanh hành trình sinh tồn của John và Quiet trong giải đấu, đồng thời khám phá sâu hơn về quá khứ của John, đặc biệt là mối quan hệ với người em gái thất lạc, Dollface (Tiana Okoye). Phần này cũng hứa hẹn mang đến nhiều khoảnh khắc hài hước, bạo lực đậm chất và những màn chiến đấu xe kịch tính, đúng với tinh thần của tựa game gốc.<br>Twisted Metal mùa 2 là bước phát triển ngoạn mục so với mùa đầu: thêm nhân vật mới, trận chiến lớn hơn, nhiều chiến xe mới, đậm chất Twisted Metal hơn - cả về nội dung lẫn âm hưởng game. Nếu bạn là fan của phim hành động bạo lực đúng chất, chiến xe điên rồ, hài hước phiêu lưu hậu tận thế... đây chính là bộ phim bạn không nên bỏ lỡ.<br>&nbsp;</p>',0,0,12,0),(877,'Hoàng Đế Ăn Mày','https://img.ophim.live/uploads/movies/hoang-de-an-may-thumb.jpg','Hoàng Đế Ăn Mày','completed','41','45 phút/tập','1996','HD',NULL,'','Hà Gia Kính, Dương Lệ Thanh, Ngô Thiên Tâm, Lý Chí Hy, Tống Đạt Dân','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Trong lịch sử, Chu Nguyên Chương được biết đến là vị vua tàn bạo, máu lạnh, giết người không ghê tay kể cả với những người từng đầu ấp tay gối với mình. Theo các sử liệu ghi lại, Chu Nguyên Chương và Mã Hoàng hậu có tình cảm rất sâu đậm, cả hai đều dành cho nhau sự tôn trọng. Tuy nhiên, vị Hoàng đế khai sáng nhà Minh này vẫn có tam cung lục viện với 42 phi tần, chưa kể đến các Quý nhân, Chiêu nghi, Tiệp dư khác.</i></p>',0,0,18,0),(878,'Cơ hội cuối cùng (Phần 3)','https://img.ophim.live/uploads/movies/co-hoi-cuoi-cung-phan-3-thumb.jpg','Last Chance U (Season 3)','completed','8','55phút/tập','2018','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Loạt phim tài liệu được đánh giá cao này chuyển sang Cao đẳng Cộng đồng Independence, Kansas, nơi một huấn luyện viên cố xây dựng lại một chương trình đang gặp khó khăn.</p>',0,0,11,0),(879,'Anh Em Đối Đầu','https://img.ophim.live/uploads/movies/anh-em-doi-dau-thumb.jpg','Blood Brothers: Dragon\'s Embers','completed','1','129 Phút','2025','HD',NULL,'Abhilash Chandra, Syafiq Yusof','Sharnaaz Ahmad, Syafiq Kyle, Shukri Yahaya, Amelia Henderson, Syazwan Zulkifly, Wan Hanafi Su, Zamarul Hisham, Andy Teh, Irfan Zaini, Shah Reza Mohd Shah','Hành Động, Hình Sự, Chính kịch','Malaysia','<p>Blood Brothers: Bara Naga (2025) kể về Ariff, một vệ sĩ bị gán tội phản bội ông chủ quyền lực từng cứu mạng mình. Quyết tâm minh oan, anh buộc phải nhờ đến người anh trai xa cách, trong khi bị truy đuổi bởi Ghaz – bạn thân nay trở thành kẻ săn lùng không khoan nhượng. Giữa vòng xoáy dối trá và hiểm nguy, tình anh em và tình bạn biến thành cuộc đối đầu.</p>',0,0,17,0),(880,'Những Người Bảo Hộ Wakanda','https://img.ophim.live/uploads/movies/nhung-nguoi-bao-ho-wakanda-thumb.jpg','Eyes of Wakanda','completed','4','30 phút/tập','2025','HD',NULL,'','','Hành Động, Viễn Tưởng, Phiêu Lưu','Anh, Âu Mỹ','<p>Theo chân những chiến binh Wakanda dũng cảm xuyên suốt chiều dài lịch sử trong hành trình vòng quanh thế giới, khi họ thực hiện những nhiệm vụ nguy hiểm nhằm thu hồi các cổ vật Vibranium từ tay kẻ thù của Wakanda. Họ chính là Hatut Zaraze — và đây là câu chuyện của họ.</p>',0,0,12,0),(881,'Cơ hội cuối cùng (Phần 2)','https://img.ophim.live/uploads/movies/co-hoi-cuoi-cung-phan-2-thumb.jpg','Last Chance U (Season 2)','completed','8','55phút/tập','2017','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Buddy và Brittany chào đón một lứa mới gồm các ngôi sao bóng bầu dục mới nổi hi vọng vượt qua những sai lầm trong quá khứ, trong khi đương đầu với sự chú ý có sau mùa 1.</p>',0,0,11,0),(882,'Trộm Long Tráo Phụng 1','https://img.ophim.live/uploads/movies/trom-long-trao-phung-1-thumb.jpg','Stealing Dragon Exchanging Phoenix','completed','40','45 phút/tập','2000','HD',NULL,'Hoa Tiểu Minh','Trương Đình, Tiêu Ân Tuấn, Ngưu Lợi, Ngưu Thanh Phong, Ngô Mạnh Đạt','Võ Thuật, Hài Hước','Đài Loan','<p><i>Một vị ái phi của vua vì muốn được làm hoàng hậu đã nỡ lòng đem tráo đổi đứa con gái mới sinh với người con trai của một vị quan trong triều đình. Tuy vậy bà yêu đứa con ruột của mình thắm thiết nên trước khi đem con đi bà đã cắn vào cánh tay nó để làm dấu. Nhưng người phu nhân của vị quan thì không cam tâm, đã đem công chúa bỏ trước một lầu xanh để trả thù vị ái phi kia, và đem cháu gái mình thế vào chỗ. Thời gian trôi qua, vị hoàng tử lớn lên và đã trở thành vua. Tính tình ham chơi nên ông cải trang để gia nhập với giới dân gian. Và trời đất xui khiến đã cho ông gặp được nàng công chúa bị bỏ rơi năm xưa.</i></p>',0,0,18,0),(883,'Lực Lượng Phản Ứng - Armed Reaction (Phần 3)','https://img.ophim.live/uploads/movies/luc-luong-phan-ung-armed-reaction-phan-3-thumb.jpg','Armed Reaction (Season 3)','completed','32','45 phút/tập','2001','HD',NULL,'','滕麗名, 陳豪, 宣萱, 鄧佩儀, 羅子溢, 許紹雄, 洪永城, 鄭俊弘, 海俊傑, 關曜儁','Hài Hước, Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Là một bộ phim truyền hình hiện đại của Hong Kong năm 1998 lấy đề tài về nữ cảnh sát được sản xuất bởi đài TVB với sự tham gia của Âu Dương Chấn Hoa, Quan Vịnh Hà, Đằng Lệ Danh, Ngụy Tuấn Kiệt, Chu Mễ Mễ.  Sau thành công của phần đầu tiên, phim được làm tiếp thêm 3 phần (Lực Lượng Phản Ứng II, Lực Lượng Phản Ứng III và Lực Lượng Phản Ứng IV).  Phim lấy bối cảnh trước khi Hong Kong được trao trả lại cho Trung Quốc và xoay quanh cuộc sống của 2 nữ cảnh sát là Chu Tố Nga và Trần Tam Nguyên tại Sở Cảnh sát Hong Kong.',0,0,17,0),(884,'Hành Trình Ngọt Ngào','https://img.ophim.live/uploads/movies/hanh-trinh-ngot-ngao-thumb.jpg','My Lovely Journey','completed','10','60 phút/tập','2025','HD',NULL,'Kang Sol','공승연, 유준상, 김재영, 홍수현, Baekho, Oh Hyun-Joong, Park Bo-yeon, 동현배','Hành Động, Phiêu Lưu, Gia Đình, Chính kịch','Hàn Quốc','<p>Kang Yeo-reum, một cựu thần tượng, trở thành phóng viên du lịch và bắt đầu hành trình khám phá thành công thực sự và ý nghĩa cuộc sống.</p>',0,0,12,0),(885,'Cơ hội cuối cùng (Phần 1)','https://img.ophim.live/uploads/movies/co-hoi-cuoi-cung-phan-1-thumb.jpg','Last Chance U (Season 1)','completed','6','55phút/tập','2016','HD',NULL,'','','Thể Thao, Tài Liệu','Âu Mỹ','<p>Các vận động viên ưu tú có quá khứ khó khăn coi đội bóng bầu dục của trường cao đẳng là cơ hội cuối cùng để đổi đời và đạt được mơ ước.</p>',0,0,11,0),(886,'Bảo Tiêu (Phần 3) -  Kiều Nữ Tuyệt Trần','https://img.ophim.live/uploads/movies/bao-tieu-phan-3-kieu-nu-tuyet-tran-thumb.jpg','Bodyguards Heavenly Charm','completed','20','45 phút/tập','2004','HD',NULL,'Chu Lệnh Cương','Hà Gia Kính, Lưu Ngọc Đình, Hứa Tịnh, Huỳnh Văn Hào, Cố Quán Trung, Trần Hồng Liệt','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Tiếp đà thành công của 2 phần trước, tựa phim kiếm hiệp nổi tiếng của đài ATV với sự tham gia của \"Triển hộ vệ\" Hà Gia Kính mang tên Bảo Tiêu tiếp tục cho ra mắt phần 3 vào năm 1998, đây cũng là phần cuối cùng trong seri đình đám này và nó được lấy tên là Kiều Nữ Giang Hồ. Với sự đầu tư mạnh mẽ cả về cảnh quay, cốt truyện, dàn diễn viên cho tới những trận thư hùng đầy ác liệt và mãn nhãn, Bảo Tiêu 3 là một cái kết đầy hoàn hảo cho loạt phim kiếm hiệp được biết tới trên khắp châu Á này.</i></p>',0,0,18,0),(887,'Thám Tử Nghệ Thuật','https://img.ophim.live/uploads/movies/tham-tu-nghe-thuat-thumb.jpg','Art Detectives','completed','6','45 phút/tập','2025','HD',NULL,'','Stephen Moyer, Nina Singh, Sarah Alexander, Larry Lamb','Hình Sự, Chính kịch','Âu Mỹ, Anh','<p>Tại đơn vị nhỏ nhất của Sở Cảnh sát Tokyo – Phòng Điều tra Tội phạm Di sản – một thanh tra mê nghệ thuật âm thầm giải mã những vụ án liên quan đến tranh quý, cổ vật, đồ sưu tầm và di sản văn hoá.<br>&nbsp;</p>',0,0,17,0),(888,'Hai Kẻ Cá Cược','https://img.ophim.live/uploads/movies/hai-ke-ca-cuoc-thumb.jpg','Two for the Money','completed','1','Đang cập nhật','2005','HD',NULL,'D.J. Caruso','Matthew McConaughey,  Al Pacino,  Rene Russo','Tâm Lý, Hình Sự, Thể Thao','Âu Mỹ','<p>Hai Kẻ Cá Cược - Two for the Money: Walter Abrams là chủ nhân của Hotline cá cược thể thao chuyên phục vụ cho những người đánh bạc lớn. Anh thuê cựu ngôi sao bóng đá làm việc cho mình. Abrams sớm phát hiện ra rằng tân binh mới này có sở trường về những trò bóng bánh. Cho đến một ngày, cả hai lao vào một cuộc đối đầu chết người trị giá hàng triệu đô la..</p>',0,0,11,0),(889,'Nhiệm vụ tối thượng','https://img.ophim.live/uploads/movies/nhiem-vu-toi-thuong-thumb.jpg','Ultimate Mission','completed','1','98 Phút','2025','HD',NULL,'','','Hành Động, Hình Sự, Viễn Tưởng','Trung Quốc','<p>Một loại virus chết người bùng phát trên đảo Asel ở Thái Bình Dương. Đối mặt với mối nguy sinh học có vũ trang, một đội an toàn sinh học quốc tế đã triển khai 3 đặc vụ cho một nhiệm vụ giải cứu khẩn cấp.</p><p>&nbsp;</p>',0,0,17,0),(890,'Bảo Tiêu (Phần 2) - Người Tình Hiệp Khách','https://img.ophim.live/uploads/movies/bao-tieu-phan-2-nguoi-tinh-hiep-khach-thumb.jpg','Bodyguards: Cryptic Crystal','completed','20','45 phút/tập','1999','HD',NULL,'Phạm Tú Minh','Hà Gia Kính, Trịnh Hạo Nam, Trần Hồng Liệt, Huỳnh Văn Hào, Lưu Ngọc Đình, Hồ Huệ Trung','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Bảo Tiêu 2 - Thúy Đình Hiệp Nữ: Vốn là Nghiêm Thân Vương trong triều có dã tâm, chuẩn bị tiến hành mưu phản. Trong tay hắn ta có một khối thuỷ tinh làm từ băng tuyết Thiên Sơn, có phép màu nhiệm. Phái võ lâm cao thủ Hồng Khôn (Trương Chấn Hoàn) bí mật liên lạc với Nam Xương phủ. Còn Thừa Tướng thì phái mật thám Thôi Kính Chi, Thúy Đình (Hồ Huệ Trung diễn) theo dõi, tìm cách thu thập chứng cứ mưu phản của Nghiêm Thân Vương. Trong lúc họ đang tìm cách đoạt lấy khối thuỷ tinh, thì Thôi Kính Chi bị Hồng Khôn đả thương, trước lúc chết liền nhờ Quách Húc giúp đỡ em gái mình hoàn thành nhiệm vụ, hy vọng Thúy Đình có thể cùng khối thuỷ tinh kia về cung an toàn. Nhưng anh cũng yêu cầu Quách Húc đến ngày 15 tháng 8 phải ra tay giết Thúy Đình. Trong quá trình hộ tống, Quách Húc phát hiện ra Thúy Đình chính là ái phi và cũng là sát thủ của Nghiêm Thân Vương – Hình Cơ, còn Thái Ngọc cũng bị cuốn vào con đường sai trái Thúy Đình (Hồ Huệ Trung): Là mật thám triều đình, võ công cao cường, tính tình tự phụ kiêu ngạo. Trong lúc truy tìm khối thuỷ tinh , phát hiện ra thân phận thật sự chính là ái phi của Ninh Vương – Hình Cơ.</i></p>',0,0,18,0),(891,'Avatar 3: Lửa và Tro Tàn','https://img.ophim.live/uploads/movies/avatar-3-lua-va-tro-tan-thumb.jpg','Avatar: Fire and Ash','trailer','1','? Phút','2025','HD',NULL,'James Cameron','Sam Worthington, Zoe Saldaña, Sigourney Weaver, Stephen Lang, Kate Winslet, Cliff Curtis, Oona Chaplin, Jack Champion, Britain Dalton, Trinity Bliss','Viễn Tưởng, Phiêu Lưu, Khoa Học','Âu Mỹ','Sau cuộc chiến tàn khốc với RDA và nỗi mất mát to lớn khi đứa con trai cả hy sinh, Jake Sully và Neytiri phải đối mặt với một mối đe dọa mới trên Pandora: tộc Tro Tàn — một nhóm Na\'vi hung bạo và khát khao quyền lực, do thủ lĩnh tàn nhẫn Varang dẫn dắt. Gia đình Jake buộc phải chiến đấu để sinh tồn và bảo vệ tương lai của Pandora, trong một cuộc xung đột đẩy họ đến giới hạn cuối cùng cả về thể xác lẫn tinh thần.',0,0,12,0),(892,'Những ngày sấm dậy','https://img.ophim.live/uploads/movies/nhung-ngay-sam-day-thumb.jpg','Days of Thunder','completed','1','1g 47phút','1990','HD',NULL,'Tony Scott','Tom Cruise,  Nicole Kidman,  Robert Duvall,  Randy Quaid,  Cary Elwes,  Michael Rooker,  Fred Thompson,  John C. Reilly,  J.C. Quinn,  Don Simpson','Hành Động, Thể Thao, Phiêu Lưu, Chính kịch','Âu Mỹ','<p>Một tay đua xe thường nóng nảy phải học cách chế ngự bản tính ngông cuồng nếu muốn trở nên thành công nhất có thể.</p>',0,0,11,0),(893,'Truy Bắt Đạo Tặc','https://img.ophim.live/uploads/movies/truy-bat-dao-tac-thumb.jpg','Never a Thief','completed','1','90 Phút','2025','HD',NULL,'Mak Ho-Pong','任達華, Henry Prince Mak, 클라라, 錢嘉樂, 袁富華, 黃德斌, 于柏林, Lu Chen Yue, 孙毓晗, 連凱','Hình Sự','Trung Quốc, Hồng Kông','Bộ phim kể về Triệu Cát – một chàng trai gốc Hoa – nhờ vào kỹ năng mở khóa siêu phàm đã gia nhập vào một băng nhóm trộm cổ vật do “Ông Tượng” cầm đầu. Cùng với những người đồng đội, mỗi người một sở trường, họ thực hiện hàng loạt phi vụ trộm táo bạo và nghẹt thở. Sau tất cả những biến cố, Triệu Cát cuối cùng cũng khám phá ra sự thật đằng sau vụ mất tích bí ẩn của cha mình.',0,0,17,0),(894,'Nhất Đại Thiên Kiều','https://img.ophim.live/uploads/movies/nhat-dai-thien-kieu-thumb.jpg','Legend Of a Beauty','completed','30','45 phút/tập','1991','HD',NULL,'Hà Pháp Minh','Mễ Tuyết, Trần Bích Phụng, Trần Lợi Bình, Trần Thiên Văn, Chu Nhiệm','Võ Thuật, Cổ Trang','Singapore','<p><i>Câu chuyện xảy ra vào đời Đường. Thượng Quan Hồng vì muốn hoàn thành tâm nguyện của phụ thân mà khổ luyện võ công hầu đánh bại cao thủ võ lâm đương thời là Đao Thần và Kiếm Tri, trong một lần ác đấu đã bị Kim Diện Nhân thừa cơ hãm hại. Đệ tử phái Điểm Thương là Diệp Phong có duyên sư đồ với Kiếm Tri nên tận lực truy tầm hung thủ, không để ý đến mối tình thâm của Hồng dành cho mình mà lại có tình ý với Liễu Oanh. Vì muốn cứu nguy cho Phong trong một hiểm cảnh nên Hồng đã thọ thương và ăn nhầm trái Thiên Hương Đậu Khấu và trơi vào trạng thái chết giả. Phong và Oanh đi tìm trái Thiên Hương Đậu Khấu thứ 2 để cứu Hồng, không ngờ chính Oanh cũng bị buộc phải ăn trái Thiên Hương Đậu Khấu. Sau cùng Phong tìm được trái Thiên Hương Đậu Khấu thứ 3. Một bên nặng ơn cứu mạng, một bên lại nặng vì tình. Diệp Phong nên đưa linh dược cho nàng nào?</i></p>',0,0,18,0),(895,'Kraken','https://img.ophim.live/uploads/movies/kraken-thumb.jpg','Kraken','completed','1','133 Phút','2025','HD',NULL,'Николай Лебедев','Александр Петров, Виктор Добронравов, Алексей Гуськов, Сергей Гармаш, Диана Пожарская, Антон Богданов, Михаил Данилюк, Роман Дудич, Владислав Хитрик, Антон Риваль','Viễn Tưởng, Phiêu Lưu, Khoa Học','Nga','Bối cảnh đặt vào thời Chiến tranh Lạnh, một tàu ngầm tên lửa Nga biến mất bí ẩn trên Biển Greenland. Đại úy Viktor Voronin (Alexander Petrov) — người em của chỉ huy tàu mất tích — dẫn đầu chiến dịch cứu hộ. Trong khi đó, một căn cứ địa chất ở Bắc Cực vô tình đánh thức con Kraken—một quái vật biển sâu khổng lồ với khả năng ngụy trang siêu việt và trí thông minh đáng sợ. Khi nhóm cứu hộ tiếp cận khu vực tàu ngầm mất tích, họ cũng phải đối mặt với sinh vật huyền thoại đang nổi lên từ đáy đại dương',0,0,12,0),(896,'Vùng Núi Nguy Hiểm','https://img.ophim.live/uploads/movies/vung-nui-nguy-hiem-thumb.jpg','North Face','completed','1','Đang cập nhật','2008','HD',NULL,'Philipp Stölzl','Benno Fürmann,  Florian Lukas,  Johanna Wokalek','Hành Động, Tâm Lý, Thể Thao, Phiêu Lưu','Đức, Thụy Sĩ','<p>Dựa trên một câu chuyện có thật, North Face là một bộ phim phiêu lưu hồi hộp về cuộc thi leo núi được tổ chức lần đầu vào năm 1936 với đích đến là mặt đá nguy hiểm nhất trong dãy núi Alps.</p>',0,0,11,0),(897,'Phi Vụ Kim Cương Thế Kỷ','https://img.ophim.live/uploads/movies/phi-vu-kim-cuong-the-ky-thumb.jpg','Stolen: Heist of the Century','completed','1','96 Phút','2025','HD',NULL,'Mark Lewis','','Hình Sự, Tài Liệu','Âu Mỹ','<p>Antwerp, năm 2003. Một băng trộm ra tay cướp Trung tâm Kim cương bất khả xâm phạm. Ai đứng sau một trong những vụ trộm lớn nhất thế giới và làm sao chúng có thể thực hiện trót lọt?</p>',0,0,17,0),(898,'Ô Long Thiên Tử','https://img.ophim.live/uploads/movies/o-long-thien-tu-thumb.jpg','Wo Long Prince','completed','41','45 phút/tập','2002','HD',NULL,'Cao Lực Cường, Đức Hỷ','Tào Dĩnh, Tôn Diệu Uy, Tống Nghiên, Thích Tiểu Long, Lâm Tâm Như, Lục Nghị','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Đời vua Hán Vũ Đế trị vì. Ông nằm mơ thấy một người nào đó trong vương quốc của mình có mưu đồ giết hại mình và chiếm đoạt ngôi báu. Vũ Đế đã ra lệnh cho hai vị quan cận thần thân tín nhất của mình là Tô Văn và Giang Sung lập tức đi điều tra. Sẵn có lòng căm thù thái tử, Tô Văn và Giang Sung đã tố cáo thái tử có âm mưu giết chết hoàng đế. Điều này đã làm cho hoàng đế vô cùng tức giận và với uy quyền của mình, ông ra lệnh xử trảm thái tử và tất cả gia quyến. Quan ngự sử Bính Thiếu Khanh rất trung thành với thái tử, biết rằng thái tử vô tội, đã bí mật cứu sống con dâu Vương Ông Tu của thái tử lúc đó đang mang thai. Sau đó, Vương Ông Tu sinh ra một cậu con trai, đặt tên là Lưu Tuân, sau để che mắt người đời, đổi tên là Lưu Bệnh Dĩ. Chứng kiến tất cả gia quyến của mình đã bị giết chết một cách dã man, Vương Ông Tu quá đau khổ và bà quyết định ra đi tìm cách trả thù. Thật đáng thương cho cậu bé Bệnh Dĩ đáng lẽ là người thừa kế ngôi vị hoàng đế, thì lại phải ở trong nhà tù từ khi mới lọt lòng mẹ được vài ngày. Thiếu Khanh đã phải đem hoàng tử nhỏ đến cho hai người bảo mẫu nuôi dưỡng ở trong tù. Không biết sự thật về thân thế của mình, Bệnh Dĩ chỉ biết mình lớn lên trong lao tù. Từ đây cũng mở ra một cuộc đời kỳ bí của Lưu Bệnh Dĩ - nhân vật chính của phim. Ngày tháng qua, Bệnh Dĩ giờ đây đã trở thành một chàng trai khôi ngô tuấn tú nhưng lại là một tên lưu manh do không được dạy dỗ đúng cách. Sự thay đổi hoàng đế trị vì đã giải thoát Bệnh Dĩ và hai bảo mẫu khỏi ngục tù. Bệnh Dĩ bắt đầu cuộc đời của một thường dân. Cùng với hai bảo mẫu của mình, họ phải bắt đầu kiếm sống bằng mọi cách. Hoàng đế thời đó là con trai út của Hán Vũ Đế là Hán Chiêu Đế, 8 tuổi đã lập vị, 11 tuổi lấy Phụng Nhi con quan mới 5 tuổi lập thành hoàng hậu. Chiêu Đế từ nhỏ thân thể suy nhược, mặc dù hoàng hậu vào cung đã 12 năm nhưng vẫn chưa sinh được mụn con nào. Cuộc đời của Bệnh Dĩ thay đổi khi hoàng tử gặp Hoắc Thủy Tiên - cô tiểu thư con của Đại tướng quân Hoắc Quang. Họ bắt đầu một mối tình lãng mạn. Sau đó, Bệnh Dĩ được sự giúp đỡ của Thủy Tiên đã trở thành Đại úy của Sài Thám Tư, nơi cung cấp củi lửa cho triều đình. Nhiều tình huống hài hước diễn ra trong thời gian Bệnh Dĩ ở kinh thành và cho đến một ngày nọ, thông qua hai người vú nuôi và Vương Ông Tu, thân phận hoàng tộc của Bệnh Dĩ được xác nhận, đăng cơ hoàng đế nhưng cùng lúc anh cũng đánh mất hai người thân yêu nhất. Mẹ anh đã lìa đời khi chưa kịp nhìn con trai lên ngôi, người con gái mà anh yêu thương Thượng Quan Phụng Nhi nay trở thành \"thái hoàng thái hậu\" (có vai vế là bà nội của Bệnh Dĩ)...Trải qua bao biến cố tưởng chừng không vượt qua nổi, cuối cùng Bệnh Dĩ cũng học được biến pháp \"tề gia, trị quốc, bình thiên hạ\" trở thành vị hoàng đế có tư tưởng chính trị nổi bật trong triều đại nhà Hán – Hán Tuyên Đế.</i></p>',0,0,18,0),(899,'Chiến Dịch Phoenicia','https://img.ophim.live/uploads/movies/chien-dich-phoenicia-thumb.jpg','The Phoenician Scheme','completed','1','102 Phút','2025','HD',NULL,'Wes Anderson','Benicio del Toro, Mia Threapleton, Michael Cera, Riz Ahmed, Tom Hanks, Bryan Cranston, Mathieu Amalric, Richard Ayoade, Benedict Cumberbatch, Jeffrey Wright','Hài Hước, Phiêu Lưu','Âu Mỹ, Đức','Wealthy businessman Zsa-zsa Korda appoints his only daughter, a nun, as sole heir to his estate. As Korda embarks on a new enterprise, they soon become the target of scheming tycoons, foreign terrorists, and determined assassins.',0,0,12,0),(900,'Quyết Đấu 3: Chuộc Tội','https://img.ophim.live/uploads/movies/quyet-dau-3-chuoc-toi-thumb.jpg','Undisputed III: Redemption','completed','1','Đang cập nhật','2010','HD',NULL,'Isaac Florentine','Scott Adkins,  Mykel Shannon Jenkins,  Mark Ivanir','Hành Động, Tâm Lý, Hình Sự, Thể Thao, Phiêu Lưu','Âu Mỹ','<p>Boyka, 1 tù nhân người Nga, đang chịu đựng chấn thương đầu gối nghiêm trọng sau khi kết thúc phần 2 của Undisputed. Sau giải đấu đó, bây giờ anh chỉ quan tâm và giỏi nhất ở việc lau rửa toalet. Nhưng một cơ hội đã đến với anh khi một giải đấu quốc tế giữa các tù nhân trên thế giới diễn ra, đó chính là giải đấu Quyền Vương. Giải đấu bao gồm những võ sĩ tù nhân giỏi nhất thế giới quy tụ với giải thưởng chính là sự tự do cho người chiến thắng. Chính vì thế, Boyka đã đánh thức lòng kiêu hãnh của chính bản thân để đổi lấy sự tự do. Nhưng cuộc đấu khônghề dễ dàng đối với Boyka...</p>',0,0,11,0),(901,'Truy Nhật Hào Hùng','https://img.ophim.live/uploads/movies/truy-nhat-hao-hung-thumb.jpg','The Edge of Righteousness','completed','30','47 phút/tập','1993','HD',NULL,'','萬梓良, 張衞健, 朱茵, 陳法蓉, 鄭則仕, 宣萱, 艾威, 關海山, 樊奕敏, 羅莽','Hình Sự, Viễn Tưởng, Khoa Học, Chính kịch','Trung Quốc, Hồng Kông','<p>LỘ MẠN PHƯỚNG (LƯỜNG VĂN TỬ) là một bác sĩ phẫu thuật thần kinh hàng đầu, một người rất nghiêm túc và kiên quyết, luôn cố gắng đạt được mục tiêu bằng mọi cách. Vì những khiếm khuyết về tính cách, anh đã có mối quan hệ không tốt với gia đình. Ngay cả bạn gái anh, Diệp Vấn (HỒ HUYỀN JESSICA HESTER), cũng lo lắng về tính khí nóng nảy của anh. Mối quan hệ giữa hai người vì thế mà thường xuyên xảy ra cãi vã. Cậu bé NG SIU TUNG (TRẦN BÁC LÂM), tám tuổi, đang mắc bệnh ung thư não. Mong muốn được chữa khỏi bệnh, cậu đã theo chú mình là LỘC Á SỢI (TRƯỜNG VỊ KIỂM) sang Mỹ để tìm kiếm sự tư vấn điều trị...</p>',0,0,17,0),(902,'Tuyệt Đại Song Kiêu (1999)','https://img.ophim.live/uploads/movies/tuyet-dai-song-kieu-1999-thumb.jpg','The Legendary Siblings','completed','42','60 phút/tập','1999','HD',NULL,'Lý Quốc Lập','Tô Hữu Bằng, Lâm Chí Dĩnh, Lý Ỷ Hồng, Trần Đức Dung, Trịnh Gia Dĩnh, Vu Lợi, Lâm Thoại Dương','Chính kịch, Võ Thuật, Cổ Trang','Trung Quốc, Đài Loan','Yến Nam Thiên vì thiên hạ nên đã bỏ rơi Yên Nguyệt cung chủ, vì yêu hóa hận nên Yên Nguyệt ghét tất cả những người đàn ông trên thế gian, nhưng bà vẫn giữ mãi hình bóng của Yến Nam Thiên trong trái tim mình. Bà tìm mọi cơ hội để làm cho Yến Nam Thiên đau khổ. Trong giang hồ lúc bấy giờ, Di Hoa Cung là nơi quyền lực nhất và Yên Nguyệt là người sáng lập. Một lần tình cờ Liên Tinh, sư muội của Yên Nguyệt, cứu được huynh đệ kết nghĩa của Yến Nam Thiên là Ngọc Lan Giang Phong, đệ nhất mĩ nam tử và đem lòng yêu anh, nhưng Giang Phong lại đem lòng yêu Nguyệt Nô, một nô tỳ trong Di Hoa Cung và hai người trốn khỏi Di Hoa Cung.',0,0,18,0),(903,'Anh Hùng Đông Phương','https://img.ophim.live/uploads/movies/anh-hung-dong-phuong-thumb.jpg','Eastern Hero','completed','20','46 phút/tập','1992','HD',NULL,'','Angela Yeung, 關禮傑, 李克勤, 黎姿, Paul Chu Kong, 雷宇揚, 胡楓, 陳曼娜, 李家鼎, 李麗麗','Hành Động, Hình Sự, Viễn Tưởng, Phiêu Lưu, Khoa Học','Trung Quốc, Hồng Kông','<p>Trình Thanh Phong mồ côi cha mẹ từ nhỏ và sống cùng anh trai là Trình Lãng. Anh vô cùng bàng hoàng khi chứng kiến anh trai mình hy sinh vợ con để chạy trốn kẻ thù. May mắn thay, Thanh Phong đã cứu được cháu trai mình, Gia Bảo. Từ đó, Thanh Phong mất liên lạc với anh trai. Anh định cư ở một vùng nông thôn và giao phó việc nuôi dưỡng Gia Bảo cho một người đàn ông tốt bụng tên là Bính. Mười tám năm sau, Thanh Phong học được những kỹ năng võ thuật tuyệt đỉnh và cải trang thành một bác sĩ chất phác. Thực chất, anh chính là một hiệp sĩ huyền thoại được mệnh danh là Long Ảnh Anh Hùng, người bảo vệ công lý và trừng trị cái ác. Đồng môn Tông Tín luôn đồng hành và ủng hộ anh. Để đoàn tụ với Bính và Gia Bảo, Thanh Phong đã đến một nơi gọi là \"Thành phố Kho Báu\". Trên đường đi, anh biết được về một bạo chúa địa phương tên là Du Vạn Cẩm, kẻ đã dùng quyền lực để đàn áp người dân. Điều này càng thôi thúc Thanh Phong quyết tâm đến thăm Thành phố Kho Báu hơn nữa...</p>',0,0,12,0),(904,'Huyền Thoại Pelé','https://img.ophim.live/uploads/movies/huyen-thoai-pele-thumb.jpg','Pelé: Birth Of A Legend','completed','1','Đang cập nhật','2016','HD',NULL,'Jeff Zimbalist,  Michael Zimbalist','Rodrigo Santoro,  Vincent D\'Onofrio,  Diego Boneta','Tâm Lý, Thể Thao','Âu Mỹ','<p>Phim Huyền Thoại Pelé - Pelé: Birth of a Legend 2016: Bộ phim về huyền thoại bóng đá Pele thưở thiếu thời ở khu Sao Paulo cho đến khi dẫn dắt đội tuyển Brazil đến chiến thắng World Cup đầu tiên năm 17 tuổi.</p>',0,0,11,0),(905,'Bác Sĩ An Tử','https://img.ophim.live/uploads/movies/bac-si-an-tu-thumb.jpg','Mary Kills People','completed','24','59 phút/tập','2025','HD',NULL,'박준우','이보영, 이민기, 강기영, 백현진, 김태우, 윤가이, 권해효, 서영희, 유승목, 강나언','Hình Sự, Chính kịch','Hàn Quốc','<p>Một bộ phim về một bác sĩ giúp đỡ những bệnh nhân giai đoạn cuối một cách bất hợp pháp bằng phương pháp an tử và một thám tử theo dõi các hoạt động bất hợp pháp của cô ta.</p>',0,0,17,0),(906,'Tiết Đình San Và Phạm Lê Hoa','https://img.ophim.live/uploads/movies/tiet-dinh-san-va-pham-le-hoa-thumb.jpg','General Father , General Son','completed','20','41 phút/tập','1986','HD',NULL,'Tiêu Hiển Huy','Huỳnh Nhật Hoa, Trần Mẫn Nhi, Cung Từ Ân, Dung Tuệ Văn, Hạ Vũ','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Tiết Đinh Sơn (Tiết Đình San) là con trai của tiêt nhân quý, khi tiết nhan quý bị quân giặc bao vây, tiết đinh sơn cùng em gái của mình đã kéo binh lính đi giải cứu cho cha, nhưng anh đã bị tên Đậu Kim Đồng bắt ép phải phối hợp với hắn, không còn cách nào khác tiết đinh son đành chấp nhận, Phàn Lê Huê (Phạm Lê Hoa) là 1 nữ tưởng tại ả tay liêu, cô với Tiết Đình San là 1 đôi trời ban. cô đã giúp Tiết Đình San giải cứu cho cha anh.</i></p>',0,0,18,0),(907,'Chúc Âm Cổ Thành','https://img.ophim.live/uploads/movies/chuc-am-co-thanh-thumb.jpg','The Guardians of Zhu Yin','completed','1','90 Phút','2025','HD',NULL,'Yu Zhang','Dong Siyi, 黃愷傑, 张晶伟, Han Congcong, 李凯','Hành Động, Phiêu Lưu','Trung Quốc','<p>Thiếu nữ Doãn Phùng An tinh thông thiên văn lịch pháp, vì cứu mẹ mà không ngại nguy hiểm, dấn thân vào địa cung Chúc Âm. Tại đây, cô vô tình hé lộ bí ẩn về sự diệt vong của vương quốc cổ Chúc Âm bị chôn vùi suốt hàng vạn năm. Để bảo vệ nền văn minh Chúc Âm và hoàn thành sứ mệnh gia tộc “chỉnh lại tinh tượng, hóa giải đại nạn”, Doãn Phùng An bước vào hành trình hiểm nguy, truy tìm Cửu Thải Lưu Ly Thiên Châu Nghi, bảo vật trong truyền thuyết có thể xoay chuyển vận mệnh tinh tú, nhằm ngăn chặn thảm họa thiên thạch sắp giáng xuống.</p>',0,0,12,0),(908,'HUSTLE: Cuộc đua NBA','https://img.ophim.live/uploads/movies/hustle-cuoc-dua-nba-thumb.jpg','Hustle','completed','1','1g 58phút','2022','HD',NULL,'Jeremiah Zagar','Adam Sandler,  Juancho Hernangómez,  Queen Latifah,  Ben Foster,  Kenny Smith,  Robert Duvall,  Jordan Elizabeth Hull,  María Botto,  Heidi Gardner,  Ainhoa Pillet,  Anthony Edwards','Hài Hước, Thể Thao, Chính kịch','Âu Mỹ','<p>Khi phát hiện ra một siêu sao tiềm năng ở Tây Ban Nha, vị tuyển trạch viên bóng rổ xui xẻo bắt đầu chứng minh cả hai có đủ mọi yếu tố cần thiết để thành công ở NBA.</p>',0,0,11,0),(909,'Huyết Án Truy Hành','https://img.ophim.live/uploads/movies/huyet-an-truy-hanh-thumb.jpg','Beyond the Sin','completed','1','0 Phút','2025','HD',NULL,'Kwok Man-Ki','古天樂, 林家棟, 張繼聰, 王敏奕, 車婉婉, 林嘉欣, 鄧月平, 孫佳君, 林家熙, 楊偲泳','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Vào một đêm mưa, Gia Kỳ – con gái của cảnh sát Lạc Nhất Ngôn được đã tử vong. Vì không đủ bằng chứng kết tội, nghi phạm được thả tự do. Liệu rằng Lạc Nhất Ngôn sẽ làm gì khi nhân chứng duy nhất lại là một cô bé thiểu năng trí tuệ?',0,0,17,0),(910,'Tiết Cương Phản Đường','https://img.ophim.live/uploads/movies/tiet-cuong-phan-duong-thumb.jpg','Destined To Rebe','completed','18','40 phút/tập','1987','HD',NULL,'Tiêu Hiển Huy','Lưu Thanh Vân, Quan Lễ Kiệt, Ngô Trấn Vũ, Lưu Mỹ Quyên, Thiệu Mỹ Kỳ, Tạ Hiền','Võ Thuật, Cổ Trang','Hồng Kông','<p><i>Tiết gia vốn được coi là rường cột của Đại Đường, liên tiếp 2 đời Đông chinh Tây phạt, công cán hiển hách. Nhưng trên đời có câu\" Nhất tướng công thành vạn cốt khô\", Tiết Nhơn Quý và Tiết Đinh San qua hai lần nhận lãnh ấn soái mở cuộc chinh đông và chinh tây tuy đem lại bình yên cho xã tắc nhưng quy ra thì cũng tạo ra bao vạn oan hồn oán khí bám theo nhà họ Tiết. Đại Nguyên soái Tây Liêu Dương Phàm, sau khi bị vợ chồng Tiết Đinh San và Phàn Lê Huê giết chết oán khí không dứt đã đầu thai vào thành con trai của hai người. Phàn Lê Huê thấu hiểu thiên cơ biết được con trai ruột của mình Tiết Cương chính là do Dương Phàm đầu thai hòng mong tru diệt nhà họ Tiết. Lê Huê vì muốn trừ diệt tâm ma cho con cắt đi mối nguy cho nhà họ Tiết nào ngờ ý trời đã định khó thể khiên cưỡng cuối cùng bị con trai mình vô tình hại chết. Tiết Cương trong hội hoa đăng, lỡ tay đánh chết con riêng của Thái Hậu Võ Tắc Thiên khiến cho họ Tiết bị tru di tam tộc, còn bản thân phải bôn đào. Nhờ sự giúp đỡ của Quán Chủ Vĩnh Thái, dần dần Tiết Cương đã trừ được tâm ma của mình, đứng lên chiêu binh chống lại Võ Tắc Thiên (lúc này đã lên ngôi hoàng đế) hòng báo thù nhà và chấn hưng Đại Đường...</i></p>',0,0,18,0),(911,'Sở U Bí Cảnh','https://img.ophim.live/uploads/movies/so-u-bi-canh-thumb.jpg','Veil of Chu','completed','1','90 Phút','2025','HD',NULL,'孙建社','Wang Kuirong, 侍宣如, Simpson Tang','Phiêu Lưu, Bí ẩn','Trung Quốc','<p>Vào đầu thời Dân Quốc, thôn Song Miếu bỗng chốc trở thành vùng đất chết sau một đêm khi toàn bộ dân làng đồng loạt treo cổ tự vẫn vì họ vô tình chạm vào điều cấm kỵ cổ xưa. Trong thảm kịch đó, cậu bé Ngô Kỳ may mắn sống sót. Từ đó đến khi trưởng thành, cậu không ngừng truy tìm bí mật năm xưa. Cùng lúc đó, Lâm Ngũ gia dưới sức ép của thương hội Nhật Bản và chính quyền Quốc dân đảng, buộc phải tiến vào lăng mộ Sở U Vương để lấy bảo vật. Ngô Kỳ cũng bị ép phải cùng xuống mộ. Trong hành trình đó, cả nhóm phải đối mặt với những ảo giác tâm ma, từng bước bước qua thử thách sinh tử, để rồi vạch trần sự thật phía sau vụ tự sát tập thể năm xưa của cả ngôi làng.<br>&nbsp;</p>',0,0,12,0),(912,'Võ Đài Yêu Thương','https://img.ophim.live/uploads/movies/vo-dai-yeu-thuong-thumb.jpg','Sultan','completed','1','Đang cập nhật','2016','HD',NULL,'Ali Abbas Zafar','Salman Khan,  Anushka Sharma,  Randeep Hooda','Hành Động, Tình Cảm, Tâm Lý, Thể Thao, Võ Thuật, Phiêu Lưu','Ấn Độ','<p>Phim Võ Đài Yêu Thương - Sultan 2016: Một bộ phim hành động tâm lý và lãng mạn, kể về cuộc sống của nhân vật Haryana dựa trên 1 số chi tiết có thật về nhà đô vật, võ thuật Sultan Ali Khan.</p>',0,0,11,0),(913,'Buôn Thần Bán Thánh','https://img.ophim.live/uploads/movies/buon-than-ban-thanh-thumb.jpg','The Stone','completed','1','125 Phút','2025','HD',NULL,'อารักษ์ อมรศุภศิริ, Wutthiphong Sukanin','จินเจษฎ์ วรรธนะสิน, กรณิศ เล้าสุบินประเสริฐ, นพพล โกมารชุน, จุลจักร จักรพงษ์, อิชณน์กร พึ่งเกียรติรัศมี, กฤษณะ พันธุ์เพ็ง, Narubeth Jinpinpetch, Sampao Nakaiam, Somjet Payakso, Rungsid Tongnam','Hình Sự, Chính kịch','Thái Lan','<p>Sau khi phát hiện tấm bùa huyền thoại của người cha ốm yếu, người đàn ông nọ bị đẩy vào thế giới nguy hiểm của tội phạm và những nhà sưu tập khao khát có được nó.</p>',0,0,17,0),(914,'Giang Hồ Lãng Tử','https://img.ophim.live/uploads/movies/giang-ho-lang-tu-thumb.jpg','The Young Wanderer','completed','20','42 phút/tập','1985','HD',NULL,'Lý Đình Luân','Huỳnh Nhật Hoa, Lưu Gia Linh, Trang Tịnh Nhi, Liêu Khải Trí, Dung Tuệ Văn, Tần Bái','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Dịch Thủy Hàn cùng thuật sĩ giang hồ Quách Thành Công kết bạn hành tẩu giang hồ, sống bằng việc lừa đảo. Một lần bị hiểu lầm liên quan đến 1 vụ án nên bị Nam Cung Thế Gia đuổi bắt, được Bang chủ cái bang Đào Nhât Túy gíup đỡ, cũng vì thế mà đã cũng để tử của Nam Cung Tống Hiểu Dương và Nguyễn Hồng Diệp kết thành bằng hữu. Đào Nhất Túy điều tra vụ cướp do Tam đại hộ pháp Ma giáo gây ra nên xuất lĩnh quần hùng tiêu diệt Ma Giáo may mắn cứu được Ngũ Đại cao thủ võ lâm.</i></p>',0,0,18,0),(915,'Cò Súng','https://img.ophim.live/uploads/movies/co-sung-thumb.jpg','Trigger','completed','10','45 phút/tập','2025','HD',NULL,'','김남길, 김영광, 우지현, 김원해, 박훈, 길해연, 조한철, 정웅인, 장동주, Park Yoon-ho','Hành Động, Hình Sự, Phiêu Lưu, Chính kịch','Hàn Quốc','<p>Khi súng ống trái phép tràn vào Hàn Quốc – nơi cấm sử dụng súng, một cảnh sát cương quyết cùng cộng sự bí ẩn hợp lực để ngăn chặn tình trạng hỗn loạn lan rộng khắp đất nước.</p>',0,0,12,0),(916,'Thiên Tài Sạch Sẽ','https://img.ophim.live/uploads/movies/thien-tai-sach-se-thumb.jpg','Cleanliness Boy! Aoyama-kun','completed','12','24 phút/tập','2017','HD',NULL,'Kazuya Ichikawa','Hirofumi Nojima,  Anzu Haruno,  Shoutrao Morikubo','Thể Thao','Nhật Bản','<p>Câu chuyện xoay quanh thiên tài bóng đá trẻ tuổi, đẹp trai tên là Aoyama. Tuy nhiên, Aoyama lại mắc một chứng bệnh đó là “sạch sẽ”, anh chàng này chẳng bao giờ tắc bóng hay là đánh đầu cả thậm chí nếu ném biên cũng phải đeo găng tay mới chịu ném.</p>',0,0,11,0),(917,'Ám Triều Tập Hung','https://img.ophim.live/uploads/movies/am-trieu-tap-hung-thumb.jpg','Beneath the Undertow','completed','19','38 phút/tập','2025','HD',NULL,'陈卓','陈建斌, Chen Ruoxuan, 李溪芮, 成泰燊, 梅婷','Hình Sự, Chính kịch','Trung Quốc','<p>Tại nhà máy quốc doanh Húc Nhật từng sầm uất, một xác nữ bị mất chân được phát hiện tại hồ nước thải bỏ hoang. Nạn nhân là Thẩm Tiểu Chu - con của một công nhân trong nhà máy. Viên cảnh sát trung niên điềm đạm Liên Hải Bình và cảnh sát trẻ nóng nảy Thạch Cường Phong vô tình trở thành đồng đội, dù có nhiều mâu thuẫn nhưng buộc phải hợp tác để tìm ra hung thủ thực sự. Trong quá trình điều tra, hàng loạt nghi phạm lần lượt xuất hiện, hai người dần phát hiện rằng phía sau cô sinh viên đại học tưởng chừng \"trắng trong như tuyết\" này lại ẩn giấu nhiều góc khuất của xã hội. Đồng thời, một vụ án cũ liên quan mật thiết đến cả hai cũng dần dần lộ diện, khiến mối quan hệ giữa Liên Hải Bình và Thạch Cường Phong trở nên phức tạp. Khi vụ án còn chưa có lời giải, hàng loạt án mạng nữ bị mất chân tiếp tục xảy ra, bao trùm lên nhà máy Húc Nhật một bầu không khí u ám.&nbsp;</p>',4,0,17,0),(918,'Nhất Đại Hoàng Hậu','https://img.ophim.live/uploads/movies/nhat-dai-hoang-hau-thumb.jpg','Empress Of The Time','completed','54','35 phút/tập','1992','HD',NULL,'Uông Cường, Chu Thục Nghi','Phan Nghinh Tử, Quý Cần, Cao Vẫn, Lưu Thanh Vân, Nhĩ Đông Thăng, Tôn Bằng, Ngô Tuyết Phân, Bảo Chính Phương, Vu Chỉ Úy, Khương Quan Quần, Uông Cường','Võ Thuật, Cổ Trang','Đài Loan','<p><i>Một câu chuyện về quyền lực,gia tộc,tình yêu của một nữ nhi hoàn mỹ. Đó là Hiếu Trang - nhan sắc khuynh quốc khuynh thành,trí tuệ uyên bác hưng quốc an bang,từ bi khoan dung khắp thiên hạ. Đại Ngọc Nhi - Hiếu Trang Văn hoàng hậu họ Bác Nhĩ Tể Cát Đặc Thị tên là Bố Mộc Bố Thái theo truyền thuyết dã sử gọi là Đại Ngọc Nhi. Năm 1613,sinh ra tại Mông Cổ Năm 1623,Đại Ngọc Nhi vô tình gặp gỡ với Ái Tân Giác La Đa Nhĩ Cổn Hai người từ thanh mai trúc mã đã thật sự yêu nhau nên nguyện lấy nhau.Nhưng Đại Ngọc Nhi phải theo sắp đặt của cha mình phải trở thành trác phúc tấn của Khả Hãn Hoàng Thái Cực.Song khó mà cắt được tình cảm sâu đậm của cô và Nhiếp Chính vương Đa Nhĩ Cổn.Sau này,Hoàng Thái Cực biết chuyện đã nghi ngờ a ca Phúc Lâm có phải con Đa Nhĩ Cổn không ? Đaị Ngọc Nhi dám yêu dám hận,từ bi thông minh cùng nhan sắc mỹ lệ đã dùng tài năng hỗ trợ Đại Thanh để lại những thành tựu to lớn cho triều đại suốt 260 năm thống trị.Bà qua đời lúc 75 tuổi. Nhất đại hoàng hậu Đại Ngọc Nhi tuy lấy đề tài cũ nhưng với Phan Nghinh Tử - thiếu nữ Đại Ngọc Nhi xinh đẹp dù đã 47 tuổi,Nhĩ Đông Thăng hào hoa và Lưu Thanh Vân âm mưu xảo quyệt tạo nên sức hút của bộ phim kinh điển này...</i></p>',0,0,18,0),(919,'Thị Trấn Tội Lỗi','https://img.ophim.live/uploads/movies/thi-tran-toi-loi-thumb.jpg','The Unholy Trinity','completed','1','95 Phút','2025','HD',NULL,'Richard Gray','Pierce Brosnan, Samuel L. Jackson, Brandon Lessard, Veronica Ferres, Gianni Capaldi, Q\'orianka Kilcher, Tim Daly, Ethan Peck, Katrina Bowden, David Arquette','Hình Sự, Phiêu Lưu','Âu Mỹ, Úc','Những bí mật bị chôn vùi của thị trấn Trinity-Montana vào những năm 1870 dẫn đến bạo lực khi một thanh niên trở về để đòi lại công lý cho cha mình và bị kẹt giữa một cảnh sát trưởng quyết tâm duy trì trật tự và một người lạ bí ẩn quyết tâm phá hủy nó.',0,0,12,0),(920,'Tiếng Hét Giữa Trời Xanh','https://img.ophim.live/uploads/movies/tieng-het-giua-troi-xanh-thumb.jpg','Yell For The Blue Sky','completed','1','Đang cập nhật','2016','HD',NULL,'Takahiro Miki','Tao Tsuchiya,  Ryoma Takeuchi,  Shono Hayama','Tình Cảm, Tâm Lý, Thể Thao','Nhật Bản','<p>Phim Tiếng Hét Giữa Trời Xanh - Yell For The Blue Sky 2016: Xoay quanh nữ sinh trung học Ono Tsubasa, một cô gái thầm nuôi dưỡng ước mơ trở thành tay trống của dàn nhạc cổ vũ sau một lần theo dõi tại trận bóng chày trường trung học Shirato. Để được trở thành tay trống cừ khôi ấy, Tsubasa quyết định thi vào Shirato. Tại đó, cô gặp gỡ Daisuke Yamada- cậu bạn catcher (bắt bóng) của đội bóng chày.</p>',0,0,11,0),(921,'Đối thoại với kẻ sát nhân: Thước phim về Con trai của Sam','https://img.ophim.live/uploads/movies/doi-thoai-voi-ke-sat-nhan-thuoc-phim-ve-con-trai-cua-sam-thumb.jpg','Conversations with a Killer: The Son of Sam Tapes','completed','3','? phút/tập','2025','HD',NULL,'','','Hình Sự, Tài Liệu','Âu Mỹ','<p>Khám phá một trong những cuộc truy lùng lớn nhất trong lịch sử thành phố New York, từ cuộc đua tuyệt vọng của NYPD nhằm bắt giữ kẻ giết người khét tiếng sử dụng súng cỡ .44—và thâm nhập vào tâm trí bất ổn của chính David Berkowitz—cho đến những bản ghi âm mới được khai quật cung cấp cái nhìn sâu sắc hiếm hoi về tâm lý méo mó của David Berkowitz, tiết lộ những gì đang diễn ra trong tâm trí hắn khi hắn mở ra một triều đại khủng bố vào cuối những năm 1970.</p>',0,0,17,0),(922,'Chung Quỳ Bắt Ma','https://img.ophim.live/uploads/movies/chung-quy-bat-ma-thumb.jpg','The Chinese Ghost Buster','completed','20','49 phút/tập','1988','HD',NULL,'Đàm Tân Nguyên','La Lạc Lâm, Thái Thiện Nghi, Lý Văn Bưu','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Zhong Kui (Luo Lelin), một học giả từ Trung Nam vào thời nhà Đường, đến Bắc Kinh để dự thi, vị hoàng đế này không được đưa vào danh sách vì ngoại hình xấu xí. Thiên hoàng đã phong anh ta là Vị thần thiêng liêng của Diệt quỷ và Diệt trừ yêu ma. kết hôn với Ping. Trong dân gian có năm con ma đang loạn lạc, Kui làm phép để điều phục năm con ma, và đặt tên nó là ma vương. Shi Du gặp hai ma nữ là Ziyun và Zihua và đặc biệt say mê Zihua, hai người nảy sinh tình yêu. Không may, sự việc bị ba hoa chủ phát hiện ra và họ đã gây sức ép với hoa, và Hoa cuối cùng không còn sự lựa chọn nào khác, trong trường hợp này, anh đã quyết định cắt cổ bản thân để chấm dứt tình cảm đau buồn này, điều này đã gián tiếp khiến Zhong và Samo bắt đầu một chuỗi trận chiến khốc liệt. Đồng thời, trước danh tiếng trừ quỷ của Zhong, Tu Qin, một pháp sư khác, đã ghen tị và thách thức Zhong liên tục. Cặp đôi Zhang trông bình thường hóa ra lại là hồn ma cướp đoạt linh hồn của quỷ giới Qizhen, sau này quay lưng lại với tà ác, muốn đạt được kết quả khả quan, sự việc bị ba con quỷ phát hiện. , người dụ bọn họ phạm giới. Có hại cho dân chúng, Zhong Kui đối mặt với kẻ thù hai bên gặp nguy hiểm, dù sao thì cái ác cũng không thể thắng, cuối cùng Zhong có thể trừ khử ba quỷ và hai quỷ, hoàn thành đại sự. nhiệm vụ từ trên trời giáng xuống, và trở thành một vị thần diệt ma nổi tiếng trong lịch sử.</i></p>',0,0,18,0),(923,'Thế Giới Khủng Long: Tái Sinh','https://img.ophim.live/uploads/movies/the-gioi-khung-long-tai-sinh-thumb.jpg','Jurassic World Rebirth','completed','1','134 Phút','2025','HD',NULL,'','','Viễn Tưởng, Phiêu Lưu, Hành Động','Âu Mỹ','<p>Thế Giới Khủng Long: Tái Sinh lấy bối cảnh 5 năm sau phần phim Thế Giới Khủng Long: Lãnh Địa, môi trường Trái đất đã chứng tỏ phần lớn là không phù hợp với khủng long. Nhiều loài thằn lằn tiền sử được tái sinh đã chết. Những con chưa chết đã rút lui đến một vùng nhiệt đới hẻo lánh gần phòng thí nghiệm. Địa điểm đó chính là nơi bộ ba Scarlett Johansson, Mahershala Ali và Jonathan Bailey dấn thân vào một nhiệm vụ cực kỳ hiểm nguy.<br>&nbsp;</p>',0,0,12,0),(924,'Tiên Cầu Đại Chiến','https://img.ophim.live/uploads/movies/tien-cau-dai-chien-thumb.jpg','Soccer Killer','completed','1','Đang cập nhật','2017','HD',NULL,'Lưu Trấn Vĩ','Chung Hân Đồng,  Đặng Lệ Hân,  Thái Trác Nghiên','Hành Động, Cổ Trang, Thể Thao, Võ Thuật, Phiêu Lưu, Gia Đình','Trung Quốc','<p>Phim Tiên Cầu Đại Chiến - Soccer Killer 2017: kể về nhóm các nhân sĩ yêu nước thời nhà Tống dùng hình thức đá bóng để đối phó với thù trong giặc ngoài.</p>',1,0,11,0),(925,'Lừa Đảo Online','https://img.ophim.live/uploads/movies/lua-dao-online-thumb.jpg','Cloud','completed','1','124 Phút','2024','HD',NULL,'','','Chính kịch, Hình Sự','Nhật Bản','<p>Một thanh niên bỏ việc để kiếm lời qua bán hàng online, nhưng lòng tham và sự vô cảm khiến anh rơi vào vòng xoáy bạo lực khi bị chính khách hàng và đồng bọn săn lùng, đẩy mọi thứ đến bờ vực của địa ngục.</p>',0,0,17,0),(926,'Võ Lâm Nhất Tuyệt','https://img.ophim.live/uploads/movies/vo-lam-nhat-tuyet-thumb.jpg','In Search Of','completed','10','49 phút/tập','1980','HD',NULL,'Vương Thiên Lâm','Tạ Hiền, Địch Ba Lai, Lữ Hữu Huệ, Lưu Đan, Huỳnh Thụ Đường, Nam Hồng','Võ Thuật, Cổ Trang','Trung Quốc, Hồng Kông','<p><i>Dịch phu nhân (Nam Hồng) bị ép gả vào Dịch Vương Phủ và thường bị hành hạ. Hiệp đạo Dương Hận (Lưu Đan) vào phủ hành thích bị thương may được Dịch phu nhân cứu vớt, hai người nảy sinh tình cảm. Khi Dịch vương Gia xuất chinh trở về và biết được bà đã sinh ra một sông bảo, ông tức giận và nhốt bà vào ngục. Hai mươi năm sau khi sông bảo này lớn lên. Dương Tranh (Huỳnh Thụ Đường) trở thành một danh bộ võ công cao cường. Dịch Thanh Lan (Tạ Hiền) thừa kế vương vị, vì muốn che dấu xuất thân và bị thiên long bang lợi dụng khiến hai anh em sinh đôi trở thành kẻ thù ...</i></p>',1,0,18,0),(927,'Lilo và Stitch','https://img.ophim.live/uploads/movies/lilo-va-stitch-thumb.jpg','Lilo & Stitch','completed','1','108 Phút','2025','HD',NULL,'','','Gia Đình, Viễn Tưởng, Hài Hước, Phiêu Lưu','Âu Mỹ','Cuộc sống của hai chị em bị xáo trộn khi Lilo nhận nuôi một \"con chó\" kỳ lạ từ trại cứu hộ động vật. Con vật đó thực chất là Thí nghiệm 626, hay còn gọi là Stitch (lồng tiếng bởi Chris Sanders, người lồng tiếng cho Stitch trong bản hoạt hình gốc), một sinh vật ngoài hành tinh được tạo ra bởi nhà khoa học điên rồ Dr. Jumba Jookiba (Zach Galifianakis) với mục đích gây hỗn loạn. Stitch là một \"quả bóng hủy diệt\" không thể kiểm soát, nhưng Lilo lại coi cậu bé là người bạn thân nhất mà cô hằng mong ước.',0,0,12,0),(928,'Võ Sĩ Quyền Anh','https://img.ophim.live/uploads/movies/vo-si-quyen-anh-2017-thumb.jpg','Jawbone','completed','1','Đang cập nhật','2017','HD',NULL,'Thomas Q. Napper','Johnny Harris,  Ian McShane,  Ray Winstone','Hành Động, Tâm Lý, Thể Thao, Phiêu Lưu','Anh','<p>Phim Võ Sĩ Quyền Anh - Jawbone 2017: Cựu vô địch quyền anh thanh thiếu niên, Jimmy McCabe, là một người đang tìm kiếm hy vọng nhưng toàn nhầm chỗ. Khi anh ấy rơi vào hoàn cảnh khó khăn, anh ấy quay lại câu lạc bộ quyền anh thời thơ ấu của mình và gia đình duy nhất mà anh ấy từng bỏ lại: chủ phòng gym Bill, chăm sóc viên Eddie, và nhà tài trợ Joe. Trở lại luyện tập sau nhiều năm, khi chẳng còn ai coi anh là đối thủ nữa, Jimmy đánh cược cả sinh mạng của mình, để trụ vững và lấy lại vị trí mà anh từng có.</p>',1,0,11,0),(929,'Người Bảo Vệ Công Lý','https://img.ophim.live/uploads/movies/nguoi-bao-ve-cong-ly-thumb.jpg','Jaat','completed','1','153 Phút','2025','HD',NULL,'Gopichand Malineni','Sunny Deol, Randeep Hooda, Saiyami Kher, Regina Cassandra, Vineet Kumar Singh, Ramya Krishnan, Jagapati Babu, Vinay Varma, Zarina Wahab, Upendra Limaye','Hành Động, Hình Sự','Ấn Độ','Phim xoay quanh cuộc chiến giữa thiện và ác. Một bên là Ranatunga: tội phạm khét tiếng, tàn nhẫn, lợi dụng quyền lực và vàng để đàn áp dân lành. Bên kia là “Jaat”, vị khách bí ẩn sắt đá, đến để đòi một lời xin lỗi và đem lại hy vọng cho người dân bị áp bức.',0,0,17,0),(930,'Mission of the Warriors','https://img.ophim.live/uploads/movies/mission-of-the-warriors-thumb.jpg','Mission of the Warriors','completed','10','45 phút/tập','2001','HD',NULL,'Mộng Kế, Vương Dĩ','Sử Khả, Vương Diễm, Huỳnh Hải Băng, Trương Diễm Diễm, Trác Phàm, Châu Hoành Gia, Vương Kiến Tân','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Thời đó, trên giang hồ có 1 người tên Châu Bảo Quý, lấy vợ là Lý Mi Nương và đã sinh ra 1 đứa con gái đặt tên là Châu Thất Thất. Bọn họ sống ở Nhân Nghĩa sơn trang. Đó cũng là nơi mà 3 thiếu niên giang hồ: Thẩm Lãng, Hùng Miêu Nhi và Vương Liên Hoa quen biết nhau. Tuy trẻ tuổi, nhưng họ cũng biết fân biệt trắng đen, phải trái. Khi ấy, 1 tên ma đầu trong võ lâm là Khoái Hoạt vương đã phái thủ hạ đến Nhân Nghĩa sơn trang để đón Châu Thất Thất về, vì tưởng Châu Thất Thất là Lý Mi Nương (mẹ của thất Thất) - ái thê của mình đã qua đời 18 năm về trước. 3 người Thẩm Lãng, Hùng Miêu Nhi và Vương Liên Hoa quyết định bảo vệ Thất Thất. Sau đó, Thẩm Lãng đã cứu thoát 1 người từ tay Khoái Hoạt Vương tên là Bạch Phi Phi, Thẩm Lãng tưởng Phi Phi ko biết võ công nhưng thực sự, cô ấy rất giỏi.Sau đó,2 người yêu nhau, nhưng mẹ của Bạch Phi Phi-Bạch Tịnh ko đồng ý, nhưng trước sau như 1, tấm lòng của Thẩm Lãng với Phi Phi ko hề thay đổi...Môt câu chuyện vừa hài vừa bi, ân oán giang hồ 18 năm, làm hại 3 người phụ nữ nhưng cuối cùng lại cho ra 1 kết thúc tốt đẹp. Tất cả âu cũng là duyên phận.</i></p>',0,0,18,0),(931,'Đứa Trẻ Khiếm Khuyết','https://img.ophim.live/uploads/movies/dua-tre-khiem-khuyet-thumb.jpg','The Defects','completed','8','45 phút/tập','2025','HD',NULL,'Oh Ki-hwan','염정아, 원진아, 최영준, 덱스, Ahn Ji-ho, 이나은, Oh Seung-jun, Kang Ji-yong, 손종학, 송영규','Hành Động, Phiêu Lưu, Chính kịch','Hàn Quốc','<p>Một bộ phim hành động ly kỳ kể về cuộc trả thù của những đứa trẻ suýt chết sau khi bị cha mẹ nuôi bỏ rơi.</p>',0,0,12,0),(932,'M.S. Dhoni: Chuyện Chưa Kể','https://img.ophim.live/uploads/movies/ms-dhoni-chuyen-chua-ke-thumb.jpg','M.S. Dhoni: The Untold Story','completed','1','Đang cập nhật','2016','HD',NULL,'Neeraj Pandey','Sushant Singh Rajput,  Disha Patani,  Bhumika Chawla','Tâm Lý, Thể Thao','Ấn Độ','<p>Phim M.S. Dhoni: Chuyện Chưa Kể - M.S. Dhoni: The Untold Story 2017: Trong phim, cô gái trẻ xinh đẹp Disha, vào vai Priyanka Jha - bạn gái quá cố của Mahendra, tình yêu đầu tiên của anh và cũng là người truyền cho anh sức mạnh trên con đường sự nghiệp. Mahendra thậm chí đã quyết định sẽ kết hôn với Priyanka. Thật không may, vào năm 2002, một tai nạn thảm khốc đã cướp đi sinh mạng của Priyanka Jha trong khi Mahendra đang đi du đấu tại nước ngoài mà ko hề hay biết người mình yêu đã mất. Trở về từ giải đấu quốc tế, Mahendra nhận được tin buồn và vô cùng suy sụp, sau đó, anh quyết tâm lấy lại phong độ và phá vỡ nhiều kỷ lục đáng nể của bộ môn Cricket, vươn lên trở thành một trong những vận động viên Cricket thành công nhất trong lịch sử Cricket Ấn Độ.</p>',0,0,11,0),(933,'Kẻ Báo Thù Thầm Lặng','https://img.ophim.live/uploads/movies/ke-bao-thu-tham-lang-thumb.jpg','Kuberaa','completed','1','185 Phút','2025','HD',NULL,'Sekhar Kammula','Dhanush, Nagarjuna Akkineni, Jim Sarbh, Rashmika Mandanna, K. Bhagyaraj, Dalip Tahil, Sunaina, Shravani, Ajithlal Sivalal, Sathyam Kurung','Hình Sự, Chính kịch','Ấn Độ','<p>Trong thế giới đầy hỗn loạn và bất công, Kuberaa – một người đàn ông mang trong mình nỗi đau quá khứ – vùng dậy chống lại giới tài phiệt và tham nhũng đang thao túng đất nước. Với sức mạnh, trí tuệ và lòng quả cảm, anh trở thành biểu tượng của công lý, khơi dậy hy vọng cho những kẻ bị lãng quên.</p>',0,0,17,0),(934,'Thế Giới Võ Hiệp: Kim Dung','https://img.ophim.live/uploads/movies/the-gioi-vo-hiep-kim-dung-thumb.jpg','The Legend of Heroes','completed','30','40 phút/tập','2024','HD',NULL,'','','Hành Động, Võ Thuật, Cổ Trang','Trung Quốc','<p>Bộ phim được ra mắt đúng dịp kỷ niệm 100 năm ngày sinh của nhà văn nổi tiếng nhất Trung Quốc Kim Dung, gồm 5 phần phim khác nhau được ấy cảm hứng từ tác phẩm của cố nhà văn: Đông Tà Tây Độc, Nam Để Bắc Cái, Hoa Sơn Luận Kiếm, Cửu Âm Chân Kinh, Thiết huyết đan tâm.</p><p>&nbsp;</p>',0,0,18,0),(935,'Sniper Standoff','https://img.ophim.live/uploads/movies/sniper-standoff-thumb.jpg','Sniper Standoff','completed','25','45 phút/tập','2013','HD',NULL,'','謝天華, 張兆輝, 徐子珊, 岑麗香, 周海媚, 陳煒, 張致恆, 林偉, Joe Junior, 雪妮','Hành Động, Hình Sự, Phiêu Lưu','Trung Quốc, Hồng Kông','Nội dung của phim Không Khoan Nhượng xoay quanh cuộc sống và công việc của một nhóm cảnh sát chuyên về bắn tỉa đang làm việc tại cục phòng chống tội phạm thành phố. Sự việc bắt đầu trở nên rắc rối xuất phát từ một chút mâu thuẫn không đáng có, cộng với lòng thù hằn đố kị, hai con người vừa là đồng đội vừa là bạn thân đã phải tách ra khỏi nhóm và hoạt động riêng lẻ, nhằm hướng mũi tên đối đầu về phía bạn mình. Một người ở lại còn người kia thì rời bỏ ngành và trở thành sát thủ máu lạnh làm thuê cho bọn Mafia, sau nhiều vụ ám sát kinh hoàng xảy ra trong thành phố, nhận thấy đây là vụ án đặc biệt nghiêm trọng ban chuyên án đã huy động lực lượng điều tra về sát thủ này.',1,0,12,0),(936,'Đội Bóng Tiếu Lâm','https://img.ophim.live/uploads/movies/doi-bong-tieu-lam-thumb.jpg','Funny Soccer','completed','1','Đang cập nhật','2016','HD',NULL,'Đang cập nhật','Hạc Thiệu Văn,  Trần Hạo Dân,  Tô Kiến Tín','Thể Thao','Trung Quốc','<p>Phim Đội Bóng Tiếu Lâm - Funny Soccer 2016: nhằm vực dậy tài chính các cầu thủ của đội bóng Chiến Thắng đồng ý thực hiện những màn quảng cáo có 1 không 2. Khó khăn được cải thiện nhưng thành tích vẫn dậm chân tại chỗ, vì người hâm mộ cả đội bóng quyết tâm dành chiến thắng ở trận chung kết.</p>',0,0,11,0),(937,'Kinh Thiên Đại Tặc Vương','https://img.ophim.live/uploads/movies/kinh-thien-dai-tac-vuong-thumb.jpg','Operation Billionaire','completed','1','83 Phút','1998','HD',NULL,'Andy Ng Yiu-Kuen','任達華, 姚樂怡, 吳廷燁, 譚耀文, Oscar Lam Wai-Kin, 黃柏文, 羅冠蘭, 傅楚卉, 曹永廉, 劉崇峯','Hình Sự, Chính kịch','Trung Quốc, Hồng Kông','Bộ phim kể về tên tội phạm nguy hiểm và mưu trí Trương Tử Hào, kẻ đã lên kế hoạch thực hiện hàng loạt vụ bắt cóc. Sau khi đồng bọn Diệp Thế Quan bị bắt, Trương Tử Hào quyết định bắt cóc chính trị gia Chung Phương An Tâm để trao đổi con tin. Tuy nhiên, kế hoạch thất bại, hắn bỏ trốn về nước...',0,0,17,0),(938,'Thiên Hạ Đệ Nhất Kiếm','https://img.ophim.live/uploads/movies/thien-ha-de-nhat-kiem-thumb.jpg','World\'s Finest','completed','35','45 phút/tập','2006','HD',NULL,'Vương Tinh','Lưu Đức Hoa, Cao Viên Viên, Hoắc Kiến Hoa, Trương Vệ Kiện, Lý Á Bằng, Huỳnh Thánh Y, Lưu Tùng Nhân','Võ Thuật, Cổ Trang','Trung Quốc','<p><i>Lấy bối cảnh vào thời nhà Minh, lúc này tiên hoàng đã hạ lệnh cho thiết đảm thần hầu Chu Vô Thị lập nên 1 tổ chức có tên Hộ Long Sơn Trang nơi tụ tập những kỳ tài để bảo vệ hoàng gia. Nơi đây vang danh bởi có 1 hệ thống tình báo thuộc hàng đệ nhất thiên hạ, dường như không có chuyện gì xảy ra trên đời mà họ không biết, qua nhiều năm thu thập Hộ Long Sơn Trang đã ghi lại thông tin của hàng vạn người kèm những bí mật của họ. Bên cạnh Thần Hầu có tứ đại mật thám họ là những cánh tay đắc lực thực hiện những nhiệm vụ khó khăn nguy hiểm chống lại thế lực đối đầu là Đông Xưởng để bảo vệ Hộ Long Sơn Trang cùng Hoàng Tộc. Thế nhưng đến cuối cùng họ nhận ra mình chỉ là con cờ bị người ta sai khiến nhằm vào âm mưu soán ngôi.</i></p>',0,0,18,0),(939,'Du Học Sinh Zero 2012','https://img.ophim.live/uploads/movies/du-hoc-sinh-zero-2012-thumb.jpg','Exchange Student Zero','completed','1','70 Phút','2012','HD',NULL,'Maurice Argiro, Patrick Crawley','Dee Bradley Baker, Rove McManus, Natalie Bond, Scott Edgar, Mark Hamill, Kate McLennan, Candi Milo, Peter Rowsthorn, Marg Downey, Jon Von Goes','Phiêu Lưu, Học Đường','Úc','<p>John Stitt và Max Cameron là hai cậu bé cuồng trò chơi bài \"Battle Day Zero\". Một ngày nọ, sự kết hợp giữa một cơn bão dữ dội và một gói tăng cường bí ẩn đột nhiên có nghĩa là họ có thể đưa Hiro, một trong những nhân vật của trò chơi vào thế giới của họ. Vừa phấn khích vừa lo lắng bí mật của mình sẽ bị phát hiện, hai cậu bé quyết định đưa Hiro đến trường, nơi cậu bị nhầm là một học sinh trao đổi người Nhật. Mặc dù đây là giải pháp tạm thời, nhưng việc cánh cổng mở ra có nghĩa là nhiều người và quái vật hơn từ thế giới của Hiro có thể du hành đến Trái đất, tàn phá thị trấn nhỏ. Hai cậu bé quyết định để mọi thứ trở lại bình thường, họ phải đưa Hiro trở lại nhưng không phải trước khi buổi khiêu vũ ở trường của họ tràn ngập các nhân vật Battle Day Zero.</p>',0,0,15,0),(940,'Cô Gái Tầng Dưới','https://img.ophim.live/uploads/movies/co-gai-tang-duoi-thumb.jpg','The Girl Downstairs','completed','22','12 phút/tập','2023','HD',NULL,'','','Học Đường','Trung Quốc','<p>Viên Quân Đường, một sinh viên năm nhất, đã nộp đơn vào Đại học Minsong để được gần gũi với chị gái Chu Thù, người mà anh ấy đã yêu thầm. Sau khi vô tình gặp Lý Thi Á, cựu thần tượng thì họ cùng nhau tạo thành một bộ ba bạn bè. Chu Thù rõ ràng nhận thấy sự ngưỡng mộ của Viên Quân Đường dành cho mình, nhưng cô không có đủ can đảm để đồng ý, và tránh mọi tiếp xúc với anh ấy, chỉ giữ khoảng cách như bạn bè</p>',0,0,15,0),(941,'ATRI -My Dear Moments','https://img.ophim.live/uploads/movies/atri-my-dear-moments-thumb.jpg','ATRI -My Dear Moments','ongoing','12','24 phút/tập','2024','HD',NULL,'','','Học Đường','Nhật Bản','<p>Trong tương lai gần, nước biển dâng đột ngột và không giải thích được đã khiến phần lớn nền văn minh nhân loại chìm trong nước. Ikaruga Natsuki, một cậu bé mất mẹ và chân trong một vụ tai nạn vài năm trước, vỡ mộng trở về sau cuộc sống khắc nghiệt ở thành phố lớn để tìm lại ngôi nhà quê cũ của mình đã bị biển nuốt chửng một nửa. Không có gia đình, tất cả những gì anh có mang tên mình là con tàu và tàu ngầm do bà nội hải dương học để lại cho anh và các khoản nợ của bà.\n\nHy vọng duy nhất của anh để khôi phục lại những giấc mơ cho tương lai mà anh đã đánh mất là tận dụng cơ hội do người đòi nợ đáng ngờ Catherine trao cho anh. Họ ra khơi tìm kiếm tàn tích bị chìm trong phòng thí nghiệm của bà ngoại anh nhằm tìm kiếm kho báu được đồn đại rằng bà đã để lại ở đó. Nhưng những gì họ tìm thấy không phải là của cải hay châu báu; đó là một cô gái kỳ lạ đang nằm ngủ trong quan tài dưới đáy biển. Atri.\n\nAtri là một người máy, nhưng vẻ ngoài và cảm xúc phong phú của cô sẽ đánh lừa bất cứ ai nghĩ rằng cô là một con người đang sống và đang thở. Để biết ơn vì đã được cứu, cô tuyên bố với Natsuki: \"Tôi muốn thực hiện mệnh lệnh cuối cùng của chủ nhân. Cho đến khi tôi làm được, tôi sẽ là chân của cậu!\"\n\nTại một thị trấn nhỏ đang dần bị đại dương bao bọc, một mùa hè khó quên sắp bắt đầu với chàng trai và cô gái robot bí ẩn này...</p>',0,0,15,0),(942,'Những công chúa trái cây (Phần 3)','https://img.ophim.live/uploads/movies/nhung-cong-chua-trai-cay-phan-3-thumb.jpg','Princess Power (Season 3)','completed','11','15 phút/tập','2024','HD',NULL,'','Trinity Bliss, Dana Heath, Madison Calderon, Alanna Ubach','Học Đường, Hài Hước','Âu Mỹ, Canada','After their coronation, the princesses have a new challenge: getting accepted to the Princess Adventure Academy! But first they must complete six quests.',0,0,15,0),(943,'Chủ Tịch Lớp 9','https://img.ophim.live/uploads/movies/chu-tich-lop-9-thumb.jpg','Level 9 Chairman','ongoing','12','45 phút/tập','2024','HD',NULL,'','','Tình Cảm, Học Đường','Hàn Quốc','<p>Một truyện tranh về đời sống học đường trong đó một học sinh phạm pháp tên Na I-soo trở thành hiệu trưởng của một ngôi trường ưu tú bị cha cậu để lại. Nó mô tả quá trình năng động của Na I-soo, người đã sống một cuộc đời khó khăn và là những học sinh ưu tú nhất của trường, tìm hiểu nhau và thay đổi.</p>',0,0,15,0),(944,'Code Geass: Hangyaku no Lelouch I - Koudou','https://img.ophim.live/uploads/movies/code-geass-hangyaku-no-lelouch-i-koudou-thumb.jpg',' Con đường thức tỉnh - Bstation Tập 1','completed','1','132 phút/tập','2017','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','The Holy Britannian Empire is a powerful nation that uses its military strength to expand its rule, and the small island nation of Japan is yet another victim. During a worldwide conflict in 2010 known as the Second Pacific War, the once-proud country was reduced to rubble and mockingly renamed to Area 11.\nHowever, one student plans to free Japan from Britannia&#39;s control through an extraordinary rebellion. His name is Lelouch Lamperouge, and he is fueled with hatred for the Empire, plotting to wipe its accursed name off the face of the planet. Lelouch&#39;s malicious plans are unexpectedly accelerated upon meeting the mysterious woman C.C., who grants him a supernatural ability known as Geass that makes anyone Lelouch commands unable to defy his will.\nNow armed with a devastating power, Lelouch assumes the persona of Zero, a revolutionary figure who carries the hopes and dreams of the oppressed around the world. He vows to restore the glorious nation of Japan and deliver divine retribution to Britannia.',0,0,15,0),(945,'Code Geass: Lelouch of the Rebellion - Rebellion','https://img.ophim.live/uploads/movies/code-geass-lelouch-of-the-rebellion-rebellion-thumb.jpg','Con đường tạo phản - Bstation Tập 1','completed','1','132 phút/tập','2018','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','Code Geass: Lelouch of the Rebellion - Rebellion',0,0,15,0),(946,'For Him','https://img.ophim.live/uploads/movies/for-him-thumb.jpg','For Him','completed','12','48 phút/tập','2023','HD',NULL,'Wayu Pattharawut Sangyahya','Dew Nitikorn Pankram, Tor Atagorn Sonyot, Fu Nattawat Nopphakornnattakrit, Jomtup Panuwat Somnam, Tong Supanut Sudjinda, Peet Atthaporn Uenthaweesab, Ryan Panya Mcshane, Toon Panisara Prinyarux, Ging Areeya Ponfutrakul, Baitoey Punnisa Sirisang, Yaya Mayura Ekrungruangkul, Nampetch Aissaree Tharakoolphipat, Peat Suchanon Chueluecha, Kong Kooppong Chumnanyong, Kla Nathawat Piyanonpong','Tâm Lý, Học Đường','Thái Lan','Mối quan hệ của tôi và anh ấy bắt đầu như tình một đêm, nhưng anh ấy không muốn nó kết thúc như vậy. Anh ấy ngày càng bước vào cuộc sống của tôi nhiều hơn và chẳng bao lâu sau, tôi nghĩ mình đã đầu hàng anh ấy. Được chuyển thể từ tiểu thuyết For Him (ยอมเป็นของฮิม) của newaccount.',0,0,15,0),(947,'Dead Friend Forever','https://img.ophim.live/uploads/movies/dead-friend-forever-thumb.jpg','Dead Friend Forever - DFF: Uncovered Version','completed','12','50 phút/tập','2023','HD',NULL,'Chookiat sakveerakul','Ta Nannakun Pakapatpornpob, Copper Phuriwat Chotiratanasak, Copper, Barcode Trinnasit Isarapongporn, JJ Patiphan Fueangfunuwat, JJ, Fuaiz Thanawat Shinawat, Fuaiz, Mio Athens werapatanakul, Mio, Us Nititorn Akkarachotsopon, Bump Pawat Akkradetsakul, Bump, JJ Chalach Tantijibul, Jet Jetsadakorn Bundit','Tâm Lý, Kinh Dị, Bí ẩn, Học Đường','Thái Lan','DFF: Dead Friend Forever xoay quanh câu chuyện về những người bạn cùng nhau đi du lịch đến một ngôi nhà nghỉ dưỡng giữa rừng để chia tay một người bạn sắp lên đường du học. Chuyến đi chia tay này khiến họ nhớ lại quá khứ và không thể ngờ rằng nó lại mang đến nhiều sự cố nguy hiểm đến tính mạng. Chẳng bao lâu, họ nhận ra đây không phải là một chuyến đi chia tay như đơn giản bình thường mà là một chuyến đi khủng khiếp với những thảm họa đang chờ đợi họ ở phía trước.',0,0,15,0),(948,'Thiếu Niên Minh Long','https://img.ophim.live/uploads/movies/thieu-nien-minh-long-thumb.jpg','The Hope','completed','30','44 phút/tập','2023','HD',NULL,'','','Hài Hước, Học Đường','Trung Quốc','<p>Nhằm phát huy tối đa tiềm năng của học sinh, Trường THPT Thực Nghiệm Minh Long, một ngôi trường tư thục tại thành phố Tinh Châu, đã thành lập lớp 12-11 do thầy giáo tiếng Anh xuất sắc Lôi Minh và cô giáo tâm lý Tang Hạ dẫn dắt. Lý Nhiên là một học sinh cấp 3 bình thường tại Trường THPT Minh Long. Từ nhỏ cậu đã mồ côi cha mẹ, vẫn luôn sống nương tựa cùng bà nội. Dù ốm yếu bệnh tật, bà nội vẫn chăm chỉ làm việc kiếm tiền, nhất quyết bắt cậu thi đại học để thực hiện giấc mộng robot của mình. Nhằm chữa bệnh cho bà, người cháu hiếu thảo Lý Nhiên có ý định bỏ học để kiếm tiền phụ giúp gia đình. Lôi Minh không bỏ mặc bất kỳ học sinh nào, cố gắng hết sức để ngăn Lý Nhiên bỏ học, đưa những học sinh có hoàn cảnh khó khăn như cậu và Trình Vũ Sam vào lớp 12-11. Để giúp học sinh thắp sáng lại ước mơ, Lôi Minh và Tang Hạ lần lượt bồi dưỡng cả trên phương diện giáo dục và tâm lý, tiến hành đào tạo theo năng lực, hướng dẫn học sinh hình thành thói quen học tập tốt. Họ giúp đỡ từng học sinh đối mặt với khó khăn, cải thiện quan hệ gia đình, đồng thời xây dựng thái độ lạc quan, từ đó giành được sự yêu mến và tin tưởng của học trò. Sau cùng, đám học trò Lý Nhiên đã nỗ lực hết mình và thi đỗ vào các trường đại học hằng mơ ước, bắt đầu hành trình mới trong cuộc đời.</p><p>&nbsp;</p>',0,0,15,0),(949,'My Hero Academia UA Heroes Battle','https://img.ophim.live/uploads/movies/my-hero-academia-ua-heroes-battle-thumb.jpg','僕のヒーローアカデミア「雄英ヒーローズ・バトル」','ongoing','1','23phút/tập','2023','HD',NULL,'','','Học Đường, Hành Động','Nhật Bản','My Hero Academia UA Heroes Battle',0,0,15,0),(950,'Bạn Học, Khi Nào Chuyển Đi Thế?','https://img.ophim.live/uploads/movies/ban-hoc-khi-nao-chuyen-di-the-thumb.jpg','My Annoying Roommate','completed','12','34 phút/tập','2023','HD',NULL,'Si Cheng','Quý Mỹ Hàm, Zhang Jia Shuo, Từ Tân, Shao Yu Qi, Shengyan Na','Gia Đình, Học Đường','Trung Quốc','<p>Vào học kỳ thứ hai của lớp 11, Tô Kiều 17 tuổi, đã chào đón người bạn cùng mới cùng bàn Ngôi sao nổi tiếng Lâm Tử Lộ. Tuy nhiên, ngay khi cậu ta xuất hiện,đã khiến Tô Kiềuphá sản</p>',0,0,15,0),(951,'Gái Hư Của Rokudo','https://img.ophim.live/uploads/movies/gai-hu-cua-rokudo-thumb.jpg','Rokudo\'s Bad Girls','completed','12','24 phút/tập','2023','HD',NULL,'','Gen Sato, Sumire Uesaka, Naomi Ohzora, Yuki Yomichi, Misato Matsuoka, Hitomi Sekine, Haruki Ishiya','Hài Hước, Học Đường, Hành Động','Nhật Bản','The story follows Tо̄suke Rokudо̄, a timid high school boy who gets bullied by delinquents. He receives a scroll from his late grandfather, leaving a mark on his forehead. The mark\'s effect causes a delinquent girl named Ranna Himawari to fall in love with him.',0,0,15,0),(952,'Thương Thần Tái Khởi','https://img.ophim.live/uploads/movies/thuong-than-tai-khoi-thumb.jpg','CROSS THE BATTLEFIELD','completed','1','1H27M55S','2023','HD',NULL,'戴希帆','Geng Yi Zhan, Xinghan Min, Chen Yu Nong, yangshiqian, Yue Xun Yu, Yiqian Zhang, Leo','Hài Hước, Học Đường','Trung Quốc, Anh','Cậu học sinh trung học Trầ Vũ Phi yêu thể thao điện tử nhưng chưa bao giờ được người cha ủng hộ. Trong một tai nạn, cha anh và Vương Khải đã hoán đổi danh tính, ban đầu muốn làm xáo trộn sự