h đẹp và thông minh. Mặt khác, bạn cùng lớp của cô, Izumi Miyamura, người buồn tẻ và hay buồn bã, thường được miêu tả là một &quot;fanboy thất bại&quot;. Nhưng hai thanh niên khác biệt đáng kể này học được rằng có nhiều khía cạnh trong mọi câu chuyện — và con người — khi Miyamura, người có vô số hình xăm và khuyên, đồng thời rất đẹp trai, đột ngột xuất hiện trước cửa nhà Hori...\nCâu chuyện lãng mạn ngọt ngào lại bắt đầu!',0,0,15,0),(957,'Dinosaur Love: Tình Yêu Khủng Long','https://img.ophim.live/uploads/movies/dinosaur-love-tinh-yeu-khung-long-thumb.jpg','Dinosaur Love','ongoing','8','45 phút/tập','2023','FHD',NULL,'Tonnam Piamchon Damrongsunthornchai, ZaanookJukkroww Nipitpon Muangsinun','Pepper Pongpat Unhapipatpong, Kakong Montree Pattarachitphinyo, Aomstin Thakrit Patthanaworakit, Mos Kitrawee Jiangthanaroj, Boss SUTTHIPAT THAUNTHONG','Tâm Lý, Học Đường','Thái Lan, Anh','Một tình yêu tình cờ khiến một anh chàng khó tính như \\\"Dino\\\" gặp được ý chung nhân \\\"Lack\\\". Mặc dù tên của anh ấy có nghĩa là \\\"tình yêu\\',0,0,15,0),(958,'Stella no Mahou','https://img.ophim.live/uploads/movies/stella-no-mahou-thumb.jpg','Magic of Stella','completed','12','24 phút/tập','2016','HD',NULL,'','Maria Naganawa, Ryoko Maekawa, Rie Murakawa, Ari Ozawa, Aoi Yuki','Học Đường','Nhật Bản','<p>Học sinh trung học năm nhất Tamaki Honda và câu lạc bộ SNS của cô ấy khi họ làm việc cùng nhau để tạo ra một trò chơi tự xuất bản. Với Tamaki là họa sĩ minh họa của dự án, cô ấy làm việc cùng với các thành viên khác (khá đặc biệt) của câu lạc bộ, bao gồm Shiina (chủ tịch câu lạc bộ và lập trình viên trò chơi), Ayame (người viết kịch bản), Kayo (nhà soạn nhạc của họ) và Yumine (các chàng trai của câu lạc bộ). \' chuyên gia tình yêu).</p>',0,0,15,0),(959,'I Am Your King 2','https://img.ophim.live/uploads/movies/i-am-your-king-2-thumb.jpg','I Am Your King 2','completed','10','30 phút/tập','2023','HD',NULL,'Kapper Worarit Ninklom','Boat Anakame Binsaman, Net Thanachar Paosung, Ryu Jessadakorn Kriangsamut, Yut Kritsadayut Thaweechaiwat','Tâm Lý, Học Đường','Thái Lan','<p>I am your KING 2</p>',0,0,15,0),(960,'I Am Your King 1','https://img.ophim.live/uploads/movies/i-am-your-king-1-thumb.jpg','I Am Your King 1','completed','5','25 phút/tập','2023','HD',NULL,'Kapper Worarit Ninklom','Newyear Kitiwhut Sawutdimilin, Mark Siwat Jumlongkul, สิวัฒน์จุลมกุล, Mark, Kris Krit Songsamphant, Best Vittawin Veeravidhayanant, Us Nititorn Akkarachotsopon, M Phurin Ruangvivatjarus','Tâm Lý, Học Đường','Thái Lan','<p>I am your KING 1</p>',0,0,15,0),(961,'Star Struck: Truy Tinh','https://img.ophim.live/uploads/movies/star-struck-truy-tinh-thumb.jpg','Star Struck','ongoing','8','20 phút/tập','2023','HD',NULL,'Park Seon Jae','Zu Ho, Chae Soo-ah, Park Tae-in, KWON SAN','Tâm Lý, Học Đường','Hàn Quốc, Anh','Nơi duy nhất mà hai thiếu niên tội nghiệp có thể thư giãn là sân chơi dưới bầu trời đêm đầy sao. Han-joon ban đầu nghĩ rằng anh ấy là người duy nhất sẽ nhìn thấy bầu trời đầy sao ở đó, nhưng anh ấy không biết rằng có những người khác cũng đã thấy. Han-joon chào người ấy mà không ngờ lại nhận lại được câu trả lời. Dưới bầu trời đêm đầy sao, hai thiếu niên cô đơn và bất hạnh, Han-joon và Yoo-jae đã gặp nhau.\\nSau khi Han-joon và Yoo-jae gặp nhau lần đầu tiên ở trường cấp hai, họ cùng học tại một trường cấp 3 và nỗ lực thi đỗ cùng một trường đại học. Cùng với  Yoon Chae-young,  Park Jin-hwan và Lee Ing-yu. Họ trải qua cuộc sống thú vị và vui vẻ. Tuy nhiên, Han-joon luôn cảm thấy khoảng thời gian thú vị nhất là khoảng thời gian anh dành cho Yoo-jae. Vì vậy, một ngày Hanjun nhận ra rằng tình cảm của mình dành cho Yoo-jae không chỉ là tình bạn... Một ngày nọ, Chaeyoung quyết định thổ lộ tình cảm của mình. Han-joon trở nên quẫn trí sau khi biết tin. Nhận ra tình cảm thực sự của mình, Han-joon quyết định bày tỏ trái tim mình... Đối với một thiếu niên, đây là một tình bạn độc nhất vô nhị, nhưng đối với một người khác, đó là một tình yêu độc nhất vô nhị. Câu chuyện về một thiếu niên tỏa sáng như một ngôi sao bắt đầu từ đây...',0,0,15,0),(962,'Chắp Cánh','https://img.ophim.live/uploads/movies/chap-canh-thumb.jpg','Fly, Again','completed','10','30 phút/tập','2021','HD',NULL,'Oh Chung Pung','Kim Myung-ji, Chae Hyung-won, Lee Seung-heon, Bae Hyeon-jun, Kim Ha-jun, Woo Han-moe, Park Eun-hye, Tony An','Tình Cảm, Học Đường','Hàn Quốc','<p>Với ước mơ trở thành một người nổi tiếng không ngừng thúc đẩy anh ấy về phía trước, Han Yo Han quyết định đã đến lúc chuyển đổi từ một vũ công thiên tài thành một thần tượng tài năng toàn diện. Để theo đuổi ước mơ của mình tốt hơn, anh chuyển đến trường Trung học Nghệ thuật Hanbit. Thật không may, mọi thứ đối với Yo Han không diễn ra suôn sẻ tại ngôi trường mới của cậu ấy, đặc biệt là sau một tai nạn đáng tiếc đã đánh cắp ước mơ cả đời của cậu ấy.</p>',1,0,15,0),(963,'Đây Không Phải Là Kéo Co Sao?','https://img.ophim.live/uploads/movies/day-khong-phai-la-keo-co-sao--thumb.jpg','Let\'s Tug It!','completed','24','45 phút/tập','2023','FHD',NULL,'Trương Lộ Nam','Trần Kinh Kha, Dịch Đại Thiên, Âm Tiểu Thiên, Lâm Tân Di, Mã Ngọc Khiết, Bạn Hạo Nhiên','Học Đường','Trung Quốc','<p>Minh Thừa Đại Bội là một câu lạc bộ không nổi tiếng, huấn luyện viên \"không đáng tin cậy\" Lôi Minh đã tập hợp 8 tân binh đều có những mục đích riêng để thành lập một đội, họ ngẫu hứng tham gia thi đấu chuyên nghiệp. Họ đã bị đánh bại và chế giễu trong trận chiến đầu tiên . Qúa trình chiến đấu, va vấp rồi trưởng thành, đồng thời có được tình bạn, vậy làm thế nào để họ tiếp tục và hoàn thành thỏa thuận ban đầu?</p>',0,0,15,0),(964,'Chàng Phản Diện Dễ Thương','https://img.ophim.live/uploads/movies/chang-phan-dien-de-thuong-thumb.jpg','Cute Bad Guy','completed','23','20 phút/tập','2023','FHD',NULL,'Tian Tian','Zhang Yi Jie, Wang Er Yi Xuan','Tâm Lý, Viễn Tưởng, Học Đường','Trung Quốc, Anh','Câu chuyện kể về Hạ Vũ Manh, một họa sĩ truyện tranh là bà hoàng suy diễn, người sẵn sàng làm người tàng hình cả đời, Thẩm Minh Hề, đại boss phản diện được tạo ra trong truyện tranh tự giải trí của cô, trong một thời khắc bất thường đã xuyên không từ thế giới truyện tranh đến thế giới thật của cô, vừa phù hợp với thiết lập nhân vật trong truyện tranh, vừa mắc chứng mất trí nhớ kỳ lạ. Người tạo ra anh, Hạ Vũ Manh chỉ có thể chịu trách nhiệm cho Hàn Lỗi. Trong cơn hoảng loạn, cô đã để tên ác nhân này xen vào mối quan hệ của mình với nam thần trong mơ của mìn là Nhậm Vân Kiệt. Người bạn thân thiết nhất của cô là Viên Y Lâm và anh trai chân chó của họ Thẩm, Hàn Phi Dương liên tục thêm cảnh. Sau khi trải qua nhiều quảng thời gian ở chung , Hạ và Thẩm càng thêm tương ái tương sát, sống chết dính vào một chỗ. Vì hạnh phúc cuối cùng và hòa bình thế giới,Hạ Vũ Manh quyết định thực hiện kế hoạch cải tạo bạn trai phản diện, biến Thẩm Minh Hề thành một chàng trai tốt ở thế kỷ 21...',0,0,15,0),(965,'Vì Nhớ (ReminderS)','https://img.ophim.live/uploads/movies/vi-nho-reminders-thumb.jpg','ReminderS','completed','3','30 phút/tập','2023','FHD',NULL,'New Siwaj Sawatmaneekul','Chonlathorn Kongyingyong, Nawat Phumphothingam, Perth Tanapon Sukhumpantanasan, Saint Suppapong Udomkaewkanjana, Mean Phiravich Attachitsataporn, Plan Rathavit Kijworalak','Học Đường','Thái Lan, Anh','Vì Nhớ (ReminderS) kể về câu chuyện của Noh và Phun, giờ họ đã trưởng thành và là sinh viên đại học. Son và Pin đang yêu nhau và phải đối mặt với những vấn đề như ghen tuông, tự tin và tin tưởng. Còn Wish và Two là một cặp đôi mới bắt đầu mối quan hệ của họ.',0,0,15,0),(966,'Alice Gear Aegis Expansion','https://img.ophim.live/uploads/movies/alice-gear-aegis-expansion-thumb.jpg','アリス・ギア・アイギス Expansion','ongoing','15','24 phút/tập','2023','HD',NULL,'','','Học Đường','Nhật Bản','Thời gian là tương lai, dưới sự tấn công bất ngờ của dạng sống máy móc &quot;Weiß&quot;, con người buộc phải thoát khỏi trái đất và tiến vào vũ trụ. Trong thời gian chạy trốn, Space Fleet SHARD đã phát triển thành công Alice Gear, một bộ giáp có thể cho phép con người chiến đấu chống lại Weiß, và gọi những người phụ nữ xuất sắc phù hợp để vận hành họ là Actress.\nThời gian trôi qua, Actress của các doanh nghiệp tư nhân cũng có thể làm việc để trục xuất Weiß sau khi được tổ chức Weiß &quot;AEGiS&quot; công nhận, và đây cũng là khởi đầu của câu chuyện về những cô gái với &quot;Alice Gear&quot; cứu những người lang thang trong vũ trụ!',0,0,15,0),(967,'Sau khi có được năng lực bá đạo ở dị giới, tôi cũng vô đối ở thế giới thực ~Thăng cấp xong thì cuộc đời cũng thay đổi~','https://img.ophim.live/uploads/movies/sau-khi-co-duoc-nang-luc-ba-dao-o-di-gioi-toi-cung-vo-doi-o-the-gioi-thuc-thang-cap-xong-thi-cuoc-doi-cung-thay-doi-thumb.jpg','異世界でチート能力を手にした俺は、現実世界をも無双する ～レベルアップは人生を変えた～','ongoing','13','24 phút/tập','2023','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','Yuya Tenjo là một thanh niên bị đối xử tàn nhẫn từ khi còn nhỏ, khi anh ta tuyệt vọng muốn sống thì &quot;cánh cổng đến dị giới&quot; đã mở ra cho anh ta! Ở phía bên kia của cánh cổng là [Vương quốc quỷ vĩ đại] nơi những con quái vật hung dữ tràn lan\n\nỞ một thế giới khác, anh đã giải cứu công chúa khỏi tay yêu quái và trở thành chủ đề bàn tán sôi nổi của người dân trên khắp đất nước...? Trong thế giới thực, nhiều cô gái bắt đầu nhiệt tình theo đuổi anh ấy...! ?\n\nDị giới × thế giới thực, ──Câu chuyện giả tưởng về đảo ngược cuộc sống bắt đầu từ đây!',0,0,15,0),(968,'The Dangers in My Heart','https://img.ophim.live/uploads/movies/the-dangers-in-my-heart-thumb.jpg','僕の心のヤバイやつ','ongoing','1','23 phút/tập','2023','HD',NULL,'','','Tình Cảm, Học Đường','Nhật Bản','Ichikawa Kyotaro, một người đàn ông tốt bụng và có khả năng cảm nhận âm thanh, rất quan tâm đến cô gái xinh đẹp Anna Yamada. Qua quan sát, đã phát hiện ra một khía cạnh bất ngờ của Yamada... Liệu điều kỳ diệu có xảy ra? ? Bằng cách này, tuổi trẻ của Kyotaro bắt đầu thay đổi rất lặng lẽ...',0,0,15,0),(969,'Yêu Yamada ở Lv999!','https://img.ophim.live/uploads/movies/yeu-yamada-o-lv999d-thumb.jpg','My Love Story With Yamada-kun at Lv999','ongoing','13','24 phút/tập','2023','HD',NULL,'','','Tình Cảm, Học Đường','Nhật Bản','My Love Story With Yamada-kun at Lv999',0,0,15,0),(970,'Khoa Học Về Tình Yêu','https://img.ophim.live/uploads/movies/khoa-hoc-ve-tinh-yeu-thumb.jpg','The Science of Falling in Love','completed','24','45 phút/tập','2023','FHD',NULL,'Hao Fei Huan','Ngô Giai Di, Lưu Dịch Sướng, Trần Hạo Lam, Wu Fei','Học Đường','Trung Quốc, Anh','Tại Đại học Khoa học và Công nghệ Đông Nam, một trường kỹ thuật nổi tiếng trong nước, tỷ lệ nam nữ là 7:1 , vậy mà sinh viên ngành sinh vật Tô Trinh Trinh chưa bao giờ có thể thoát ế. Cho đến một ngày, một loạt cuộc gặp gỡ kỳ lạ, lãng mạn và kỳ diệu giữa Tô Trinh Trinh và \\\"thần nghiên cứu khoa học\\\" Tiêu Vũ Hà đã diễn ra. Do bốc đồng, Trinh Trinh đã đến gặp Vũ Hà và ttỏ tình: \\\"Em thích anh\\\". Thật bất ngờ, cô được đưa vào phòng thí nghiệm não bộ và trí thông minh, để thử nghiệm, bằng cách sử dụng các phương pháp khoa học như khoa học não bộ, y học thần kinh và tâm lý học để xác minh \\\"tình cảm\\\" của cô dành cho anh. Tuy nhiên, trong một thí nghiệm tình yêu được cho là ngọt ngào, Trinh Trinh phát hiện ra rằng Vũ Hà đầy \\\"ác ý\\\"...',0,0,15,0),(971,'Giai Điệu Trên Triền Dốc','https://img.ophim.live/uploads/movies/giai-dieu-tren-trien-doc-thumb.jpg','Kids on the Slope Sakamichi no Apollon','completed','12','23 phút/tập','2012','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Đầu mùa hè năm 1966, do công việc của ba, cậu học sinh trung học năm nhất Kaoru Nishimi, một mình tới Sasebo để sống với người họ hàng. Như duyên số, cậu gặp Sen - \"bad boy\" thứ thiệt, cậu Ấm dần mở lòng và thay đổi bản thân. Tình yêu với Jazz, là cầu nối giúp Ấm tìm ra người bạn thực sự của cuộc đời mình.</p>',0,0,15,0),(972,'Robotics;Notes','https://img.ophim.live/uploads/movies/roboticsnotes-thumb.jpg','ROBOTICS;NOTES','completed','22','23 phút/tập','2012','HD',NULL,'','','Hành Động, Viễn Tưởng, Học Đường','Nhật Bản','<p>CLB Robot của trường Chuuoutanegashima đang đứng trước nguy cơ giải tán. CLB chỉ có 2 thành viên là Kaito Yashio, 1 nam sinh chỉ chăm chỉ chơi game đối kháng robot, và ko quan tâm đến CLB. 1 nữ sinh ăn hại, táo bạo có tên Akiho Senomiya, muốn hoàn thành chế tạo 1 con robot. 1 ngày kia Kaito phát hiện ra 1 bản báo cáo viết về A.R. (Artificial Resistance), trong này còn có 1 bản cáo trạng về âm mưu của người có tên Kou Kimishima.</p>',1,0,15,0),(973,'Thần Thám Trốn Học','https://img.ophim.live/uploads/movies/than-tham-tron-hoc-thumb.jpg','DETECTIVE CHEN','completed','1','92 Phút','2022','HD',NULL,'Thích Tiểu Long','Thích Tiểu Long, Collin Chou, Liu Tian Zuo, Steven Hao, Norman Chui, Huang Qiao, Zhang Hao Yu','Hành Động, Bí ẩn, Học Đường','Trung Quốc','<p>Một vụ giết người kỳ lạ xảy ra ở trường trung học St. Martin. Hà Mạn Quân, con trai của Bộ trưởng Bộ Quân sự và Chính trị đã chết một cách kỳ lạ. Viên cảnh sát Trần Hổ nhận nhiệm vụ và bí mật điều tra sự thật trong trường. Khuôn viên tưởng chừng yên bình lại ngấm ngầm dậy sóng, thầy trò chia bè kết phát, nhưng lại có thể cùng nhau chống lại kẻ thù bên ngoài, người ta nghi ngờ người bạn gái bị bắt từng báo cảnh sát bắt Hà Mạn Quân vì tội cưỡng hiếp. Người đàn ông đeo mặt nạ với thân thủ nhanh nhẹn, những tranh chấp dai dẳng của xã hội đen, cô giáo dịu dàng quyến rũ, và học sinh xinh đẹp đáng thương, mối quan hệ giữa họ và vụ án giết người là gì? Với những nỗ lực của Trần Hổ, bí mật ẩn giấu cuối cùng đã được tiết lộ, nhưng vụ án ngày càng trở nên phức tạp và khó hiểu, mạng người hóa ra chỉ là phần nổi của tảng băng chìm, và sự thật thực sự chỉ ra một thứ khác.</p>',0,0,15,0),(974,'Nhất Quỷ Nhì Ma, Thứ Ba Takagi - Movie','https://img.ophim.live/uploads/movies/nhat-quy-nhi-ma-thu-ba-takagi-movie-thumb.jpg','劇場版 からかい上手の高木さん','ongoing','1','72 phút/tập','2023','HD',NULL,'','','Tình Cảm, Hài Hước, Học Đường','Nhật Bản','<p>Mùa hè cuối cùng của Takagi và Nishikata ở trường trung học cơ sở sắp bắt đầu, và nó đã có một khởi đầu ấm áp! Khi cặp đôi tìm thấy một chú mèo con bị bỏ rơi, họ quyết định cùng nhau chăm sóc người bạn đồng hành mới đáng yêu của mình cho đến khi tìm được người mẹ mất tích của nó. Trong khi tìm kiếm, họ cũng có những cảm nhận mới về mối quan hệ của mình.</p>',0,0,15,0),(975,'Kubo Không Để Tôi Vô Hình','https://img.ophim.live/uploads/movies/kubo-khong-de-toi-vo-hinh-thumb.jpg','Kubo Won\'t Let Me Be Invisible','ongoing','12','24 phút/tập','2023','HD',NULL,'','','Tình Cảm, Học Đường','Nhật Bản','<p>Học sinh trung học Junta Shiraishi có một mục tiêu đơn giản là sống một tuổi trẻ viên mãn. Trên thực tế, sự vắng mặt của Shiraishi nghiêm trọng đến mức mọi người nghĩ rằng chỗ ngồi của anh ấy trong lớp luôn trống và lầm tưởng rằng anh ấy thường trốn học. Thậm chí còn có một tin đồn kỳ lạ, cho rằng những ai nhìn thấy Shiraishi sẽ được ban phước lành. Người duy nhất nhận ra sự tồn tại của anh ấy là Nagisa Kubo, cô gái ngồi cạnh anh ấy. Tuy nhiên, thật không may cho anh ấy, Kubo thích trêu chọc anh ấy hàng ngày. Khi những trò hề khôi hài của Kubo tiếp tục liên quan đến Shiraishi, anh ấy có thể sớm phát hiện ra rằng tuổi trẻ của mình có thể không nhàm chán như anh ấy nghĩ ban đầu?</p>',0,0,15,0),(976,'Thiên Sứ nhà bên','https://img.ophim.live/uploads/movies/the-angel-next-door-spoils-me-rotten-thumb.jpg','The Angel Next Door Spoils Me Rotten','ongoing','12','24 phút/tập','2023','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Sau khi bị cảm lạnh khi đưa chiếc ô duy nhất của mình cho một cô gái đang ngồi dưới mưa, Amane Fujimiya chỉ mong cô ấy cuối cùng sẽ trả lại nó. Tuy nhiên, Mahiru Shiina, \"Thiên thần\" của trường Amane và là hàng xóm của cậu, lại cho cậu nhiều hơn thế. Từ duy nhất Mahiru tìm thấy trong miệng để mô tả sự hỗn loạn là \"khó coi\". Nhưng bất chấp sự miêu tả không thiện cảm của cô ấy, Mahiru vẫn tiếp tục giúp đỡ Amane đang vô vọng. Có điều gì mà Thiên sứ không làm được không?</p>',0,0,15,0),(977,'Kẻ Ngoại Lai Ở Học Viện Ma Vương (Phần 2)','https://img.ophim.live/uploads/movies/the-misfit-of-demon-king-academy-ii-thumb.jpg','The Misfit of Demon King Academy Ⅱ: Raja Iblis Terkuat dalam Sejarah Bereinkarnasi dan Bersekolah dengan Keturunannya','ongoing','24','24 phút/tập','2023','HD',NULL,'','','Tình Cảm, Viễn Tưởng, Học Đường','Nhật Bản','<p>The Misfit of Demon King Academy II Để chấm dứt cuộc xung đột bất tận giữa con người và ác quỷ, Quỷ vương Anos Voldigoad sẵn sàng hy sinh mạng sống của mình, với hy vọng được tái sinh trong một tương lai hòa bình. Để chuẩn bị cho sự trở lại của vị vua của họ, quỷ tộc đã thành lập Học viện Quỷ vương, một tổ chức ưu tú có nhiệm vụ xác định danh tính của Anos khi anh ta tỉnh lại. Anh ta tái sinh hai thiên niên kỷ sau đó, nhưng thật ngạc nhiên, anh ta sớm biết rằng mức độ ma thuật trên thế giới đã suy giảm nghiêm trọng trong thời gian anh ta vắng mặt ...</p>',0,0,15,0),(978,'Đừng Chọc Anh Nữa Mà, Nagatoro! Phần 2  ','https://img.ophim.live/uploads/movies/dont-toy-with-me-miss-nagatoro-2nd-attack-thumb.jpg',' Don\'t Toy with Me, Miss Nagatoro 2nd Attack','ongoing','12','24 phút/tập','2023','HD',NULL,'','','Tình Cảm, Hài Hước, Học Đường','Nhật Bản','<p>Một ngày nọ, \"Senpai\" đến thư viện sau giờ học và trở thành mục tiêu của một đàn em siêu bạo dâm! Tên của cô gái hay trêu chọc, hành hạ và trêu ngươi Senpai là \"Nagatoro!\" Cô ấy phiền phức nhưng đáng yêu. Đây là câu chuyện về một cô gái cực kỳ bạo dâm và thất thường và bạn sẽ cảm thấy có điều gì đó được đánh thức bên trong bạn!</p>',0,0,15,0),(979,'Lớp Học Điệp Viên','https://img.ophim.live/uploads/movies/spy-classroom-thumb.jpg','Spy Classroom','ongoing','12','24 phút/tập','2023','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Lily, một cô gái xinh đẹp với những lọn tóc trắng, là sinh viên của một trong nhiều học viện đào tạo thanh niên trở thành điệp viên có năng lực. Thật không may, không có kỹ năng thực tế nào để nói đến, hy vọng tốt nghiệp của cô ấy rất ảm đạm cho đến khi cô ấy được trao cơ hội gia nhập đội bí ẩn \"Tomoshibi\" và tham gia vào Nhiệm vụ bất khả thi. Lily chết lặng khi đến Cung điện Kagerou và mục đích thực sự của Tomoshibi cũng như tình thế vô vọng của nó được đưa ra ánh sáng. Được tham gia bởi các nữ điệp viên có vấn đề khác cùng với một thanh niên bí ẩn dẫn đầu chiến dịch, Lily nhận ra rằng đây không phải là cuộc vượt ngục lý tưởng mà cô đã hình dung.</p>',0,0,15,0),(980,'kỷ lục lạ về kỵ sĩ không đầu','https://img.ophim.live/uploads/movies/ky-luc-la-ve-ky-si-khong-dau-thumb.jpg','The tale of the headless horseman','completed','25','25 phút/tập','2010','HD',NULL,'','','Học Đường','Trung Quốc','<p>Tokyo, Ikebukuro. Ryanomine Teijin trẻ tuổi khao khát cuộc sống thành thị đã nhận lời mời từ người bạn Masaomi Kida, người đã chơi với anh từ thời thơ ấu, rời quê hương và đến Tokyo để vào Học viện Ikebukuro Raira. Và ở Ikebukuro, có một số người không thể khiêu khích, đặc biệt là Shizuo Heiwajima, người được mệnh danh là \"mạnh nhất\" và Rinya Orihara, người điều hành phòng thông tin. Ngoài ra, ở Ikebukuro còn có một tổ chức bạo lực không xác định được gọi là \"Dollars\". Tuy nhiên, vào ngày đầu tiên đến Bắc Kinh, Teijin, người bị xáo trộn bởi mối quan hệ phức tạp ở Ikebukuro, đã chứng kiến ​​​​huyền thoại đô thị \"Kỵ sĩ không đầu\" -Selti Stroud, cưỡi một chiếc mô tô màu đen qua đường. Elson. Vì vậy, khi các vụ sát nhân lần lượt xảy ra ở Ikebukuro, Heiwajima Shizuo, Orihara Rinya, Dollars, Headless Horseman, Slasher, Yellow Turban, v.v. dần dần nổi lên xung quanh \"Ai là kẻ mạnh nhất ở Ikebukuro\". Chủ đề, Ikebukuro đang đối mặt với sự sụp đổ, một loạt các câu chuyện bất thường nhưng thẳng thắn bắt đầu.</p>',0,0,15,0),(981,'Xin Chào, Ngày Hôm Qua','https://img.ophim.live/uploads/movies/xin-chao-ngay-hom-qua-thumb.jpg','Never Grow Old','ongoing','24','45 phút/tập','2022','HD',NULL,'Cao Hy Hy','Quách Tuấn Thần, Nhậm Mẫn, Tôn Y Hàm','Tình Cảm, Học Đường','Trung Quốc','<p>Bối cảnh phim diễn ra vào những năm 90, cái thời mà mạng xã hội chưa len lỏi vào cuộc sống, xoay quanh những câu chuyện thú vị của các bạn trẻ ở khu phố Tiểu Cát. Họ bên nhau cùng cười, cùng vượt qua khó khăn, cùng nhau trải qua thời thanh xuân tươi đẹp nhưng ngắn ngủi, rồi lặng lẽ trưởng thành để đi tìm con đường của riêng mình.</p>',0,0,15,0),(982,'Mật Mã Lệch Lạc','https://img.ophim.live/uploads/movies/mat-ma-lech-lac-thumb.jpg','The Warp Effect','ongoing','12','50 phút/tập','2022','FHD',NULL,'Jojo Tichakorn Phukhaotong, Ninew Pinya Chookamsri','Sing Harit Cheewagaroon, New Thitipoom Techa-apaikhun, Fah Yongwaree Anilbol','Tình Cảm, Hài Hước, Chính kịch, Học Đường','Thái Lan','<p>Alex là một cậu bé mười bảy tuổi nhút nhát, vẫn còn là trinh nữ duy nhất trong nhóm bạn của mình. Nhiều nỗ lực để mất trinh tiết của anh ấy đều thất bại một cách vui nhộn. Một ngày nọ, anh ta thức dậy và thấy mình ở một môi trường khác, nơi anh ta không còn là một trinh nữ nữa mà là một chuyên gia về các mối quan hệ tình dục và một bác sĩ phụ khoa. Tuy nhiên, những người bạn cũ của anh ấy ghét anh ấy không rõ lý do và thân thiết với một nhóm người mới. Ngoài ra, một tập hợp các hình ảnh bí ẩn xuất hiện có thể cung cấp manh mối về những gì đã xảy ra cho sự biến đổi này. Alex có thể giải quyết những cuộc cãi vã với những người bạn cũ của mình và giải quyết bí ẩn của những bức ảnh không?</p>',0,0,15,0),(983,'Bài Học Tình Yêu Thứ 9','https://img.ophim.live/uploads/movies/bai-hoc-tinh-yeu-thu-9-thumb.jpg','Lesson in Love','completed','12','55 phút/tập','2022','FHD',NULL,'Wang Li Wen','Hsu Wei Ning, Edward Chen, Yin Shin, Hsueh Shih Ling, Wang Yu Ping, Kota, Lin Yu Shu, Yang Chen, Chang Chin Lan','Tâm Lý, Gia Đình, Học Đường','Đài Loan','<p>Nữ giáo viên mới trở thành mục tiêu bắt nạt học sinh tài năng. Nhưng những cuộc đối đầu của họ nhanh chóng phát triển thành một chủ đề lãng mạn và họ bắt đầu có một mối tình bí mật khiến tình cảm của họ diễn ra nhanh chóng và lỏng lẻo.</p>',0,0,15,0),(984,'Người Hùng Yếu Đuối','https://img.ophim.live/uploads/movies/nguoi-hung-yeu-duoi-thumb.jpg','Weak Hero Class 1','completed','8','45 phút/tập','2022','HD',NULL,'Yoo Soo-Min','Park Ji-Hoon, Choi Hyun-Wook, Hong Kyung, Lee Yeon, Shin Seung-Ho','Tâm Lý, Học Đường','Hàn Quốc','<p>Một học sinh gương mẫu, đứng đầu trường trung học của mình. Về mặt thể chất, Yeon Shi-Eun trông giống như một cậu bé yếu đuối, nhưng bằng cách sử dụng trí thông minh, công cụ và tâm lý của mình, anh ấy chiến đấu chống lại bạo lực diễn ra bên trong và bên ngoài trường học của mình.</p>',2,0,15,0),(985,'Những Đứa Trẻ Nhà Giàu','https://img.ophim.live/uploads/movies/nhung-dua-tre-nha-giau-thumb.jpg','Rich Kids','completed','1','96 phút','2017','HD',NULL,'','','Phiêu Lưu, Bí ẩn, Học Đường','Âu Mỹ','<p>Một nhóm thanh thiếu niên sống trong một cộng đồng thu nhập thấp đột nhập vào \\</p>',0,0,15,0),(986,'Gặp Được Em','https://img.ophim.live/uploads/movies/gap-duoc-em-thumb.jpg','ALMOST LOVE','completed','1','109 Phút','2022','HD',NULL,'LuoLuo','Li Wen Han, Từ Nhược Hàm, Wang Bo Wen, Gao Qiu Zi, Michelle, Chen Tian Ming, Hoi Lin, Andrew Lin, Tan Kai, Miao Fu, Wei Qing, Michelle','Tình Cảm, Tâm Lý, Học Đường','Trung Quốc','<p>Ở tuổi thanh xuân tươi đẹp nhất, một cô gái gặp một chàng trai muốn dũng cảm mà yêu.\\nNăm 18 tuổi, Dư Kiêu Dương, người bị bạn bè chế giễu là \\\"thùng rác\\</p>',0,0,15,0),(987,'Ba đến rồi!','https://img.ophim.live/uploads/movies/ba-den-roi-thumb.jpg','DAD IS HERE','completed','1','90 phút','2022','HD',NULL,'劉海亮','Zhou Xiao Ou, SATO','Tâm Lý, Viễn Tưởng, Gia Đình, Học Đường','Trung Quốc','<p>Bộ phim kể về câu chuyện của một người cha \\\"không đáng tin cậy\\\" và một cô con gái \\\"siêu nghiêm túc\\\" đã vô tình hoán đổi thân xác vì một tờ vé số ma thuật. Người cha \\\"trở thành\\\" con gái đang tuổi ăn học và quậy phá trường học, trong khi con gái học bá \\\"thay\\\" cha chấn chỉnh các ngõ ngách. Họ đã thực sự hiểu nhau hơn trong cuộc sống lộn xộn vui nhộn khó xử và đáng xấu hổ này, đây là sự hòa giải giữa \\\"đứa con gái kiêu hãnh\\\" và \\\"người cha thất bại\\</p>',0,0,15,0),(988,'Nhà Có Năm Nàng Dâu (Phim Điện Ảnh)','https://img.ophim.live/uploads/movies/nha-co-nam-nang-dau-phim-dien-anh-thumb.jpg','5-toubun no Hanayome Movie','completed','1','136 phút/tập','2022','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Gia sư thiếu niên Fuutaro Uesugi cuối cùng phải lựa chọn giữa 5 chị em gái Nakano - những người đều có tình cảm với anh. Tại Lễ hội Văn hóa sắp tới của trường; sự kiện sẽ dẫn đến đám cưới của anh với một trong số họ.</p>',0,0,15,0),(989,'4-nin wa Sorezore Uso wo Tsuku','https://img.ophim.live/uploads/movies/4-nin-wa-sorezore-uso-wo-tsuku-thumb.jpg','Four People and Their Respective Lies','ongoing','11','23 phút/tập','2022','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Câu chuyện hài hước về bốn người là bạn bè của nhau ở một trường nữ sinh. Mỗi người trong số họ đều sở hữu một bí mật cho riêng mình. Thoạt nhìn, họ chỉ là những nữ sinh bình thường. Nhưng thật ra, họ lại là một nhóm kỳ quặc gồm một người ngoài hành tinh, một ninja không thuộc gia tộc nào, một siêu năng lực gia và một cậu bé mặc đồ nữ.</p>',0,0,15,0),(990,'Chàng Trai Năm Ấy Tôi Từng Nhớ','https://img.ophim.live/uploads/movies/chang-trai-nam-ay-toi-tung-nho-thumb.jpg','I Once Remembered That Guy','completed','48','45 phút','2021','HD',NULL,'','Châu Kha Vũ, Châu Đan Ni Trát, Chu Lâm Vũ, Phong Sở Hiên','Tình Cảm, Hài Hước, Học Đường','Trung Quốc','<p>Bộ phim Chàng Trai Năm Ấy Tôi Từng Nhớ - I Once Remembered That Guy xoay quanh câu chuyện kể về một nhóm bạn học cấp ba, trong nỗ lực thực hiện ước mơ và khuyến khích lẫn nhau, một loạt các thói quen đủ mọi chuyện ngọt ngào và xoắn xuýt đã xảy ra, họ đã đoàn kết và hòa giải với nhau và trở thành bạn tốt trong nhiều năm.</p>',0,0,15,0),(991,'Ái Tình Flops','https://img.ophim.live/uploads/movies/ai-tinh-flops-thumb.jpg','Love Flops','ongoing','12','23 phút/tập','2022','HD',NULL,'','','Tình Cảm, Hài Hước, Học Đường','Nhật Bản','<p>Asahi Kashiwagi là một học sinh trung học bình thường, cho đến ngày lời tiên tri của một thầy bói trên TV lần lượt trở thành sự thật, kéo theo một loạt các cuộc gặp gỡ đầy bất ngờ. Định mệnh dường như đã kéo 5 cô gái xinh đẹp vào con đường của Asahi. Và không phải chờ đợi quá lâu, câu đã nhận được không phải 1, 2 mà là 5 lời tỏ tình. Liệu tiếng gọi của trái tim có đưa cậu đến một tình yêu hoàn hảo? Hay sẽ là một cú ngã ái tình không thể cứu vãn?</p>',0,0,15,0),(992,'Vào Ma Giới rồi đấy! Iruma-kun3','https://img.ophim.live/uploads/movies/vao-ma-gioi-roi-day-iruma-kun3-thumb.jpg','Welcome to Demon School! Iruma-kun3','completed','20','25 phút/tập','2022','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Anime \"Vào Ma giới rồi đấy! Iruma\" vẽ nên bức tranh về sự phấn đấu và trưởng thành của cậu bé loài người mang tên Suzuki Iruma, sau khi cậu được nhận làm cháu nuôi của Đại ác ma Ma giới Sullivan và nhập học vào ngôi trường do ông làm hiệu trưởng. Trong mùa thứ ba này, thử thách tiếp theo đón chờ Iruma sẽ là... \"Lễ hội thu hoạch\" một cuộc đua thu thập thực phẩm trong cánh rừng khổng lồ của Ma giới. Những người bạn cùng lớp nay sẽ trở thành đối thủ, những trận chiến xáp lá cà nhưng không kém phần toan tính sẽ được bày ra!?</p>',0,0,15,0),(993,'Mob Psycho 100 Ⅲ','https://img.ophim.live/uploads/movies/mob-psycho-100-iii-thumb.jpg','モブサイコ100 III','completed','13','23 phút/tập','2022','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Mob Psycho 100 Ⅲ &nbsp;kể câu chuyện về Shigeo – thường gọi là Mob, một cậu nam sinh sở hữu năng lực tâm linh cực mạnh! Cuộc sống học đường của Mob sẽ trôi qua vui vẻ hay sóng gió bắt đầu diễn ra? Hãy xem Mob Psycho 100 để có câu trả lời cho điều này nhé</p>',0,0,15,0),(994,'Cuộc Sống Thường Ngày Của Tiên Vương Mùa 3','https://img.ophim.live/uploads/movies/cuoc-song-thuong-ngay-cua-tien-vuong-mua-3-thumb.jpg','The Daily Life of the Immortal King 3','completed','13','18 phút/tập','2022','HD',NULL,'','','Viễn Tưởng, Học Đường','Trung Quốc','<p>Vương Lệnh sinh ra đã có sức mạnh to lớn, dần mở lòng hơn sau khi quen Tôn Dung và các bạn học khác. Từ việc chỉ quan tâm đến cuộc sống bình yên của bản thân, trở thành Tiên Vương đại nhân muốn bảo vệ thời gian tươi đẹp đồng hành với bạn bè, nhưng tại sao lần này lại bí mật chiến đấu?</p>',0,0,15,0),(995,'Học Viện Anh Hùng Phần 6','https://img.ophim.live/uploads/movies/hoc-vien-anh-hung-phan-6-thumb.jpg','My Hero Academia Ss6','ongoing','25','23phút/tập','2022','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Nối tiếp những câu chuyện giữa phe ác nhân và phe anh hùng ở mùa trước, ở phần tiếp theo đây chúng ta sẽ được chiêm ngưỡng tới cuộc chiến toàn tổng lực giữa hai phe chính và ta.</p>',0,0,15,0),(996,'Đừng Chạm Vào Nơi Mềm Yếu Đáy Lòng Em','https://img.ophim.live/uploads/movies/dung-cham-vao-noi-mem-yeu-day-long-em-thumb.jpg','Soft Memory','completed','20','35 phút/tập','2019','HD',NULL,'Hoàng Hà,  Trương Nghệ Chiêu','Dịch Hằng,  Tân Thụy Kỳ,  Nghê Ngôn,  Thái Nghi Đạt','Tình Cảm, Học Đường','Trung Quốc','<p>Với gam màu ấm áp về chủ đề thanh xuân, kể nên câu chuyện về bốn thanh thiếu niên, nữ sinh trung học Tôn Tiểu Nhu, học bá với ngoại hình vô cùng đáng yêu Âu Dương Vũ Sinh, Ga lăng mang trong mình giọng hát tuyệt vời Sở Lộ, và Cao Nguyên với tình yêu âm nhạc sâu sắc.Họ cùng tạo nên một bức tranh tươi mới nhiệt huyết về thanh xuân, mang đến một giai điệu tươi trẻ và cái nhìn sâu sắc về sự trưởng thành!</p>',0,0,15,0),(997,'In Our Prime','https://img.ophim.live/uploads/movies/in-our-prime-thumb.jpg','In Our Prime','completed','1','1H53M3S','2022','HD',NULL,'Piao Dong Xun','Min-sik Choi,  Park Byung eun,  Dong-hwi Kim,  Hea-jun Park','Tâm Lý, Học Đường','Hàn Quốc','<p>Nhà toán học thiên tài đào tẩu khỏi miền Bắc đã cố gắng che giấu quá khứ của mình cuối cùng bắt đầu dạy một học sinh đã từ bỏ môn Toán cách đúng để tìm ra câu trả lời.</p>',0,0,15,0),(998,'Bụi Trên Cổ Áo','https://img.ophim.live/uploads/movies/bui-tren-co-ao-thumb.jpg','Tozluyaka','completed','26','2h30p/tập','2022','HD',NULL,'Semih Bagci','Emre Kınay, Dolunay Soysert, Tayanç Ayaydın','Tình Cảm, Chính kịch, Học Đường','Thổ Nhĩ Kỳ','<p>Ali (Kaan Mirac Sezen), Zeyno (Serra Pirinc), Arap (Can Bartu Arslan), và Vefa (Durukan Celikkaya) là những người bạn thời thơ ấu đã lớn lên cùng nhau trong cùng một khu phố. Họ có thể làm bất cứ điều gì cho tình bạn của họ. Dù xuất thân từ gia đình nghèo khó nhưng họ vẫn biết cách vui vẻ và tận hưởng.</p><p><br>&nbsp;</p><p>Trong khi Ali, Zeyno và Arap học trường trung học lân cận, thì người bạn thông minh Vefa của họ học một trường cao đẳng tư với học bổng.</p><p><br>&nbsp;</p><p>Cuộc sống hạnh phúc của Ali và những người bạn bỗng chốc đảo lộn với một bi kịch. Chàng trai thông minh của nhóm, Vefa, qua đời trong bữa tiệc của trường đại học. Cảnh sát coi cái chết của Vefa như một vụ tự sát mà không điều tra chi tiết.</p><p><br>&nbsp;</p><p>Mặt khác, Ali và bạn bè của anh ta không tin rằng Vefa đã tự sát. Họ nghi ngờ rằng người bạn thời thơ ấu của họ đã phải vật lộn với nạn bắt nạt bạn bè ở trường và đã bị các bạn cùng trường sát hại.</p><p><br>&nbsp;</p><p>Khi Ali, Arap và Zeyno không bỏ cuộc và cố gắng điều tra lý do đằng sau cái chết của người bạn thời thơ ấu của họ, họ phát hiện ra rằng Vefa đã tham gia vào một cuộc chiến với các bạn cùng trường của mình tại bữa tiệc đại học.</p><p><br>&nbsp;</p><p>Berk (Ulvi Kahyaoglu), Ege (Ozgur Daniel Foster), và Cagri (Ahmet Haktan Zavlak) là những học sinh bắt nạt Vefa ở trường. Khi không thể kiềm chế cơn tức giận của mình trong bữa tiệc đại học, họ đã đánh Vefa đến chết. Để bảo vệ bản thân, họ nói rằng Vefa đã cố gắng hãm hiếp Hazal ( Cagla Simsek ) và vì lý do này, họ đã đánh anh ta. Tuy nhiên, họ nói rằng họ không giết anh ta thay vào đó Vefa đã tự sát.</p><p><br>&nbsp;</p><p>Ali và bạn bè không tin rằng Vefa đã âm mưu hãm hiếp Hazal. Họ cố gắng làm hết sức mình để tiết lộ sự thật trong bữa tiệc đại học. May mắn thay, họ tìm ra cách để vượt qua kỳ thi học bổng và bắt đầu theo học tại trường cao đẳng tư thục nơi Berk, Ege, Cagri và Hazal theo học.</p><p><br>&nbsp;</p><p>Ali, Arap và Zeyno thấy mình ở một thế giới mới mà họ chưa từng làm quen. Họ cố gắng thích nghi với cuộc sống ở trường mới và đồng thời, họ cố gắng tìm ra thủ phạm đằng sau cái chết của người bạn thời thơ ấu của họ. Trong hành trình gian nan này, Ali chạm trán với cô gái xinh đẹp Cemre (Ecem Calhan).</p><p><br>&nbsp;</p><p>Câu chuyện của bộ phim truyền hình Tozluyaka kể về ba học sinh trung học xuất thân từ gia đình nghèo và theo học tại một trường cao đẳng tư để tìm hiểu sự thật về cái chết của người bạn thời thơ ấu của họ. Liệu Ali và những người bạn thân của mình có biết được người bạn thời thơ ấu của họ đã qua đời như thế nào? Liệu Ali, Arap và Zeyno có quen với ngôi trường mới và những người bạn học mới của họ từ những gia đình giàu có? Liệu Cemre có hiểu được cảm xúc thực sự của cô ấy? Cemre sẽ tiếp tục mối quan hệ với Berk hay bắt đầu một câu chuyện tình yêu mới với Ali? Liệu cuối cùng Zeyno có tiết lộ tình cảm của mình đối với Ali? Học sinh phản ứng thế nào khi biết Hazal xuất thân từ một gia đình nghèo? Liệu Hazal có thừa nhận rằng cô đã vu khống Vefa?</p>',2,0,15,0),(999,'My Hero Academia HLB','https://img.ophim.live/uploads/movies/my-hero-academia-hlb-thumb.jpg','僕のヒーローアカデミア HLB','completed','1','24 phút','2022','HD',NULL,'','','Hành Động, Bí ẩn, Học Đường','Nhật Bản','<p>My Hero Academia HLB</p>',0,0,15,0),(1000,'Hồn Ma Mùa Hạ','https://img.ophim.live/uploads/movies/hon-ma-mua-ha-thumb.jpg','Summer Ghost','completed','1','40 phút','2021','HD',NULL,'Loundraw','Rina Kawaei,  Chiaki Kobayashi,  Miyuri Shimabukuro,  Nobunaga Shimazaki','Bí ẩn, Học Đường','Nhật Bản','<p>Tomoya, Aoi và Ryo là những học sinh trung học tình cờ gặp gỡ nhau trên mạng. Họ đều được nghe về một truyền thuyết đô thị nói về một “hồn ma mùa hè”, một linh hồn của một cô gái sẽ xuất hiện khi pháo hoa cháy sáng. Tomoya không thể sống cuộc sống mà cậu ấy đã hình dung cho chính mình. Aoi không thể tìm thấy vị trí của mình trên thế giới. Ryo từng có một tương lai tươi sáng nay đã bị tước bỏ. Mỗi người đều có một lý do riêng để cần gặp hồn ma mùa hè. Vào một đêm hè khi sự sống và cái chết giao thoa lẫn nhau, mỗi cung bậc cảm xúc của họ sẽ đưa họ đến nơi đâu?</p>',0,0,15,0),(1001,'Thiếu niên bóng chuyền !! Tài năng và cảm giác','https://img.ophim.live/uploads/movies/thieu-nien-bong-chuyen-tai-nang-va-cam-giac-thumb.jpg','ハイキュー!! 才能とセンス','completed','1','90 Phút','2017','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Một phiên bản điện ảnh tổng biên tập của anime bom tấn \"Haikyu!!\" dựa trên bộ truyện tranh nổi tiếng lấy chủ đề về các tuyển thủ bóng chuyền trung học của tác giả Furudate Haruichi. Câu lạc bộ bóng chuyền trung học Karasuno sẽ tham gia trại huấn luyện chung với đội mạnh Kanto cho vòng loại trung học mùa xuân. Karasuno tung ra một cuộc tấn công dữ dội ngay từ đầu, nhưng bị đẩy bởi cú giao bóng của Oikawa và bị giữ lại bởi đôi giày đinh, vũ khí bí mật của Kyotani, và thắng lợi dần nghiêng về Aoba Josai ...</p>',0,0,15,0),(1002,'Kỳ tích màu cam Orange','https://img.ophim.live/uploads/movies/ky-tich-mau-cam-orange-thumb.jpg','orange','completed','13','24 phút/tập','2016','HD',NULL,'','','Học Đường','Nhật Bản','<p>Naho Takamiya, một nữ sinh trung học, nhận được một lá thư có tên người gửi là tên của cô vào ngày khai giảng năm thứ hai. Lúc đầu, cô nghĩ đó là một trò nghịch ngợm của ai đó, nhưng như những gì viết trong bức thư, Sho Naruse sẽ chuyển trường từ Tokyo tới. Bức thư nói rằng tháng 5, cô sẽ đem lòng yêu Sho Naruse, Sho sẽ chết trong một vụ tai nạn vào mùa đông năm 17 tuổi, và tai nạn đó có thể được ngăn chặn.</p>',0,0,15,0),(1003,'Gin no Saji Silver Spoon Mùa 2','https://img.ophim.live/uploads/movies/gin-no-saji-silver-spoon-mua-2-thumb.jpg','Silver Spoon 2nd Season','completed','11','23 phút/tập','2014','HD',NULL,'','','Học Đường','Nhật Bản','<p>Khi học kỳ mới bắt đầu tại Trường Trung học Nông nghiệp Ooezo, Hachiken giờ đây đã quen với lối sống khắc nghiệt của một trường trung học nông nghiệp nông thôn. Trong khi Hachiken vẫn tự hỏi mình sẽ làm gì trong tương lai, anh tiếp tục khám phá những thực tế khắc nghiệt và tươi đẹp của vùng nông thôn.</p>',0,0,15,0),(1004,'Hãy Lắng Nghe Tôi','https://img.ophim.live/uploads/movies/hay-lang-nghe-toi-thumb.jpg','Duy Beni (Hear Me)','completed','20','2h30p/tập','2022','Full HD',NULL,'Ali Balcı','Berk Hakman, Rabia Soytürk, Caner Topçu, Helin Kandemir, Burak Can, Sümeyye Aydoğan, Feride Çetin, Aytaç Uşun, Meltem Akçöl, ..','Tình Cảm, Học Đường','Thổ Nhĩ Kỳ','<p>uộc sống của cô học sinh trung học Ekim, một người sống bình thường tại một trong những khu trung lưu của Istanbul, bị đảo lộn bởi một vụ tai nạn giao thông thương tâm diễn ra ngay trước mắt cô. Điều duy nhất mà Ekim nhớ về vụ tai nạn là chiếc mặt nạ trên mặt người lái xe và người bạn Leyla của cô ấy nằm trên mặt đất đầy máu.</p><p>Chiếc xe đâm vào Leyla và bỏ chạy, người dân trong khu phố bắt đầu nổi loạn khi biết rằng hung thủ đang trốn trong trường Cao đẳng Gerçek - trường có khuôn viên rất gần khu phố. Chiếc xe gần như biến mất khi lao vào giữa ngôi trường mà con cái của những gia đình giàu có và quyền lực này theo học.</p><p>Trong khi những người hàng xóm yêu cầu công lý, ban giám hiệu nhà trường cố gắng làm dịu phản ứng bằng cách trao học bổng cho ba học sinh từ khu phố của Leyla. Sau một thời gian, tin tức này được khép lại. Tuy nhiên, Ekim không có ý định buông tha cho kẻ đã khiến bạn thân mình dành phần đời còn lại của mình trên xe lăn. Chỉ có một điều mà cô ấy chắc chắn: Tên tội phạm là một trong những đứa trẻ nhà giàu và hư hỏng ở trường.</p><p>Vì vướng phải vài rắc rối mà Ekim và hai người bạn kia phải đối mặt với cảnh bạo lực học đường do một nhóm học sinh gây nên, mà trong đó cầm đầu là “nữ hoàng” của trường.</p><p>Khi Ekim đấu tranh để phá bỏ bức màn bí mật đen tối này và đảm bảo công lý, cảm xúc của cô ấy sẽ khiến cô ấy bối rối và trái tim của cô ấy sẽ bị đảo lộn.</p><p>Liệu Ekim có đủ sức mạnh để vượt qua tất cả, đứng lên tìm ra và đưa sự thật ra công lý hay không?</p><p>&nbsp;Hãy cùng chờ đón sự phát sóng của siêu phẩm “DUY BENI / HEAR ME / LẮNG NGHE TÔI” trên OPhim.CC nhé cả nhà mình ơiiii&nbsp;</p><p>cho tớ thấy cánh tay của các bạn đang hóng phim này đi ạ</p>',0,0,15,0),(1005,'Love Live! Siêu Sao!! Mùa 2','https://img.ophim.live/uploads/movies/love-live-sieu-sao-mua-2-thumb.jpg','Love Live! Superstar!! (2nd season)','completed','12','24 phút/tập','2022','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Trường nữ sinh tư thục mới thành lập Yuigaoka, tọa lạc giữa Ometesando, Harajuku và Aoyama đã bước sang mùa xuân thứ hai. Nhóm Idol học đường \"Liella!\" do Shibuya Kanon và các bạn thành lập chuẩn bị đón thêm bốn thành viên mới, những cô đã bắt đầu cất bước chạy trong vai trò \"Idol học đường!\". Họ đã nghĩ vậy. Rằng phải cố gắng cùng với các thành viên mới... \"Câu chuyện nơi tất cả cùng biến nó trở thành sự thật\" của Kanon và các bạn. Đón chào thành viên mới và hướng đến ngôi sao đầu tiên. Tung cánh bay nào! Love Live của chúng ta!</p>',0,0,15,0),(1006,'The iDOLM@STER Movie: Kagayaki no Mukougawa e!','https://img.ophim.live/uploads/movies/the-idolmster-movie-kagayaki-no-mukougawa-e-thumb.jpg','The idol master theater version is facing the glorious shore!','completed','1','120 phút','2014','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Movie của series idolm@ster và có thêm vài nhân vật từ bên Million Live qua.Dựa theo một game cùng tên nổi tiếng của Namco Bandai. Câu chuyện kể về 13 cô gái tại trung tâm 765 Pro đang trên con đường tiến đến sự nghiệp làm thần tượng âm nhạc.</p>',0,0,15,0),(1007,'Trận chiến bi thảm giữa bạn gái và bạn thời thơ ấu','https://img.ophim.live/uploads/movies/tran-chien-bi-tham-giua-ban-gai-va-ban-thoi-tho-au-thumb.jpg','Ore no Kanojo to Osananajimi ga Shuraba Sugiru','completed','13','24 phút/tập','2013','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Sau khi vào cấp 3, Keita Kido, khao khát trở thành bác sĩ , cậu đặt mục tiêu đỗ vào ngành y của trường đại học quốc gia. Cậu không hề sao lãng mà luôn duy trì điểm số cao nhất trong top đầu. Tuy nhiên, khi Masaru Natsukawa, nữ du học sinh về nước xinh đẹp nhất trường, đột nhiên rủ:&nbsp; \" Cậu có về nhà cùng tớ không?\". Keita không hiểu được thành ý của Masaru nên đã từ chối. Thế nhưng Masaru không từ bỏ mà tiếp tục kiên trì mời gọi mỗi ngày, cuối cùng, Keita cũng chịu khuất phục. Mặc dù cậu đã từ chối nhiều lần, nhưng khi biết cuốn nhật ký của Keita hồi trung học không hiểu vì một lý do nào đó đã nằm trong tay Masaru, và cậu buộc phải chấp thuận việc hai người giả vờ trở thành một đôi ...</p>',0,0,15,0),(1008,'Đại chiến Titan: Trường trung học','https://img.ophim.live/uploads/movies/dai-chien-titan-truong-trung-hoc-thumb.jpg','Shingeki! Kyojin Chuugakkou','completed','12','18 phút/tập','2015','HD',NULL,'','','Hài Hước, Bí ẩn, Học Đường','Nhật Bản','<p>Ellen suýt chút nữa là ngủ quên vào buổi sáng của nhập học. Người bạn nối khố Mikasa đã đánh thức Ellen dậy, cậu phóng như bay ra khỏi nhà, trên đường chạy hộc tốc tới trường, cậu gặp nhóm người học cùng trường tiểu học là Sasha , Jean, và Connie. Cả nhóm ngước nhìn cánh cổng trường và bức tưởng khổng lồ đứng sừng sững: \"Liệu đây có phải là ngôi trường Attack on Titan không ta?\". Trường trung học Attack on Titan - ngôi trường mà con người và người khổng lồ học chung với nhau.</p>',0,0,15,0),(1009,'Người thích ông đây chỉ có một mình cô?','https://img.ophim.live/uploads/movies/nguoi-thich-ong-day-chi-co-mot-minh-co-thumb.jpg','俺を好きなのはお前だけかよ','completed','14','24 phút/tập','2019','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Joro, một học sinh trung học, cậu đã rất đau khổ khi biết người mà cả sempai và bạn thời ấu thơ thích lại chính là bạn của mình. Và người tiến tới gần Joro lại chính là tên khốn mà cậu ghét nhất. “Tôi chỉ yêu một mình cậu thôi!” Một bộ phim hài tuổi trẻ học đường sôi nổi bắt đầu từ đây!</p>',0,0,15,0),(1010,'Himouto! Umaru-chan Cô em gái hai mặt R','https://img.ophim.live/uploads/movies/himouto-umaru-chan-co-em-gai-hai-mat-r-thumb.jpg','干物妹! うまるちゃんR','completed','12','24 phút/tập','2017','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Bên ngoài là \"cô em gái\" tài sắc vẹn toàn người người ghen tị, nhưng trở về nhà, lại là \"cô em gái\" cá khô mà không ai hay biêt. Uruma một tay cầm lon coca, potato và một tay thì chơi game, lướt anime, lướt web. Cô liếc nhìn người anh Taihei - người hừng hực khí thế bước đến mục tiêu của mình. Cuộc sống mạnh mẽ nhất và tuyệt vời nhất của Uruma lại bắt đầu.</p>',0,0,15,0),(1011,'Futsal Boys!!!!!','https://img.ophim.live/uploads/movies/futsal-boys-thumb.jpg','フットサルボーイズ!!!!!','completed','12','24 phút/tập','2022','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Lấy bối cảnh một thế giới hơn một thập kỷ sau khi môn bóng đá futsal đã trở nên phổ biến toàn cầu một cách chóng mặt. Nhân vật chính Haru Yamato có đam mê theo dõi chức vô địch của U-18 thế giới và được truyền cảm hứng bởi một cầu thủ Nhật Bản tên là Tokinari Tenoji. Anh tham gia đội futsal của trường Trung học Học viện Koyo với quyết tâm trở thành một cầu thủ như Tenoji. Tại đó, anh đã tìm thấy những người bạn, và họ cùng nhau đối mặt với các đối thủ của mình.</p>',0,0,15,0),(1012,'The Files of Young Kindaichi 5','https://img.ophim.live/uploads/movies/the-files-of-young-kindaichi-5-thumb.jpg','Kindaichi Shonen no Jikenbo 5','ongoing','8','55phút/tập','2022','HD',NULL,'','','Hình Sự, Bí ẩn, Học Đường','Nhật Bản','<p>Kindaichi Hajime là một học sinh trung học và là một thám tử tư với chỉ số IQ 180. Anh giải quyết những vụ án giết người đầy rẫy những manh mối khó khăn. Kindaichi Hajime làm việc với người bạn thời thơ ấu của mình là Nanase Miyuki và Kenmochi Isamu. Kenmochi Isamu hiện là thanh tra trưởng của Sở cảnh sát thủ đô Tokyo.</p>',0,0,15,0),(1013,'Thiếu niên bóng chuyền !! Người thắng và kẻ bại','https://img.ophim.live/uploads/movies/thieu-nien-bong-chuyen-nguoi-thang-va-ke-bai-thumb.jpg','Volleyball Junior Haikyu!! the Movie 2: The Winner and the Loser','completed','1','88 Phút','2015','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Tuyển tập những bộ TV anime [Haikyu] từ chương 14 kì 1 cho đến chương 25.</p>',2,0,15,0),(1014,'Tsuredure Children Nhiệt huyết tuổi trẻ','https://img.ophim.live/uploads/movies/tsuredure-children-nhiet-huyet-tuoi-tre-thumb.jpg','Tsuredure Children','completed','12','12 phút/tập','2020','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Tác phẩm là một vở kịch của nhóm thanh niên miêu tả về hiện trạng ở đâu cũng có, những học sinh cấp 3 cười, khóc, thuận lợi hay vấp váp trong tình yêu, họ trải qua những năm tháng thanh xuân không gì có thể đánh đổi được. Tất cả những nhân vật xuất hiện đều là nhân vật chính. Chắc hẳn bạn sẽ có những cảm xúc của một nhân vật nào đó.</p>',0,0,15,0),(1015,'Musaigen no Phantom World','https://img.ophim.live/uploads/movies/musaigen-no-phantom-world-thumb.jpg','無彩限のファントム・ワールド','completed','14','24 phút/tập','2016','HD',NULL,'','','Bí ẩn, Học Đường','Nhật Bản','<p>Trong tương lai gần, đột biến sẽ xảy ra trong chức năng não của con người. Mọi người đã nhận ra ma và yêu quái, và gọi chúng là \"ma\". Haruhiko Ichijo, một học sinh trung học năm thứ nhất tại Hosea Gakuin, đã sống một cuộc sống học đường đầy đau khổ và thú vị với Mai Kawakami, Rena Izumi và Koito Minase, những người có khả năng đặc biệt có thể cạnh tranh với ma quái.</p>',0,0,15,0),(1016,'Lam Hỏa Diệt Quỷ Movie','https://img.ophim.live/uploads/movies/lam-hoa-diet-quy-movie-thumb.jpg','Blue Exorcist: The Movie','completed','1','90 phút','2012','HD',NULL,'','','Hành Động, Bí ẩn, Học Đường','Nhật Bản','<p>Khi lễ hội lớn của Học viện Chân Thập Tự đến gần, các nhà diệt quỷ và trừ tà nỗ lực kết hợp nỗ lực với nhau để trục xuất bất kỳ con quỷ nào dám đe dọa lễ kỷ niệm. Trong số đó, Okumura Rin được giao nhiệm vụ xua đuổi con quỷ ăn thịt người được gọi là \"Chuyến tàu ma\" cùng với em trai mình là Yukio và Moriyama Shiemi.</p>',0,0,15,0),(1017,'Học Viên Ưu Tú ở Trường Cao Trung Ma Pháp','https://img.ophim.live/uploads/movies/hoc-vien-uu-tu-o-truong-cao-trung-ma-phap-thumb.jpg','Mahouka Koukou no Yuutousei','completed','13','24 phút/tập','2021','HD',NULL,'','','Học Đường','Nhật Bản','<p>Đã một thế kỉ trôi qua kể từ khi phép thuật - thứ tưởng như chỉ có trong truyền thuyết trở lại thế giới này. Bây giờ là mùa xuân, mùa tựu trường, thời điểm một lớp học sinh mới bắt đầu cuộc sống trường cấp ba của họ tại Trường trung học Đệ Nhất trực thuộc Đại học Ma pháp Quốc gia. Shiba Tatsuya và Shiba Miyuki - cặp anh em tài năng được đông đảo khán giả hâm mộ nay lại trở lại màn ảnh nhỏ, vẫn với câu chuyện cũ, nhưng lần này là dưới góc nhìn của Miyuki. Đây là bộ phim về cuộc sống của một học sinh ưu tú được rất nhiều người kì vọng cùng những cảm xúc ẩn giấu của cô ấy.</p>',0,0,15,0),(1018,'Chuyện tình thanh xuân bi hài của tôi quả nhiên là sai lầm (kết thúc)','https://img.ophim.live/uploads/movies/chuyen-tinh-thanh-xuan-bi-hai-cua-toi-qua-nhien-la-sai-lam-ket-thuc-thumb.jpg','Yahari Ore no Seishun Love Comedy wa Machigatteiru. 3rd Season My Teen Romantic Comedy SNAFU 3 Oregairu 3 My youth romantic comedy is wrong as I expected 3  Yahari Ore no Seishun Love Comedy wa Machigatteiru. Kan','completed','12','25 phút/tập','2020','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Câu lạc bộ tình nguyện là một câu lạc bộ từ giải quyết các vấn đề về mối quan hệ của các bạn trong lớp cho đến việc giúp đỡ Hội học sinh. Yêu cầu cuối cùng của Yukino mà Yawata và Yui nhận được là gì? Cuộc sống cấp ba của cậu ấy sẽ có cái kết như thế nào?</p>',0,0,15,0),(1019,'Cấm thư ma thuật Index','https://img.ophim.live/uploads/movies/cam-thu-ma-thuat-index-thumb.jpg','Toaru Majutsu no Index','completed','24','24 phút/tập','2008','HD',NULL,'','','Bí ẩn, Học Đường','Nhật Bản','<p>Thành phố Gakuen - nơi phát minh về siêu năng lực được tiến hành Nữ tu sĩ áo trắng vốn là học sinh cấp 3 - Kamijo Toma sinh sống ở thành phố đó. Cô gái ấy tự giới thiệu rằng mình có trong danh sách cấm và bị truy đuổi bởi 1 vị pháp sư. Bằng cách này, Kajio Toma đã bước chân vào thế giới huyền bí.</p>',0,0,15,0),(1020,'Chuyện tình của tôi','https://img.ophim.live/uploads/movies/chuyen-tinh-cua-toi-thumb.jpg','Ore Monogatari!!','completed','24','23 phút/tập','2015','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Câu chuyện tình yêu độc đáo giữa Takeo, một học sinh trung học cao lớn, vạm vỡ, thẳng thắn và đáng tin cậy nhưng lại không có duyên với phụ nữ, Yamato, một cô gái hiền lành, và Makoto Sunakawa, đẹp trai và là bạn nối khố của Takeo..</p>',0,0,15,0),(1021,'Bậc thầy quần vợt','https://img.ophim.live/uploads/movies/bac-thay-quan-vot-thumb.jpg','Hoshiai no Sora Stars Align','completed','12','25 phút/tập','2019','HD',NULL,'','','Học Đường','Nhật Bản','<p>Câu lạc bộ Tennis bóng mềm nam của trường Trung học Shinjo Minami đang trên đà bị giải tán do chính sách sử dụng ngân quỹ mới của Hội học sinh. Toma Shinjo, đội trưởng của câu lạc bộ đang lên kế hoạch thay đổi hoặc không phải giải tán CLB. Vô tình cậu gặp Maki, một cậu bạn chuyển trường có phản xạ vô cùng nhạy bén. Toma sau đó đã ngay và luôn mời Maki về CLB cho bằng được. Yều cầu từ phía Hội sinh viên đưa ra là thắng một trận đấu trong Giải đấu mùa hè. Toma và Maki sẽ làm gì để giải cứu CLB Tennis bóng mềm nam trường Shinjo Minami đây ?</p>',0,0,15,0),(1022,'Bạn Cùng Lớp','https://img.ophim.live/uploads/movies/ban-cung-lop-thumb.jpg','Doukyuusei','completed','1','60 phút','2016','HD',NULL,'','','Học Đường','Nhật Bản','<p>Rihito Sajo, người đạt điểm tuyệt đối tất cả các môn trong kỳ thi tuyển sinh trung học, và Hikaru Kusakabe, người nổi tiếng trong giới nữ sinh, hoạt động trong một ban nhạc, bắt đầu&nbsp; chuyện với nhau sau khi luyện tập hợp xướng. Kusakabe tới những buổi luyện tập của Sajo, người chẳng có tí năng khiếu hát hò nào, cùng dành thời gian cho nhau, lắng nghe giọng nói của nhau, thì thầm những bài hát, dần dần hai người cứ thế yêu nhau say đắm.</p>',0,0,15,0),(1023,'Love Live! Siêu Sao!!','https://img.ophim.live/uploads/movies/love-live-sieu-sao-thumb.jpg','Love Live! Superstar!!','ongoing','1','24 phút/tập','2022','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Trường nữ sinh tư thục mới thành lập Yuigaoka, tọa lạc giữa Ometesando, Harajuku và Aoyama đã bước sang mùa xuân thứ hai. Nhóm Idol học đường \"Liella!\" do Shibuya Kanon và các bạn thành lập chuẩn bị đón thêm bốn thành viên mới, những cô đã bắt đầu cất bước chạy trong vai trò \"Idol học đường!\". Họ đã nghĩ vậy. Rằng phải cố gắng cùng với các thành viên mới... \"Câu chuyện nơi tất cả cùng biến nó trở thành sự thật\" của Kanon và các bạn. Đón chào thành viên mới và hướng đến ngôi sao đầu tiên. Tung cánh bay nào! Love Live của chúng ta!</p>',0,0,15,0),(1024,'Machine-Doll wa Kizutsukanai','https://img.ophim.live/uploads/movies/machine-doll-wa-kizutsukanai-thumb.jpg','Unbreakable Machine-Doll','completed','12','24 phút/tập','2013','HD',NULL,'','','Bí ẩn, Học Đường','Nhật Bản','<p>Vào đầu thế kỉ 20, cùng với sự tiến bộ về công nghệ, các nhà khoa học bắt đầu quan tâm tới ma thuật cấp cao. Sự kết hợp giữa khoa học và ma thuật đã tao ra Makinot – những vòng phép có thể mang lại sự sống, thậm chí là nhân cách cho đồ vật. Nó được phát triển như một loại vũ khí và giờ đây đã lan rộng ra toàn thế giới. Nhân vật chính của chúng ta là Akabane Raishin – đang theo học tại học viện Hoàng Gia với hi vọng trở thành người giỏi nhất thế giới với sự trợ giúp của Yaya – một cô gái đáng yêu, đồng thời cũng chính là vũ khí của Raishin. Trớ trêu thay, điểm số trên lớp của cậu lại ở ngưỡng gần liệt mặc dù khả năng chiến đấu và sự quyết đoán lại quá đủ để đứng đầu. Giờ đây Raishin lại phải cạnh tranh với những bạn cùng cấp để thoát kiếp bét nếu còn muốn trở thành số 1.</p>',0,0,15,0),(1025,'Xanh hơn màu chàm','https://img.ophim.live/uploads/movies/xanh-hon-mau-cham-thumb.jpg','藍より青し','completed','24','24 phút/tập','2002','HD',NULL,'','','Học Đường','Nhật Bản','<p>Hanabishi Kaoru là một sinh viên năm cuối đại học, sống một cuộc sống bình thường giữa học tập và bạn bè. Một ngày nọ, anh gặp Sakuraba Aoi, một người bạn cũ gần như bị lãng quên, người mà anh dường như đã đính hôn. Cùng nhau, cả hai khám phá lại những khía cạnh trong quá khứ mà họ đã cố gắng quên đi khi bắt đầu cuộc sống mới với nhau. Thật không may, có rất nhiều vị khách không mong muốn luôn xen vào chuyện tình cảm của họ.</p>',0,0,15,0),(1026,'BanG Dream! 3','https://img.ophim.live/uploads/movies/bang-dream-3-thumb.jpg','BanG Dream! Season 3','completed','13','25 phút/tập','2020','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Mùa thứ ba của bộ phim BanG Dream!.</p>',0,0,15,0),(1027,'Long Nhật Nhất, Anh Chết Chắc (Phần 1)','https://img.ophim.live/uploads/movies/long-nhat-nhat-anh-chet-chac-phan-1-thumb.jpg','Dragon Day, You\'re Dead (Season 1)','completed','20','25 phút / tập','2017','HD',NULL,'Lý Diêu Ba','Ngụy Triết Minh,  Khâu Hách Nam,  Hầu Bội Sam,  Thạch Tuyết Tịnh,  Tằng Lệ Dao,  Hoàng Thiên Mạc','Tình Cảm, Hài Hước, Gia Đình, Học Đường','Trung Quốc','<p>Bộ phim xoay quanh cô sinh viên ưu tú Trương Tịnh Mỹ, khi chuyển đến Học Viện Bản Thừa - ngôi trường thuộc hàng top, trong ngày đi học đầu tiên, đã không may mắn mà đụng phải đại ma đầu của trường là Long Nhật Nhất. Cặp đôi này từ nhiều lần va chạm đối đầu với nhau, dần dần nảy sinh tình cảm. Mối quan hệ giữa hai người tạo nên một phen sóng gió ở trường, đồng thời khiến cho mối quan hệ của gia đình Long Nhật Nhất trở nên thân thiết hơn.</p>',0,0,15,0),(1028,'Long Nhật Nhất, Anh Chết Chắc (Phần 2)','https://img.ophim.live/uploads/movies/long-nhat-nhat-anh-chet-chac-phan-2-thumb.jpg','Dragon Day, You\'re Dead (Season 2)','completed','20','25 phút/tập','2018','HD',NULL,'Lý Diêu Ba','Ngụy Triết Minh,  Khâu Hách Nam,  Hầu Bội Sam,  Thạch Tuyết Tịnh,  Tằng Lệ Dao,  Hoàng Thiên Mạc','Tình Cảm, Hài Hước, Gia Đình, Học Đường','Trung Quốc','<p>Học sinh xuất sắc Trương Tĩnh Mỹ chuyển trường đến trường đại học ưu tú hàng đầu – Bản Thừa Học Viện. Nhưng ở ngày nhập trường đầu tiên không may gặp phải \"Ma đầu vườn trường” - Long Nhật Nhất. Hai người ở nơi này một thời gian, đấu trí so dũng khí. Trong lúc tranh đấu cả hai đã nảy sinh tình cảm. Tình cảm của bọn họ ở Bản Thừa Học Viện đã khơi dậy sóng lớn, đồng thời cũng để cho mối quan hệ của gia đình Long Nhật Nhất trở nên vi diệu hơn…</p>',0,0,15,0),(1029,'Học Viện Nữ Sinh','https://img.ophim.live/uploads/movies/hoc-vien-nu-sinh-thumb.jpg','Juuou Mujin no Fafnir','completed','12','24 phút/tập','2015','HD',NULL,'','','Hành Động, Bí ẩn, Học Đường','Nhật Bản','<p>Chuyện kể về cậu trai Yuu Mononobe , giống đực duy nhất ở thế giới “D”. Vào một ngày đẹp trời, cậu bất ngờ “được” hốt vô học tại trường nữ sinh Midgar – ngôi trường vốn chỉ dành cho những cô gái “D”. Cuộc sống của cậu giờ đây sẽ ra sao, khi mà mới vô học ngày đầu tiên đã “giúp con gái nhà người ta khỏi lấy chồng”. Trong cái rủi may mà không kẹp thêm cái xui, khi mà cậu được đoàn tụ với cô em gái bé bỏng Mitsuki của mình.</p>',0,0,15,0),(1030,'BanG Dream! Episode of Roselia I: Yakusoku','https://img.ophim.live/uploads/movies/bang-dream-episode-of-roselia-i-yakusoku-thumb.jpg','劇場版 BanG Dream! Episode of Roselia','completed','1','78 phút','2021','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Để vươn tới sân khấu của \"FES.\", Yukina Minato quyết định thành lập một ban nhạc. Năm cô gái bắt đầu hành trình vươn tới đỉnh cao với cái tên Roselia ... Đây là câu chuyện về \"lời hứa\" của năm thành viên với nhau, từ khi thành lập ban nhạc cho đến khi họ thử thách hướng tới THẾ GIỚI TƯƠNG LAI!</p>',0,0,15,0),(1031,'Anima Yell!','https://img.ophim.live/uploads/movies/anima-yell-thumb.jpg','Anima Yell!','completed','12','24 phút/tập','2018','HD',NULL,'','','Học Đường','Nhật Bản','<p>\"Anima Yell!\" Nguyên tác của \"Anima Yell!\" dựa trên chủ đề của hoạt náo viên. Nó đã được đăng nhiều kỳ trên tạp chí Fangbunsha \"Manga Time Kirara Carat\". Một tính cách cổ vũ, một câu chuyện tuổi trẻ mở ra với các thành viên sau khi anh ấy thành lập nhóm cổ vũ.</p>',0,0,15,0),(1032,'Ore no Imouto ga Konnani Kawaii Wake ga Nai','https://img.ophim.live/uploads/movies/ore-no-imouto-ga-konnani-kawaii-wake-ga-nai-thumb.jpg','My Little Sister Can\'t Be This Cute Ore no Imouto ga Konnani Kawaii Wake ga Nai','completed','15','28 phút/tập','2010','HD',NULL,'','','Học Đường','Nhật Bản','<p>Kirino Kousaka là hiện thân của mẫu học sinh lý tưởng với vẻ ngoài cuốn hút không kém. Điểm số của cô gần như hoàn hảo, và để trang trải chi phí cá nhân, cô làm người mẫu chuyên nghiệp cùng với người bạn thân nhất của mình Ayase Aragaki, người ghét những kẻ nói dối và mọi thứ về otaku. Nhưng điều mà Ayase không biết là Kirino ẩn chứa một bí mật sâu kín và sẽ sớm được đưa ra ánh sáng. Một ngày nọ, ở nhà, Kyousuke, người anh trai hoàn toàn bình thường của Kirino, tình cờ bắt gặp một trò chơi khiêu dâm không thuộc về ai khác ngoài cô em gái có vẻ hoàn mỹ của mình. Với danh tiếng của mình đang bị đe dọa, Kirino ra lệnh bịt miệng anh chị em của mình trong khi đồng thời giới thiệu anh ta với thế giới của eroge và anime. Thông qua Kirino, Kyousuke gặp lolita gothic Ruri Gokou và otaku đeo kính cận Saori Makishima, do đó bắt đầu một lối sống hoàn toàn mới. Nhưng khi anh ta ngày càng tham gia nhiều hơn vào cuộc sống bí mật của em gái mình, thì việc giữ bí mật trở nên khó khăn hơn rất nhiều.</p>',0,0,15,0),(1033,'Danganronpa 3: Chương tương lai','https://img.ophim.live/uploads/movies/danganronpa-3-chuong-tuong-lai-thumb.jpg','Danganronpa 3 -The End of Hope Peak Academy-The Future','completed','12','24 phút/tập','2016','HD',NULL,'','','Học Đường','Nhật Bản','<p>Danganronpa 3: anime mới của trò chơi hành động lý luận \"The End of Kibougamine Gakuen – Zetsubou\" mô tả cách các học sinh trung học với tài năng đỉnh cao phát triển phán đoán trong một không gian khép kín và một phiên tòa xét xử trong lớp học để tìm ra tên tội phạm.</p>',0,0,15,0),(1034,'Cô Nàng Làm Thơ','https://img.ophim.live/uploads/movies/co-nang-lam-tho-thumb.jpg','Senryu Girl Senryuu Shoujo','completed','12','13 phút/tập','2019','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Cô Nàng Làm Thơ - Senryuu Shoujo kể về Yukishiro Nanako là một nữ sinh trung học dễ thương, vui vẻ với một đặc điểm kỳ lạ; thay vì giao tiếp bằng lời nói, cô viết những bài thơ senryuu (một loại thơ haiku) để nói lên suy nghĩ của mình. Cùng với Busujima Eiji, một cựu sinh viên mới chớm nở của Câu lạc bộ Văn học của trường. Mặc dù Nanako không nói chuyện, với sức mạnh của senryuu, cặp đôi đáng yêu này không gặp vấn đề gì khi tận hưởng cuộc sống học đường vui vẻ của họ thông qua giai điệu của 5 - 5 âm tiết</p>',0,0,15,0),(1035,'Shin Tennis no Ouji-sama: Hyoutei vs. Rikkai - Game of Future','https://img.ophim.live/uploads/movies/shin-tennis-no-ouji-sama-hyoutei-vs-rikkai-game-of-future-thumb.jpg','新テニスの王子様 氷帝vs立海 Game of Future','completed','2','50 phút/tập','2021','HD',NULL,'','','Học Đường','Nhật Bản','<p>The new anime will tell an original story, featuring a match between the Hyoutei Academy Secondary Department led by Keigo Atobe and Rikkai University-Affiliated Middle School led by Seiichi Yukimura. The story was previously not depicted in the manga.</p>',0,0,15,0),(1036,'Câu lạc bộ bơi nam - Bơi đến tận cùng thế giới - Giấc mơ','https://img.ophim.live/uploads/movies/cau-lac-bo-boi-nam-boi-den-tan-cung-the-gioi-giac-mo-thumb.jpg','Road to the World','completed','1','99 Phút','2019','HD',NULL,'','','Học Đường','Nhật Bản','<p>Haruka, Makoto, Nagisa và Rin tạo thành một liên kết trẻ với tư cách là đội đầu tiên. Mục tiêu là tiến tới cuộc thi cấp quốc gia với nội dung chạy tiếp sức. Họ có một sợi dây ràng buộc là ước mơ. Từ giờ họ hướng đến mục tiêu, biến giấc mơ thành hiện thực. Và câu chuyện của những người trẻ không ngừng \"bơi lội\" sẽ chuyển sang giai đoạn tiếp theo.</p>',0,0,15,0),(1037,'Máy gia tốc khoa học nhất định','https://img.ophim.live/uploads/movies/may-gia-toc-khoa-hoc-nhat-dinh-thumb.jpg','Toaru Kagaku no Accelerator','completed','12','24 phút/tập','2019','HD',NULL,'','','Hành Động, Học Đường','Nhật Bản','<p>Tại \"thành phố gakuen\" khổng lồ nằm ở phía Tây Tokyo, một chương trình giảng dạy đặc biệt để phát triển sức mạnh siêu nhiên của học sinh sẽ được thực hiện. Đương kim của những người tài giỏi - Accelerator là một \"thí nghiệm\" lập dị và bị đánh bại sau khi tìm kiếm quyền lực tuyệt đối. Và nhờ cuộc gặp gỡ với một cô gái, số phận của anh sẽ thay đổi đáng kể ...</p>',1,0,15,0),(1038,'Lạc Vào Yêu Linh Giới','https://img.ophim.live/uploads/movies/lac-vao-yeu-linh-gioi-thumb.jpg','Fukigen na Mononokean Tsuzuki','completed','13','24 phút/tập','2019','HD',NULL,'','','Bí ẩn, Học Đường','Nhật Bản','<p>\"Thuật trừ tà\" là thuật đưa tiễn những yokai đang lang thang trên dương gian trở về lại với linh giới, là nơi mà chúng thuộc về.Một ngày nọ, anh chàng học sinh cao trung Hanae Ashiya bị ám bởi một con yêu quái, chính lúc đó, anh tình cờ diện kiến một thầy trừ tà gọi là \"Mononokean\". Thầy trừ tà mà anh gặp được hóa ra là một chàng trai trẻ đẹp có tên là Haruitsuki Abeno. Vì nhiều lý do nào đó mà Ashiya lại làm việc cho Mononokean luôn.Và thế là câu chuyện của cặp đôi trừ tà Ashiya - Abeno cùng với những yokai kì quặc đã được bắt đầu như thế đó!</p>',0,0,15,0),(1039,'Tanaka-kun vẫn luôn lười biếng như vậy','https://img.ophim.live/uploads/movies/tanaka-kun-van-luon-luoi-bieng-nhu-vay-thumb.jpg','田中くんはいつもけだるげ','ongoing','12','24 phút/tập','2016','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Tanaka, người đã ngủ muộn vào buổi sáng, được bạn cùng lớp Ota đến đón và đưa đến lớp học. Tuy nhiên, Tanaka chuẩn bị tham gia lớp học thể chất để xây dựng một cơ thể không bị tê liệt và đau đớn ngay cả khi trong khoảng 1 thời gian dài cậu lười biếng. Tanaka và Ota, 2 người họ bắt đầu chơi cầu lông ...</p>',0,0,15,0),(1040,'Hãy dạy tôi với, Hokusai !','https://img.ophim.live/uploads/movies/hay-day-toi-voi-hokusai-thumb.jpg','Oshiete Hokusai!','completed','9','12 phút/tập','2021','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Câu chuyện về việc một số nữ sinh phổ thông không