nh tranh khốc liệt.</p>',0,0,15,0),(1045,'Bí mật của Nogizaka Haruka Mùa 2','https://img.ophim.live/uploads/movies/bi-mat-cua-nogizaka-haruka-mua-2-thumb.jpg','The secret purezza of Haruka Nogizaka♪','completed','12','25 phút/tập','2009','HD',NULL,'','','Học Đường','Nhật Bản','<p>Nogizaka Haruka No Himitsu Purezza là phần tiếp theo trong loạt anime Nogizaka no Himitsu. Ở phần trước, cặp đôi nhân vật chính Ayase Yuuto và Nogizaka Haruka đã vượt qua được định kiến xã hội và khoảng cách về gia thế để đến với nhau. Tưởng như sẽ chẳng còn gì có thể ngăn cản họ trên con đường tiến tới một cái kết màu hồng, nhưng một tình địch bạn cùng lớp đột nhiên xuất hiện và những cô gái gần gũi với Yuuto cũng trở nên yêu thích cậu ấy. Mặc kệ những cơn sóng ngầm, Yuuto và Haruka vẫn chỉ cùng nhau ngồi vẽ doujinshi và tham gia các sự kiện anime. Chuyện tình giữa hai người rồi sẽ đi về đâu? Hãy cùng đón xem!</p>',4,0,15,0),(1046,'BanG Dream! Episode of Roselia II: Song I am.','https://img.ophim.live/uploads/movies/bang-dream-episode-of-roselia-ii-song-i-am-thumb.jpg','劇場版 BanG Dream! Episode of Roselia II: Song I am.','completed','1','70 phút','2021','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Phần tiếp theo của BanG Dream! Episode of Roselia I: Promise</p>',0,0,15,0),(1047,'Những Trái Tim Tối Cường','https://img.ophim.live/uploads/movies/nhung-trai-tim-toi-cuong-thumb.jpg','Extreme Hearts','completed','12','25 phút/tập','2022','HD',NULL,'','','Học Đường','Nhật Bản','<p>Đây là câu chuyện về một tương lai không xa thực tại. Hypersports (Siêu thể thao) tận dụng Support Item Extreme Gear (Trang thiết bị hỗ trợ tối cường) để chơi đã trở thành sở thích của đông đảo người lớn lẫn trẻ nhỏ. Câu chuyện bắt đầu khi Hayama Hiyori, một ca sĩ trung học vốn không hề có duyên với thể thao cường điệu gặp tai nạn.</p>',0,0,15,0),(1048,'Pop Team Epic','https://img.ophim.live/uploads/movies/pop-team-epic-thumb.jpg','ポプテピピック','completed','12','24 phút/tập','2018','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Crude, rude, and a little…cute? Get ready for the larger-than-life attitude of Popuko and Pipimi, the small and tall stars of Pop Team Epic! Based off the bizarre four-panel webcomic by Bukubu Okawa comes a comedy that’ll throw you off with its out-there jokes and intense absurdity. You think you’re ready for these girls? Think again, F#%**er!</p>',0,0,15,0),(1049,'Cô Bé Thiên Thần','https://img.ophim.live/uploads/movies/co-be-thien-than-thumb.jpg','Saint Tail','completed','43','25 phút/tập','1995','HD',NULL,'','','Học Đường','Nhật Bản','<p>Meimi là một nữ sinh bình thường nhưng khi đêm xuống thì cô trở thành một \"siêu trộm\" biệt danh là Saint Tail. Cố gắng bắt Meimi là Asuka Jr một thám tử nghiệp dư học cùng lớp với cô. Rồi trời xui đất khiến sao cho một người thì mỗi khi ăn trộm lại \"la làng\" cho thám tử biết còn 1 người thì lúc đầu muốn bắt trộm sau lại muốn \"chiếm\" luôn tên trộm đó thế là Happy Ending</p>',0,0,15,0),(1050,'Kaguya-sama Muốn Tỏ Tình ~Tình Chiến Căng Não Của Các Thiên Tài~ OVA','https://img.ophim.live/uploads/movies/kaguya-sama-muon-to-tinh-tinh-chien-cang-nao-cua-cac-thien-tai-ova-thumb.jpg','かぐや様は告らせたい？～天才たちの恋愛頭脳戦～ OVA','completed','1','25 phút','2021','HD',NULL,'','','Hài Hước, Học Đường','Nhật Bản','<p>Câu chuyện tình yêu giữa hội phó Kaguya Shinomiya và hội trưởng Miyuki Shirogane, 2 trong số những thiên tài của học viện Shuchiin, ngôi trường ưu tú nơi hội tụ những người tài năng. Hai người họ gặp nhau tại hội gặp mặt học sinh, dần nhận ra tình cảm dành cho đối phương, nhưng lòng kiêu hãnh của những thiên tài không cho phép họ thú nhận và ngỏ lời trước, và dẫn đến trận chiến khiến đối phương phải tỏ tình trước bắt đầu!!</p>',0,0,15,0),(1051,'Cô Gái Nhạc Kịch!!','https://img.ophim.live/uploads/movies/co-gai-nhac-kich-thumb.jpg','Kageki Shojo!!','completed','13','25 phút/tập','2021','HD',NULL,'','','Âm Nhạc, Học Đường','Nhật Bản','<p>Được thành lập vào thời Taisho, Kouka Kageki là đoàn ca kịch chỉ bao gồm những cô gái chưa kết hôn. Những vở diễn của họ đã đánh cắp trái tim của biết bao nhiêu người. Vài năm sau, học viện âm nhạc Kouka Kageki được thành lập, và chỉ những cô gái xinh đẹp mới có thể gia nhập. Watanabe Sarasa là một cô gái ngây thơ với chiều cao 1m78 khao khát được đóng vai \"Oscar-sama. Narada Ai là một cựu thần tượng nổi tiếng toàn quốc, người luôn thơ ơ với mọi thứ, kể cả ước mơ lẫn bạn bè. Cuộc sống học đường đầy hy vọng và biến động của họ chuẩn bị bắt đầu.</p>',1,0,15,0),(1052,'Tình bạn một tuần','https://img.ophim.live/uploads/movies/tinh-ban-mot-tuan-thumb.jpg','一週間フレンズ。','completed','12','24 phút/tập','2014','HD',NULL,'','','Học Đường','Nhật Bản','<p>“Tôi… trí nhớ của bạn bè sẽ biến mất sau một tuần.” Yuki Hase, một học sinh trung học, muốn kết bạn với người bạn cùng lớp Kaori Fujimiya, người luôn cô đơn. Nhưng những gì cô ấy nói thật gây sốc, rằng những ký ức của cô ấy với bạn bè sẽ biến mất trong một tuần và mọi thứ sẽ được thiết lập lại vào thứ Hai. Tôi sẽ là bạn của Fujimiya! Hết lần này đến lần khác.</p>',0,0,15,0),(1053,'Sui Gia Tương Phùng','https://img.ophim.live/uploads/movies/sui-gia-tuong-phung-thumb.jpg','Happy Returns','completed','20','48 phút/tập','1993','HD',NULL,'','魏駿傑, 梁藝齡, 戴志偉, 吳詠紅, 關海山, 南紅, 雷宇揚, 白茵, Carrie Choi, 江毅','Tình Cảm','Trung Quốc, Hồng Kông','Sui Gia Tương Phùng-Happy Returns (1993) [HD-Lồng Tiếng]',0,0,9,0),(1054,'Hoa Khôi Cảnh Viên','https://img.ophim.live/uploads/movies/hoa-khoi-canh-vien-thumb.jpg','Madam Cutie On Duty','completed','20','40 phút/tập','2015','HD',NULL,'','','Tình Cảm','Hồng Kông','Lúc còn trẻ, Hoa Bình (Huỳnh Thúy Như) từng bị trêu chọc vì vẻ bề ngoài xấu xí của mình. Sau một tai nạn và phẫu thuật thẩm mỹ, cô tin chắc cuộc sống sẽ khá hơn khi bản thân đẹp lên. Ngay cả khi làm cảnh sát, Hoa Bình vẫn quan tâm làm đẹp hơn bất cứ thứ gì. Khi có vụ án ép bà nội trợ làm gái mại dâm tại một chung cư, Hoa Bình và đồng nghiệp La Đại Thụ (Tiêu Chính Nam) được phân nhiệm vụ giả làm vợ chồng vào tòa chung cư ở đề điều tra thông tin từ các bà nội trợ. Họ gặp một nhóm bà nội trợ (Huỳnh Trí Văn - Lương Gia Kỳ - Giản Mộ Hoa .',1,0,9,0),(1055,'Con Tôi Hẹn Hò','https://img.ophim.live/uploads/movies/con-toi-hen-ho-thumb.jpg','내 새끼의 연애','ongoing','7','? phút/tập','2025','HD',NULL,'','','Tình Cảm','Hàn Quốc','<p>“Con Tôi Hẹn Hò” là một chương trình thực tế lãng mạn độc đáo, nơi <strong>phụ huynh theo dõi con cái mình hẹn hò</strong> với một mức độ tập trung cao độ, hoàn toàn trái ngược với các show hẹn hò thông thường <a href=\"https://tv.apple.com/kr/show/%E1%84%82%E1%85%A2-%E1%84%89%E1%85%A2%E1%84%81%E1%85%B5%E1%84%8B%E1%85%B4-%E1%84%8B%E1%85%A7%E1%86%AB%E1%84%8B%E1%85%A2/umc.cmc.4hq0qh7m7lol6q67y4v3hrg7e?utm_source=chatgpt.com\">Apple&nbsp;TV</a>.</p><p>Trong phần giới thiệu đầu, các phụ huynh xuất hiện trên poster với ánh mắt tự hào, rạng rỡ rạng như diễn viên chính trong phim thanh xuân. Dòng tagline “Câu chuyện tình yêu của người giống tôi nhất” gợi lên cảm xúc ấm áp, quen thuộc và đầy hy vọng.</p><p>Trong những tập đầu phát sóng, khán giả sẽ được thấy phản ứng thực của các bố mẹ khi tận mắt chứng kiến con mình đang hẹn hò. Sự hồi hộp, lo lắng pha lẫn niềm tự hào là những phản ứng chân thật, hài hước và dễ đồng cảm. Chẳng hạn, khi một phụ huynh tự hào nói “Đó là con gái tôi!”, thì ngay sau đó lại nhen nhóm sự ghen cạnh “Con người ta tốt vậy, con mình thì sao?”, tạo nên những khoảnh khắc vừa hài hước vừa cảm động</p>',0,0,9,0),(1056,'Hành Tinh Độc Thân: Phiêu Lưu Hy Lạp','https://img.ophim.live/uploads/movies/hanh-tinh-doc-than-phieu-luu-hy-lap-thumb.jpg','Planet Single: Greek Adventure','completed','1','100 Phút','2025','HD',NULL,'','','Hài Hước, Tình Cảm','Ba lan','<p>Chuyến nghỉ dưỡng ở Hy Lạp của năm người bạn hóa câu chuyện trinh thám hài hước khi nghi ngờ nảy sinh về việc một trong những người đồng hành có thể là tay lừa đảo khét tiếng.</p>',0,0,9,0),(1057,'Oan Gia Kiếp Trước','https://img.ophim.live/uploads/movies/oan-gia-kiep-truoc-thumb.jpg','Trail of Love','completed','20','47 phút/tập','1995','HD',NULL,'','歐陽震華, 曾華倩, Michael Tong Chun-Chung, Elizabeth Lee Mei-Fung, 阮兆祥, 古巨基, 朱咪咪, 夏萍, 黃愷欣, 古明華','Tình Cảm','Trung Quốc, Hồng Kông','Oan Gia Kiếp Trước-Trail of Love (1995) [HD-Lồng Tiếng]',0,0,9,0),(1058,'Vượt Rào','https://img.ophim.live/uploads/movies/vuot-rao-thumb.jpg','At Point Blank','completed','20','45 phút/tập','2006','HD',NULL,'','苑瓊丹, 羅嘉良, 謝天華, 胡杏兒, 蘇玉華, 麥長青, 袁彩雲','Tình Cảm','Trung Quốc, Hồng Kông','<p>At Point Blank là một bộ phim truyền hình lãng mạn hiện đại của Hồng Kông do TVB sản xuất.</p>',0,0,9,0),(1059,'Đáng Mặt Nữ Nhi','https://img.ophim.live/uploads/movies/dang-mat-nu-nhi-thumb.jpg','La Femme Desperado','completed','22','45 phút/tập','2006','HD',NULL,'','','Tình Cảm','Hồng Kông','<p>Lấy cảm hứng từ loạt phim Mỹ \"Desperate Housewives\", chương trình có sự góp mặt của ba cặp đôi và vai trò của phụ nữ trong những mối quan hệ này: Một cặp đôi cách nhau bảy tuổi; một cặp đôi đầy tham vọng bắt đầu nhận ra hậu quả của việc thăng tiến trong công ty; và một cặp đôi truyền thống mâu thuẫn giữa định kiến ​​truyền thống và hiện đại về phụ nữ trong xã hội.</p>',0,0,9,0),(1060,'Mong Manh Cuộc Tình','https://img.ophim.live/uploads/movies/mong-manh-cuoc-tinh-thumb.jpg','Ups and Downs in the Sea of Love','completed','20','45 phút/tập','2003','HD',NULL,'','','Tình Cảm','Hồng Kông','<p>Sau khi bị hôn phu bỏ rơi, Yama gặp giám đốc du thuyền Jason, người đã an ủi cô. Họ yêu nhau và kết hôn ngay lập tức. Tuy nhiên, khi vị hôn phu cũ muốn quay lại, Jason và Yama đã có một hiểu lầm khiến họ ly hôn ngay lập tức. Khi họ tái hợp trên một du thuyền, một thảm họa đã xảy ra.</p>',0,0,9,0),(1061,'Người Hồng Kông Ở Bắc Kinh','https://img.ophim.live/uploads/movies/nguoi-hong-kong-o-bac-kinh-thumb.jpg','From Hong Kong to Beijing','completed','20','43 phút/tập','2023','HD',NULL,'','','Tình Cảm','Hồng Kông','<p>Từ Cung Yến, một giám đốc điều hành cấp cao của một công ty quản lý bất động sản, đã tận dụng vận may và sự nghiệp đang trên đà phát triển. Tuy nhiên, anh và vợ Helen Kwong vô tình vướng vào một vụ lừa đảo đầu tư và chịu tổn thất nặng nề. Từ Cung Yến được bổ nhiệm làm CEO chi nhánh Bắc Kinh, nhận thấy đây là cơ hội để xoay chuyển tình thế nên anh và Helen đã lên đường ra Bắc Kinh để phát triển, nhưng bất ngờ họ lại gặp phải một cuộc khủng hoảng tuổi trung niên. Từ Cung Yến buộc phải ở lại để giữ thể diện trước sự thăng trầm của kẻ thù cũ Đinh Trí Cường. Sau đó, anh gặp lại Sophie, người mà anh đã không gặp trong nhiều năm, và cuộc hôn nhân của anh đứng trước một thử thách. Ngôi sao ẩm thực trên mạng Từ Cung Yến và ca sĩ đường phố Từ Bá Nghĩa, mỗi người đều có lý do riêng để chuyển lên Bắc Kinh đoàn tụ với anh trai cả Từ Cung Yến. Gia đình cùng nhau lên kế hoạch cải tạo một nhà máy biến áp bỏ hoang thành một công viên văn hóa và sáng tạo. Những người Hồng Kông theo \"đạo Phật\" phải nghiêm túc đối mặt với một cuộc chiến khó khăn trong cuộc sống!</p>',0,0,9,0),(1062,'Ước Mơ Xa Vời','https://img.ophim.live/uploads/movies/uoc-mo-xa-voi-thumb.jpg','L\'Escargot','completed','30','45 phút/tập','2012','HD',NULL,'','苗僑偉, 郭羨妮, 謝天華, 滕麗名, 吳卓羲, 鐘嘉欣, 梁競徽, 黃智雯, 羅子溢, 陳自瑤','Tình Cảm','Trung Quốc, Hồng Kông','<p>Anh trai KWAN KA ON (Michael Miu) là một nhà thiết kế nội thất và vợ anh là SZE LONG KIU (Sonija Kwok) là một bà nội trợ hiện đại. Cặp đôi luôn mong muốn có một gia đình yên bình, nhưng vì ON phải giải cứu anh trai thứ hai KWAN KA HONG (Oscar Leung) và giúp anh vượt qua những khó khăn trong công việc kinh doanh thất bại, anh không chỉ phải gác lại các kế hoạch sự nghiệp sang một bên, vợ anh là KIU cũng phải quay lại làm việc. Em gái anh là KWAN KA LOK (Linda Chung Lệ Đề) không muốn làm gánh nặng cho anh trai mình thêm nữa nên đã nhờ đến sự giúp đỡ của cấp trên là KO WAN JIM (Michael Tse). Tuy nhiên, mối quan hệ đã trở thành một mối quan hệ không đứng đắn. Bạn trai của LOK là TING KOON FUNG (Ron Ng) tức giận vì những việc làm của cô và muốn chia tay cô. Anh trai thứ tư, KWAN KA WING (Him Law) sống cuộc sống của mình dựa vào tiền lương hàng tháng. Anh ấy thà tiêu hết tiền lương hàng tháng còn hơn phải gánh vác trách nhiệm sở hữu một ngôi nhà...cuối cùng, cơn ác mộng bắt đầu trong gia đình KWAN.</p>',0,0,9,0),(1063,'Cô Gái Đến Từ Sao Miêu','https://img.ophim.live/uploads/movies/co-gai-den-tu-sao-mieu-thumb.jpg','My Lover From The Planet Meow','completed','32','44 phút/tập','2016','HD',NULL,'','陳豪, 田蕊妮, 胡定欣, 楊秀惠, 關禮傑, 朱咪咪, William Fung, Maggie Yu, 蔣志光, 敖嘉年','Tình Cảm','Trung Quốc, Hồng Kông','<p>Planet Meow có sự tham gia của Kristal trong vai Miu Miu, một người ngoài hành tinh giống mèo đến từ một hành tinh xa xôi, tiên tiến về mặt công nghệ. Cô chăm sóc người chủ loài người yêu quý của mình là Sze Sze (ngôi sao nhí Celine Yeung) từ trên cao. Sau khi chứng kiến ​​Sze Sze đau khổ vì mối quan hệ ngày càng xấu đi của cha mẹ, Miu Miu quyết định trở lại trái đất để giúp chủ nhân của mình, lần này dưới hình dạng con người. Miu Miu, dưới hình dạng con người, gặp bậc thầy nắn xương Ko Kwai (Mimi Chu), người đã thuê cô. Tình cờ, cô làm việc cho cha của Sze Sze, Garfield (Moses Chan) tại công ty nghiên cứu của ông. Miu Miu bảo vệ Garfield và biết rằng cấp trên của anh, Hill (Eddie Kwan) và Natasha (Vivien Yeo), đã âm mưu chống lại anh. Mặc dù Miu Miu cố gắng hết sức để hàn gắn mối quan hệ của Garfield với vợ anh là Cat (Nancy Wu), Miu Miu không thể không yêu anh.</p>',0,0,9,0),(1064,'Anh Chàng Độc Thân','https://img.ophim.live/uploads/movies/anh-chang-doc-than-thumb.jpg','A Taste of Bachelorhood','completed','20','42 phút/tập','1986','HD',NULL,'','吳啟華, 毛舜筠, 藍潔瑛, Eugina Lau Mei-Guen, 李國麟, 商天娥, 吳鎮宇, 郭鋒, 李龍基, Amy Wu Mei-Yee','Tình Cảm, Hài Hước','Hồng Kông','Anh Chàng Độc Thân-A Taste of Bachelorhood (1986) [HD-Lồng Tiếng]',0,0,9,0),(1065,'Mối Tình Thượng Hải','https://img.ophim.live/uploads/movies/moi-tinh-thuong-hai-thumb.jpg','Remembrance','completed','22','45 phút/tập','1994','HD',NULL,'','張智霖, 郭可盈, 鮑方, 邵仲衡, 張鳳妮, 林尚武, 韓馬利, Chu Tit-Wo, 江漢, 陳狄克','Tình Cảm','Trung Quốc, Hồng Kông','Mối Tình Thượng Hải-Remembrance (1994) [HD-Lồng Tiếng]',0,0,9,0),(1066,'Cuộc Chiến Dành Quyền Nuôi Mèo','https://img.ophim.live/uploads/movies/cuoc-chien-danh-quyen-nuoi-meo-thumb.jpg','냥육권 전쟁','completed','1','0 Phút','2025','HD',NULL,'','','Tình Cảm','Hàn Quốc','<p>Phim kể về câu chuyện của một cặp vợ chồng đang ở năm thứ 5 của cuộc hôn nhân, sắp ly hôn, và cuộc xung đột của họ về \"quyền nuôi mèo\" của một chú mèo mà họ coi như con ruột. Họ gặp khó khăn trong việc thụ thai nhưng đã nhận nuôi một chú mèo hoang và sống như một gia đình, nhưng cuối cùng quyết định ly hôn.</p>',0,0,9,0),(1067,'Vượt Qua Thử Thách','https://img.ophim.live/uploads/movies/vuot-qua-thu-thach-2001-thumb.jpg','In the Realm of Success','completed','20','42 phút/tập','2001','HD',NULL,'','陳松伶, 馬浚偉, 唐文龍, 姚嘉妮, 盧宛茵, 關海山, 白茵, 韓馬利, 馮曉文, 鄭子誠','Tình Cảm','Trung Quốc, Hồng Kông','<p>Hạo Nhiên (Mã Tuấn Vệ) đã du học nhiều năm. Sau khi trở về, anh theo nguyện vọng của cha mình và vào khách sạn làm việc. Tuy nhiên, Hạo Nhiên, người đã đắm chìm trong nền văn hóa nước ngoài quanh năm, không biết rằng việc quản lý các mối quan hệ giữa các cá nhân thậm chí còn quan trọng hơn việc quản lý sự nghiệp. Quả nhiên, Hạo Nhiên thẳng thắn đã xúc phạm đến sếp của mình ngay khi mới đến, và thậm chí còn liên lụy đến đồng nghiệp của mình là Mỹ Kỳ (Trần Tùng Linh) bị giáng chức. Trải nghiệm cuộc sống của Majesty rất khó khăn, mẹ cô phải ra ngoài làm việc và em gái cô vẫn chưa hiểu chuyện, gánh nặng gia đình đổ lên vai Majesty. Sau khi phát hiện ra rằng người bạn trai của mình, người đã yêu nhau nhiều năm và đã kết hôn, đã trật bánh, Majestic đã chọn cách rời đi.</p>',0,0,9,0),(1068,'Tình Bạn Thân Thiết','https://img.ophim.live/uploads/movies/tinh-ban-than-thiet-thumb.jpg','A Watchdog‘s Tale','completed','20','45 phút/tập','2009','HD',NULL,'','鄭則仕, 邵美琪, 馬浚偉, 鐘嘉欣, 黃浩然, 唐詩詠, 呂慧儀, 李國麟, 蔣志光, 程可為','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','<p>Thám tử Lý Tuấn Sinh (Trịnh Trạch Thạch thủ vai) đã nhiều lần phá án kỳ lạ trong quá trình điề