 (Lưu Đản), đột nhiên lâm bệnh, Long, giờ lại độc thân, quyết định chuyển về nhà cũ ở Stanley. Tại đây, Long gặp lại người bạn thời thơ ấu Bành Chính (Trần Trung Linh, Nadia), giờ đã trở thành huấn luyện viên lướt ván buồm và kỹ sư cơ khí. Biết Long đang nóng lòng muốn bán du thuyền, Chính dành ngày đêm sửa chữa nó, với hy vọng bán được giá cao hơn và giúp anh giải quyết phần nào khó khăn tài chính. Tuy mọi thứ dường như đang trở lại đúng hướng, nhưng những thách thức vẫn còn ở phía trước - KEI muốn quay lại với Long, điều này đe dọa đến mối quan hệ đang nảy nở của anh với Chính. Cùng lúc đó, một bi kịch lớn ập đến với gia đình Long, khiến anh vô cùng đau khổ và buồn phiền...</p>',0,0,9,0),(1073,'Lưới Tình','https://img.ophim.live/uploads/movies/luoi-tinh-thumb.jpg','Web of Love','completed','20','46 phút/tập','1998','HD',NULL,'','','Tình Cảm, Hài Hước','Hồng Kông','Lưới Tình-Web of Love (1998) [HD-Lồng Tiếng]',1,0,9,0),(1074,'Thử Thách','https://img.ophim.live/uploads/movies/thu-thach-thumb.jpg','Let\'s Face It','completed','20','46 phút/tập','2002','HD',NULL,'','汪明荃, 張可頤, 馬德鐘, 錢嘉樂, 郭鋒, 莫家堯, 苑瓊丹, 戴志偉, 程可為, 盧海鵬','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','Thử Thách-Let\'s Face It (2002) [HD-Lồng Tiếng]',0,0,9,0),(1075,'Tái Đắc Hữu Tình Nhân','https://img.ophim.live/uploads/movies/tai-dac-huu-tinh-nhan-thumb.jpg','Rear Mirror','completed','20','45 phút/tập','2014','HD',NULL,'','黎耀祥, 蘇玉華, 洪永城, 唐詩詠, 鍾景輝, 謝雪心, 劉江, 韓馬利, 梁舜燕, 姚子羚','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','<p>Một người cha đơn thân làm tài xế xe buýt nhỏ, đang phải vật lộn một mình nuôi dạy cậu con trai nhỏ bị dị ứng thực phẩm nghiêm trọng, gặp một nữ giám đốc điều hành của một tập đoàn lớn, người dường như có tất cả mọi thứ bên ngoài nhưng cũng đang phải vật lộn với căn bệnh của cha mình và các thành viên trong gia đình tranh giành vị trí giám đốc điều hành.</p>',7,0,9,0),(1076,'Chuyện Tình Sân Khấu','https://img.ophim.live/uploads/movies/chuyen-tinh-san-khau-thumb.jpg','Romantic Repertoire','completed','21','45 phút/tập','2015','HD',NULL,'','陳豪, 蓋鳴暉, 龔嘉欣, 李司棋, 麥長青, 韓馬利, 謝雪心, 羅樂林, 孫慧雪, 呂珊','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','<p>Nhà thiết kế nội thất Moon Sing Hong mua một căn hộ để chuẩn bị kết hôn với bạn gái lâu năm, người dự kiến sẽ sớm trở về nước sau khi du học. Không có sự cho phép hoặc hiểu biết của anh, chị gái anh đã cho ca sĩ opera Quảng Đông nổi tiếng Kan Kit thuê căn hộ của anh. Không thể phá vỡ hợp đồng thuê nhà, Sing Hong sử dụng đủ mọi chiêu trò để cố gắng đuổi Kan Kit ra ngoài nhưng người quản lý của cô là Lin Sau Fong đã giúp cô giữ vững lập trường. Khi Tin Hak Kan, bạn thân và đối tác kinh doanh của Sing Hong, gặp Kit, anh ngay lập tức bị cô thu hút và nhờ Sing Hong giúp anh theo đuổi Kit. Để giúp bạn mình yêu, Sing Hong tiếp cận Kit để tìm hiểu về sở thích của cô. Hai người sớm giải quyết được những khác biệt và trở thành bạn bè. Tuy nhiên, cuộc sống thường ngày của họ bị đảo lộn khi Kit gặp tai nạn xe hơi và tìm thấy mẹ ruột của mình, trong khi Sing Hong phát hiện ra bạn gái lâu năm của mình đã sống ở Hồng Kông cùng với một người đàn ông khác.</p>',0,0,9,0),(1077,'Mặt Trái Tình Yêu','https://img.ophim.live/uploads/movies/mat-trai-tinh-yeu-thumb.jpg','The Threat Of Love','completed','10','44 phút/tập','2000','HD',NULL,'','薛家燕, 吳啟華, 鄧萃雯, 鍾景輝, 鄭嘉穎, 楊思琦','Tình Cảm','Trung Quốc, Hồng Kông','Mặt Trái Tình Yêu-The Threat Of Love (2000) [HD-Lồng Tiếng]',0,0,9,0),(1078,'Bước Cùng Em','https://img.ophim.live/uploads/movies/buoc-cung-em-thumb.jpg','Every Step You Take','completed','20','? phút/tập','2015','HD',NULL,'','','Tình Cảm','Hồng Kông','Người sáng mắt có lúc mù lòa, người mù lòa đôi khi lại có thể nhìn thấy ánh sáng. Bộ phim Bước cùng em kể cho khán giả một câu chuyện tình sâu lắng, đầy cảm xúc của hai người đang mất phương hướng cuộc đời là nhiếp ảnh gia Tống Thiên Tòng và giám đốc công ty quảng cáo Cam Ngôn Trọng. Sau một vụ tai nạn, Tống Thiên Tòng mất đi cha mẹ và mù cả hai mắt. Nhưng chính tình yêu dành cho bạn trai và chú chó dẫn đường đã giúp Thiên Tòng có sức mạnh cố gắng vươn lên. Tuy nhiên, bạn trai của Thiên Tòng lại phản bội khiến cô vô cùng đau khổ. Trong khi đó, Cam Ngôn Trọng vì quá say mê công việc nên mất hết bạn bè. Ngôn Trọng quyết định từ bỏ công việc, trở về nơi ở cũ để tìm lại chính mình. Tại đây, Ngôn Trọng gặp Thiên Tòng. Cuộc sống của cả hai bắt đầu có sự thay đổi.',0,0,9,0),(1079,'Xẻo','https://img.ophim.live/uploads/movies/xeo-thumb.jpg','Fixed','completed','1','86 Phút','2025','HD',NULL,'','','Hài Hước, Tình Cảm','Âu Mỹ','Biết tin sắp bị thiến, chú chó nọ có 24 giờ để tận hưởng nốt chuyến phiêu lưu điên cuồng cuối cùng với những cậu bạn của mình trong phim hài thô tục dành cho người lớn này.',0,0,9,0),(1080,'Bí Ẩn Trong Nhà Hát','https://img.ophim.live/uploads/movies/bi-an-trong-nha-hat-thumb.jpg','A Loving Spirit','completed','20','45 phút/tập','1999','HD',NULL,'','關詠荷, 吳啟華, 湯盈盈, 羅蘭, 苑瓊丹, 駱應鈞, 韓馬利, 羅君左, 朱咪咪, 馬蹄露','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','The celebrated Tung Sing Cinema has a full house at all times; but who would have thought that a spot as busy as it has been haunted for a period? It is early 60’s, definitely a trying time for Hong Kong. Unemployed YING has just been given a job as a ticket-seller by the Tung Sing Cinema on her friend SUK’s recommendation. YING works very diligently and responsibly and is therefore highly regarded by her boss, YIN. However when YING keeps stating that there is an apparition around the cinema, YIN soon gets irritated. In time, YING and YIN see the spirit SIN and from her, they learn that YIN’s step-mother MUI has been having an affair with the manager of the cinema, LAI and that they have planned to seize YIN’s property. Will the Tung Sing Cinema stay haunted in the days ahead',0,0,9,0),(1081,'Hy Vọng','https://img.ophim.live/uploads/movies/hy-vong-2001-thumb.jpg','Hope For Sale','completed','20','45 phút/tập','2001','HD',NULL,'','伍詠薇, 夏雨, 羅嘉良, 吳美珩, 程可為, 李家聲, 陳國邦, 蘇恩磁, 劉曉彤, 顏國樑','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','Wang Xiabo (Luo Jialiang) is the eldest son of the vegetable vendor Wang Erzai (Xia Yu). Since graduating from high school, he has been taking care of the vegetable stalls for his father, so he has a strong affection for the vegetable market.\n\nOne day, Xia Bo met her childhood playmate Su Youmei (played by Wu Yongwei), and her mother (played by Cheng Kewei) even operated flower stalls in the market. The Yumi family and Erzai were friends at first, but unfortunately they turned against each other because of money.\n\nXia Bo is straightforward and snobbish from the United States, and the two suddenly become enemies. Soon, Yumi suspected that her boyfriend had an affair with Xia Bo\'s wife Yan Meizhu (Wu Meiheng), and the two were forced to put aside their family feud and investigate together.',0,0,9,0),(1082,'Bước Thăng Trầm','https://img.ophim.live/uploads/movies/buoc-thang-tram-thumb.jpg','Ups And Downs','completed','21','69 phút/tập','2000','HD',NULL,'','劉松仁, 伍詠薇, 江華, 張燊悅, 廖啟智, 洪天明, 郭少藝, 黎宣, 麥長青, 張英才','Hài Hước, Tình Cảm','Trung Quốc, Hồng Kông','Bước Thăng Trầm-Ups And Downs (2000) [HD-Lồng tiếng]',0,0,9,0),(1083,'Hồn Ma Báo Thù','https://img.ophim.live/uploads/movies/hon-ma-bao-thu-thumb.jpg','Friends & Enemies','completed','20','40 phút/tập','1988','HD',NULL,'','Chan Lai-Sze, Carrie Choi, 温兆倫, 盧海鵬, 毛舜筠, James Yi Lui, Eugina Lau Mei-Guen','Hành Động, Hài Hước, Tình Cảm','Trung Quốc, Hồng Kông','Hồn Ma Báo Thù-Friends & Enemies (1988) [HD-Lồng tiếng]',0,0,9,0),(1084,'Người Vô Hình','https://img.ophim.live/uploads/movies/nguoi-vo-hinh-1-thumb.jpg','The Disappearance','completed','20','45 phút/tập','1997','HD',NULL,'','林家棟, 楊千嬅, 林保怡, 陳妙瑛, 陳啟泰, 陳芷菁, 羅君左, 關寶慧, Edmond Leung, 王青','Tình Cảm, Hài Hước','Trung Quốc, Hồng Kông','Người Vô Hình-The Disappearance (1997) [HD-Lồng tiếng]',0,0,9,0),(1085,'Z-O-M-B-I-E-S 2','https://img.ophim.live/uploads/movies/z-o-m-b-i-e-s-2-thumb.jpg','Z-O-M-B-I-E-S 2','completed','1','84 Phút','2020','HD',NULL,'Paul Hoen','Meg D