ương trình thực tế mới có sự tham gia của nữ diễn viên Trung Quốc <strong>Triệu Lộ Tư</strong>.</p>',1,0,9,0),(1121,'Tiệm Ăn Của Ngài Heo','https://img.ophim.live/uploads/movies/tiem-an-cua-ngai-heo-thumb.jpg','Heo\'s Diner','completed','10','50 phút/tập','2025','HD',NULL,'','','Tình Cảm','Hàn Quốc','<p>Người đàn ông đến từ Joseon đã nhảy qua 400 năm trong thời gian để tìm kiếm hương vị đích thực! Một bộ phim truyền hình ẩm thực du hành thời gian đích thực của Joseon Diner Heo Kyun.</p><p>Joseon, một thời kỳ lịch sử khi địa vị và các quy định cấm nhiều thứ và phân biệt đối xử với nhiều người. Heo Kyun, một nhà tư tưởng tiến bộ và tự do mơ ước xây dựng một xã hội nơi mọi người có thể sống bình đẳng mà không cần hệ thống địa vị, là một nhân vật có vấn đề ở Joseon. Cuối cùng, những ý tưởng đó đã dẫn đến việc ông phải lưu vong.</p><p>Vào thời điểm ông qua đời, ông đột nhiên nhảy qua 400 năm và đến Seoul vào năm 2024! Ông tiếp tục cuộc sống của mình bằng cách làm việc trong một nhà hàng với người mẹ và cô con gái đã cứu mạng ông. Mọi thứ có vẻ hoàn hảo lúc đầu Tuy nhiên, do một tai nạn bất ngờ, Heo Kyun trở thành đầu bếp của nhà hàng và cố gắng tìm ra kẻ giết người.</p>',0,0,9,0),(1122,'Người yêu Một Nửa Thân Thuộc (Phần 4)','https://img.ophim.live/uploads/movies/nguoi-yeu-mot-nua-than-thuoc-phan-4-thumb.jpg','Love Actually (Season 4)','completed','26','123 phút/tập','2025','HD',NULL,'','Tang Yixin, Xie Nan, Chunye Zhang, Xu Yiyang, 颜安','Tình Cảm','Trung Quốc','<p>Đây là một chương trình tập trung vào tình yêu dũng cảm và thẳng thắn của những người trưởng thành bình thường từ cuối độ tuổi 20 đến giữa độ tuổi 40. Nó liên quan đến các mối quan hệ, hôn nhân và vô số các tương tác xã hội. Chương trình sẽ mời 12 người đàn ông và phụ nữ ở chung dưới một mái nhà trong 30 ngày. Một số có thể trở thành cặp đôi vào cuối cùng trong khi những người khác có thể chia tay. Trong trường quay truyền hình, những người nổi tiếng và những người bình thường sẽ tụ tập lại với nhau để theo dõi bộ phim và chia sẻ ý kiến ​​và kinh nghiệm của họ về tình yêu.</p>',0,0,9,0),(1123,'Phượng Lâu Truyện: Truyền Thuyết Linh Hồ','https://img.ophim.live/uploads/movies/凤楼传之灵狐传说-thumb.jpg','Fenglou Chronicles: Tale of the Spirit Fox','completed','1','85 Phút','2025','HD',NULL,'Wenjun Yang','Zhu Minxin, 彭静, Lu Zhuo, Wang Zhengxuan, 唐永愉, 洪云刚, 於不凡, 霍赞臣, Li Song Ci, 方萌兮','Viễn Tưởng, Tình Cảm','Trung Quốc','Eighteen years after her grandfather\'s death, a young woman marries the fox spirit Feng Lou to seek revenge. Meanwhile, a power struggle within the fox clan escalates as Feng Lou’s grandfather allies with foreign forces to seize control, unleashing chaos and endangering innocent lives.',0,0,9,0),(1124,'Chuyện Tình Của Anh Chị Em Tôi (Bản Trung 2025)','https://img.ophim.live/uploads/movies/chuyen-tinh-cua-anh-chi-em-toi-ban-trung-2025-thumb.jpg','My Sibling\'s Romance','completed','33','70 phút/tập','2025','HD',NULL,'','蔣敦豪, Cecilia Boey, 吳尊, 小鹿, Yang Gen, 朱丹','Tình Cảm','Trung Quốc','<p>Mô hình phổ biến của Hàn Quốc đã được giới thiệu và tác giả gốc đã tham gia vào quá trình sản xuất. Năm cặp anh chị em bản xứ ở trong cabin và mỗi người tìm kiếm nửa kia dưới sự nhìn chằm chằm và tham gia của anh chị em mình. Phá vỡ mô hình tình yêu toàn diện truyền thống và tình yêu song song và tình yêu gia đình. Việc che giấu danh tính của anh chị em ngay từ đầu và nhìn vào ảnh hưởng của gia đình bản xứ đối với tình cảm không còn là hành trình tìm kiếm tình yêu đơn thuần nữa mà là một bí ẩn của \"thần tình yêu thật và giả\" với tiếng cười không ngớt. Đây cũng là một hành trình mới ấm áp và ấm áp đan xen với anh chị em.</p>',2,0,9,0),(1125,'Hỏa Hồ Điệp','https://img.ophim.live/uploads/movies/hoa-ho-diep-thumb.jpg','Flaming Butterfly','completed','31','45 phút/tập','2008','HD',NULL,'Siu-hung Yang','李彩樺, Michael Tong, 梁俊一, 曾江, Monie Tung Man-Lee, 李龍基, 陳少霞, 鮑起靜, Katherine Lau Ying-Hung, 盧海鵬','Tình Cảm, Tâm Lý','Trung Quốc, Hồng Kông','Flaming Butterfly was a drama series produced by Hong Kong broadcaster Asia Television. It was the first series to be filmed in High Definition by ATV. The series consisted of 40 1-hour episodes, but 21 of them were re-edited into 90-minute episodes, making it the second \"Drama90\" series to be aired by ATV. As a result of, the episode count was reduced to 31. The series was sold to MediaCorp TV, with each episode running for 1 hour, instead of 90 minutes.',0,0,9,0),(1126,'Mạnh Bà Truyện: Duyên Khởi','https://img.ophim.live/uploads/movies/manh-ba-truyen-duyen-khoi-thumb.jpg','Biography of Meng Po','completed','1','76 Phút','2024','HD',NULL,'Đái Y Lâm, Vương Tiểu Vũ','Hà Hoa, Phùng Lập Quân, Thương Thiết Long, Lý Tài Hoa','Tình Cảm, Viễn Tưởng','Trung Quốc','<p>Trong quá khứ, khi Mạnh Thanh không phải Mạnh Phá và Thanh Hành không phải Nhạc Lão, hai người yêu nhau bất tử đã bị thần trừng buộc phải chia cắt. Mạnh Thanh chết đi, cùng với linh hồn còn sót lại của Thanh Hằng rơi vào thế giới của người chết - Võ Thành. Tại thành phố Vạn Thành nguy hiểm và đầy rẫy sự nguy hiểm, Mạnh Thanh tìm mọi cách để khôi phục lại linh hồn còn lại của Thanh Hằng, nhưng cuối cùng cô phát hiện ra rằng người yêu mình hằng mong ước vẫn còn sống. Để khám phá sự thật năm đó và tìm lại người yêu của mình, Mạnh Thanh đã đột phá thành phố và tiến về phía trước. Điều đang chờ đợi cô ở phía trước chỉ là sự thật phũ phàng. Tình yêu và tình bạn, trả thù và buông bỏ, trưởng thành và giải thoát, cuối cùng Mạnh Thanh nên lựa chọn như thế nào…</p>',0,0,9,0),(1127,'Ghép Đôi Trái Tim','https://img.ophim.live/uploads/movies/heart-pairing-thumb.jpg','Heart Pairing','completed','16','100 phút/tập','2025','HD',NULL,'','','Tình Cảm','Hàn Quốc','<p>Tình yêu bắt đầu bằng sự phấn khích. Nhưng cần gì để tình yêu trở thành hôn nhân?! Những chàng trai và cô gái trẻ mơ ước về hôn nhân đã tụ họp dưới một mái nhà. Trong suốt một tháng, họ đi du lịch giữa Ý và Seoul, trải qua những cặp đôi định mệnh để tìm được người bạn đời trọn đời của mình. Một trái tim đập rộn ràng, những giá trị hoàn toàn phù hợp, sự ổn định tài chính đáng mơ ước, một quan điểm chung về tình yêu… Cặp đôi nào sẽ là tốt nhất đối với tôi? Những chàng trai và cô gái trẻ này điều hướng giữa sự lãng mạn và thực tế, dành một tháng tràn ngập cả sự phấn khích và những khoảnh khắc sáng suốt. Câu chuyện ly kỳ và thực tế nhất về tình yêu và hôn nhân trong thời đại này!</p>',0,0,9,0),(1128,'Tình yêu ngoại tuyến','https://img.ophim.live/uploads/movies/tinh-yeu-ngoai-tuyen-thumb.jpg','Offline Love','completed','10','50 phút/tập','2025','HD',NULL,'','小泉今日子, 髙比良くるま, 松井ケムリ','Tình Cảm','Nhật Bản','Những người trẻ độc thân dành mười ngày ở một đất nước xa lạ, tất cả chỉ trông chờ vào duyên số. Không có bất kỳ thiết bị kỹ thuật số nào, liệu họ có thể tìm thấy nửa kia của mình?',1,0,9,0),(1129,'When the Mist Clears','https://img.ophim.live/uploads/movies/when-the-mist-clears-thumb.jpg','When the Mist Clears','completed','1','103 Phút','2022','HD',NULL,'','','Chính kịch, Tình Cảm','Âu Mỹ','Isabella is a disconnected and angry young woman. Her life was shattered at 13 when her Italian mother died of cancer. Her successful British father Frank, who harbors a painful secret, chose to lose himself with work and outsource Isabella’s care and upbringing to nanny’s, tutors and eventually therapists. Many years later Frank had remarried to a wonderful Italian woman, Claudia, who manages to convince Frank that they all need to get away from work, from the city, from internet and spend a month close to nature on a remote Italian country estate and hopefully reconnect to each other.',0,0,9,0),(1130,'Tình Yêu Bị Chiếm Hữu (Phần 2)','https://img.ophim.live/uploads/movies/tinh-yeu-bi-chiem-huu-phan-2-thumb.jpg','Possessed Love (Season 2)','completed','10','108 phút/tập','2025','HD',NULL,'','','Tình Cảm, Bí ẩn','Hàn Quốc','<p>Tám thầy bói đã tụ họp lại để xem vận mệnh hẹn hò tương lai của chính họ! Trong thời gian ở cùng nhau tại Ngôi nhà bị ám trong một tuần, các thầy bói trẻ sẽ sử dụng chuyên môn của mình để tìm kiếm tình yêu định mệnh một cách mù quáng. Liệu họ có thể tìm thấy người bạn đời định mệnh của mình không, và họ sẽ làm gì khi tình cảm của họ quyết định đi ngược lại số phận?</p>',2,0,9,0),(1131,'Yêu Em','https://img.ophim.live/uploads/movies/yeu-em-thumb.jpg','The Best Thing','completed','28','42 phút/tập','2025','FHD',NULL,'','','Chính kịch, Tình Cảm','Trung Quốc','Phim kể về mối quan hệ giữa Thẩm Tích Phàm, một quản lý khách sạn đam mê công việc, và Hà Tô Diệp, một bác sĩ Đông y điềm đạm. Vì chứng mất ngủ, cô tìm đến Đông y và tình cờ gặp anh. Ban đầu chỉ là bác sĩ và bệnh nhân, nhưng những lần chạm mặt bất ngờ dần kéo họ lại gần nhau. Khi tình cảm nảy nở, cả hai phải đối mặt với những do dự từ quá khứ và dần tìm thấy ý nghĩa thực sự của tình yêu và đam mê của mình.',4,0,9,0),(1132,'Chiếm Hữu Khương Tây','https://img.ophim.live/uploads/movies/chiem-huu-khuong-tay-thumb.jpg','Grab Your Love','completed','24','15 phút/tập','2025','HD',NULL,'','','Chính kịch, Tình Cảm','Trung Quốc','<p>Bộ phim kể về Mẫn Khương Tây, người có hoài bão trở thành \"giáo viên số một Thân Thành\", gặp phải Tần Chiếm, \"ác bá số một Thân Thành\", hai người từ đề phòng lẫn nhau đến khi thấu hiểu trân trọng, cuối cùng cùng nhau hợp sức tiêu diệt thế lực xấu xa trong giới kinh doanh. Trong quá trình cùng nhau trưởng thành và chữa lành, họ cũng viết nên câu chuyện tình yêu đầy dục vọng ngang tài ngang sức của giới thượng lưu.</p><p>&nbsp;</p>',0,0,9,0);
